B.aaT=new A.a(" \uc774 \ubb38\uad6c\ub294 \uc801 \ubcd1\uc0ac\ub4e4\uc758 \uc678\ud615\uc801\uc778 \ud589\ub3d9\uc774\ub098 \ud2b9\uc815 \uc0c1\ud669\uc5d0\uc11c\uc758 \ubc18\uc751\uc744 \ud1b5\ud574 \uadf8\ub4e4\uc758 \uc2e0\uccb4\uc801, \uc2ec\ub9ac\uc801 \uc0c1\ud0dc\ub97c \uc720\ucd94\ud558\ub294 \ud1b5\ucc30\ub825\uc758 \uc911\uc694\uc131\uc744 \uac15\uc870\ud569\ub2c8\ub2e4. \uc774\ub294 \uc801\uc758 \uc57d\uc810\uc744 \ud30c\uc545\ud558\uace0 \uc774\ub97c \uacf5\ub7b5\ud558\uae30 \uc704\ud55c \ud575\uc2ec\uc801\uc778 \uc815\ubcf4 \uc218\uc9d1 \ubc29\ubc95\ub860\uc785\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
B.ahQ=new A.a(" 1.\t\u6756\u800c\u7acb\u8005 \u98e2\u4e5f (\uc9c0\ud321\uc774\uc5d0 \uc758\uc9c0\ud558\uace0 \uc11c \uc788\ub294 \uc790\ub294 \uad76\uc8fc\ub9b0 \uac83\uc774\ub2e4): \n   \u2022 \uc758\ubbf8: \ubcd1\uc0ac\uac00 \uc9c0\ud321\uc774\uc5d0 \ubab8\uc744 \uc758\uc9c0\ud558\uace0 \uc11c \uc788\ub294 \ubaa8\uc2b5\uc740 \uc721\uccb4\uc801\uc73c\ub85c \ub9e4\uc6b0 \uc9c0\uce58\uace0 \uae30\ub825\uc774 \uc5c6\ub2e4\ub294 \uc2e0\ud638\uc785\ub2c8\ub2e4. \uc774\ub294 \uc7a5\uae30\uac04\uc758 \uad76\uc8fc\ub9bc\uc73c\ub85c \uc778\ud574 \uccb4\ub825\uc774 \uace0\uac08\ub418\uc5c8\uc74c\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \n\n 2.\t\u6c72\u800c\u5148\u98ee\u8005 \u6e34\u4e5f (\ubb3c\uc744 \uae38\uc5b4 \uba3c\uc800 \ub9c8\uc2dc\ub294 \uc790\ub294 \ubaa9\ub9c8\ub978 \uac83\uc774\ub2e4): \n   \u2022 \uc758\ubbf8: \ubb3c\uc744 \uae38\uc790\ub9c8\uc790 \ubcd1\uc0ac\ub4e4\uc774 \uc11c\ub458\ub7ec \uba3c\uc800 \ub9c8\uc2dc\ub294 \uac83\uc740, \ub9e4\uc6b0 \uadf9\uc2ec\ud55c \uac08\uc99d \uc0c1\ud0dc\uc5d0 \uc788\ub2e4\ub294 \uba85\ubc31\ud55c \uc99d\uac70\uc785\ub2c8\ub2e4. \uc774\ub294 \uc801\uc774 \ubb3c \ubd80\uc871\uc73c\ub85c \uace0\ud1b5\ubc1b\uace0 \uc788\uc74c\uc744 \ub098\ud0c0\ub0c5\ub2c8\ub2e4. \n\n  3.\t\u898b\u5229\u800c\u4e0d\u9032\u8005 \u52de\u4e5f (\uc774\ub4dd\uc744 \ubcf4\uace0\ub3c4 \ub098\uc544\uac00\uc9c0 \uc54a\ub294 \uc790\ub294 \ud53c\ub85c\ud55c \uac83\uc774\ub2e4): \n   \u2022 \uc758\ubbf8: \uba85\ubc31\ud558\uac8c \uc774\ub4dd\uc744 \ucde8\ud560 \uae30\ud68c(\u898b\u5229) \uac00 \uc788\uc74c\uc5d0\ub3c4 \ubd88\uad6c\ud558\uace0, \uc801 \ubcd1\uc0ac\ub4e4\uc774 \uc120\ub73b \ub098\uc544\uac00\ub824 \ud558\uc9c0 \uc54a\ub294 \uac83(\u800c\u4e0d\u9032)\uc740 \uadf8\ub4e4\uc774 \uadf9\ub3c4\ub85c \ud53c\ub85c(\u52de\u4e5f)\ud558\uac70\ub098 \uc0ac\uae30\uac00 \uc800\ud558\ub418\uc5b4 \uc788\uc74c\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \uc774\ub294 \ub2e8\uc21c\ud55c \uccb4\ub825 \uace0\uac08\uc744 \ub118\uc5b4 \uc815\uc2e0\uc801\uc778 \ud53c\ub85c\uc640 \uc804\ud22c \uc758\uc9c0\uc758 \uc57d\ud654\ub97c \uc2dc\uc0ac\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
