B.aAH=new A.a(" 1.\t\uad00\ucc30\ub825\uacfc \ud1b5\ucc30\ub825: \uac89\uc73c\ub85c \ub4dc\ub7ec\ub098\ub294 \ubbf8\ubb18\ud55c \ud589\ub3d9\uacfc \uc9d5\ud6c4\ub97c \ud1b5\ud574 \uc0c1\ub300\ubc29\uc758 \uc228\uaca8\uc9c4 \uc57d\uc810\uc774\ub098 \uc0c1\ud0dc\ub97c \uaff0\ub6ab\uc5b4 \ubcf4\ub294 \ud1b5\ucc30\ub825\uc774 \ud544\uc694\ud569\ub2c8\ub2e4. \n\n 2.\t\uac04\uc811 \uc815\ubcf4 \ud65c\uc6a9: \uc9c1\uc811\uc801\uc778 \uc815\ubcf4\uac00 \uc5c6\uc744 \ub54c, \uac04\uc811\uc801\uc778 \ub2e8\uc11c\ub4e4\uc744 \uc885\ud569\ud558\uc5ec \uc0c1\ub300\uc758 \uc2e4\uc9c8\uc801\uc778 \uc0c1\ud669\uc744 \uc720\ucd94\ud558\ub294 \ub2a5\ub825\uc774 \uc911\uc694\ud569\ub2c8\ub2e4. \n\n 3.\t\uc57d\uc810 \uacf5\ub7b5: \uc0c1\ub300\ubc29\uc758 \uc721\uccb4\uc801, \uc815\uc2e0\uc801 \uc57d\uc810(\uad76\uc8fc\ub9bc, \uac08\uc99d, \ud53c\ub85c, \uc0ac\uae30 \uc800\ud558)\uc744 \ud30c\uc545\ud558\uc5ec \uc774\ub97c \uc9d1\uc911\uc801\uc73c\ub85c \uacf5\ub7b5\ud558\ub294 \uc804\ub7b5\uc744 \uc218\ub9bd\ud574\uc57c \ud569\ub2c8\ub2e4.\n\n 4.\t\uc2ec\ub9ac \uc0c1\ud0dc \uc774\ud574: \uc801\uc758 \ubb3c\ub9ac\uc801 \uc0c1\ud0dc\uac00 \uadf8\ub4e4\uc758 \uc2ec\ub9ac\uc801 \uc0c1\ud0dc(\uc758\uc9c0, \ud310\ub2e8\ub825)\uc5d0 \ubbf8\uce58\ub294 \uc601\ud5a5\uc744 \uc774\ud574\ud558\uace0 \uc774\ub97c \uc804\uc220\uc5d0 \ubc18\uc601\ud574\uc57c \ud569\ub2c8\ub2e4. \n\n 5.\t\uc608\uce21 \ubc0f \uc120\uc81c \ub300\uc751: \uc774\ub7ec\ud55c \uc9d5\ud6c4\ub97c \ud1b5\ud574 \uc801\uc758 \ub2e4\uc74c \ud589\ub3d9\uc744 \uc608\uce21\ud558\uace0, \uc120\uc81c\uc801\uc73c\ub85c \uc57d\uc810\uc744 \ud30c\uace0\ub4e4\uc5b4 \uc2b9\uae30\ub97c \uc7a1\uc744 \uae30\ud68c\ub97c \ub9cc\ub4e4\uc5b4\uc57c \ud569\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
