B.a7Z=new A.a("\u318d \u51e1(f\xe1n): \ubb34\ub987, \uc77c\ubc18\uc801\uc73c\ub85c\n\u318d \u7528\u5175\u4e4b\u6cd5(y\xf2ng b\u012bng zh\u012b f\u01ce): \ubcd1\ubc95\uc758 \uc6d0\uce59, \uc804\uc7c1\uc744 \uc4f0\ub294 \ubc95\n\u318d \u5168\u570b\u7232\u4e0a(qu\xe1n gu\xf3 w\xe9i sh\xe0ng): \uc801\uad6d\uc744 \uc628\uc804\ud788 \ubcf4\uc874\ud558\uc5ec \ud56d\ubcf5\uc2dc\ud0a4\ub294 \uac83\uc774 \ucd5c\uc0c1\uc774\ub2e4\n\u318d \u7834\u570b\u6b21\u4e4b(p\xf2 gu\xf3 c\xec zh\u012b): \ub098\ub77c\ub97c \ud30c\uad34\ud574\uc11c \uc2b9\ub9ac\ud558\ub294 \uac83\uc740 \uadf8 \ub2e4\uc74c\uc774\ub2e4 (\ucc28\uc120\ucc45\uc774\ub2e4)\u920d\u5175 (d\xf9n b\u012bng): \ubcd1\uc0ac\ub4e4\uc774 \ubb34\ub514\uc5b4\uc9c0\uace0 (\uc804\ud22c\ub825\uc774 \ub5a8\uc5b4\uc9c0\uace0)\n\n",null,B.a,null,B.c)
B.axY=new A.a("\u201c\uc804\uc7c1\uc758 \ucd5c\uc120\uc740 \uc801\uad6d\uc744 \ud30c\uad34\ud558\uc9c0 \uc54a\uace0 \ud56d\ubcf5\uc2dc\ud0a4\ub294 \uac83\uc774\ub2e4. \uc2f8\uc6cc\uc11c \uc801\uc744 \ubb34\ub108\ub728\ub9ac\ub294 \uac83\uc740 \ucc28\uc120\uc774\uba70, \uac00\ub2a5\ud558\ub2e4\uba74 '\uc2f8\uc6b0\uc9c0 \uc54a\uace0 \uc774\uae30\ub294 \uac83'\uc774 \ucd5c\uace0\uc758 \uc804\ub7b5\uc774\ub2e4.\u201d",null,B.a,null,B.c)
