B.a9E=new A.a("1. \uc804\uad6d\uc758 \uac00\uce58: \uc804\uc7c1\uc758 \uac00\uc7a5 \uc774\uc0c1\uc801\uc778 \uc2b9\ub9ac\ub294 **\uc801\uc758 \ub098\ub77c\ub97c \uc628\uc804\ud788 \ubcf4\uc804\ud558\uba74\uc11c \uc2b9\ub9ac\ud558\ub294 \uac83(\u5168\u570b\u7232\u4e0a)**\uc785\ub2c8\ub2e4. \uc774\ub294 \ubb34\ub825 \uc0ac\uc6a9\uc744 \ucd5c\uc18c\ud654\ud558\uc5ec \uc801\uc758 \uc0dd\uc0b0 \uae30\ubc18, \uc778\uba85, \ubb38\ud654 \uc720\uc0b0 \ub4f1\uc744 \ud30c\uad34\ud558\uc9c0 \uc54a\uace0 \uc790\uc2e0\uc758 \uac83\uc73c\ub85c \ud761\uc218\ud558\ub294 \uac83\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \ud30c\uad34\ub41c \uc801\uad6d\uc740 \uc810\ub839\ud558\ub354\ub77c\ub3c4 \uc7ac\uac74\uc5d0 \ub9c9\ub300\ud55c \ube44\uc6a9\uacfc \uc2dc\uac04\uc774 \ub4e4\uace0, \uc800\ud56d \uc138\ub825\uc758 \ubc1c\uc0dd \uac00\ub2a5\uc131\uc774 \ub192\uc544 \ud6a8\uc728\uc801\uc774\uc9c0 \ubabb\ud569\ub2c8\ub2e4.\n\n2. \ud30c\uad6d\uc758 \ube44\ud6a8\uc728\uc131: \ubc18\ub300\ub85c **\uc801\uad6d\uc744 \uc644\uc804\ud788 \ud30c\uad34\ud558\uc5ec \uc2b9\ub9ac\ud558\ub294 \uac83(\u7834\u570b\u6b21\u4e4b)**\uc740 \ucc28\uc120\ucc45\uc785\ub2c8\ub2e4. \uc774\ub294 \uc9c1\uc811\uc801\uc778 \ubb34\ub825 \ucda9\ub3cc\uc744 \ud1b5\ud574 \uc801\uc744 \uada4\uba78\uc2dc\ud0a4\ub294 \ubc29\uc2dd\uc73c\ub85c, \uc544\uad70\uacfc \uc801\uad70 \ubaa8\ub450\uc5d0\uac8c \ub9c9\ub300\ud55c \ud53c\ud574\ub97c \ucd08\ub798\ud569\ub2c8\ub2e4. \ubb3c\ub9ac\uc801\uc778 \uc2b9\ub9ac\ub294 \uc5bb\uc744 \uc218 \uc788\uc73c\ub098, \uadf8 \uacfc\uc815\uc5d0\uc11c \ubc1c\uc0dd\ud558\ub294 \uc778\uba85 \uc190\uc2e4, \uc7ac\uc0b0 \ud30c\uad34, \uc0ac\ud68c\uc801 \ud63c\ub780 \ub4f1\uc740 \uc7a5\uae30\uc801\uc73c\ub85c \ubcfc \ub54c \uc774\ub4dd\ubcf4\ub2e4 \uc190\ud574\uac00 \ub354 \ud074 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n\n3.\t\uc190\uc2e4 \ucd5c\uc18c\ud654\uc758 \uc6d0\uce59: \uad81\uadf9\uc801\uc73c\ub85c \uc774 \ubb38\uad6c\ub294 \uc804\uc7c1\uc758 \ubaa9\ud45c\uac00 \ub2e8\uc21c\ud788 \uc801\uc744 \uc81c\uac70\ud558\ub294 \uac83\uc744 \ub118\uc5b4, \uc804\uc7c1\uc73c\ub85c \uc778\ud55c \uc190\uc2e4\uc744 \ucd5c\uc18c\ud654\ud558\uba74\uc11c \ucd5c\ub300\ud55c\uc758 \uc774\uc775\uc744 \uc5bb\ub294 \uac83\uc5d0 \uc788\uc74c\uc744 \uac15\uc870\ud569\ub2c8\ub2e4. \ubb34\ub825 \ucda9\ub3cc\uc744 \ud53c\ud558\uace0 \uc678\uad50, \uc804\ub7b5\uc801 \uc555\ubc15, \uc2ec\ub9ac\uc804 \ub4f1\uc73c\ub85c \uc801\uc744 \uad74\ubcf5\uc2dc\ud0a4\ub294 \uac83\uc774 \uac00\uc7a5 \ud604\uba85\ud55c \ubc29\ubc95\uc784\uc744 \uc2dc\uc0ac\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
