B.ab7=new A.a("1. \ucd5c\uc18c \uc190\uc2e4, \ucd5c\ub300 \uc774\ub4dd: \uc804\uc7c1\uc758 \ubcf8\uc9c8\uc740 \ud30c\uad34\uac00 \uc544\ub2c8\ub77c \uc790\uad6d\uc758 \uc774\uc775\uc744 \uadf9\ub300\ud654\ud558\ub294 \ub370 \uc788\uc2b5\ub2c8\ub2e4. \uc774\ub97c \uc704\ud574 \ubd88\ud544\uc694\ud55c \ud30c\uad34\ub97c \ud53c\ud558\uace0, \uc801\uc758 \uc790\uc6d0\uc744 \uc628\uc804\ud788 \ud65c\uc6a9\ud560 \uc218 \uc788\ub3c4\ub85d \ubcf4\uc804\ud558\ub294 \uac83\uc774 \uc911\uc694\ud569\ub2c8\ub2e4.\n\n2.\t\uc678\uad50 \ubc0f \uc2ec\ub9ac\uc804\uc758 \uc6b0\uc704: \uc9c1\uc811\uc801\uc778 \ubb34\ub825 \ucda9\ub3cc\ubcf4\ub2e4\ub294 \uc678\uad50, \uc804\ub7b5\uc801 \uc555\ubc15, \uae30\ub9cc, \uc2ec\ub9ac\uc804 \ub4f1 \ube44\uad70\uc0ac\uc801 \uc218\ub2e8\uc744 \ud1b5\ud574 \uc801\uc758 \ud56d\ubcf5\uc744 \uc720\ub3c4\ud558\ub294 \uac83\uc774 \ucd5c\uc0c1\uc758 \uc804\ub7b5\uc785\ub2c8\ub2e4..\n\n3.\t\uc9c0\uc18d \uac00\ub2a5\ud55c \uc2b9\ub9ac: \ud30c\uad34\ub97c \ud1b5\ud55c \uc2b9\ub9ac\ub294 \ub2e8\uae30\uc801\uc77c \uc218 \uc788\uc73c\ub098, \uc628\uc804\ud55c \ud761\uc218\ub97c \ud1b5\ud55c \uc2b9\ub9ac\ub294 \uc7a5\uae30\uc801\uc778 \uc548\uc815\uacfc \uc774\ub4dd\uc744 \uac00\uc838\ub2e4\uc90d\ub2c8\ub2e4. \uc774\ub294 \uc810\ub839 \ud6c4\uc758 \uc7ac\uac74 \ube44\uc6a9\uacfc \ud1b5\uce58 \ud6a8\uc728\uc131\uc744 \uace0\ub824\ud55c \uc9c0\ud61c\uc785\ub2c8\ub2e4.\n\n4.\t\ud6a8\uc728\uc801\uc778 \uc790\uc6d0 \ud65c\uc6a9: \uc801\uc758 \uc778\uba85\uacfc \ubb3c\uc790\ub97c \ubcf4\uc804\ud568\uc73c\ub85c\uc368 \uc544\uad70\uc758 \uc790\uc6d0 \uc18c\ubaa8\ub97c \uc904\uc774\uace0, \ub098\uc544\uac00 \uc801\uc758 \uc790\uc6d0\uc744 \uc544\uad70 \uc790\uc6d0\uc73c\ub85c \uc804\ud658\ud558\ub294 \ud6a8\uc728\uc131\uc744 \ucd94\uad6c\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
