B.aia=new A.a(" 1. \uc120\ud0dd\uacfc \uc9d1\uc911: \ud55c\uc815\ub41c \uc790\uc6d0\uc744 \ubaa8\ub4e0 \uacf3\uc5d0 \ubd84\uc0b0\uc2dc\ud0a4\uc9c0 \ub9d0\uace0, \ud575\uc2ec\uc801\uc778 \uc9c0\uc810\uc774\ub098 \ubaa9\ud45c\uc5d0 \uc790\uc6d0\uc744 \uc9d1\uc911\ud558\uc5ec \uc555\ub3c4\uc801\uc778 \uc6b0\uc704\ub97c \ud655\ubcf4\ud574\uc57c \ud569\ub2c8\ub2e4.\n\n 2. \uc8fc\ub3c4\uad8c \uc7a5\uc545: \uacf5\uc218 \uc804\ud658\uc758 \uc8fc\ub3c4\uad8c\uc744 \uc544\uad70\uc774 \uc950\uace0, \uc801\uc744 \uc544\uad70\uc758 \uc758\ub3c4\ub300\ub85c \uc6c0\uc9c1\uc774\uac8c \ub9cc\ub4e4\uc5b4\uc57c \ud569\ub2c8\ub2e4. \uc218\ub3d9\uc801\uc73c\ub85c \ub04c\ub824\ub2e4\ub2c8\ub294 \uac83\uc744 \uacbd\uacc4\ud574\uc57c \ud569\ub2c8\ub2e4.\n\n 3.\t \uc57d\uc810 \ub178\ucd9c \uc720\ub3c4: \uc544\uad70\uc758 \uac15\uc810\uc744 \ud1b5\ud574 \uc801\uc758 \uc790\uc6d0\uc744 \ubd84\uc0b0\uc2dc\ud0a4\uace0, \uc801\uc758 \ubc29\uc5b4 \ud5c8\uc810(\u865b)\uc744 \ub9cc\ub4e4\uc5b4 \uacf5\uaca9\ud574\uc57c \ud569\ub2c8\ub2e4.\n\n 4.\t \ud6a8\uc728\uc801\uc778 \uc790\uc6d0 \ubc30\ubd84: \uc544\uad70\uc758 \uac15\uc810\uc744 \uadf9\ub300\ud654\ud558\uace0 \uc57d\uc810\uc744 \ucd5c\uc18c\ud654\ud558\ub294 \ucd5c\uc801\uc758 \uc790\uc6d0 \ubc30\ubd84 \uc804\ub7b5\uc744 \uc218\ub9bd\ud574\uc57c \ud569\ub2c8\ub2e4.\n\n 5.\t \uc801\uc758 \uc2ec\ub9ac \uc774\uc6a9: \uc801\uc758 \ubd88\uc548\uac10\uc774\ub098 \uc608\uce21 \ubd88\uac00\ub2a5\uc131\uc744 \uc774\uc6a9\ud558\uc5ec \uc801\uc758 \uc790\uc6d0\uc744 \ube44\ud6a8\uc728\uc801\uc73c\ub85c \uc0ac\uc6a9\ud558\uac8c \ub9cc\ub4ed\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
