B.agU=new A.a("This passage clearly states that the essence of leadership lies in 'leading by example' and 'building trust'. It conveys the message that for commands to be properly executed and for organizational members to truly follow, not only the content of the command but also the leader's actions themselves must be consistent and trustworthy.\n\n",null,B.a,null,B.c)
B.amQ=new A.a(" 1.\t'If commands are consistently practiced when teaching, the people will obey': \n   \u2022\tMeaning: If a leader consistently adheres to the commands or rules they have issued and sets an example through their actions (\u7d20\u884c\u4ee5\u654e), the organizational members (\u6c11) will believe in the legitimacy of the commands and the sincerity of the leader, and will truly obey (\u670d). \n\n 2.\t'If commands are not consistently practiced when teaching, the people will not obey': \n   \u2022\tMeaning: Conversely, if a leader does not adhere to the principles they have set (\u4e0d\u7d20\u884c), or if their words and actions are inconsistent, no matter how good the command, organizational members will not follow it wholeheartedly (\u4e0d\u670d) and will rebel. This leads to a loss of the leader's prestige and the disintegration of the organization. \n\n 3.\t'Commands that are consistently practiced lead to mutual understanding with the multitude': \n   \u2022\tMeaning: A state where a leader's commands are consistently well-followed (\u4ee4\u7d20\u884c\u8005) goes beyond mere obedience. It means that both the leader and the organizational members share the same goals and values (\u8207\u8846\u76f8\u5f97\u4e5f) and have reached a stage of mutual understanding. This is the completion of true leadership. \n\n",null,B.a,null,B.c)
