B.aAj=new A.a("\u318d \u8a08\u5229 (j\xec l\xec): Calculate profit (analyze advantage) \n\u318d \u4ee5\u807d (y\u01d0 t\u012bng): Listen and obey (follow judgment based on the situation) \n\u318d \u4e43\u70ba\u4e4b\u52e2 (n\u01cei w\xe9i zh\u012b sh\xec): And thereby create momentum/advantage \n\u318d \u4ee5\u4f50\u5176\u5916 (y\u01d0 zu\u01d2 q\xed w\xe0i): To assist the external (indirectly assist beyond direct force) \n\u318d \u52e2\u8005 (sh\xec zh\u011b): Momentum/advantage \n\u318d \u56e0\u5229\u800c\u5236\u6b0a\u4e5f (y\u012bn l\xec \xe9r zh\xec qu\xe1n y\u011b): Is to control (qu\xe1n) based on advantage \n\n",null,B.a,null,B.c)
