B.a76=new A.a("This passage emphasizes the importance of situational assessment, creation of momentum, and flexible response capability in the process of strategy formulation and execution. \n\n",null,B.a,null,B.c)
B.a5H=new A.a("1.\t\u8a08\u5229\u4ee5\u807d (J\xec l\xec y\u01d0 t\u012bng - Thorough Assessment of Advantages and Disadvantages): Before formulating and executing any strategy, one must thoroughly analyze and heed (fully consider and judge) the advantageous and disadvantageous aspects of the situation. This is a fundamental principle of Sun Tzu's Art of War that warns against emotional judgments or blind actions. \n\n2.\t\u4e43\u70ba\u4e4b\u52e2 (N\u01cei w\xe9i zh\u012b sh\xec - Creating a Favorable Momentum): Based on the assessment of advantages and disadvantages, if judged favorable, one must create momentum (\u52e2). Here, momentum (\u52e2) is not merely a superiority in forces, but a favorable formation, flow, or impetus that can overwhelm the opponent. This is created through meticulous planning and execution. \n\n3.\t\u4ee5\u4f50\u5176\u5916 (Y\u01d0 zu\u01d2 q\xed w\xe0i - Aiding External Conditions): The created momentum (\u52e2) should not merely remain an internal advantage, but should serve to aid and lead external conditions, such as the geographical conditions of the battlefield, the enemy's psychology, and the friendly forces' supply situation, favorably. It means using momentum (\u52e2) to make external circumstances advantageous for friendly forces. \n\n4.\t\u52e2\u8005\uff0c\u56e0\u5229\u800c\u5236\u6b0a\u4e5f (Sh\xec zh\u011b, y\u012bn l\xec \xe9r zh\xec qu\xe1n y\u011b - The Essence of Momentum): Momentum (\u52e2) is not fixed; it is the ability to exert qu\xe1n (\u6b0a - expediency, flexible response) to control and manage the situation flexibly, based on l\xec (\u5229 - advantage, favorable conditions). This means gaining the initiative by not being constrained by fixed principles and responding flexibly according to favorable conditions. \n\n",null,B.a,null,B.c)
