B.azF=new A.a("1.\tThorough Prior Analysis: Thoroughly analyzing advantages and disadvantages before any action is the starting point of all strategies. \n\n2.\tProactive Creation of Momentum: It is important not just to react passively to given situations, but to proactively create favorable momentum for oneself. \n\n3.\tFlexible Response to Situations: One must not be constrained by fixed tactics or principles, but exercise the wisdom of expediency (\u6b0a) to respond flexibly according to changes in the situation and advantages. \n\n4.\tUtilization of External Environment: Strategic thinking is needed to make the external environment favorable for friendly forces through internal strengths. \n\n5.\tSecuring the Initiative: Securing the initiative by controlling and managing the situation through momentum (\u52e2) is the key to victory. \n\n",null,B.a,null,B.c)
