B.H=new A.a("- Chinese Character Analysis (by vocabulary):  \n",null,B.a,null,B.t)
B.avn=new A.a("\u318d\u5341\u5247\u570d\u4e4b(sh\xed z\xe9 w\xe9i zh\u012b): If your forces are ten times stronger than the enemy, encircle them. \n\u318d\u4e94\u5247\u653b\u4e4b(w\u01d4 z\xe9 g\u014dng zh\u012b): If five times stronger, attack them. \n\u318d\u500d\u5247\u5206\u4e4b(b\xe8i z\xe9 f\u0113n zh\u012b): If twice as strong, divide them to respond. \n\u318d\u6575\u5247\u80fd\u6230\u4e4b(d\xed z\xe9 n\xe9ng zh\xe0n zh\u012b): If forces are equal, you can engage them in battle. \n\u318d\u5c11\u5247\u80fd\u9003\u4e4b(sh\u01ceo z\xe9 n\xe9ng t\xe1o zh\u012b): If your forces are fewer than the enemy, flee (retreat). \n\u318d\u4e0d\u82e5\u5247\u80fd\u907f\u4e4b(b\xf9 ru\xf2 z\xe9 n\xe9ng b\xec zh\u012b): If you are at a disadvantage, avoid confrontation (avoid direct conflict). \n\n",null,B.a,null,B.c)
B.anY=new A.a("\u201cIf your forces are overwhelmingly superior to the enemy, encircle them; if superior, attack them; if somewhat superior, divide them to respond. If forces are equal, you can fight head-on, but if inferior, it is advisable to retreat or avoid confrontation. Avoid reckless battles and make flexible judgments according to the situation.\u201d",null,B.a,null,B.c)
