B.adH=new A.a("This passage provides specific guidelines for action based on the comparison of friendly and enemy forces, emphasizing the importance of flexible response strategies depending on the battlefield situation. \n\n",null,B.a,null,B.c)
B.a7t=new A.a("1. Overwhelming Superiority (Ten times, Five times):\n\u2022 \u5341\u5247\u570d\u4e4b (Sh\xed z\xe9 w\xe9i zh\u012b): If your forces are ten times stronger than the enemy, employ a strategy of completely encircling the enemy, preventing their escape, and either annihilating them or forcing their surrender. This method aims to break the enemy's will to resist and achieve maximum results. \n\n\u2022 \u4e94\u5247\u653b\u4e4b (W\u01d4 z\xe9 g\u014dng zh\u012b): If your forces are five times stronger than the enemy, actively attack and destroy them. This level of superiority provides sufficient forces for a full-scale assault leading to victory. \n\n2. Tactical Superiority (Two times):\n\u2022 \u500d\u5247\u5206\u4e4b (B\xe8i z\xe9 f\u0113n zh\u012b): If your forces are twice as strong as the enemy, use a strategy of dispersing the enemy and defeating them piecemeal, or dividing the enemy's forces to allow your individual units to achieve relative superiority before engaging in combat. \n\n3.\tEqual or Inferior (Equal, Fewer, Greatly Inferior):\n\u2022 \u6575\u5247\u80fd\u6230\u4e4b (D\xed z\xe9 n\xe9ng zh\xe0n zh\u012b): If friendly and enemy forces are equal, you can fight head-on. In this situation, factors other than troop numbers (terrain, morale, commander's ability, etc.) determine victory or defeat. \n\n\u2022 \u5c11\u5247\u80fd\u9003\u4e4b (Sh\u01ceo z\xe9 n\xe9ng t\xe1o zh\u012b): If your forces are fewer than the enemy, it is wise to avoid battle and flee to preserve your strength. It is important to avoid disadvantageous battles to prevent losses to your forces. \n\n\u2022 \u4e0d\u82e5\u5247\u80fd\u907f\u4e4b (B\xf9 ru\xf2 z\xe9 n\xe9ng b\xec zh\u012b): If your forces are overwhelmingly inferior to the enemy, to the point of being completely unmatched, you should completely avoid battle and pursue other strategic objectives or plan for a later time. This is the principle of not engaging in battles where defeat is certain. \n\n",null,B.a,null,B.c)
