B.ata=new A.a("1.\tImportance of Situation Assessment: Accurately assessing the relative strength of friendly and enemy forces on the battlefield is the prerequisite for all strategic planning. \n\n2.\tFlexible Response to Situation: Depending on the troop situation, various strategies such as attack, encirclement, dispersion, avoidance, and retreat must be flexibly employed. One should not adhere to a single method. \n\n3.\tAssessment of Victory Probability: Before initiating combat, coldly assess the possibility of victory, and if it is determined that victory is impossible, boldly avoid the battle to minimize losses. \n\n4.\tPrinciple of Minimizing Losses: Avoid battles that are disadvantageous to your forces, and only fight in advantageous situations to minimize unnecessary loss of life and materiel. \n\n5.\tPreservation of Strength: When at a disadvantage, avoid fighting to preserve your strength and plan for a later time, which contributes to long-term victory. \n\n",null,B.a,null,B.c)
