B.a62=new A.a("\ud83d\udcda 5: Energy(\u5175\u52e2) \u2013 \uc694\uc57d\n",null,B.a,null,B.m)
B.abX=new A.a("Sun Tzu's Energy chapter emphasizes that the fundamental principles of war (or competition) are the same regardless of scale, and that the harmony of orthodox and surprising tactics, the application of emptiness and fullness, and the establishment of overwhelming momentum are key to victory. Furthermore, it insightfully points out that chaos, fear, and weakness can arise from order, courage, and strength, respectively, stressing the importance of flexible strategies that lure the enemy and seize opportunities.\n\n",null,B.a,null,B.t)
B.j_=new A.a("The core principles are as follows:\n\n",null,B.a,null,B.c)
B.awD=new A.a(" \u2022\tPrinciples of Large-Scale Organization Management: Managing a large army is no different from handling a small one, and this is possible through organization and division (\u5206\u6578). Also, deploying a large army in battle is like fighting with a small one, and this is controlled through names and identification (\u5f62\u540d).\n\n \u2022\tHarmony of Orthodox and Surprising Tactics: Victory comes from confronting the enemy with orthodox methods (\u6b63) and achieving decisive victory with surprising tactics (\u5947). The ability to inevitably engage the enemy without defeat lies in the skillful application of these qi and zheng forces.\n\n \u2022\tApplication of Emptiness and Fullness: Defeating a weak enemy with strong forces is like 'throwing a millstone at an egg (\u5982\u4ee5\u78aa\u6295\u5375\u8005)'. This refers to the principle of xu shi (\u865b\u5be6), which means striking the enemy's emptiness (\u865b) with one's fullness (\u5be6).\n\n \u2022\tImportance of Momentum (\u52e2) and Precision (\u7bc0): When swift and fierce water sweeps away rocks, it is due to the power of momentum (\u52e2). When a fierce bird breaks its target, it is due to the precision of timing (\u7bc0). Overwhelming power and precise timing determine victory.\n\n \u2022\tParadoxical Insight: Through the paradoxical insight that chaos arises from order (\u4e82\u751f\u65bc\u6cbb), fear arises from courage (\u602f\u751f\u65bc\u52c7), and weakness arises from strength (\u5f31\u751f\u65bc\u5f3a), one must penetrate the surface of phenomena and find weaknesses.\n\n \u2022\tLuring with Profit and Seizing Opportunity: Lure the enemy with profit (\u5229), wait for the enemy with prepared troops (\u5352), and seize decisive opportunities.\n\n",null,B.a,null,B.c)
