B.acZ=new A.a("\u318d\u52dd\u6575\u800c\u76ca\u5f3a(sh\xe8ng d\xed \xe9r y\xec qi\xe1ng): By defeating the enemy, one becomes even stronger. (Power and morale increase through victory) \n\u318d\u5175\u8cb4\u52dd(b\u012bng gu\xec sh\xe8ng): War values victory (should value victory most highly) \n\u318d\u4e0d\u8cb4\u4e45(b\xf9 gu\xec ji\u01d4): Does not value prolongation. (Should avoid protracted war) \n\u318d\u77e5\u5175\u4e4b\u5c07(zh\u012b b\u012bng zh\u012b ji\xe0ng): A general who understands military strategy (a wise general skilled in warfare) \n\u318d\u6c11\u4e4b\u53f8\u547d(m\xedn zh\u012b s\u012b m\xecng): Is the one who oversees the lives of the people (holds the fate of the people) \n\u318d\u570b\u5bb6\u5b89\u5371\u4e4b\u4e3b\u4e5f(gu\xf3 ji\u0101 \u0101n w\u0113i zh\u012b zh\u01d4 y\u011b): Is the master who determines the security and danger of the state \n",null,B.a,null,B.c)
B.a5Z=new A.a('\u201cBy defeating the enemy, one becomes even stronger. War values victory; it does not value prolongation. A general who understands military strategy is the one who holds the lives of the people and determines the security and danger of the state."',null,B.a,null,B.c)
