B.ah8=new A.a("This passage comprehensively explains the purpose of war, efficiency, and the responsibility of a leader. \n\n",null,B.a,null,B.c)
B.abf=new A.a("1. \u52dd\u6575\u800c\u76ca\u5f3a(sh\xe8ng d\xed \xe9r y\xec qi\xe1ng): Winning against the enemy in war is not merely about removing a threat but also an opportunity to make oneself even stronger (\u76ca\u5f3a). This includes positive effects such as seizing enemy resources, boosting friendly morale, and enhancing international standing. It means that the gains from victory go beyond mere territorial expansion to a real strengthening of national power. \n\n2. \u5175\u8cb4\u52dd\uff0c\u4e0d\u8cb4\u4e45((b\u012bng gu\xec sheng, b\xf9 gu\xec ji\u01d4): As repeatedly emphasized earlier, war values victory (\u52dd) most highly (\u8cb4) and does not value prolongation (\u4e45) (\u4e0d\u8cb4\u4e45). It reiterates the harms of protracted war, emphasizing that only a swift and decisive victory is truly valuable. \n\n3. \u77e5\u5175\u4e4b\u5c07\uff0c\u6c11\u4e4b\u53f8\u547d\uff0c\u570b\u5bb6\u5b89\u5371\u4e4b\u4e3b\u4e5f(zh\u012b b\u012bng zh\u012b ji\xe0ng, m\xedn zh\u012b s\u012b m\xecng gu\xf3 ji\u0101 \u0101n w\u0113i zh\u012b zh\u01d4 y\u011b):\n\n - \u77e5\u5175\u4e4b\u5c07(zh\u012b b\u012bng zh\u012b ji\xe0ng): A true commander is not simply a brave general or one with many troops, but a general who truly understands (\u77e5) and can employ military strategy (\u5175).\n\n - \u6c11\u4e4b\u53f8\u547d(m\xedn zh\u012b s\u012b m\xecng): Such a general is the one who oversees (\u53f8) the lives (\u547d) of the people (\u6c11).This is because every decision he makes determines the life and death of countless people. \n\n - \u570b\u5bb6\u5b89\u5371\u4e4b\u4e3b\u4e5f(gu\xf3 ji\u0101 \u0101n w\u0113i zh\u012b zh\u01d4 y\u011b): Furthermore, he is the master (\u4e3b) responsible for the security (\u5b89\u5371) of the state (\u570b\u5bb6). It emphasizes that a general's outstanding capability and judgment play a crucial role in determining the fate of the nation.  \n\n",null,B.a,null,B.c)
