B.aiC=new A.a(" 1.\t\u7d76\u5c71\u4f9d\u8c37 (\ud5d8\uc900\ud55c \uc0b0\uc744 \ud53c\ud558\uace0 \uacc4\uace1\uc5d0 \uc758\uc9c0\ud558\ub77c): \n  \u318d \uc758\ubbf8: \uc804\ud22c \uc2dc \ud5d8\uc900\ud55c \uc0b0(\u7d76\u5c71)\uc740 \ubcd1\ub825 \uc774\ub3d9\uc774 \uc5b4\ub835\uace0 \ub9e4\ubcf5\uc5d0 \ucde8\uc57d\ud558\uba70 \ubcf4\uae09\uc774 \ud798\ub4e0 \ub2e8\uc810\uc774 \uc788\uc73c\ubbc0\ub85c \ud53c\ud574\uc57c \ud569\ub2c8\ub2e4. \ub300\uc2e0, **\uacc4\uace1(\u8c37)\uc5d0 \uc758\uc9c0\ud558\uc5ec \uc9c4\uc744 \uce58\ub294 \uac83(\u4f9d\u8c37)**\uc774 \uc720\ub9ac\ud569\ub2c8\ub2e4. \uacc4\uace1\uc740 \ub300\uccb4\ub85c \ubcd1\ub825 \uc740\ud3d0\uc5d0 \uc6a9\uc774\ud558\uace0, \uac15\uc774\ub098 \uc218\uc6d0\uc9c0\uac00 \uc788\uc5b4 \ubcf4\uae09\uc5d0 \uc720\ub9ac\ud558\uba70, \uc801\uc758 \uacf5\uaca9\uc744 \ud55c\uc815\ub41c \ud1b5\ub85c\ub85c \uc720\ub3c4\ud560 \uc218 \uc788\uc5b4 \ubc29\uc5b4\uc5d0 \uc720\ub9ac\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \n\n 2.\t\u8996\u751f\u8655\u9ad8 (\uc0b4\uc544\uac08 \uae38\uc744 \ubcfc \ub54c\ub294 \ub192\uc740 \uacf3\uc5d0 \uc704\uce58\ud574\uc57c \ud55c\ub2e4): \n  \u318d \uc758\ubbf8: \uc544\uad70\uc774 \uc0dd\uc874\ud560 \uae38(\u751f)\uc744 \ucc3e\uace0 \uc804\uc7a5\uc758 \uc0c1\ud669\uc744 \ud30c\uc545(\u8996)\ud560 \ub54c\ub294 \ub192\uc740 \uacf3(\u9ad8)\uc5d0 \uc704\uce58\ud574\uc57c(\u8655) \ud55c\ub2e4\ub294 \uc758\ubbf8\uc785\ub2c8\ub2e4. \ub192\uc740 \uacf3\uc5d0 \uc788\uc73c\uba74 \ub113\uc740 \uc2dc\uc57c\ub97c \ud655\ubcf4\ud558\uc5ec \uc801\uc758 \uc6c0\uc9c1\uc784, \uc9c0\ud615\uc758 \ud2b9\uc131, \ubcf4\uae09\ub85c \ub4f1\uc744 \ud55c\ub208\uc5d0 \ud30c\uc545\ud560 \uc218 \uc788\uc5b4, \uc704\uae30 \uc0c1\ud669\uc5d0\uc11c \ud0c8\ucd9c\ub85c\ub97c \ucc3e\uac70\ub098 \uc720\ub9ac\ud55c \uacf5\uaca9 \uae30\ud68c\ub97c \ud3ec\ucc29\ud558\ub294 \ub370 \uc6a9\uc774\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
