B.avl=new A.a("  \u2022 \u572e\u5730(p\u01d0 d\xec): Broken ground, unfavorable terrain, rough and unstable ground \n  \u2022 \u7121\u820d(w\xfa sh\xe8): Do not encamp (\u820d: to stay, to station) \n  \u2022 \u8862\u5730(q\xfa d\xec): Strategic ground, crossroads where various units or nations meet \n  \u2022 \u4ea4\u5408(ji\u0101o h\xe9): Unite, cooperate (\u4ea4: to interact, \u5408: to combine) \n  \u2022 \u7d76\u5730(ju\xe9 d\xec): Isolated ground (\u7d76: cut off), an area with no escape route. \n  \u2022 \u7121\u7559(w\xfa li\xfa): Do not linger. \n  \u2022 \u570d\u5730(w\xe9i d\xec): Surrounded ground. \n  \u2022 \u5247\u8b00(z\xe9 m\xf3u): Then devise a strategy (\u8b00: to plan). \n  \u2022 \u6b7b\u5730(s\u01d0 d\xec): Death ground, a situation where one must fight desperately to survive. \n  \u2022 \u5247\u6230(z\xe9 zh\xe0n): Then fight.\n\n",null,B.a,null,B.c)
