B.a8y=new A.a(" 1.\t\u572e\u5730\u7121\u820d (Do not linger in isolated ground):\n\u2022\tMeaning: Emphasizes that in rough and weak terrain (\u572e\u5730) where one can be easily surrounded or isolated by the enemy, one should not linger but quickly move away.\n\n 2.\t\u8862\u5730\u4ea4\u5408 (Unite in strategic ground):\n\u2022\tMeaning: Emphasizes that in strategic strongholds (\u8862\u5730) that are easily accessible to both friendly and enemy forces, troops should be concentrated and allied forces should unite to strengthen their power.\n\n 3.\t\u7d76\u5730\u7121\u7559 (Do not delay in difficult terrain):\n\u2022\tMeaning: Emphasizes that in rugged terrain or isolated passages (\u7d76\u5730) where supplies are difficult and passage is hard, one should not waste time but pass through quickly.\n\n 4.\t\u570d\u5730\u5247\u8b00 (When surrounded, devise a strategy):\n\u2022\tMeaning: Emphasizes that in a situation (\u570d\u5730) where one is surrounded by the enemy and in danger, instead of a frontal breakthrough or reckless action, one should devise a wise strategy (\u8b00) to find a breakthrough or escape. \n\n 5.\t\u6b7b\u5730\u5247\u6230 (When in death ground, fight desperately):\n\u2022\tMeaning: Emphasizes that in a situation (\u6b7b\u5730) where retreat is completely blocked and the chances of survival are slim \u2013 a 'death or nothing' situation \u2013 one should abandon hope of survival and fight with a desperate resolve. In such a situation, soldiers fight with a willingness to die, which can paradoxically unleash unexpected strength. \n\n",null,B.a,null,B.c)
