B.amh=new A.a(" 1.\tTerrain and Situation Analysis: Accurately assessing the terrain features of the battlefield and the situation of both friendly and enemy forces is fundamental to all strategic planning.\n\n 2.\tSituation-Specific Strategies: The most appropriate courses of action (not lingering, uniting, not delaying, devising strategies, fighting desperately) must be applied according to different situations and terrains.\n\n 3.\tFlexible Response: The ability to flexibly shift strategies in response to environmental changes, without being bound by fixed tactics, is essential.\n\n 4.\tDecisiveness and Execution: After assessing the situation, it is crucial to make bold decisions and execute them without delay, especially in times of crisis.\n\n 5.\tBalance of Survival and Victory: In dangerous situations, survival is prioritized, while in desperate situations, a balanced perspective is needed to paradoxically find opportunities for victory through desperate fighting.\n\n",null,B.a,null,B.c)
