B.an5=new A.a("This passage embodies one of the core ideas of Sun Tzu's Art of War, penetrating the essence of defensive strategy. It clearly states that the success of defense does not depend on the enemy's will or actions, but on strengthening one's own capabilities and establishing a state of preparedness.\n\n",null,B.a,null,B.c)
B.amU=new A.a(" 1.\tGuarding against Passive Defense:\n\u2022\t\u7121\u6043\u5176\u4e0d\u653b: Warns against having vague hopes or expectations that the enemy will not attack because they are weak or have no will to attack. One must always assume the enemy can attack at any time and prepare accordingly.\n\n 2.\tCore of Proactive Defense: \n \u2022\t\u6043\u543e\u6709\u6240\u4e0d\u53ef\u653b\u4e5f: Emphasizes that true defense does not depend on whether the enemy attacks, but on our own forces creating a state where the enemy finds it difficult to attack, or where their attack would not succeed (\u6709\u6240\u4e0d\u53ef\u653b\u4e5f). This means proactive efforts such as strengthening defensive capabilities, compensating for weaknesses, and establishing unpredictable defensive postures. \n\n",null,B.a,null,B.c)
