B.ati=new A.a("1. \uc120\uc704\ubd88\uac00\uc2b9 (\u5148\u7232\u4e0d\u53ef\u52dd - \uba3c\uc800 \uc2b9\ub9ac\ud560 \uc218 \uc5c6\ub294 \uc0c1\ud0dc\ub97c \ub9cc\ub4e0\ub2e4):\n  \u318d \uc758\ubbf8: \uc544\uad70 \uc2a4\uc2a4\ub85c\ub97c \uba3c\uc800 \uacb0\ucf54 \ud328\ubc30\ud558\uc9c0 \uc54a\ub294, \uc989 \uc801\uc774 \uacb0\ucf54 \uc774\uae38 \uc218 \uc5c6\ub294 \uacac\uace0\ud55c \uc0c1\ud0dc\ub85c \ub9cc\ub4dc\ub294 \uac83\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \uc774\ub294 \ucca0\uc800\ud55c \ubc29\uc5b4 \ud0dc\uc138, \uc644\ubcbd\ud55c \uc900\ube44, \uc57d\uc810 \ubcf4\uc644, \uac15\ub825\ud55c \uc5b5\uc81c\ub825 \uad6c\ucd95 \ub4f1\uc744 \ud1b5\ud574 \uc801\uc774 \uc544\uad70\uc5d0\uac8c \uac10\ud788 \ub3c4\uc804\ud560 \uc218 \uc5c6\ub3c4\ub85d \ub9cc\ub4dc\ub294 \uac83\uc744 \ub73b\ud569\ub2c8\ub2e4.\n\n2. \uc774\ub300\uc801\uc9c0\uac00\uc2b9 (\u4ee5\u5f85\u6575\u4e4b\u53ef\u52dd - \uc801\uc774 \uc2b9\ub9ac\ud560 \uc218 \uc788\ub294 \ub54c\ub97c \uae30\ub2e4\ub9b0\ub2e4):\n \u318d \uc758\ubbf8: \uc544\uad70\uc774 '\ubd88\uac00\uc2b9'\uc758 \uc0c1\ud0dc\uac00 \ub41c \ud6c4\uc5d0\ub294 \uc801\uc774 \uc2e4\uc218\ud558\uac70\ub098 \uc57d\uc810\uc744 \ub178\ucd9c\ud558\uc5ec \uc544\uad70\uc774 '\uac00\uc2b9(\uc774\uae38 \uc218 \uc788\ub294)' \uae30\ud68c\ub97c \ubcf4\uc77c \ub54c\uae4c\uc9c0 \uc778\ub0b4\uc2ec\uc744 \uac00\uc9c0\uace0 \uae30\ub2e4\ub9ac\ub294 \uac83\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \uc774\ub294 \uc123\ubd80\ub978 \uacf5\uaca9\uc744 \uc0bc\uac00\uace0, \uc801\uc774 \uc2a4\uc2a4\ub85c \ubb34\ub108\uc9c0\uac70\ub098 \ud5c8\uc810\uc744 \ub4dc\ub7ec\ub0bc \ub54c\uae4c\uc9c0 \ub54c\ub97c \uae30\ub2e4\ub9ac\ub294 \uc804\ub7b5\uc801 \uc778\ub0b4\ub97c \ub73b\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
