B.aua=new A.a(" 1. \ubc29\uc5b4\uc758 \uc6b0\uc120\uc131: \uacf5\uaca9\uc5d0 \uc55e\uc11c \uc790\uc2e0\uc744 \uacac\uace0\ud558\uac8c \ub9cc\ub4dc\ub294 \ubc29\uc5b4 \uc804\ub7b5\uc774 \uc2b9\ub9ac\uc758 \uccab\uac78\uc74c\uc785\ub2c8\ub2e4. '\uc9c0\uc9c0 \uc54a\ub294 \uc2f8\uc6c0'\uc744 \ub9cc\ub4dc\ub294 \uac83\uc774 '\uc774\uae30\ub294 \uc2f8\uc6c0'\ubcf4\ub2e4 \uc120\ud589\ub418\uc5b4\uc57c \ud569\ub2c8\ub2e4.\n\n2. \ubb34\ud328(\u7121\u6557)\uc758 \uc6d0\uce59: \uc808\ub300 \ud328\ubc30\ud558\uc9c0 \uc54a\ub294 \uc0c1\ud0dc\ub97c \uc720\uc9c0\ud568\uc73c\ub85c\uc368 \uc7a5\uae30\uc801\uc778 \uad00\uc810\uc5d0\uc11c \uc6b0\uc704\ub97c \uc810\ud558\uace0 \uae30\ud68c\ub97c \uae30\ub2e4\ub9ac\ub294 \uac83\uc774 \uc911\uc694\ud569\ub2c8\ub2e4.\n\n 3. \uc801\uc758 \uc2e4\uc218 \uc720\ub3c4: \uc544\uad70\uc774 \uacac\uace0\ud558\uba74 \uc801\uc740 \uc870\uae09\ud574\uc838 \uc2a4\uc2a4\ub85c \uc57d\uc810\uc744 \ub4dc\ub7ec\ub0b4\uac70\ub098 \uc2e4\uc218\ub97c \ud560 \uac00\ub2a5\uc131\uc774 \ub192\uc544\uc9d1\ub2c8\ub2e4.\n\n 4. \uc804\ub7b5\uc801 \uc778\ub0b4: \uc123\ubd80\ub974\uac8c \uacf5\uaca9\ud558\uc9c0 \uc54a\uace0, \uc801\uc774 \uacb0\uc815\uc801\uc778 \uc57d\uc810\uc744 \ub178\ucd9c\ud560 \ub54c\uae4c\uc9c0 \uc778\ub0b4\uc2ec\uc744 \uac00\uc9c0\uace0 \uae30\ub2e4\ub9b4 \uc904 \uc544\ub294 \uc9c0\ud61c\uac00 \ud544\uc694\ud569\ub2c8\ub2e4.\n\n 5. \uae30\ud68c \ud3ec\ucc29: \uc801\uc758 \uc57d\uc810\uc774 \ub4dc\ub7ec\ub0ac\uc744 \ub54c, \uc774\ub97c \ub193\uce58\uc9c0 \uc54a\uace0 \uc989\uc2dc \uacf5\uaca9\ud558\uc5ec \uc2b9\ub9ac\ub85c \uc5f0\uacb0\ud558\ub294 \ub2a5\ub825\uc774 \uc911\uc694\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
