B.axw=new A.a("  \u2022 \u4e0d\u722d(b\xf9 zh\u0113ng): \ub2e4\ud22c\uc9c0 \uc54a\ub294\ub2e4 \n  \u2022 \u5929\u4e0b\u4e4b\u4ea4(ti\u0101n xi\xe0 zh\u012b ji\u0101o): \uc138\uc0c1\uc758 \uc678\uad50 \uad00\uacc4, \uacf5\uc801 \uad00\uacc4 \n  \u2022 \u4e0d\u990a(b\xf9 y\u01ceng): \uae30\ub974\uc9c0 \uc54a\ub294\ub2e4, \uc758\uc874\ud558\uc9c0 \uc54a\ub294\ub2e4 \n  \u2022 \u5929\u4e0b\u4e4b\u6b0a(ti\u0101n xi\xe0 zh\u012b qu\xe1n): \uc138\uc0c1\uc758 \uad8c\uc138\ub098 \uc678\uc138\uc758 \ud798 \n  \u2022 \u795e\u6a5f(sh\xe9n j\u012b): \uc2e0\ubb18\ud55c \uc804\ub7b5, \uae30\ubbfc\ud55c \uae30\ud68d \n  \u2022 \u4e4b\u58eb(zh\u012b sh\xec): \uadf8\ub7ec\ud55c \uc0ac\ub78c, \uc804\ub7b5\uac00 \n  \u2022 \u7232\u5bb6(w\xe9i ji\u0101): \uac70\ucc98\ub97c \uc0bc\ub2e4, \uc9d1\uc73c\ub85c \uc0bc\ub2e4 \n  \u2022 \u65bc\u8cca(y\xfa z\xe9i): \uc801\uc9c4 \uc18d\uc5d0\uc11c, \uc801\uacfc \ud568\uaed8 \n\n",null,B.a,null,B.c)
