B.a5S=new A.a(" \uc774 \ubb38\uad6c\ub294 \u201c\uac89\uc73c\ub85c \ubcf4\uc774\ub294 \uc678\uad50\ub098 \uad8c\uc138\uc5d0 \ud754\ub4e4\ub9ac\uc9c0 \uc54a\uace0, \uc624\ud788\ub824 \uc801\uc758 \ub0b4\ubd80\uc5d0\uc11c \uc815\ubcf4\ub97c \uc5bb\uace0 \uc791\uc804\uc744 \ud3bc\uce58\ub294 \uc790\uac00 \uc9c4\uc815\ud55c \uc804\ub7b5\uac00\ub2e4\u201d \ub77c\ub294 \uc758\ubbf8\ub85c \ud3c9\ubc94\ud55c \uc804\ub7b5\uac00\ub97c \ub118\uc5b4\uc120 '\uc2e0\ubb18\ud55c \uae30\ubbf8\ub97c \uc544\ub294 \uc790(\u795e\u6a5f\u4e4b\u58eb)'\uc758 \ub3c5\ud2b9\ud55c \uc811\uadfc\ubc95\uc744 \uc124\uba85\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
B.anf=new A.a(" 1. \u4e0d\u722d\u5929\u4e0b\u4e4b\u4ea4 \u4e0d\u990a\u5929\u4e0b\u4e4b\u6b0a: \ubcf4\ud1b5\uc758 \uad70\uc8fc\ub098 \uc804\ub7b5\uac00\ub4e4\uc740 \uc8fc\ubcc0 \uad6d\uac00\uc640\uc758 \uc678\uad50 \uad00\uacc4\ub97c \uad6c\ucd95\ud558\uace0 \ub3d9\ub9f9\uc744 \ub9fa\uac70\ub098, \uc790\uc2e0\uc758 \uc138\ub825\uacfc \uad8c\ub825\uc744 \ud655\uc7a5\ud558\ub294 \ub370 \uc8fc\ub825\ud569\ub2c8\ub2e4. \ud558\uc9c0\ub9cc '\uc2e0\ubb18\ud55c \uae30\ubbf8\ub97c \uc544\ub294 \uc790'\ub294 \uc774\ub7ec\ud55c \uc9c1\uc811\uc801\uc778 \uc678\uad50\uc801/\uc815\uce58\uc801 \uacbd\uc7c1\uc5d0 \uc5bd\ub9e4\uc774\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4. \uac89\uc73c\ub85c \ub4dc\ub7ec\ub098\ub294 \uba85\ubd84\uc774\ub098 \uc138\ub825 \ud655\uc7a5\uc5d0 \uc9d1\ucc29\ud558\uc9c0 \uc54a\ub294\ub2e4\ub294 \uc758\ubbf8\uc785\ub2c8\ub2e4. \n\n 2. \u7232\u5bb6\u65bc\u8cca: \uadf8\ub4e4\uc740 \uc801\uc758 \ub0b4\ubd80 \uae4a\uc219\uc774 \uce68\ud22c\ud558\uc5ec \uc790\uc2e0\uc758 \uadfc\uac70\uc9c0\ub098 \uc601\ud5a5\ub825\uc744 \uad6c\ucd95\ud569\ub2c8\ub2e4. \uc774\ub294 \ubb3c\ub9ac\uc801\uc778 \uc810\ub839\uc744 \uc758\ubbf8\ud560 \uc218\ub3c4 \uc788\uc9c0\ub9cc, \ub354 \ub098\uc544\uac00 \uc801 \ub0b4\ubd80\uc758 \uc57d\uc810\uc744 \ud30c\uace0\ub4e4\uc5b4 \ubd84\uc5f4\uc744 \uc870\uc7a5\ud558\uac70\ub098, \ud575\uc2ec \uc815\ubcf4\ub97c \ube7c\ub0b4\uac70\ub098, \uc801\uc758 \uc758\uc0ac\uacb0\uc815\uc5d0 \uc601\ud5a5\uc744 \ubbf8\uce58\ub294 \ub4f1 \ubb34\ud615\uc758 \ubc29\uc2dd\uc73c\ub85c \uc801\uc758 \uc2ec\uc7a5\ubd80\uc5d0\uc11c \uc790\uc2e0\uc758 \uc774\uc775\uc744 \ub3c4\ubaa8\ud558\ub294 \uac83\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \n\n 3. \u795e\u6a5f\u4e4b\u58eb: \uc774\ub7ec\ud55c \uc804\ub7b5\uc740 \uc77c\ubc18\uc801\uc778 \uc0ac\uace0\ubc29\uc2dd\uc73c\ub85c\ub294 \uc774\ud574\ud558\uae30 \uc5b4\ub835\uace0, \uc5c4\uccad\ub09c \ud1b5\ucc30\ub825\uacfc \uc6a9\uae30, \uadf8\ub9ac\uace0 \ubbf8\ub798\uc758 \uae30\ubbf8(\u6a5f)\ub97c \uc815\ud655\ud558\uac8c \uc77d\uc5b4\ub0b4\ub294 '\uc2e0\ubb18\ud55c' \ub2a5\ub825\uc744 \uac00\uc9c4 \uc790\ub9cc\uc774 \uc2e4\ud589\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uac89\uc73c\ub85c \ub4dc\ub7ec\ub098\uc9c0 \uc54a\ub294 \uc704\ud5d8\ud55c \ub3c4\ubc15\ucc98\ub7fc \ubcf4\uc77c\uc9c0\ub77c\ub3c4, \uc7a5\uae30\uc801\uc778 \uc548\ubaa9\uc73c\ub85c \uc801\uc758 \uc2ec\uc7a5\ubd80\ub97c \ubb34\ub108\ub728\ub9ac\ub294 \uac00\uc7a5 \ud6a8\uacfc\uc801\uc778 \ubc29\ubc95\uc774 \ub420 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
