B.aAA=new A.a("  \u2022 \u5730\u5f62(d\xec x\xedng): \uc9c0\ub9ac\uc801 \ud615\uc138, \uc804\uc7a5\uc758 \ud658\uacbd\n  \u2022 \u6d41\u901a\u8005(li\xfa t\u014dng zh\u011b): \uc774\ub3d9\uacfc \ud1b5\ub85c\uac00 \uc6d0\ud65c\ud55c \uc9c0\ud615\n  \u2022 \u6109\u5feb\u8005(y\xfa ku\xe0i zh\u011b): \uad70\uc758 \uae30\ub3d9\uc774 \uc790\uc720\ub86d\uace0 \uc548\uc815\ub41c \uc9c0\ud615\n  \u2022 \u6538\u6301\u8005(y\u014du ch\xed zh\u011b): \ubcd1\ub825\uc744 \uc720\uc9c0\ud558\uae30 \uc88b\uc740 \uc9c0\ud615\n  \u2022 \u6538\u611b\u8005(y\u014du \xe0i zh\u011b): \uc591\uad70\uc774 \ub2e4\ud22c\uc5b4 \uc810\ub839\ud558\ub824\ub294 \uc694\ucda9\uc9c0\n  \u2022 \u6538\u96aa\u8005(y\u014du xi\u01cen zh\u011b): \ud5d8\uc900\ud558\uace0 \uc704\ud5d8\ud55c \uc9c0\ud615\n  \u2022 \u6538\u9060\u8005(y\u014du yu\u01cen zh\u011b): \uad70 \ubcf4\uae09\ub85c\ub098 \ubcf8\uc9c4\uc5d0\uc11c \uba40\ub9ac \ub5a8\uc5b4\uc9c4 \uc9c0\ud615 \n\n",null,B.a,null,B.c)
