B.aA1=new A.a(" 1. \u5730\u5f62\u6d41\u901a\u8005 \u6109\u5feb\u8005 (\uc9c0\ud615\uc774 \uc720\ud1b5\ub418\ub294 \uacf3\uc740 \uc990\uac70\uc6b4 \uacf3\uc774\ub2e4): \n   \u318d\uc758\ubbf8: \ubcd1\ub825\uc774\ub098 \ubb3c\uc790 \uc774\ub3d9\uc774 \uc790\uc720\ub86d\uace0, \uc815\ubcf4 \uc18c\ud1b5\uc774 \uc6d0\ud65c\ud558\uba70, \uad50\ud1b5\uc774 \ud3b8\ub9ac\ud55c **\uac1c\ubc29\uc801\uc774\uace0 \ud1b5\uacfc\ud558\uae30 \uc26c\uc6b4 \uc9c0\ud615(\u6d41\u901a\u8005)**\uc740 \uc791\uc804 \uc218\ud589\uc774 \uc6a9\uc774\ud558\uc5ec '\uacf5\ub7b5\ud558\uae30 \uc990\uac70\uc6b4(\u6109\u5feb\u8005)' \uacf3\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \uc774\ub7ec\ud55c \uacf3\uc740 \ube60\ub978 \uae30\ub3d9\uacfc \uacf5\uaca9 \uc791\uc804\uc5d0 \uc720\ub9ac\ud569\ub2c8\ub2e4. \n\n 2. \u6538\u6301\u8005 \u6538\u611b\u8005 (\uc9c0\ud0ac \uc218 \uc788\ub294 \uacf3\uc740 \uc544\ub084 \ub9cc\ud55c \uacf3\uc774\ub2e4): \n   \u318d\uc758\ubbf8: \ubc29\uc5b4\ud558\uae30 \uc720\ub9ac\ud558\uc5ec **\uc624\ub798 \uc9c0\ud0ac \uc218 \uc788\ub294 \uc9c0\ud615(\u6538\u6301\u8005)**\uc740 \uadf8\ub9cc\ud07c \uc804\ub7b5\uc801 \uac00\uce58\uac00 \ub192\uace0 '\uc18c\uc911\ud788 \uc5ec\uaca8\uc57c \ud560(\u6538\u611b\u8005)' \uacf3\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \ubc29\uc5b4 \uc2dc\uc124 \uad6c\ucd95\uc774 \uc6a9\uc774\ud558\uac70\ub098, \uc801\uc758 \uacf5\uaca9\uc744 \ud6a8\uacfc\uc801\uc73c\ub85c \ub9c9\uc544\ub0bc \uc218 \uc788\ub294 \uc694\ucda9\uc9c0 \ub4f1\uc774 \uc774\uc5d0 \ud574\ub2f9\ud569\ub2c8\ub2e4. \n\n 3. \u6538\u96aa\u8005 \u6538\u9060\u8005 (\ud5d8\ud55c \uacf3\uc740 \uba3c \uacf3\uc774\ub2e4): \n   \u318d\uc758\ubbf8: \ubcd1\ub825 \uc774\ub3d9\uc774 \uc5b4\ub835\uace0 \ub9e4\ubcf5\uc5d0 \ucde8\uc57d\ud558\uba70 \ubcf4\uae09\uc774 \ud798\ub4e0 **\ud5d8\ud55c \uc9c0\ud615(\u6538\u96aa\u8005)**\uc740 \ubb3c\ub9ac\uc801\uc73c\ub85c \uba40\uc9c0 \uc54a\ub354\ub77c\ub3c4, \uc791\uc804\uc744 \uc218\ud589\ud558\uae30\uc5d0\ub294 '\ub9e4\uc6b0 \uba40\uac8c \ub290\uaef4\uc9c0\ub294(\u6538\u9060\u8005)' \uacf3\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \uc989, \uadf8\uacf3\uc73c\ub85c \uc9c4\uad70\ud558\uac70\ub098 \uadf8\uacf3\uc5d0\uc11c \uc791\uc804\uc744 \uc218\ud589\ud558\ub294 \uac83\uc774 \ub9e4\uc6b0 \ud798\ub4e4\uace0 \ube44\ud6a8\uc728\uc801\uc784\uc744 \ub098\ud0c0\ub0c5\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
