B.ac9=new A.a(" 1. \uc9c0\ud615\uc758 \uc804\ub7b5\uc801 \ubd84\ub958: \ubaa8\ub4e0 \uc9c0\ud615\uc744 \ub3d9\uc77c\ud558\uac8c \ubcf4\uc9c0 \uc54a\uace0, \uadf8 \ud2b9\uc131\uc5d0 \ub530\ub77c '\uacf5\uaca9 \uc720\ub9ac', '\ubc29\uc5b4 \uc720\ub9ac', '\uc791\uc804 \ubd88\uac00' \ub4f1\uc73c\ub85c \ubd84\ub958\ud558\uc5ec \uc804\ub7b5\uc744 \uc218\ub9bd\ud574\uc57c \ud569\ub2c8\ub2e4. \n\n 2. \uac00\uce58\uc5d0 \ub530\ub978 \ud589\ub3d9: \uc720\ub9ac\ud55c \uc9c0\ud615\uc740 \uc801\uadf9\uc801\uc73c\ub85c \ud65c\uc6a9\ud558\uace0, \uc9c0\ud0ac \uac00\uce58\uac00 \uc788\ub294 \uc694\ucda9\uc9c0\ub294 \uc0ac\uc218\ud558\uba70, \ubd88\ub9ac\ud55c \uc9c0\ud615\uc740 \ud68c\ud53c\ud558\ub294 \ub4f1 \uac00\uce58 \ud310\ub2e8\uc5d0 \ub530\ub978 \uc720\uc5f0\ud55c \ud589\ub3d9\uc774 \uc911\uc694\ud569\ub2c8\ub2e4. \n\n 3. \ud6a8\uc728\uc131 \ucd94\uad6c: \uc791\uc804\uc758 \uc131\uacf5 \uac00\ub2a5\uc131\uacfc \ube44\uc6a9 \ub300\ube44 \ud6a8\uc728\uc131\uc744 \uace0\ub824\ud558\uc5ec \uc9c0\ud615\uc744 \uc120\ud0dd\ud574\uc57c \ud569\ub2c8\ub2e4. \ubb34\ubaa8\ud558\uac8c \ud5d8\uc9c0\uc5d0 \ub3c4\uc804\ud558\ub294 \uac83\uc740 \uc790\uc6d0 \ub0ad\ube44\uc785\ub2c8\ub2e4. \n\n 4. \uc815\ubcf4 \uae30\ubc18 \uc758\uc0ac\uacb0\uc815: \uc9c0\ud615\uc5d0 \ub300\ud55c \uc815\ud655\ud55c \uc815\ubcf4\uc640 \ubd84\uc11d\uc744 \ubc14\ud0d5\uc73c\ub85c \ucd5c\uc801\uc758 \uacb0\uc815\uc744 \ub0b4\ub824\uc57c \ud569\ub2c8\ub2e4. \n\n 5. \uc120\ud0dd\uacfc \uc9d1\uc911: \ud55c\uc815\ub41c \uc790\uc6d0\uc744 \ud6a8\uc728\uc801\uc73c\ub85c \uc0ac\uc6a9\ud558\uc5ec, \uacf5\ub7b5\ud558\uae30 \uc26c\uc6b4 \uacf3\uc744 \uba3c\uc800 \ucde8\ud558\uac70\ub098 \uc9c0\ud0ac \uac00\uce58\uac00 \uc788\ub294 \uacf3\uc5d0 \uc9d1\uc911\ud568\uc73c\ub85c\uc368 \uc2b9\ub9ac\uc758 \ud655\ub960\uc744 \ub192\uc5ec\uc57c \ud569\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
