B.ajK=new A.a("\ud83d\udcda 2: Waging War(\u4f5c\u6230) \u2013 Summary\n",null,B.a,null,B.m)
B.ag3=new A.a("Sun Tzu's Waging War chapter emphasizes deeply understanding the nature of war (or competition), achieving decisive victory in a short period through thorough prior analysis and deception strategies, and thereby strengthening national power (corporate competitiveness/team strength). Furthermore, it highlights that fully recognizing the harms (losses) of war is a prerequisite for understanding true benefits (gains), and to this end, it stresses efficient resource procurement (especially from the enemy) and the immense responsibility of the leader. \n",null,B.a,null,B.t)
B.j0=new A.a("The core principles are as follows: \n\n",null,B.a,null,B.c)
B.a9T=new A.a("1.\tNature of War and Prudence: War is a matter of paramount importance involving the life and death of the nation and its people, so it should never be taken lightly. All elements must be thoroughly analyzed and deliberated through the Five Factors (\u4e94\u4e8b) and Seven Calculations (\u4e03\u8a08). (\u5175\u8005 \u570b\u4e4b\u5927\u4e8b \u6b7b\u751f\u4e4b\u5730 \u5b58\u4ea1\u4e4b\u9053 \u4e0d\u53ef\u4e0d\u5bdf\u4e5f; \u7d93\u4e4b\u4ee5\u4e94\u4e8b \u6821\u4e4b\u4ee5\u4e03\u8a08 \u800c\u7d22\u5176\u60c5; \u4e00\u66f0\u9053\u4e8c\u66f0\u5929\u4e09\u66f0\u5730\u56db\u66f0\u5c07\u4e94\u66f0\u6cd5) \n\n2.\tDeception and Creation of Momentum: War is based on deception (\u8a6d\u9053). Therefore, even if one has actual ability, one should appear to have none; even if one can utilize something, one should appear not to, in order to deceive the enemy. Based on this understanding of advantage and disadvantage, one should create a favorable situation (\u52e2) and use this situation to control external circumstances to one's advantage. Momentum (\u52e2) means the wisdom of adapting flexibly to advantageous situations and seizing the initiative. (\u5175\u8005 \u8a6d\u9053\u4e5f; \u80fd\u800c\u793a\u4e4b\u4e0d\u80fd\uff0c\u7528\u800c\u793a\u4e4b\u4e0d\u7528; \u8a08\u5229\u4ee5\u807d\uff0c\u4e43 \u70ba \u4e4b\u52e2\uff0c\u4ee5\u4f50\u5176\u5916\u3002\u52e2\u8005\uff0c\u56e0\u5229\u800c\u5236\u6b0a\u4e5f) \n\n3.\tSwift Victory and Efficiency: War values victory most highly and does not value prolongation. It is important to conclude swiftly, even if somewhat clumsy, and there has never been a case where a prolonged war benefited the nation. Protracted war breaks the morale of soldiers, weakens national power, depletes resources, and invites provocations from surrounding rival forces. (\u5176\u7528\u6230\u4e5f\u8cb4\u52dd\uff0c\u4e45\u5247\u920d\u5175\u632b\u92b3; \u592b\u920d\u5175\u632b\u92b3 \u5c48\u529b\u6bab\u8ca8 \u5247\u8af8\u4faf\u4e58\u5176\u5f0a\u800c\u8d77; \u5175\u805e\u62d9\u901f\uff0c\u672a\u7779\u5de7\u4e4b\u4e45\u4e5f\uff1b\u592b\u5175\u4e45\u800c\u570b\u5229\u8005\uff0c\u672a\u4e4b\u6709\u4e5f\u3002) \n\n4.\tRisk Awareness and Resource Procurement: If one does not fully understand the harm of war, one cannot fully understand its benefits. Therefore, a wise general should procure food and other necessary supplies from the enemy to reduce national power consumption and maximize gains. Subduing the enemy depends on the fighting spirit (anger) of the soldiers, but seizing the enemy's benefits (resources) depends on actual wealth (materiel, supplies). (\u4e0d\u76e1\u77e5\u7528\u5175\u4e4b\u5bb3\u8005\uff0c\u5247\u4e0d\u80fd\u76e1\u77e5\u7528\u5175\u4e4b\u5229\u4e5f\u3002\u6545\u667a\u5c07\u52d9\u98df\u65bc\u6575; \u6bba\u6575\u8005 \u6012\u4e5f\uff0c\u53d6\u6575\u4e4b\u5229\u8005 \u8ca8\u4e5f) \n\n5.\tLeader's Responsibility: By defeating the enemy, one can become stronger, and a general who is skilled in military strategy is the most important person who controls the lives of the people and is responsible for the security of the state. (\u52dd\u6575\u800c\u76ca\u5f3a\uff0c\u5175\u8cb4\u52dd\uff0c\u4e0d\u8cb4\u4e45\uff0c\u77e5\u5175\u4e4b\u5c07\uff0c\u6c11\u4e4b\u53f8\u547d\uff0c\u570b\u5bb6\u5b89\u5371\u4e4b\u4e3b\u4e5f)\n\n",null,B.a,null,B.c)
