B.ayc=new A.a("\"Overall, Sun Tzu's Art of War emphasizes thorough analysis and preparation before starting a war (or competition), meticulous deception tactics and flexible responses during war, the pursuit of efficient victory in a short period, and the leader's cool judgment and immense responsibility in overseeing all of these.\" \n\n",null,B.a,null,B.c)
B.arp=new A.a("War is a crossroads of life and death for the nation's destiny; all tactics are a continuous series of deceptions. Based on just cause, environment, terrain, commander, and system, thoroughly compare and analyze the seven major strengths. Even with overwhelming power, pretend to have none; even with an opportunity to attack, feign hesitation, and create a favorable situation to dominate the battlefield! Modern warfare, even if clumsy, must be ended swiftly! Protracted war invites depletion of national power and provocations from surrounding countries, and is never beneficial to the state! To know the harms of war is to know victory! A wise general cuts off enemy supply and provisions locally! The soldiers' morale subdues the enemy, and enemy supplies provide for the battlefield! Victory makes one stronger, and swift victory is the path to success! A commander who understands military strategy is responsible for the lives of the people and the security of the nation!\n\n",null,B.a,null,B.c)
B.amF=new A.a("Business Field  \n",null,B.a,null,B.t)
B.aqD=new A.a("Business is a war for corporate survival; all strategies are a continuous series of contrarian thinking. Based on vision, market, environment, leader, and system, thoroughly compare and analyze the seven major competitive strengths. Even with overwhelming technology, pretend to be humble; even with an opportunity for aggressive investment, feign observation, and create a favorable market environment to lead the competition! Business competition, even if clumsy, launch quickly! Project delays are never beneficial to the company! To know market risks is to succeed! A wise CEO exploits competitors' weaknesses and minimizes costs! Employee passion overwhelms competitors, and exploiting competitors' weaknesses generates corporate profit! Market victory means corporate growth! Business must succeed swiftly! A CEO who understands strategy is responsible for the rise and fall of employees and the company!\n\n",null,B.a,null,B.c)
B.a8F=new A.a("A game is a decisive moment for the team's fate; all plays are a continuous series of deceptions. Based on team philosophy, weather, home advantage, coach, and discipline, thoroughly compare and analyze the seven major strengths. Hide the ace's skill, disguise main tactics, and create a favorable flow to dominate the game! Even if clumsy, play a fast-paced game! A prolonged match is never beneficial to the team! To know game risks is to win! A wise coach induces opponent mistakes and minimizes energy consumption! Player fighting spirit subdues opponents, and inducing opponent mistakes creates team opportunities! Game victory means strengthening the team's power! Finish the game swiftly! A coach who understands tactics is responsible for the fate of the players and the team!\n\n",null,B.a,null,B.c)
