B.aaZ=new A.a("\u318d \u4e0d\u76e1\u77e5(b\xf9 j\xecn zh\u012b): If one does not fully know \n\u318d \u7528\u5175\u4e4b\u5bb3\u8005(y\xf2ng b\u012bng zh\u012b h\xe0i zh\u011b): The harm (losses) caused by employing troops \n\u318d \u5247\u4e0d\u80fd\u76e1\u77e5(z\xe9 b\xf9 n\xe9ng j\xecn zh\u012b): Then one cannot fully know \n\u318d \u7528\u5175\u4e4b\u5229\u4e5f(y\xf2ng b\u012bng zh\u012b l\xec y\u011b): The benefits of employing troops \n\u318d \u6545(g\xf9): Therefore \n\u318d \u667a\u5c07(zh\xec ji\xe0ng): A wise (sagacious) general \n\u318d \u52d9(w\xf9): Exerts effort, emphasizes \n\u318d \u98df\u65bc\u6575(sh\xed y\xfa d\xed): Obtains provisions from the enemy (utilizes enemy resources) \n\n",null,B.a,null,B.c)
