B.acJ=new A.a("This passage presents the duality of war and an efficient supply strategy. \n\n",null,B.a,null,B.c)
B.acg=new A.a("1.\tImportance of Risk Awareness: While war seeks benefits (victory, territorial expansion, etc.), it also entails immense harm (loss of life, resource depletion, weakening of national power, etc.). It warns that if this harm is not fully understood, true benefits cannot be gained. In other words, underestimating the risks makes it impossible to expect successful outcomes. \n\n2.\tCore of Logistics and Wisdom of Foraging: Among the greatest harms of war, the supply problem takes the largest share. Transporting food and supplies to a battlefield far from one's own country is a costly, time-consuming, and dangerous undertaking. \n\n3.\tReason for Foraging from the Enemy: Therefore, a wise general (\u667a\u5c07) considers it important to obtain provisions (\u98df) from the enemy (\u52d9\u98df\u65bc\u6575) to minimize such harms. This is a double-edged strategy that aims to seize enemy resources to reduce friendly consumption while simultaneously cutting off enemy supplies to weaken them. \n\n",null,B.a,null,B.c)
