B.ax2=new A.a("  \u2022 \u51e1(f\xe1n): Generally, usually. \n  \u2022 \u8655\u8ecd(ch\u01d4 j\u016bn): To encamp troops. \n  \u2022 \u76f8\u6575(xi\u0101ng d\xed): To confront the enemy. \n  \u2022 \u7d76\u5c71(ju\xe9 sh\u0101n): To cross mountains (to pass through rugged mountains). \n  \u2022 \u4f9d\u8c37(y\u012b g\u01d4): To rely on valleys, to depend on gorges. \n  \u2022 \u8996\u751f(sh\xec sh\u0113ng): To consider survival, to look for a way to live. \n  \u2022 \u8655\u9ad8(ch\u01d4 g\u0101o): To occupy high ground, to seize the high ground. \n\n",null,B.a,null,B.c)
