B.axo=new A.a("  \u2022 \u9032(j\xecn): To advance (attack or march).\n  \u2022 \u4e0d\u6c42\u540d(b\xf9 qi\xfa m\xedng): Does not seek fame. \n  \u2022 \u9000(tu\xec): To retreat. \n  \u2022 \u4e0d\u907f\u7f6a(b\xf9 b\xec zu\xec): Does not avoid blame (does not shirk responsibility). \n  \u2022 \u552f(w\xe9i): Only.\n  \u2022 \u6c11(m\xedn): People, soldiers, citizens (modern interpretation: team, organizational members, etc.).\n  \u2022 \u662f\u4fdd(sh\xec b\u01ceo): To protect. \n  \u2022 \u800c(\xe9r): And. \n  \u2022 \u5229(l\xec): Benefit, achievement. \n  \u2022 \u5408\u65bc\u4e3b(h\xe9 y\xfa zh\u01d4): To accord with the ruler (superior, leader).  \n\n",null,B.a,null,B.c)
