B.awa=new A.a("This passage emphasizes the dedicated attitude and selfless approach of a true leader. It states that prioritizing the well-being and interests of the entire organization over personal glory or safety is the virtue of a true leader.\n\n",null,B.a,null,B.c)
B.aoW=new A.a(" 1.\t\u9032\u4e0d\u6c42\u540d (When advancing, do not seek fame):\n\u2022\tMeaning: This means not being preoccupied with personal fame or praise when achieving victory or accomplishments. The sole goals are mission completion and organizational success. \n\n 2.\t\u9000\u4e0d\u907f\u7f6a (When retreating, do not avoid blame):\n\u2022\tMeaning: This means not shirk responsibilities or try to escape blame when an operation fails or faces difficulties. It shows a willingness to willingly accept the due responsibilities. \n\n3.\t\u552f\u6c11\u662f\u4fdd (Only for the protection of the people):\n\u2022\tMeaning: This means setting aside personal interests, fame, and even one's own safety, and prioritizing the well-being and protection of the people (or organizational members). This demonstrates a leader's true sense of mission. \n\n4.\t\u800c\u5229\u5408\u65bc\u4e3b (And thus ultimately accord with the ruler's benefit):\n\u2022\tMeaning: The conclusion is that a leader's selfless actions in protecting and dedicating themselves to the people (organizational members), even if they seem like a personal loss on the surface, ultimately align most strongly with the interests and goals of the ruler (state, organization). This means that true dedication ultimately leads to the success of the entire organization. \n\n",null,B.a,null,B.c)
