B.w4=new A.a("\u9867\u9675\u52ff\u5411 \u80cc\u4e18\u52ff\u9006 \u4f6f\u80cc\u52ff\u5f9e \u92b3\u5352\u52ff\u653b \u990c\u5175\u52ff\u98df \u6b78\u5e2b\u52ff\u904f \u570d\u5e2b\u5fc5\u95d5 \u7aae\u5bc7\u52ff\u8feb\n\n",null,B.a,null,B.t)
B.agF=new A.a("  \u2022 \u9867\u9675\u52ff\u5411(g\xf9 l\xedng w\xf9 xi\xe0ng): \u9867(\ub4a4\ub3cc\uc544\ubd04), \u9675(\uc5b8\ub355), \u52ff\u5411(\ud5a5\ud558\uc9c0 \ub9c8\ub77c)\n   \u2022 \u80cc\u4e18\u52ff\u9006(b\xe8i qi\u016b w\xf9 n\xec): \u80cc\u4e18(\uc5b8\ub355\uc744 \ub4f1\uc9c4 \uad70\ub300), \u52ff\u9006(\ub9de\uc11c \uc2f8\uc6b0\uc9c0 \ub9c8\ub77c)\n   \u2022 \u4f6f\u80cc\u52ff\u5f9e(y\xe1ng b\xe8i w\xf9 c\xf3ng): \u4f6f\u80cc(\uac70\uc9d3 \ud1f4\uac01), \u52ff\u5f9e(\ucad3\uc9c0 \ub9c8\ub77c)\n   \u2022 \u92b3\u5352\u52ff\u653b(ru\xec z\xfa w\xf9 g\u014dng): \u92b3\u5352(\uae30\uc138\ub4f1\ub4f1\ud55c \ubcd1\uc0ac), \u52ff\u653b(\uacf5\uaca9\ud558\uc9c0 \ub9c8\ub77c) \n  \u2022 \u990c\u5175\u52ff\u98df(\u011br b\u012bng w\xf9 sh\xed): \u990c\u5175(\ubbf8\ub07c \ubcd1\ub825), \u52ff\u98df(\uac78\ub824\ub4e4\uc9c0 \ub9c8\ub77c) \n  \u2022 \u6b78\u5e2b\u52ff\u904f(gu\u012b sh\u012b w\xf9 \xe8): \u6b78\u5e2b(\uadc0\ud658 \uc911\uc778 \uad70\ub300), \u52ff\u904f(\ub9c9\uc9c0 \ub9c8\ub77c) \n  \u2022 \u570d\u5e2b\u5fc5\u95d5(w\xe9i sh\u012b b\xec qu\u0113): \u570d\u5e2b(\ud3ec\uc704\ub41c \uad70\ub300), \u5fc5\u95d5(\ud2c8\uc744 \uc918\ub77c) \n  \u2022 \u7aae\u5bc7\u52ff\u8febqi\xf3ng k\xf2u w\xf9 p\xf2): \u7aae\u5bc7(\uad81\uc9c0\uc5d0 \ubab0\ub9b0 \uc801), \u52ff\u8feb(\ubab0\uc544\ubd99\uc774\uc9c0 \ub9c8\ub77c) \n\n",null,B.a,null,B.c)
B.avV=new A.a("\u201c\uc5b8\ub355\uc744 \ub4f1\uc9c4 \uc801\uacfc\ub294 \uc2f8\uc6b0\uc9c0 \ub9d0\uace0, \ud1f4\uac01\ud558\ub294 \uc801\uc740 \ud568\uc815\uc77c \uc218 \uc788\uc73c\ub2c8 \ub530\ub77c\uac00\uc9c0 \ub9c8\ub77c. \uc0ac\uae30\uac00 \ub192\uc740 \ubcd1\uc0ac\uc640 \uc815\uba74\ucda9\ub3cc\uc744 \ud53c\ud558\uace0, \uc720\uc778\ucc45\uc740 \uc758\uc2ec\ud558\ub77c. \ub3cc\uc544\uac00\ub294 \uad70\ub300\ub97c \uac00\ub85c\ub9c9\uc9c0 \ub9d0\uba70, \ud3ec\uc704\ud55c \uc801\uc5d0\uac8c\ub294 \ub3c4\ub9dd\uae38\uc744 \ub0a8\uaca8\ub450\uc5b4\ub77c. \ub9c8\uc9c0\ub9c9\uae4c\uc9c0 \uc800\ud56d\ud558\ub294 \uc801\uc740 \ubb34\ub9ac\ud558\uac8c \ubab0\uc544\uc138\uc6b0\uc9c0 \ub9c8\ub77c.\u201d\n ",null,B.a,null,B.c)
