B.akL=new A.a("\uc774 \ubb38\uad6c\ub294 \uc804\uc7c1(\uacbd\uc7c1)\uc5d0\uc11c \ubb34\ub9ac\ud55c \ud589\ub3d9\uc744 \ud53c\ud558\uace0, \uc801\uc758 \ud2b9\uc131\uacfc \uc0c1\ud669\uc744 \uace0\ub824\ud55c '\ud53c\ud560 \uac83\uc740 \ud53c\ud558\uace0, \uc720\uc778\ud560 \uac83\uc740 \uc720\uc778\ud558\uba70, \uc0b4 \uae38\uc744 \uc5f4\uc5b4\uc8fc\ub294' \uc9c0\ud61c\ub85c\uc6b4 \ub300\uc751 \uc804\ub7b5\uc744 \uc81c\uc2dc\ud569\ub2c8\ub2e4. \uc774\ub294 \uc544\uad70\uc758 \ud53c\ud574\ub97c \ucd5c\uc18c\ud654\ud558\uba74\uc11c \uc2b9\ub9ac\ud558\ub294 '\uc778\uc815(\u4ec1\u653f)'\uc5d0 \uac00\uae4c\uc6b4 \ubcd1\ubc95\uc785\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
B.ag4=new A.a("1.\t\u9867\u9675\u52ff\u5411 \u80cc\u4e18\u52ff\u9006 (\uc5b8\ub355\uc5d0 \uc758\uc9c0\ud55c \uc801\uc744 \ud5a5\ud574 \uacf5\uaca9\ud558\uc9c0 \ub9d0\uace0, \uc5b8\ub355\uc744 \ub4f1\uc9c4 \uc801\uc744 \uac70\uc2ac\ub7ec \uacf5\uaca9\ud558\uc9c0 \ub9c8\ub77c):\n  \u2022 \uc758\ubbf8: \uc801\uc774 **\uc9c0\ud615\uc801 \uc774\uc810(\uc5b8\ub355)\uc744 \ud65c\uc6a9\ud558\uc5ec \ubc29\uc5b4 \ud0dc\uc138\ub97c \uac16\ucd94\uace0 \uc788\uc744 \ub54c(\u9867\u9675)**\ub294 \uacf5\uaca9\ud558\uc9c0 \ub9d0\uace0, \ubc30\uc218\uc9c4(\u80cc\u4e18)\uc744 \uccd0\uc11c \ud544\uc0ac\uc801\uc73c\ub85c \uc2f8\uc6b0\ub824 \ud558\ub294 \uc801\uc744 \uc815\uba74\uc73c\ub85c \uacf5\uaca9\ud558\uc5ec \uadf8\ub4e4\uc758 \uacb0\uc0ac \ud56d\uc804\uc744 \uc720\ub3c4\ud558\uc9c0 \ub9d0\ub77c\ub294 \ub73b\uc785\ub2c8\ub2e4.\n\n 2.\t\u4f6f\u80cc\u52ff\u5f9e \u92b3\u5352\u52ff\u653b (\uac70\uc9d3\uc73c\ub85c \ub3c4\ub9dd\uac00\ub294 \uc801\uc744 \ucad3\uc544\uac00\uc9c0 \ub9d0\uace0, \ub0a0\uce74\ub85c\uc6b4 \ubcd1\uc0ac\ub97c \uacf5\uaca9\ud558\uc9c0 \ub9c8\ub77c): \n  \u2022 \uc758\ubbf8: \uc801\uc774 \uac70\uc9d3\uc73c\ub85c \ub3c4\ub9dd\uac00\ub294 \ucc99\ud558\uc5ec \uc720\uc778\ud558\ub294 \ud568\uc815(\u4f6f\u80cc)\uc5d0 \ube60\uc9c0\uc9c0 \ub9d0\uace0(\u52ff\u5f9e), **\uc0ac\uae30\uac00 \ub192\uace0 \ud6c8\ub828\uc774 \uc798 \ub418\uc5b4 \ub0a0\uce74\ub85c\uc6b4(\u92b3) \uc801\uc758 \uc815\uc608 \ubcd1\uc0ac(\u5352)\uc640\ub294 \uc815\uba74 \ub300\uacb0\uc744 \ud53c\ud558\ub77c(\u52ff\u653b)**\ub294 \uc758\ubbf8\uc785\ub2c8\ub2e4.\n\n 3.\t\u990c\u5175\u52ff\u98df \u6b78\u5e2b\u52ff\u904f (\ubbf8\ub07c \ubcd1\uc0ac\ub97c \ubb3c\ub9ac\ub824 \ud558\uc9c0 \ub9d0\uace0, \uadc0\ud658\ud558\ub294 \uc801\uc744 \ub9c9\uc9c0 \ub9c8\ub77c): \n  \u2022 \uc758\ubbf8: \uc801\uc774 \uc77c\ubd80 \ubcd1\ub825\uc744 \ubbf8\ub07c(\u990c\u5175)\ub85c \ub0b4\uc138\uc6cc \uc720\uc778\ud560 \ub54c \uadf8 \ubbf8\ub07c\ub97c \ubb3c\uc9c0 \ub9d0\uace0(\u52ff\u98df), \uc804\ud22c\ub97c \ud53c\ud558\uace0 **\ubcf8\uac70\uc9c0\ub85c \ub3cc\uc544\uac00\ub294 \uc801\uad70(\u6b78\u5e2b)\uc744 \uad73\uc774 \ub9c9\uc544 \uc804\ud22c\ub97c \uc77c\uc73c\ud0a4\uc9c0 \ub9d0\ub77c(\u52ff\u904f)**\ub294 \ub73b\uc785\ub2c8\ub2e4. \uc774\ub294 \uc801\uc758 \uc758\ub3c4\uc5d0 \ub9d0\ub824\ub4e4\uc9c0 \uc54a\uace0 \ubd88\ud544\uc694\ud55c \ucda9\ub3cc\uc744 \ud53c\ud558\ub294 \uc9c0\ud61c\ub97c \ub9d0\ud569\ub2c8\ub2e4.\n\n 4.\t\u570d\u5e2b\u5fc5\u95d5 \u7aae\u5bc7\u52ff\u8feb (\ud3ec\uc704\ud55c \uc801\uc740 \ubc18\ub4dc\uc2dc \ud55c\ucabd\uc744 \ube44\uc6cc\ub450\uace0, \uad81\uc9c0\uc5d0 \ubab0\ub9b0 \uc801\uc740 \ub108\ubb34 \ubab0\uc544\ubd99\uc774\uc9c0 \ub9c8\ub77c): \n  \u2022 \uc758\ubbf8: \uc801\uc744 \uc644\uc804\ud788 \ud3ec\uc704\ud588\uc744 \ub54c(\u570d\u5e2b)\ub77c\ub3c4 \ubc18\ub4dc\uc2dc \ud55c\ucabd(\u95d5)\uc744 \ube44\uc6cc\ub450\uc5b4 \ud1f4\ub85c\ub97c \uc5f4\uc5b4\uc8fc\uace0(\u5fc5\u95d5), **\uad81\uc9c0\uc5d0 \ubab0\ub824 \ud544\uc0ac\uc801\uc73c\ub85c \uc800\ud56d\ud558\ub824\ub294 \uc801(\u7aae\u5bc7)\uc744 \ub108\ubb34 \ubab0\uc544\ubd99\uc774\uc9c0 \ub9d0\ub77c(\u52ff\u8feb)**\ub294 \uac00\uc7a5 \uc911\uc694\ud55c \uc6d0\uce59\uc785\ub2c8\ub2e4. \ud1f4\ub85c\uac00 \ub9c9\ud788\uba74 \uc950\ub3c4 \uace0\uc591\uc774\ub97c \ubb38\ub2e4\ub294 \uc2ec\ub9ac\ub85c \ud544\uc0ac\uc801\uc778 \uc800\ud56d\uc744 \ud558\uc5ec \uc544\uad70\uc758 \ud53c\ud574\uac00 \ucee4\uc9c8 \uc218 \uc788\uae30 \ub54c\ubb38\uc785\ub2c8\ub2e4. \uc0b4 \uae38\uc744 \uc5f4\uc5b4\uc8fc\uc5b4 \uadf8\ub4e4\uc758 \uc800\ud56d \uc758\uc9c0\ub97c \uaebe\uace0 \uc21c\uc21c\ud788 \ub3c4\ub9dd\uac00\uac8c \uc720\ub3c4\ud558\ub294 \uac83\uc774 \ubaa9\ud45c\uc785\ub2c8\ub2e4.\n\n ",null,B.a,null,B.c)
