B.adY=new A.a(" 1. \ubb34\ub9ac\ud55c \uc815\uba74 \ub300\uacb0 \ud68c\ud53c: \uc801\uc774 \uac15\ud55c \uc774\uc810\uc744 \uac00\uc9c4 \uc0c1\ud669\uc774\ub098 \ud544\uc0ac\uc801\uc73c\ub85c \uc800\ud56d\ud560 \uc758\uc9c0\uac00 \uac15\ud55c \uacbd\uc6b0, \uc815\uba74 \ub300\uacb0\uc744 \ud53c\ud558\uc5ec \uc544\uad70\uc758 \ubd88\ud544\uc694\ud55c \uc190\uc2e4\uc744 \ub9c9\uc544\uc57c \ud569\ub2c8\ub2e4.\n\n  2. \ud568\uc815\uacfc \uc720\uc778\ucc45 \uac04\ud30c: \uc801\uc758 \uac70\uc9d3 \ud6c4\ud1f4\ub098 \ubbf8\ub07c \uc804\ub7b5\uc5d0 \ud604\ud639\ub418\uc9c0 \uc54a\uace0, \uadf8\ub4e4\uc758 \uc9c4\uc9dc \uc758\ub3c4\ub97c \ud30c\uc545\ud558\ub294 \ub0c9\ucca0\ud55c \ud310\ub2e8\ub825\uc774 \ud544\uc694\ud569\ub2c8\ub2e4.\n\n  3. \uc801\uc758 \uc2ec\ub9ac \uc774\uc6a9: \uc801\uc774 \uad81\uc9c0\uc5d0 \ubab0\ub838\uc744 \ub54c \ud1f4\ub85c\ub97c \uc5f4\uc5b4\uc90c\uc73c\ub85c\uc368 \ud544\uc0ac\uc801\uc778 \uc800\ud56d\uc744 \ub9c9\uace0, \uc544\uad70\uc758 \ud53c\ud574\ub97c \ucd5c\uc18c\ud654\ud558\uba70 \uc2b9\ub9ac\ud558\ub294 \uc9c0\ud61c\ub97c \ubc1c\ud718\ud574\uc57c \ud569\ub2c8\ub2e4. \uc774\ub294 '\uc8fd\uc744 \uae38\uc744 \uc5f4\uc5b4\uc8fc\uc5b4 \uc0b4 \uae38\uc744 \uc5bb\ub294' \uc5ed\uc124\uc801 \uc804\ub7b5\uc785\ub2c8\ub2e4.\n\n  4. \uc544\uad70 \ud53c\ud574 \ucd5c\uc18c\ud654: \uc2b9\ub9ac\ub3c4 \uc911\uc694\ud558\uc9c0\ub9cc, \uadf8 \uacfc\uc815\uc5d0\uc11c \uc544\uad70\uc758 \ud76c\uc0dd\uc744 \ucd5c\uc18c\ud654\ud558\ub294 \uac83\uc774 \ub354 \ud070 \uc2b9\ub9ac\uc784\uc744 \uac15\uc870\ud569\ub2c8\ub2e4.\n\n  5. \uc720\uc5f0\ud558\uace0 \ud604\uc2e4\uc801\uc778 \ub300\uc751: \uace0\uc815\ub41c \uc804\uc220\uc5d0 \uc5bd\ub9e4\uc774\uc9c0 \uc54a\uace0, \uc801\uc758 \uc0c1\ud669\uacfc \uc2ec\ub9ac \uc0c1\ud0dc\uc5d0 \ub530\ub77c \uc720\uc5f0\ud558\uac8c \ub300\ucc98\ud558\ub294 \uac83\uc774 \uc911\uc694\ud569\ub2c8\ub2e4.\n\n ",null,B.a,null,B.c)
