B.azG=new A.a("\u318d\u52dd\u6575\u800c\u76ca\u5f3a(sh\xe8ng d\xed \xe9r y\xec qi\xe1ng): \uc801\uc744 \uc774\uae30\uace0 \ub098\uba74 \uc624\ud788\ub824 \ub354 \uac15\ud574\uc9c4\ub2e4. (\uc2b9\ub9ac\ub97c \ud1b5\ud574 \uc804\ub825\uacfc \uc0ac\uae30\uac00 \uc99d\uac00\ud568)\n\u318d\u5175\u8cb4\u52dd(b\u012bng gu\xec sh\xe8ng): \uc804\uc7c1\uc740 \uc2b9\ub9ac\ub97c \uadc0\ud558\uac8c \uc5ec\uaca8\uc57c \ud558\uba70 (\uac00\uc7a5 \uc911\uc694\ud558\uac8c \uc5ec\uaca8\uc57c \ud558\uba70)\n\u318d\u4e0d\u8cb4\u4e45(b\xf9 gu\xec ji\u01d4): \uc624\ub798 \ub044\ub294 \uac83\uc744 \uadc0\ud558\uac8c \uc5ec\uae30\uc9c0 \uc54a\ub294\ub2e4. (\uc7a5\uae30\uc804\uc744 \ud53c\ud574\uc57c \ud568)\n\u318d\u77e5\u5175\u4e4b\u5c07(zh\u012b b\u012bng zh\u012b ji\xe0ng): \ubcd1\ubc95\uc744 \uc544\ub294 \uc7a5\uc218\ub294 (\uc804\uc7c1\uc5d0 \uc815\ud1b5\ud55c \uc9c0\uc7a5)\n\u318d\u6c11\u4e4b\u53f8\u547d(m\xedn zh\u012b s\u012b m\xecng): \ubc31\uc131\uc758 \uc0dd\uc0ac\ub97c \uad00\uc7a5\ud558\ub294 \uc790\uc774\uba70 (\ubc31\uc131\uc758 \uc6b4\uba85\uc744 \uc954 \uc790\uc774\uba70)\n\u318d\u570b\u5bb6\u5b89\u5371\u4e4b\u4e3b\u4e5f(gu\xf3 ji\u0101 \u0101n w\u0113i zh\u012b zh\u01d4 y\u011b): \uad6d\uac00\uc758 \uc548\uc704(\ud3c9\uc548\uacfc \uc704\uae30)\ub97c \uacb0\uc815\ud558\ub294 \uc8fc\uccb4\uc774\ub2e4)\n",null,B.a,null,B.c)
B.ay0=new A.a('\u201c\uc801\uc744 \uc774\uae40\uc73c\ub85c\uc368 (\uc624\ud788\ub824) \ub354\uc6b1 \uac15\uc131\ud574\uc9c0\uace0, \uc804\uc7c1\uc740 \uc2b9\ub9ac\ud558\ub294 \uac83\uc744 \uadc0\ud558\uac8c \uc5ec\uae30\uc9c0 \uc624\ub798 \ub044\ub294 \uac83\uc744 \uadc0\ud558\uac8c \uc5ec\uae30\uc9c0 \uc54a\ub294\ub2e4. \ubcd1\ubc95\uc744 \uc544\ub294 \uc7a5\uc218\ub294 \ubc31\uc131\uc758 \uc0dd\uba85\uc744 \uc8fc\uad00\ud558\uace0, \uad6d\uac00\uc758 \uc548\uc704\ub97c \ucc45\uc784\uc9c0\ub294 \uc8fc\uc778\uc774 \ub418\ub294 \uac83\uc774\ub2e4."',null,B.a,null,B.c)
