B.atw=new A.a("\uc774 \ubb38\uad6c\ub294 \uc804\uc7c1\uc758 \ubaa9\uc801, \ud6a8\uc728\uc131, \uadf8\ub9ac\uace0 \ub9ac\ub354\uc758 \ucc45\uc784\uac10\uc744 \uc885\ud569\uc801\uc73c\ub85c \uc124\uba85\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
B.aAB=new A.a("1.\t\u52dd\u6575\u800c\u76ca\u5f3a(sh\xe8ng d\xed \xe9r y\xec qi\xe1ng): \uc804\uc7c1\uc5d0\uc11c \uc801\uc744 \uc774\uae30\ub294 \uac83\uc740 \ub2e8\uc21c\ud788 \uc704\ud611\uc744 \uc81c\uac70\ud558\ub294 \uac83\uc744 \ub118\uc5b4, \uc544\uad70\uc744 \ub354\uc6b1 \uac15\uc131\ud558\uac8c \ub9cc\ub4dc\ub294(\u76ca\u5f3a) \uae30\ud68c\uac00 \ub429\ub2c8\ub2e4. \uc774\ub294 \uc801\uc758 \uc790\uc6d0\uc744 \ucde8\ud558\uac70\ub098, \uc544\uad70\uc758 \uc0ac\uae30\ub97c \uc9c4\uc791\uc2dc\ud0a4\uace0, \uad6d\uc81c\uc801 \uc704\uc0c1\uc744 \ub192\uc774\ub294 \ub4f1\uc758 \uae0d\uc815\uc801\uc778 \ud6a8\uacfc\ub97c \ud3ec\ud568\ud569\ub2c8\ub2e4. \uc2b9\ub9ac\ub97c \ud1b5\ud574 \uc5bb\ub294 \uc774\ub4dd\uc774 \ub2e8\uc21c\ud55c \uc601\ud1a0 \ud655\uc7a5\uc744 \ub118\uc5b4 \uad6d\ub825\uc758 \uc2e4\uc9c8\uc801 \uc99d\uac15\uc73c\ub85c \uc774\uc5b4\uc9c4\ub2e4\ub294 \uc758\ubbf8\uc785\ub2c8\ub2e4.\n\n2.\t\u5175\u8cb4\u52dd\uff0c\u4e0d\u8cb4\u4e45((b\u012bng gu\xec sheng, b\xf9 gu\xec ji\u01d4): \uc55e\uc11c \uc5ec\ub7ec \ucc28\ub840 \uac15\uc870\ud588\ub4ef\uc774, \uc804\uc7c1\uc740 '\uc2b9\ub9ac(\u52dd)'\ub97c \uac00\uc7a5 \uadc0\ud558\uac8c(\u8cb4) \uc5ec\uae30\uba70, '\uc624\ub798 \ub044\ub294(\u4e45)' \uac83\uc744 \uadc0\ud558\uac8c \uc5ec\uae30\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4(\u4e0d\u8cb4\u4e45). \uc7a5\uae30\uc804\uc758 \ud3d0\ud574\ub97c \ub2e4\uc2dc \ud55c\ubc88 \uc0c1\uae30\uc2dc\ud0a4\uba70, \ub2e8\uae30\uac04 \ub0b4\uc758 \ud655\uc2e4\ud55c \uc2b9\ub9ac\ub9cc\uc774 \uc9c4\uc815\uc73c\ub85c \uac00\uce58 \uc788\ub2e4\ub294 \uc810\uc744 \uac15\uc870\ud569\ub2c8\ub2e4.\n\n3.\t\u77e5\u5175\u4e4b\u5c07\uff0c\u6c11\u4e4b\u53f8\u547d\uff0c\u570b\u5bb6\u5b89\u5371\u4e4b\u4e3b\u4e5f(zh\u012b b\u012bng zh\u012b ji\xe0ng, m\xedn zh\u012b s\u012b m\xecng gu\xf3 ji\u0101 \u0101n w\u0113i zh\u012b zh\u01d4 y\u011b):\n\n -\t\u77e5\u5175\u4e4b\u5c07(zh\u012b b\u012bng zh\u012b ji\xe0ng): \ub2e8\uc21c\ud788 \uc6a9\ub9f9\ud558\uac70\ub098 \ubcd1\ub825\uc744 \ub9ce\uc774 \uac00\uc9c4 \uc7a5\uc218\uac00 \uc544\ub2c8\ub77c, '\ubcd1\ubc95(\u5175)\uc744 \uc81c\ub300\ub85c \uc54c\uace0(\u77e5)' \uc6b4\uc6a9\ud560 \uc904 \uc544\ub294 \uc7a5\uc218\uac00 \uc9c4\uc815\ud55c \uc9c0\ud718\uad00\uc785\ub2c8\ub2e4.\n\n -\t\u6c11\u4e4b\u53f8\u547d(m\xedn zh\u012b s\u012b m\xecng): \uc774\ub7ec\ud55c \uc7a5\uc218\ub294 \ubc31\uc131(\u6c11)\uc758 '\uc0dd\uba85(\u547d)\uc744 \uad00\uc7a5\ud558\ub294(\u53f8)' \uc874\uc7ac\uc785\ub2c8\ub2e4. \uadf8\uc758 \uacb0\uc815 \ud558\ub098\ud558\ub098\uac00 \uc218\ub9ce\uc740 \ubc31\uc131\ub4e4\uc758 \uc0b6\uacfc \uc8fd\uc74c\uc744 \uacb0\uc815\ud558\uae30 \ub54c\ubb38\uc785\ub2c8\ub2e4.\n\n -\t\u570b\u5bb6\u5b89\u5371\u4e4b\u4e3b\u4e5f(gu\xf3 ji\u0101 \u0101n w\u0113i zh\u012b zh\u01d4 y\u011b): \ub354 \ub098\uc544\uac00 \uadf8\ub294 \uad6d\uac00(\u570b\u5bb6)\uc758 '\uc548\uc704(\u5b89\u5371)\ub97c \ucc45\uc784\uc9c0\ub294 \uc8fc\uc778(\u4e3b)'\uc785\ub2c8\ub2e4. \uc7a5\uc218\uc758 \ub6f0\uc5b4\ub09c \uc5ed\ub7c9\uacfc \ud310\ub2e8\uc774 \uad6d\uac00\uc758 \uc874\ub9dd\uc744 \uc88c\uc6b0\ud558\ub294 \uc911\ub300\ud55c \uc5ed\ud560\uc744 \ud55c\ub2e4\ub294 \uc810\uc744 \uac15\uc870\ud569\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
