B.agw=new A.a("1.\t\uc2b9\ub9ac\uc758 \uc9c8\uc801 \ucd94\uad6c: \ub2e8\uc21c\ud788 \uc774\uae30\ub294 \uac83\uc744 \ub118\uc5b4, \uc2b9\ub9ac \ud6c4 \uc5bb\ub294 \uae0d\uc815\uc801\uc778 \ud6a8\uacfc\uc640 \uad6d\ub825\uc758 \uac15\ud654\uae4c\uc9c0 \uace0\ub824\ud558\ub294 \uc804\ub7b5\uc801 \uc0ac\uace0\uac00 \ud544\uc694\ud569\ub2c8\ub2e4.\n\n2.\t\uc2dc\uac04\uacfc \ud6a8\uc728\uc131\uc758 \uac00\uce58: \ubaa8\ub4e0 \uc804\ub7b5\uc740 \ucd5c\ub2e8 \uc2dc\uac04 \ub0b4\uc5d0 \ubaa9\ud45c\ub97c \ub2ec\uc131\ud558\uc5ec \ubd88\ud544\uc694\ud55c \uc18c\ubaa8\ub97c \ub9c9\uace0 \ud6a8\uc728\uc131\uc744 \uadf9\ub300\ud654\ud558\ub294 \ubc29\ud5a5\uc73c\ub85c \uc218\ub9bd\ub418\uc5b4\uc57c \ud569\ub2c8\ub2e4.\n\n3.\t\ub9ac\ub354\uc758 \ud575\uc2ec \uc5ed\ub7c9: \ub9ac\ub354\ub294 \ub2e8\uc21c\ud788 \uc9c0\ud718 \ub2a5\ub825\ubfd0\ub9cc \uc544\ub2c8\ub77c, **\uae4a\uc774 \uc788\ub294 \uc804\ubb38 \uc9c0\uc2dd(\ubcd1\ubc95, \uc989 \uc804\ub7b5\uacfc \uc804\uc220)**\uc744 \uac16\ucd94\uace0 \uc788\uc5b4\uc57c \ud569\ub2c8\ub2e4.\n\n4.\t\ub9c9\uc911\ud55c \ucc45\uc784\uac10: \ub9ac\ub354\uc758 \uacb0\uc815\uc774 \uc870\uc9c1\uc6d0(\ubc31\uc131)\uc758 \uc0dd\uba85\uacfc \uc870\uc9c1(\uad6d\uac00)\uc758 \uc874\ub9dd\uc5d0 \uc9c1\uacb0\ub41c\ub2e4\ub294 \ub9c9\uc911\ud55c \ucc45\uc784\uac10\uc744 \uac00\uc838\uc57c \ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
