B.arR=new A.a("\uc190\uc790\ubcd1\ubc95 \uad70\uc7c1(\u8ecd\u722d)\ud3b8\uc5d0\uc11c\ub294 \uc804\uc7a5(\uacbd\uc7c1\uc758 \uc8fc\ub3c4\uad8c\uc744 \uc7c1\ucde8\ud558\uace0 \uc720\uc9c0\ud558\uba70, \uc801\uc758 \uc2ec\ub9ac\uc640 \uc0c1\ud669\uc744 \ucca0\uc800\ud788 \ubd84\uc11d\ud558\uc5ec \ud6a8\uc728\uc801\uc73c\ub85c \ub300\uc751\ud558\uba70, \uc544\uad70\uc758 \ud53c\ud574\ub97c \ucd5c\uc18c\ud654\ud558\uba74\uc11c \uc2b9\ub9ac\ub97c \uc7c1\ucde8\ud558\ub294 \uace0\ub3c4\uc758 \uc804\ub7b5\uc801 \uc9c0\ud61c\ub97c \ub2f4\uace0 \uc788\uc2b5\ub2c8\ub2e4. \uc774\ub294 \ub2e8\uc21c\ud788 \ud798\uc758 \ub300\uacb0\uc744 \ub118\uc5b4\uc120 \uc9c0\ud61c\ub85c\uc6b4 \ud1b5\uc81c, \uc5ed\ubc1c\uc0c1\uc801 \uc0ac\uace0, \uc2ec\ub9ac\uc804, \uadf8\ub9ac\uace0 \uc720\uc5f0\ud55c \uc0c1\ud669 \uc801\uc751 \ub2a5\ub825\uc758 \uc911\uc694\uc131\uc744 \uac15\uc870\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.t)
B.ag5=new A.a(" \uc8fc\ub3c4\uc801 \ud1b5\uc81c, \uc5ed\ubc1c\uc0c1\uc801 \uae30\ub9cc, \uad70\uc7c1\uc758 \uc591\uba74\uc131 \uc778\uc2dd, \uc720\uc5f0\ud55c \uc0c1\ud669 \uc801\uc751, \uadf8\ub9ac\uace0 \ud53c\ud574 \ucd5c\uc18c\ud654\ub97c \ud1b5\ud55c \uc2b9\ub9ac\ub77c\ub294 \ub2e4\uc12f \uac00\uc9c0 \ud070 \ucd95\uc744 \ud1b5\ud574 \uc644\ubcbd\ud55c \uc2b9\ub9ac \uc804\ub7b5\uc744 \uc81c\uc2dc\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
B.abc=new A.a(" 1. \uc8fc\ub3c4\uc801 \ud1b5\uc81c\uc640 \uc801\uc758 \ud589\ub3d9 \uc720\ub3c4:\n    \u2022 \u5c07\u53d7\u547d\u65bc\u541b\uff0c\u5408\u8ecd\u805a\u8846\uff0c\u4ea4\u548c\u800c\u820d\uff0c\u83ab\u96e3\u65bc\u8ecd\u722d: \uad70\uc0ac(\uc870\uc9c1)\ub97c \ubaa8\uc73c\uace0 \ud3c9\ud654\ub86d\uac8c \uc9c4\uc744 \uce58\ub294 \uac83\ubcf4\ub2e4 \uc804\uc7a5\uc758 \uc8fc\ub3c4\uad8c\uc744 \uc7c1\ucde8\ud558\ub294 '\uad70\uc7c1'\uc774 \uac00\uc7a5 \uc5b4\ub835\uace0 \uc911\uc694\ud568\uc744 \uac15\uc870\ud569\ub2c8\ub2e4. \uc544\uad70\uc774 \ud56d\uc0c1 \uc804\uc7a5\uc758 \uc8fc\ub3c4\uad8c\uc744 \uc950\uace0 \uc801\uc744 \uc544\uad70\uc774 \uc6d0\ud558\ub294 \uc2dc\uac04, \uc7a5\uc18c, \ubc29\uc2dd\uc73c\ub85c \uc6c0\uc9c1\uc774\uac8c \ub9cc\ub4e4\uc5b4\uc57c \ud569\ub2c8\ub2e4. \n    \u2022 \u81f4\u4eba\u800c\u4e0d\u81f4\u65bc\u4eba: \ub0a8\uc744 \uc624\uac8c \ud560\uc9c0\uc5b8\uc815 \ub0a8\uc5d0\uac8c \uc774\ub04c\ub824 \uac00\uc9c0 \uc54a\uc544\uc57c \ud569\ub2c8\ub2e4. \n    \u2022 \u80fd\u4f7f\u6575\u4eba\u81ea\u81f3\u8005 \u5229\u4e4b\u4e5f\uff0c\u80fd\u4f7f\u6575\u4eba\u4e0d\u5f97\u81f3\u8005 \u5bb3\u4e4b\u4e5f: \uc801\uc744 \uc774\uc775\uc73c\ub85c \uc720\uc778\ud558\uace0 \uc190\ud574\ub85c \ubc29\ud574\ud568\uc73c\ub85c\uc368 \uc801\uc758 \ud589\ub3d9\uc744 \uc544\uad70\uc758 \uc758\ub3c4\ub300\ub85c \ud1b5\uc81c\ud574\uc57c \ud569\ub2c8\ub2e4. \n    \u2022 \u6575\u4f5a\u80fd\u6012\u4e4b\uff0c\u98fd\u80fd\u98e2\u4e4b\uff0c\u5b89\u80fd\u52d5\u4e4b: \uc801\uc774 \ud3b8\uc548\ud560 \ub54c\ub294 \ub178\ud558\uac8c \ud558\uace0, \ubc30\ubd80\ub97c \ub54c\ub294 \uad76\uc8fc\ub9ac\uac8c \ud558\uba70, \uc548\uc815\ub418\uc5b4 \uc788\uc744 \ub54c\ub294 \uc6c0\uc9c1\uc774\uac8c \ud558\uc5ec \uc801\uc744 \uad50\ub780\ud558\uace0 \uc544\uad70\uc774 \uc6d0\ud558\ub294 \ub300\ub85c \uc6c0\uc9c1\uc774\uac8c \ub9cc\ub4ed\ub2c8\ub2e4.\n\n 2. \uc5ed\ubc1c\uc0c1\uc801 \uae30\ub9cc\uacfc \uc0c1\ud669 \uc5ed\uc774\uc6a9: \n  \u2022 \u4ee5\u8fc2\u7232\u76f4 \u4ee5\u60a3\u7232\u5229: \uac89\uc73c\ub85c\ub294 \uba40\uace0 \ube44\ud6a8\uc728\uc801\uc778 \ub4ef\ud55c \uc6b0\ud68c\uc801\uc778 \uacbd\ub85c\ub97c \uc120\ud0dd\ud558\uc5ec \uc624\ud788\ub824 \uac00\uc7a5 \ube60\ub974\uace0 \ud6a8\uacfc\uc801\uc778 \uacb0\uacfc\ub97c \uc5bb\uace0, \ub2e5\uccd0\uc628 \uc704\uae30\ub098 \uace0\ub09c\uc744 \uc624\ud788\ub824 \uae30\ud68c\ub098 \uc774\uc810\uc73c\ub85c \uc804\ud658\ud558\ub294 \uc5ed\ubc1c\uc0c1\uc758 \uc9c0\ud61c\ub97c \uac15\uc870\ud569\ub2c8\ub2e4. \n  \u2022 \u51fa\u5176\u6240\u4e0d\u8da8 \u8da8\u5176\u6240\u4e0d\u610f: \uc801\uc774 \uac00\uc9c0 \uc54a\ub294 \uacf3\uc73c\ub85c \ub098\uac00\uace0, \uc801\uc774 \uc608\uc0c1\uce58 \ubabb\ud558\ub294 \uacf3\uc73c\ub85c \uc2e0\uc18d\ud788 \ub098\uc544\uac00 \uc801\uc758 \ud5c8\ub97c \ucc0c\ub985\ub2c8\ub2e4. \n  \u2022 \u5148\u653b\u8005 \u6575\u4e0d\u77e5\u5176\u6240\u5b88 \u5584\u5b88\u8005 \u6575\u4e0d\u77e5\u5176\u6240\u653b: \uc120\uc81c\uacf5\uaca9\uc73c\ub85c \uc801\uc758 \ubc29\uc5b4 \ubaa9\ud45c\ub97c \ubaa8\ud638\ud558\uac8c \ub9cc\ub4e4\uace0, \uacac\uace0\ud558\uace0 \uc608\uce21 \ubd88\uac00\ub2a5\ud55c \ud615\ud0dc\ub85c \ubc29\uc5b4\ud558\uc5ec \uc801\uc774 \uacf5\uaca9\ud560 \uacf3\uc744 \ucc3e\uc9c0 \ubabb\ud558\uac8c \ud569\ub2c8\ub2e4.\n\n \u2022 3. '\uad70\uc7c1'\uc758 \uc591\uba74\uc131 \uc778\uc2dd: \n  \u2022 \u8ecd\u722d\u7232\u5229 \u8ecd\u722d\u7232\u5371: \uc804\uc7a5\uc758 \uc8fc\ub3c4\uad8c\uc744 \uc7c1\ucde8\ud558\ub294 '\uad70\uc7c1'\uc740 \ud070 '\uc774\ub85c\uc6c0(\u5229)'\uc744 \uac00\uc838\ub2e4\uc904 \uc218\ub3c4 \uc788\uc9c0\ub9cc, \ub3d9\uc2dc\uc5d0 \uce58\uba85\uc801\uc778 '\uc704\ud5d8(\u5371)'\uc774 \ub420 \uc218\ub3c4 \uc788\uc74c\uc744 \uc778\uc9c0\ud558\uace0 \uc2e0\uc911\ud558\uac8c \uc811\uadfc\ud574\uc57c \ud569\ub2c8\ub2e4.\n\n 4. \uc720\uc5f0\ud55c \uc0c1\ud669 \uc801\uc751\uacfc \uc644\ubcbd\ud55c \ud1b5\uc81c: \n  \u2022 \u5176\u75be\u5982\u98a8 \u5176\u5f90\u5982\u6797 \u4fb5\u63a0\u5982\u706b \u4e0d\u52d5\u5982\u5c71: \uad70\ub300\uc758 \ud589\ub3d9\uc774 \uc0c1\ud669\uc5d0 \ub530\ub77c \ubc14\ub78c\ucc98\ub7fc \ube60\ub974\uac8c(\u5176\u75be\u5982\u98a8) \uc6c0\uc9c1\uc774\uace0, \uc232\ucc98\ub7fc \uace0\uc694\ud558\uba70(\u5176\u5f90\u5982\u6797) \uc740\ubc00\ud558\uba70, \ubd88\uae38\ucc98\ub7fc \ub9f9\ub82c\ud788(\u4fb5\u63a0\u5982\u706b) \uacf5\uaca9\ud558\uace0, \uc0b0\ucc98\ub7fc \ud754\ub4e4\ub9bc \uc5c6\uc774(\u4e0d\u52d5\u5982\u5c71) \uacac\uace0\ud558\uac8c \ubc29\uc5b4\ud558\ub294 \ub4f1 \uadf9\ub3c4\ub85c \uc720\uc5f0\ud558\uac8c \ubcc0\ud654\ud574\uc57c \ud569\ub2c8\ub2e4. \uc774\ub294 \uc801\uc758 \uc608\uce21\uc744 \ub6f0\uc5b4\ub118\ub294 \uc644\ubcbd\ud55c \ud1b5\uc81c\ub825\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \n  \u2022 \u63a0\u9115\u5206\u8846 \u5ed3\u5730\u5206\u5229 \u61f8\u6b0a\u800c\u52d5: \uc804\ud22c \ud6c4 \ud68d\ub4dd\ud55c **\uc790\uc6d0\uc73c\ub85c \ubcd1\uc0ac\ub4e4\uc758 \uc0ac\uae30\ub97c \uc9c4\uc791(\u63a0\u9115\u5206\u8846)**\uc2dc\ud0a4\uace0, **\uc810\ub839\uc9c0\ub97c \ud655\uc7a5\ud558\uc5ec \uc7a5\uae30\uc801\uc778 \uc774\uc775\uc744 \uacf5\uc720(\u5ed3\u5730\u5206\u5229)**\ud558\uba70, \ubaa8\ub4e0 \uc0c1\ud669\uc744 \uc800\uc6b8\uc9c8\ud558\ub4ef \uba74\ubc00\ud788 \ud5e4\uc544\ub824 \uc720\uc5f0\ud558\uac8c(\u61f8\u6b0a\u800c\u52d5) \uc6c0\uc9c1\uc5ec\uc57c \ud569\ub2c8\ub2e4. \n  \u2022 \u907f\u5176\u92b3\u6c23 \u64ca\u5176\u60f0\u6b78 \u6b64\u6cbb\u6c23\u8005\u4e5f \u4ee5\u6cbb\u5f85\u4e82 \u4ee5\u975c\u5f85\u8b41 \u6b64\u6cbb\u5fc3\u8005\u4e5f \u6b64\u6cbb\u529b\u8005\u4e5f \u7121\u9080\u6b63\u6b63\u4e4b\u65d7 \u7269\u64ca\u5802\u5802\u4e4b\u9663 \u6b64\u6cbb\u8b8a\u8005\u4e5f: \uc801\uc758 \ub0a0\uce74\ub85c\uc6b4 \uae30\uc138(\u92b3\u6c23)\ub97c \ud53c\ud558\uace0 \ub098\ud0dc\ud574\uc9c8 \ub54c\ub97c \uacf5\uaca9\ud558\uc5ec '\uae30(\u6c23)'\ub97c \ub2e4\uc2a4\ub9ac\uace0, \uc544\uad70\uc758 \uc815\ube44\ub41c \uc0c1\ud0dc\ub85c \uc801\uc758 \ud63c\ub780(\u4e82)\uc744 \uae30\ub2e4\ub824 '\ub9c8\uc74c(\u5fc3)'\uc744 \ub2e4\uc2a4\ub9ac\uba70, \uc774\ub85c\uc368 '\ud798(\u529b)'\uc744 \ud6a8\uc728\uc801\uc73c\ub85c \uc6b4\uc6a9\ud569\ub2c8\ub2e4. \ub610\ud55c, \uc815\uc5f0\ud558\uac8c \uac16\ucdb0\uc9c4 \uc801\uc758 \uac15\ud55c \uc9c4\uc601(\u6b63\u6b63\u4e4b\u65d7 \u5802\u5802\u4e4b\u9663)\uc740 \ud53c\ud558\uc5ec '\ubcc0\ud654(\u8b8a)'\ub97c \ub2e4\uc2a4\ub824\uc57c \ud569\ub2c8\ub2e4.\n\n 5. \ud53c\ud574 \ucd5c\uc18c\ud654\ub97c \ud1b5\ud55c \uc2b9\ub9ac: \n  \u2022 \u9867\u9675\u52ff\u5411 \u80cc\u4e18\u52ff\u9006 \u4f6f\u80cc\u52ff\u5f9e \u92b3\u5352\u52ff\u653b \u990c\u5175\u52ff\u98df \u6b78\u5e2b\u52ff\u904f \u570d\u5e2b\u5fc5\u95d5 \u7aae\u5bc7\u52ff\u8feb: \uc801\uc774 \uc9c0\ud615\uc801 \uc774\uc810\uc744 \uac00\uc84c\uac70\ub098 \ud544\uc0ac\uc801\uc778 \uc800\ud56d\uc744 \ud560 \uc0c1\ud669\uc740 \ud53c\ud558\uace0, \ud568\uc815\uc774\ub098 \ubbf8\ub07c\uc5d0 \ud604\ud639\ub418\uc9c0 \ub9c8\ub77c\ub294 \uacbd\uace0\uc785\ub2c8\ub2e4. \ud2b9\ud788, **\ud3ec\uc704\ud55c \uc801\uc5d0\uac8c\ub294 \ubc18\ub4dc\uc2dc \ud1f4\ub85c\ub97c \uc5f4\uc5b4\uc8fc\uace0(\u570d\u5e2b\u5fc5\u95d5), \uad81\uc9c0\uc5d0 \ubab0\ub9b0 \uc801\uc740 \ub108\ubb34 \ubab0\uc544\ubd99\uc774\uc9c0 \ub9c8\ub77c(\u7aae\u5bc7\u52ff\u8feb)**\ub294 \uc6d0\uce59\uc744 \uac15\uc870\ud558\uc5ec, \uc801\uc758 \ud544\uc0ac\uc801\uc778 \uc800\ud56d\uc744 \ub9c9\uace0 \uc544\uad70\uc758 \ud53c\ud574\ub97c \ucd5c\uc18c\ud654\ud558\uba74\uc11c \uc2b9\ub9ac\ub97c \uc7c1\ucde8\ud558\ub294 \uc9c0\ud61c\ub97c \uc5ed\uc124\ud569\ub2c8\ub2e4. \n",null,B.a,null,B.c)
