B.aZ=new A.a("\uad70\uc0ac \ubd84\uc57c\n",null,B.a,null,B.t)
B.alV=new A.a("\ubcd1\ub825 \ub3d9\uc6d0\ubcf4\ub2e4 \uc804\uc7a5\uc758 \uc8fc\ub3c4\uad8c \uc7c1\ucde8\uac00 \uac00\uc7a5 \uc5b4\ub835\uace0 \uc911\uc694\ud558\uba70, \uc6b0\ub9ac\ub294 \uc801\uc73c\ub85c \ud558\uc5ec\uae08 \uc6b0\ub9ac\uac00 \uc6d0\ud558\ub294 \uacf3\uc73c\ub85c \uc624\uac8c \ud560\uc9c0\uc5b8\uc815 \uacb0\ucf54 \ub04c\ub824\uac00\uc9c0 \uc54a\ub294\ub2e4. \uac89\ubcf4\uae30\uc5d4 \uc6b0\ud68c\uc801\uc778 \uc804\ub7b5\uc774 \uc624\ud788\ub824 \uac00\uc7a5 \ube60\ub974\uace0, \uc704\ud5d8\ud55c \uc0c1\ud669\uc744 \uc624\ud788\ub824 \uae30\ud68c\ub85c \uc804\ud658\ud558\ub77c. \uc804\uc7a5\uc758 \uc8fc\ub3c4\uad8c \uc7c1\ucde8\ub294 \ud070 \uae30\ud68c\uc640 \uce58\uba85\uc801 \uc704\ud5d8\uc744 \ub3d9\uc2dc\uc5d0 \ub0b4\ud3ec\ud558\uba70, \ubc14\ub78c\ucc98\ub7fc \uae30\ub3d9\ud558\uace0 \uc232\ucc98\ub7fc \uc740\ubc00\ud788 \uc228\uc8fd\uc774\uba70, \ubd88\uae38\ucc98\ub7fc \ub9f9\ub82c\ud788 \uacf5\uaca9\ud558\uace0 \uc0b0\ucc98\ub7fc \uacac\uace0\ud788 \ubc29\uc5b4\ud558\ub77c. \ud68d\ub4dd\ud55c \uc804\ub9ac\ud488\uc73c\ub85c \ubcd1\uc0ac\ub4e4\uc758 \uc0ac\uae30\ub97c \ub192\uc774\uace0, \uc810\ub839\uc9c0\ub97c \uad00\ub9ac\ud558\uc5ec \uc774\ub4dd\uc744 \ud655\ubcf4\ud558\uba70, \ubaa8\ub4e0 \uc791\uc804\uc744 \uc0c1\ud669\uc5d0 \ub9de\ucdb0 \uc720\uc5f0\ud558\uac8c \uc870\uc815\ud558\ub77c. \uc801\uc758 \uae30\uc138\uac00 \uc624\ub97c \ub550 \ucda9\ub3cc\uc744 \ud53c\ud558\uace0, \uc774\uc644\ub420 \ub54c \uacf5\uaca9\ud558\uba70, \ub0b4\ubd80\ub97c \uc815\ube44\ud558\uc5ec \uc801\uc758 \ud63c\ub780\uc744 \uae30\ub2e4\ub9ac\uace0 \uce68\ucc29\ud558\uac8c \ub300\ud558\ub77c. \uc801\uc758 \uad73\uac74\ud55c \ubc29\uc5b4\uc120\uc744 \ud53c\ud558\uace0 \ud5c8\uc810\uc744 \ub178\ub824 \ubcc0\ud654\ub97c \uc8fc\ub3c4\ud558\ub77c. \uad81\uc9c0\uc5d0 \ubab0\ub9b0 \uc801\uc5d0\uac8c\ub294 \ubc18\ub4dc\uc2dc \ud1f4\ub85c\ub97c \uc5f4\uc5b4\uc8fc\uace0, \ub108\ubb34 \ubab0\uc544\ubd99\uc774\uc9c0 \ub9c8\ub77c!\n\u2022  \uc694\uc57d: \ud604\ub300\uc804\uc740 \ub2e8\uc21c\ud788 \ubb3c\ub9ac\uc801 \ucda9\ub3cc\uc774 \uc544\ub2cc, \uc9c0\ub2a5\uc804\uc774\uc790 \uc815\ubcf4\uc804\uc785\ub2c8\ub2e4. \uc8fc\ub3c4\uad8c\uc744 \uc7c1\ucde8\ud558\uae30 \uc704\ud574 \uc801\uc758 \uc2ec\ub9ac\ub97c \uc77d\uace0 \uc720\uc778\ud558\uba70, \uc2a4\ud154\uc2a4\ub098 \uc0ac\uc774\ubc84 \uacf5\uaca9 \uac19\uc740 \ubb34\ud615\uc758 \uc804\ub7b5\uc73c\ub85c \uc608\uce21 \ubd88\uac00\ub2a5\uc131\uc744 \uadf9\ub300\ud654\ud574\uc57c \ud569\ub2c8\ub2e4. \ub610\ud55c, \uc544\uad70\uc758 \ud53c\ud574\ub97c \ucd5c\uc18c\ud654\ud558\uba70 \uc801\uc758 \uacb0\uc0ac \ud56d\uc804\uc744 \uc720\ub3c4\ud558\uc9c0 \uc54a\ub294 \uc9c0\ud61c\uac00 \uc911\uc694\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
