B.aoj=new A.a(" 1.\t\u5175\u4e4b\u60c5\u4e3b\u901f: The nature (\u60c5) of troops (\u5175) prioritizes speed (\u901f), emphasizing the great importance of speed in war.\n\n 2.\t\u4e58\u4eba\u4e4b\u4e0d\u53ca: To take advantage (\u4e58) of others' (\u4eba) unpreparedness (\u4e0d\u53ca), meaning one must attack when the enemy is not ready. \n\n 3.\t\u7531\u4e0d\u865e\u4e4b\u9053: To follow (\u7531) unexpected paths (\u9053), meaning one must attack the enemy using unpredictable methods. \n\n 4.\t\u653b\u5176\u6240\u4e0d\u6212\u4e5f: To attack (\u653b) places (\u6240) they do not guard (\u4e0d\u6212), meaning one must attack where the enemy is complacent. \n\n",null,B.a,null,B.c)
