B.ax5=new A.a("\ud83d\udcda 12: The Attack by Fire(\u706b\u653b) \u2013 Summary \n",null,B.a,null,B.m)
B.axa=new A.a("Sun Tzu's Art of War, Chapter on Attack by Fire (\u706b\u653b), provides profound insights beyond merely using fire tactics, covering types of attack, execution conditions, characteristics of strategic means, the importance of post-victory management, and the ultimate consequences of war.  \n\n",null,B.a,null,B.t)
B.alc=new A.a("In summary, it emphasizes the following core principles: \n\n",null,B.a,null,B.c)
B.as4=new A.a(" 1.\tMultifaceted Objectives of Fire Attack: 'Fire attack' is not just about burning the enemy but a multi-layered attack method to paralyze the enemy's war-fighting capability by destroying various key elements such as enemy personnel (\u706b\u4eba), supplies (\u706b\u7a4d), transport means (\u706b\u8f1c), storage facilities (\u706b\u5eab), and organizational formations (\u706b\u968a). \n\n 2.\tConditions for Executing Fire Attack: To successfully carry out a fire attack, meticulous planning and timing are essential, requiring a clear basis (\u884c\u706b\u5fc5\u6709\u56e0), thorough prior preparation (\u7159\u706b\u5fc5\u7d20\u5177), and seizing the appropriate 'time' (\u767c\u706b\u6709\u6642) and 'day' (\u8d77\u706b\u6709\u65e5). \n\n 3.\tCharacteristics and Limitations of Attack Means: Attacks using fire (\u706b) bring clear and immediate effects (\u660e), while attacks using water (\u6c34) possess powerful destructive force (\u5f3a). However, it must be clearly understood that while water can cut off or isolate the enemy (\u53ef\u4ee5\u7d76), it cannot seize enemy resources for one's own benefit (\u4e0d\u53ef\u4ee5\u596a). This means that when choosing strategic means, the strengths and weaknesses of each must be clearly understood. \n\n 4.\tImportance of Post-Victory Management: Even after winning battles and acquiring enemy assets (\u6230\u52dd\u653b\u53d6), failure to properly manage and consolidate those achievements (\u800c\u4e0d\u4fee\u5176\u529f) will lead to disaster and danger (\u51f6). This results in wasting resources and lingering without any progress (\u8cbb\u7559), thus stabilization and management after victory are key to sustainable success. \n\n 5.\tIrreversibility of War Outcomes: Emotions like personal anger or displeasure can recover over time (\u6012\u53ef\u4ee5\u5fa9\u559c, \u614d\u53ef\u4ee5\u5fa9\u6085), but a nation that has perished (\u4ea1\u570b) cannot be restored, and the dead (\u6b7b\u8005) cannot be brought back to life. This emphasizes that leaders should not be swayed by emotions and must make decisions with extreme caution, always recognizing the ultimate and irreversible destructive power of war. \n\n It conveys a comprehensive message that in war, one must meticulously analyze the purpose and means of attack, prepare thoroughly, seize opportune moments, manage achievements rigorously after victory, and above all, deeply consider the ultimate ramifications of war. \n\n",null,B.a,null,B.c)
