B.ah2=new A.a("  \u2022\t\u6210\u529f(ch\xe9ng g\u014dng): To succeed. \n  \u2022 \u51fa\u65bc(ch\u016b y\xfa): Originates from. \n  \u2022 \u8846\u8005(zh\xf2ng zh\u011b): Many people (army, organization, group). \n  \u2022 \u5148\u77e5(xi\u0101n zh\u012b): Foreknowledge (prior information, foresight). \n  \u2022 \u4e0d\u53ef\u53d6(b\xf9 k\u011b q\u01d4): Cannot be obtained. \n  \u2022 \u9b3c\u795e(gu\u01d0 sh\xe9n): Ghosts, spirits. \n  \u2022 \u8c61\u65bc\u4e8b(xi\xe0ng y\xfa sh\xec): Inferred from phenomena. \n  \u2022 \u9a57\u65bc\u5ea6(y\xe0n y\xfa d\xf9): Verified by regulations or measurements. \n  \u2022 \u5fc5\u53d6\u65bc\u4eba(b\xec q\u01d4 y\xfa r\xe9n): Must be obtained from people. \n  \u2022 \u77e5\u6575\u4e4b\u60c5(zh\u012b d\xed zh\u012b q\xedng): Knowing the enemy's true situation, information, circumstances.  \n\n",null,B.a,null,B.c)
B.a6T=new A.a("\u201cSuccess that stands out from the ordinary stems from 'foreknowledge' (\u5148\u77e5). This 'foreknowledge' cannot be obtained from spirits or gods, nor can it be inferred from outward signs (omens), nor can it be proven by (visible) figures or measurements. It must be obtained from 'people,' and that means 'knowing the enemy's true situation (\u5be6\u60c5)\u201d",null,B.a,null,B.c)
