B.ayi=new A.a(" 1.\tAbsolute Value of Information: The greatest secret to success lies in knowing and preparing in advance, which means accurate intelligence. \n\n 2.\tIndirect Information Acquisition: Beyond overt data or general analysis, covert and in-depth information acquisition through insiders ('people') is crucial. \n\n 3.\tUnderstanding the Enemy's Essence: It's not just a simple list of facts; insightful information that penetrates the enemy's intentions, weaknesses, and internal affairs\u2014the enemy's 'true situation (\u5be6\u60c5)'\u2014is needed. \n\n 4.\tDispelling Superstition and Realism: One must not rely on luck, vague expectations, or unrealistic predictions, but instead prepare for the future through realistic and concrete intelligence activities. \n\n 5.\tRole of Leadership: Building and utilizing a systematic intelligence network to acquire this crucial 'foreknowledge (\u5148\u77e5)' is a core competency of leaders. \n\n",null,B.a,null,B.c)
