B.ad_=new A.a("  \u2022 \u7528\u5175\u4e4b\u6cd5(y\xf2ng b\u012bng zh\u012b f\u01ce): Method of waging war. \n  \u2022 \u6709\u6563\u5730(y\u01d2u s\xe0n d\xec): Ground where it's easy to scatter, good for fleeing. \n  \u2022 \u6709\u8f15\u5730(y\u01d2u q\u012bng d\xec): Ground where it's easy to move lightly, easy to retreat. \n  \u2022 \u6709\u722d\u5730(y\u01d2u zh\u0113ng d\xec): Ground where contention occurs, ground both sides strive to seize. \n  \u2022 \u6709\u4ea4\u5730(y\u01d2u ji\u0101o d\xec): Ground where it's easy for both sides to come and go, frequented ground. \n  \u2022 \u6709\u8862\u5730(y\u01d2u q\xfa d\xec): Ground like a four-way junction, ground that branches into multiple paths. \n  \u2022 \u6709\u91cd\u5730(y\u01d2u zh\xf2ng d\xec): Important ground, strategically important to occupy. \n  \u2022 \u6709\u572e\u5730(y\u01d2u p\u01d0 d\xec): Broken ground, ground with blocked paths or many obstacles. \n   \u2022 \u6709\u570d\u5730(y\u01d2u w\xe9i d\xec): Ground easy to encircle, good for encirclement attacks. \n  \u2022 \u6709\u6b7b\u5730(y\u01d2u s\u01d0 d\xec): Ground of death, ground with no retreat.  \n\n",null,B.a,null,B.c)
B.auQ=new A.a("\u201cThere are nine types of ground in the art of war: Dispersive Ground (\u6563\u5730), Light Ground (\u8f15\u5730), Contention Ground (\u722d\u5730), Intersecting Ground (\u4ea4\u5730), Fissile Ground (\u8862\u5730), Serious Ground (\u91cd\u5730), Difficult Ground (\u572e\u5730), Encircled Ground (\u570d\u5730), and Deadly Ground (\u6b7b\u5730).\u201d",null,B.a,null,B.c)
