B.aAd=new A.a("This presents nine types of ground, briefly explaining the strategic characteristics of each. Sun Tzu's Art of War provides different military operational principles for each of these nine types of ground. \n\n",null,B.a,null,B.c)
B.arB=new A.a(" 1.\tDispersive Ground (\u6563\u5730): Ground where it's easy to scatter. This is ground close to one's own country, not deeply penetrated into enemy territory. Soldiers are easily inclined to return home, making their will to fight dispersive. Do not fight here. \n\n 2.\tLight Ground (\u8f15\u5730): Slightly deeper into enemy territory. Soldiers can still easily connect with their home country, so they tend to retreat easily, making their mindset light. Do not stop here. \n\n 3.\tContention Ground (\u722d\u5730): Ground whose occupation is advantageous to one side and disadvantageous to the other, making both sides fight desperately for it (a strategic point). Seize it first. \n\n 4.\tIntersecting Ground (\u4ea4\u5730): Ground where both friendly and enemy forces can come and go, meaning it's easy for them to intermingle. Do not disperse your forces. \n\n 5.\tFissile Ground (\u8862\u5730): Ground where the borders of several countries meet, with paths leading in all directions (a diplomatic strategic point). Ally with friendly states. \n\n 6.\tSerious Ground (\u91cd\u5730): Deeply penetrated into enemy territory, with enemy fortifications behind and surrounded by enemies. Very important ground (where retreat is difficult once battle commences). Obtain supplies locally. \n\n 7.\tDifficult Ground (\u572e\u5730): Difficult and treacherous to pass through, with risks of ambush or natural disaster, making the terrain prone to collapse. Pass through quickly. \n\n 8.\tEncircled Ground (\u570d\u5730): Terrain entered through a narrow passage and exited into a wide area, making it easy to be surrounded by the enemy. Devise a plan to escape. \n\n 9.\tDeadly Ground (\u6b7b\u5730): Ground with no retreat, where one must fight desperately or die. Fight desperately. \n\n",null,B.a,null,B.c)
