B.auS=new A.a("  \u2022 \u9053(d\xe0o): Road, strategic path. \n  \u2022 \u6240(su\u01d2): That which, place. \n  \u2022 \u4e0d\u7531(b\xf9 y\xf3u): Not to follow, not to obey. \n  \u2022 \u8ecd(j\u016bn): Army, military force. \n  \u2022 \u4e0d\u64ca(b\xf9 j\u012b): Not to attack. \n  \u2022 \u57ce(ch\xe9ng): City, target, objective. \n  \u2022 \u4e0d\u653b(b\xf9 g\u014dng): Not to besiege. \n  \u2022 \u5730(d\xec): Area, market, territory. \n  \u2022 \u4e0d\u722d(b\xf9 zh\u0113ng): Not to contest, not to strive for. \n  \u2022 \u547d(m\xecng): Command. \n  \u2022 \u4e0d\u53d7(b\xf9 sh\xf2u): Not to obey, not to receive.  \n\n ",null,B.a,null,B.c)
