B.awj=new A.a("This passage emphasizes the strategic wisdom of 'non-action' (\u4e0d\u7232). It means that simply fighting and occupying is not always the best course of action; sometimes, not acting or refusing to act can bring greater benefits. \n\n",null,B.a,null,B.c)
B.ahl=new A.a(" 1.\t\u9053\u6709\u6240\u4e0d\u7531 (There are roads not to follow):\n\u2022\tMeaning: It means that even if a road (\u9053) seems like the logical or generally accepted path, if it is disadvantageous or dangerous to friendly forces in the actual situation, it should not be followed (\u4e0d\u7531). This requires flexible thinking that breaks away from convention or fixed ideas.\n\n 2.\t\u8ecd\u6709\u6240\u4e0d\u64ca (There are armies not to attack):\n\u2022\tMeaning: It means that among the enemy's forces (\u8ecd), elite units with high morale or complete defensive postures should not be attacked (\u4e0d\u64ca). This is the wisdom of avoiding reckless frontal confrontations and minimizing friendly casualties.\n\n 3.\t\u57ce\u6709\u6240\u4e0d\u653b (There are cities not to besiege):\n\u2022\tMeaning: It means that among the enemy's cities (\u57ce), those that are strongly defended and difficult to capture, or those whose capture would result in greater losses than gains, should not be attacked (\u4e0d\u653b). This is a strategic judgment based on cost-benefit analysis. \n\n 4.\t\u5730\u6709\u6240\u4e0d\u722d (There is ground not to contest):\n\u2022\tMeaning: It means that if a particular piece of ground (\u5730) has low strategic value, or if too great a sacrifice would be required to seize it, it should not be contested (\u4e0d\u722d). This is a cold judgment for efficient resource allocation and achieving the ultimate goal. \n\n 5.\t\u8ecd\u547d\u6709\u6240\u4e0d\u53d7 (There are commands from the sovereign not to obey):\n\u2022\tMeaning: It emphasizes that even a command (\u547d) from the sovereign (\u541b), if it is clearly and fatally disadvantageous to friendly forces or would lead to defeat in light of the current situation, the commander should sometimes not obey (\u4e0d\u53d7) that command and make an independent judgment. This is the part that emphasizes the commander's autonomy and responsibility to the maximum. \n\n",null,B.a,null,B.c)
