B.aqG=new A.a(" 1.\tStrategic Selection and Concentration: Do not try to obtain everything. Avoid unnecessary battles to focus resources on truly important and valuable objectives, emphasizing the importance of selection and concentration.\n\n 2.\tTarget Selection for Attack: Avoid reckless attacks that directly confront the enemy's strengths. Instead, choose targets that can minimize friendly casualties.\n\n 3.\tCost-Benefit Analysis: Before any action, coldly analyze the potential gains and costs to prevent inefficient resource waste.\n\n 4.\tFlexible Application of Principles: It is crucial not to be bound by fixed principles or commands, but to judge and respond flexibly in the most favorable direction according to the real situation.\n\n 5.\tCommander's Decisiveness and Responsibility: Field commanders sometimes need the courage to refuse even a superior's order for the sake of overall victory and must bear the responsibility for that decision.\n\n",null,B.a,null,B.c)
