B.asv=new A.a("\u318d\u82e5(ru\xf2): Like (figurative expression)  \n\u318d\u6c7a(ju\xe9): To burst, to collapse, to release  \n\u318d\u7a4d\u6c34(j\u012b shu\u01d0): Accumulated large volume of water, i.e., a large amount of water  \n\u318d\u65bc \u5343\u4ede\u4e4b\u6eaa(y\xfa qi\u0101n r\xe8n zh\u012b x\u012b): In a thousand-ren (very deep) ravine \n\u318d\u8005 \u5f62\u4e5f(zh\u011b x\xedng y\u011b): This is the disposition (\u5f62\u52e2) \n\n",null,B.a,null,B.c)
B.aed=new A.a("\u201cThe battle of the victorious is like bursting forth accumulated water from a ravine a thousand ren deep. This is the disposition (\u5f62) that leads to victory.\u201d",null,B.a,null,B.c)
