B.aux=new A.a("\ud83d\udcda 6: Weak Points and Strong(\u865b\u5be6) \u2013 Summary\n",null,B.a,null,B.m)
B.abT=new A.a("In Sun Tzu's The Art of War chapter on Weak Points and Strong (\u865b\u5be6), it is emphasized that the core of warfare (competition) is to secure the initiative and lead the opponent. To achieve this, one must control the opponent's intentions, exhibit unpredictable movements, and maintain focus without dispersing forces in all defenses. Ultimately, reaching the 'formless' state, where the opponent cannot grasp our form, is the ultimate strategy for victory.\n",null,B.a,null,B.t)
B.ayJ=new A.a(" \u2022\tSeize the Initiative: Cause others to move (\u81f4\u4eba), and do not be caused to move by others (\u4e0d\u81f4\u65bc\u4eba).\n\n \u2022\tControl the Enemy with Benefit and Harm: If you can make the enemy come of himself, it is because you have lured him with benefit (\u5229); if you can prevent him from coming, it is because you have placed harm (\u5bb3) there.\n\n \u2022 Disrupt the Enemy's State: When the enemy is at ease, make him angry; when well fed, make him hungry; when at rest, make him move, thereby throwing him into confusion.\n\n \u2022\tUnpredictability: March to places where the enemy does not head (\u51fa\u5176\u6240\u4e0d\u8da8), and rush to where the enemy does not expect (\u8da8\u5176\u6240\u4e0d\u610f).\n\n \u2022\tPsychological Warfare of Attack and Defense: One who attacks first makes the enemy unaware of what he should guard, and one who defends well makes the enemy unaware of what he should attack.\n\n \u2022\tSelection and Concentration: If you prepare everywhere, you will be weak everywhere (\u7121\u6240\u4e0d\u5099 \u5247\u7121\u6240\u4e0d\u5be1). If you have few troops, you are the one who is prepared against by others; if you have many troops, you are the one who makes others prepare against you.\n\n \u2022\tFormless State: The ultimate in employing troops is to reach the 'formless (\u7121\u5f62)' state. This means making it impossible for the enemy to know your intentions or troop dispositions. \n\n",null,B.a,null,B.c)
B.RH=s([B.aux,B.abT,B.j_,B.ayJ],t.R)
