B.abH=new A.a("\u318d\u4e00\u66f0 \u5ea6(y\u012b yu\u0113 d\xf9): \uccab\uc9f8\ub294 \ub3c4(\u5ea6), \uc9c0\ud615\uc774\ub098 \uc804\uc7a5\uc758 \uac70\ub9ac\ub97c \uce21\uc815\ud568 \n\u318d\u4e8c\u66f0 \u91cf(\xe8r yu\u0113 li\xe0ng): \ub458\uc9f8\ub294 \ub7c9(\u91cf), \ubcd1\ub825\uc774\ub098 \uc790\uc6d0\uc758 \uc591\uc744 \ud5e4\uc544\ub9bc \n\u318d\u4e09\u66f0 \u6578(s\u0101n yu\u0113 sh\xf9): \uc14b\uc9f8\ub294 \uc218(\u6578), \ubcd1\uc0ac \uc218\ub098 \uc804\ud22c\ub825 \ub4f1\uc758 \uc218\uce58\ub97c \uacc4\uc0b0\ud568\n\u318d\u56db\u66f0 \u7a31(s\xec yu\u0113 ch\u0113ng): \ub137\uc9f8\ub294 \uce6d(\u7a31), \uc801\uacfc \ube44\uad50\ud558\uc5ec \ud615\uc138\ub97c \uac00\ub2a0\ud568 \n\u318d\u4e94\u66f0 \u52dd(w\u01d4 yu\u0113 sh\xe8ng): \ub2e4\uc12f\uc9f8\ub294 \uc2b9(\u52dd), \uc774\uae38 \uc218 \uc788\ub294\uc9c0\ub97c \ud310\ub2e8\ud568 \n\n ",null,B.a,null,B.c)
