B.aro=new A.a("\uc774 \ubb38\uad6c\ub294 \uc2b9\ub9ac\ub97c \uad6c\uc131\ud558\ub294 \ub2e4\uc12f \uac00\uc9c0 \ud575\uc2ec \uc694\uc18c\ub4e4\uc774 \uc5f0\uc18d\uc801\uc774\uace0 \uc778\uacfc\uc801\uc778 \uad00\uacc4\ub97c \ub9fa\uace0 \uc788\uc74c\uc744 \uc124\uba85\ud569\ub2c8\ub2e4. \uc774\ub294 \ub2e8\uc21c\ud55c \ub098\uc5f4\uc774 \uc544\ub2c8\ub77c, \uc804\uc7c1 \uc900\ube44 \ubc0f \uc218\ud589\uc758 \ub17c\ub9ac\uc801\uc778 \ub2e8\uacc4\ub97c \uc81c\uc2dc\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
B.afk=new A.a("1. \u5ea6 (\uc9c0\ud615\uc758 \ub113\uc774/\uacf5\uac04\uc801 \uaddc\ubaa8): \uc804\uc7c1\uc774 \ubc8c\uc5b4\uc9c0\ub294 \uacf5\uac04\uc801 \ubc30\uacbd\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \uc804\uc7a5\uc758 \ub113\uc774\uc640 \ud2b9\uc131(\uc0b0\uc545, \ud3c9\uc57c, \uac15 \ub4f1)\uc740 \ubcd1\ub825\uc758 \uc6b4\uc6a9 \ubc29\uc2dd\uacfc \ubcf4\uae09\uc758 \ub09c\uc774\ub3c4\uc5d0 \uc9c1\uc811\uc801\uc778 \uc601\ud5a5\uc744 \ubbf8\uce69\ub2c8\ub2e4. \n\n2. \u91cf (\ubb3c\uc790\uc758 \uc6a9\ub7c9/\ubcf4\uae09): \uc804\uc7a5\uc758 \ub113\uc774\uac00 \uacb0\uc815\ub418\uba74, \uadf8 \ub113\uc774\uc5d0\uc11c \ubcd1\ub825\uc744 \uc6b4\uc6a9\ud558\ub294 \ub370 \ud544\uc694\ud55c \ubb3c\uc790(\uc2dd\ub7c9, \ubb34\uae30, \uc7a5\ube44 \ub4f1)\uc758 \uc591\uc744 \uce21\uc815\ud558\uac8c \ub429\ub2c8\ub2e4. \ucda9\ubd84\ud55c \ubb3c\uc790 \uacf5\uae09\uc740 \uc7a5\uae30\uc804 \uc218\ud589 \ub2a5\ub825\uacfc \uc9c1\uacb0\ub429\ub2c8\ub2e4.\n\n3. \u6578 (\ubcd1\ub825\uc758 \uc218\ud6a8): \ud544\uc694\ud55c \ubb3c\uc790\ub7c9\uc774 \ud655\ubcf4\ub420 \uc218 \uc788\ub2e4\uba74, \uc774\ub97c \ubc14\ud0d5\uc73c\ub85c \uc6b4\uc6a9 \uac00\ub2a5\ud55c \ubcd1\ub825\uc758 \uc218\ub97c \uacb0\uc815\ud569\ub2c8\ub2e4. \ubcd1\ub825 \uc218\ub294 \uc804\uc7c1 \uc218\ud589\uc758 \uae30\ubcf8\uc801\uc778 \uc5ed\ub7c9\uc744 \ub098\ud0c0\ub0c5\ub2c8\ub2e4.\n\n4. \u7a31 (\uc804\ub825\uc758 \ud615\uc138/\ube44\uad50 \uc6b0\uc704): \uc9c0\ud615, \ubb3c\uc790, \ubcd1\ub825 \uc218\ub97c \ubaa8\ub450 \uc885\ud569\ud558\uc5ec \uc544\uad70\uacfc \uc801\uad70\uc758 \uc804\ub825\uc744 \ube44\uad50\ud558\uace0, \uc5b4\ub290 \ucabd\uc774 \uc0c1\ub300\uc801\uc778 \uc6b0\uc704\ub97c \uc810\ud558\ub294\uc9c0 '\uc800\uc6b8\uc9c8'\ud569\ub2c8\ub2e4. \uc774 '\ud615\uc138' \ud310\ub2e8\uc774 \uc2b9\ub9ac\ub97c \uacb0\uc815\ud558\ub294 \uacb0\uc815\uc801\uc778 \uc694\uc18c\uac00 \ub429\ub2c8\ub2e4.\n\n 5. \u52dd (\uc2b9\ub9ac): \uc774 \ub124 \uac00\uc9c0 \uc694\uc18c(\u5ea6, \u91cf, \u6578, \u7a31)\ub97c \ubc14\ud0d5\uc73c\ub85c \uc720\ub9ac\ud55c '\ud615\uc138(\u5f62)'\ub97c \ub9cc\ub4e4\uc5c8\uc744 \ub54c, \ucd5c\uc885\uc801\uc73c\ub85c '\uc2b9\ub9ac'\ub97c \uc5bb\uc744 \uc218 \uc788\ub2e4\ub294 \uac83\uc785\ub2c8\ub2e4. \uc989, \uc2b9\ub9ac\ub294 \uc6b0\uc5f0\uc774 \uc544\ub2cc \ucca0\uc800\ud55c \ubd84\uc11d\uacfc \uc900\ube44\uc758 \uacb0\uacfc\uc784\uc744 \ub9d0\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
