B.adp=new A.a("1. \uccb4\uacc4\uc801 \ubd84\uc11d\uc758 \uc911\uc694\uc131: \uc804\uc7c1(\uacbd\uc7c1)\uc740 \uac00\uc7a5 \uae30\ubcf8\uc801\uc778 \uc694\uc18c(\uc9c0\ud615/\uacf5\uac04)\ubd80\ud130 \uc2dc\uc791\ud558\uc5ec \uc21c\ucc28\uc801\uc73c\ub85c \ub354 \ubcf5\ud569\uc801\uc778 \uc694\uc18c(\ubb3c\uc790, \ubcd1\ub825, \uc804\ub825 \ud615\uc138)\ub97c \ubd84\uc11d\ud574\uc57c \ud55c\ub2e4\ub294 \uac83\uc744 \uac15\uc870\ud569\ub2c8\ub2e4.\n\n 2. \ubb3c\uc790 \ubc0f \uc790\uc6d0 \uad00\ub9ac: \ubcd1\ub825 \uc6b4\uc6a9\uc5d0 \ud544\uc694\ud55c \ubb3c\uc790(\uc790\uc6d0)\uc758 \ud655\ubcf4 \ubc0f \ud6a8\uc728\uc801\uc778 \uad00\ub9ac\uac00 \uc804\uc7c1 \uc218\ud589 \ub2a5\ub825\uc758 \ud575\uc2ec\uc784\uc744 \ubcf4\uc5ec\uc90d\ub2c8\ub2e4.\n\n 3. \ubcd1\ub825 \uaddc\ubaa8\uc758 \uc801\uc808\uc131: \ubb34\uc870\uac74\uc801\uc778 \ubcd1\ub825\uc758 \ub2e4\uc218\uac00 \uc544\ub2cc, \uc8fc\uc5b4\uc9c4 \ud658\uacbd\uacfc \ubb3c\uc790\uc5d0 \ub9de\ucdb0 \uc801\uc808\ud55c \ubcd1\ub825\uc744 \uc6b4\uc6a9\ud558\ub294 \uac83\uc774 \uc911\uc694\ud569\ub2c8\ub2e4.\n\n 4. \uc885\ud569\uc801 \uc804\ub825 \ud3c9\uac00: \uc2b9\ub9ac\ub294 \ub2e8\uc21c\ud788 \ubcd1\ub825\uc758 \ub9ce\uace0 \uc801\uc74c\uc774 \uc544\ub2c8\ub77c, \uc9c0\ud615, \ubb3c\uc790, \ubcd1\ub825 \ub4f1 \ubaa8\ub4e0 \uc694\uc18c\ub97c \uc885\ud569\ud558\uc5ec \ud615\uc131\ub418\ub294 '\uc804\ub825\uc758 \ud615\uc138'\uc5d0 \ub2ec\ub824 \uc788\uc74c\uc744 \uac15\uc870\ud569\ub2c8\ub2e4.\n\n 5. \uc2b9\ub9ac\ub294 \uc608\uce21 \uac00\ub2a5\ud55c \uacb0\uacfc: \uc774 \ubaa8\ub4e0 \uc694\uc18c\ub4e4\uc744 \uc815\ud655\ud788 \ud30c\uc545\ud558\uace0 \uc720\ub9ac\ud55c \ud615\uc138\ub97c \ub9cc\ub4e4\uba74, \uc2b9\ub9ac\ub294 \uc6b0\uc5f0\uc774 \uc544\ub2cc \uc608\uce21 \uac00\ub2a5\ud55c \uacb0\uacfc\uac00 \ub41c\ub2e4\ub294 \uc810\uc744 \uc5ed\uc124\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
