B.wf=new A.a('"\u5175\u805e\u62d9\u901f\uff0c\u672a\u7779\u5de7\u4e4b\u4e45\u4e5f\uff1b\u592b\u5175\u4e45\u800c\u570b\u5229\u8005\uff0c\u672a\u4e4b\u6709\u4e5f"\n\n',null,B.a,null,B.t)
B.awH=new A.a("\u318d \u5175(b\u012bng): War (military strategy) \n\u318d \u805e\u62d9\u901f(w\xe9n zhu\u014d s\xf9): I have heard of clumsy but swift war \n\u318d \u672a\u7779\u5de7\u4e4b\u4e45\u4e5f(w\xe8i d\u01d4 qi\u01ceo zh\u012b ji\u01d4 y\u011b): But have never seen a clever and prolonged one \n\u318d \u592b(f\u016b): Generally, as an emphasizing prefix \n\u318d \u5175\u4e45\u800c(b\u012bng ji\u01d4 \xe9r): If the war is prolonged \n\u318d \u570b\u5229\u8005(gu\xf3 l\xec zh\u011b): Cases beneficial to the nation \n\u318d \u672a\u4e4b\u6709\u4e5f(w\xe8i zh\u012b y\u01d2u y\u011b): Have never existed \n\n",null,B.a,null,B.c)
B.adP=new A.a("\u201cIn war, it is better to finish quickly, even if a bit clumsy. No matter how excellent the strategy, if a war is prolonged, it will inevitably harm the nation. There has never been a case in history where a prolonged war benefited the state.\u201d ",null,B.a,null,B.c)
