B.a6Q=new A.a("This passage clarifies the relationship between the speed of war and national interest. \n\n",null,B.a,null,B.c)
B.a9b=new A.a("1.\tTolerance of \u62d9\u901f (zhu\u014d s\xf9): It states that in war, even if there are somewhat clumsy (\u62d9) or awkward aspects, it is important to bring it to a swift (\u901f) conclusion. This means that it is better to proceed quickly, even if imperfect, than to delay while pursuing perfection. \n\n2.\tNegation of \u5de7\u4e45 (qi\u01ceo ji\u01d4): It states unequivocally that even if a war is led cleverly and excellently (\u5de7), there has never been a case where prolonging it (\u4e45) was beneficial. This emphasizes the inevitable harms caused by a protracted war. \n\n3.\tRelationship Between Protracted War and National Interest: It firmly declares that there has never been a single instance (\u672a\u4e4b\u6709\u4e5f) where a prolonged war (\u5175\u4e45) benefited (\u570b\u5229) the nation. This asserts that protracted war inevitably brings immense losses to the nation, and true victory through a prolonged war is impossible. \n\n",null,B.a,null,B.c)
