B.apn=new A.a("1.\tDecisive Importance of Time: In war, time is a core factor determining victory or defeat, and it is crucial to achieve goals in the shortest possible time. \n\n2.\tRejection of Perfectionism: It can be more advantageous to act swiftly, even if somewhat imperfectly, rather than wasting time pursuing only perfect preparation or cunning strategies. \n\n3.\tProtracted War is Inevitable Defeat: Prolonging a war cannot benefit the nation and inevitably leads to resource depletion and weakening of national power, so it must be avoided. \n\n4.\tEfficient Resource Management: Limited resources must be utilized as efficiently as possible to achieve maximum effect in a short period. \n\n",null,B.a,null,B.c)
