B.acm=new A.a("  \u2022 \u706b\u4f50\u653b\u8005(hu\u01d2 zu\u01d2 g\u014dng zh\u011b): \ubd88\ub85c \uacf5\uaca9\uc744 \ubcf4\uc870\ud558\ub294 \uc790 \n  \u2022 \u660e(m\xedng): \ubc1d\ub2e4, \uba85\ud655\ud558\ub2e4 (\uc9c0\ud61c\ub86d\uace0 \ud1b5\ucc30\ub825 \uc788\uc74c) \n  \u2022 \u4ee5\u6c34\u4f50\u653b\u8005(y\u01d0 shu\u01d0 zu\u01d2 g\u014dng zh\u011b): \ubb3c\ub85c \uacf5\uaca9\uc744 \ubcf4\uc870\ud558\ub294 \uc790 \n  \u2022 \u5f3a(qi\xe1ng): \uac15\ud558\ub2e4, \uac15\ub825\ud558\ub2e4 \n  \u2022 \u6c34(shu\u01d0): \ubb3c \n   \u2022 \u53ef\u4ee5\u7d76(k\u011b y\u01d0 ju\xe9): \ub04a\uc744 \uc218 \uc788\ub2e4 (\uad50\ud1b5\xb7\ubcf4\uae09\ub85c, \ud1b5\uc2e0 \ub4f1 \ucc28\ub2e8) \n  \u2022 \uf967\u53ef\u4ee5\u596a(b\xf9 k\u011b y\u01d0 du\xf3): \ube7c\uc557\uc744 \uc218\ub294 \uc5c6\ub2e4 (\uc18c\uc720\xb7\uc810\uc720 \ubd88\uac00\ud568) \n\n",null,B.a,null,B.c)
