B.aui=new A.a(" 1. \u706b\u4f50\u653b\u8005\u660e: \ubd88\uc744 \uc774\uc6a9\ud55c \uacf5\uaca9\uc740 \uadf8 \ud6a8\uacfc\uac00 \ube60\ub974\uace0 \uc2dc\uac01\uc801\uc73c\ub85c \uba85\ud655\ud558\uac8c \ub4dc\ub7ec\ub0a9\ub2c8\ub2e4. \uc801\uc5d0\uac8c \uc9c1\uc811\uc801\uc778 \ud53c\ud574\ub97c \uc8fc\uace0 \ud63c\ub780\uacfc \uacf5\ud3ec\ub97c \uc2ec\uc5b4\uc8fc\ub294 \ub370 \ud6a8\uacfc\uc801\uc774\uba70, \uadf8 \uacb0\uacfc\uac00 \ubd84\uba85\ud569\ub2c8\ub2e4. \ud558\uc9c0\ub9cc \ub3d9\uc2dc\uc5d0 \uc544\uad70\uc758 \uc874\uc7ac\uc640 \uc758\ub3c4 \uc5ed\uc2dc \uba85\ud655\ud558\uac8c \ub178\ucd9c\ub420 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \n\n 2. \u4ee5\u6c34\u4f50\u653b\u8005\u5f3a: \ubb3c\uc744 \uc774\uc6a9\ud55c \uacf5\uaca9\uc740 \uadf8 \ud6a8\uacfc\uac00 \ub9e4\uc6b0 \uac15\ub825\ud569\ub2c8\ub2e4. \ud64d\uc218\ub97c \uc77c\uc73c\ud0a4\uac70\ub098 \uc801\uc758 \ubcf4\uae09\ub85c\ub97c \uce68\uc218\uc2dc\ud0a4\ub294 \ub4f1, \uad11\ubc94\uc704\ud558\uace0 \uce58\uba85\uc801\uc778 \ud53c\ud574\ub97c \uc904 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc790\uc5f0\uc758 \uac70\ub300\ud55c \ud798\uc744 \uc774\uc6a9\ud558\ubbc0\ub85c \ud30c\uad34\ub825\uc774 \uc5c4\uccad\ub0a9\ub2c8\ub2e4. \n\n 3. \u6c34\u53ef\u4ee5\u7d76 \u4e0d\u53ef\u4ee5\u596a: \ubb3c\uc740 \uc801\uc758 \ubcf4\uae09\ub85c\ub098 \ud1f4\ub85c\ub97c \ub04a\uac70\ub098 \uc801\uc744 \uace0\ub9bd\uc2dc\ud0a4\ub294 \ub370\ub294 \uac15\ub825\ud558\uc9c0\ub9cc, \uc801\uc758 \ubb3c\uc790\ub098 \uc804\ub9ac\ud488\uc744 \uc9c1\uc811\uc801\uc73c\ub85c '\ube7c\uc557\uc544 \uc62c' \uc218\ub294 \uc5c6\uc2b5\ub2c8\ub2e4. \uc624\ud788\ub824 \ubb3c\uc5d0 \uc7a0\uaca8 \uc720\uc2e4\ub418\uac70\ub098 \uc0ac\uc6a9\ud560 \uc218 \uc5c6\uac8c \ub9cc\ub4e4 \ubfd0\uc785\ub2c8\ub2e4. \uc774\ub294 \uc218\uacf5\uc774 \ud30c\uad34\uc5d0\ub294 \ub2a5\ud558\uc9c0\ub9cc, \uc544\uad70\uc758 \uc774\ub4dd\uc73c\ub85c \uc9c1\uc811 \uc5f0\uacb0\ud558\uae30\ub294 \uc5b4\ub835\ub2e4\ub294 \ud55c\uacc4\ub97c \uba85\ud655\ud788 \uc9c0\uc801\ud569\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
