B.au6=new A.a("'This passage points out the problems that arise when the important virtues a leader should possess, such as 'generosity' and 'love', do not translate into practical leadership ability.  \n\n'",null,B.a,null,B.c)
B.anj=new A.a(" 1.\t\u539a\u800c\u4e0d\u80fd\u4f7f (Generous but cannot employ):\n\u2022\tMeaning: Refers to a situation where a leader has a magnanimous and generous character (\u539a) and treats subordinates well, but at crucial moments, does not know how to effectively command or employ them (\u4e0d\u80fd\u4f7f). This can stem from a lack of charisma, unprincipled leniency, or indecisiveness. \n\n 2.\t\u611b\u800c\u4e0d\u80fd\u4ee4 (Loving but cannot command):\n\u2022\tMeaning: Refers to a situation where a leader personally cherishes and loves (\u611b) organizational members but cannot firmly command them or apply discipline (\u4e0d\u80fd\u4ee4). This can lead to unfairness towards organizational members or disregard for discipline due to excessive affection. \n\n 3.\t\u96e3\u800c\u4e0d\u80fd\u6cbb (Faces difficulties but cannot govern):\n\u2022\tMeaning: Refers to a situation where, despite facing a difficult and chaotic time (\u96e3) in the external environment, the leader cannot control the chaos, establish order, or govern (\u4e0d\u80fd\u6cbb). This stems from a lack of crisis management ability, poor judgment, or an irresponsible attitude. \n\n",null,B.a,null,B.c)
