B.aA7=new A.a("\u201cAvoid his keen spirit and strike him when he is weary and turning back. This is the art of managing 'spirit.' Wait for chaos with order, wait for uproar with calm. This is the art of managing 'mind,' and this is the art of managing 'strength.' Do not meet the enemy's well-aligned banner head-on, nor attack a grandly aligned formation head-on. This is the art of managing 'change.'\u201d\n ",null,B.a,null,B.c)
