B.afK=new A.a(" 1.\t\u907f\u5176\u92b3\u6c23 \u64ca\u5176\u60f0\u6b78 \u6b64\u6cbb\u6c23\u8005\u4e5f (Avoid the enemy's sharp spirit and attack when they are weary and returning. This is the method of managing 'spirit (\u6c23)'):\n\u2022\tMeaning: Emphasizes avoiding head-on confrontation when the enemy's morale is at its peak (\u92b3\u6c23), and instead targeting them when their spirit wanes and they are about to withdraw (\u60f0\u6b78). This refers to the wisdom of observing the enemy's morale (\u6c23) and striking at their weaknesses.\n\n  2.\t\u4ee5\u6cbb\u5f85\u4e82 \u4ee5\u975c\u5f85\u8b41 \u6b64\u6cbb\u5fc3\u8005\u4e5f (Wait for chaos in a well-ordered state, and wait for uproar in a calm state. This is the method of managing 'mind (\u5fc3)'):\n\u2022\tMeaning: Emphasizes that our side should wait for the enemy's chaos (\u4e82) in a well-ordered (\u6cbb) state, and wait for their uproar (\u8b41) in a calm (\u975c) state. This means maintaining a peaceful and unwavering mind (\u5fc3) state for our commanders and soldiers, enabling them to seize opportunities without being swayed by enemy disruption or confusion. \n\n  3.\t\u6b64\u6cbb\u529b\u8005\u4e5f (This is the method of managing 'strength (\u529b)'):\n\u2022\tMeaning: As mentioned in the two preceding phrases (methods of managing spirit and mind), this emphasizes that effectively preserving our own strength (\u529b), depleting the enemy's strength, and concentrating it at decisive moments is truly the way to manage strength. That is, fighting when necessary, avoiding when necessary, and waiting when necessary is efficient use of strength. \n\n  4.\t\u7121\u9080\u6b63\u6b63\u4e4b\u65d7 \u7269\u64ca\u5802\u5802\u4e4b\u9663 \u6b64\u6cbb\u8b8a\u8005\u4e5f (Do not meet a well-aligned banner head-on, nor attack a grandly aligned formation head-on. This is the method of managing 'change (\u8b8a)'):\n\u2022\tMeaning: This means avoiding head-on confrontation when the enemy's morale is high (\u6b63\u6b63\u4e4b\u65d7) and their defense posture is perfect (\u5802\u5802\u4e4b\u9663). This emphasizes the importance of reading the changes (\u8b8a) on the battlefield and flexibly responding by avoiding the enemy's strengths and seeking out their weaknesses to attack.\n\n ",null,B.a,null,B.c)
