B.afw=new A.a(" 1.\tConfrontation with Zheng (\u4ee5\u6b63\u5408):\n  \u2022\tMeaning: 'Zheng (\u6b63)' refers to regular troop deployments, predictable tactics, frontal confrontation, etc. It plays the role of tying down the enemy's main force, establishing one's basic defensive line or offensive formation, and showing the enemy one's 'standard' movements. It forms the 'stage' of the battle through basic engagement with the enemy and plays the role of attracting the enemy's attention.\n\n 2.\tVictory with Qi (\u4ee5\u5947\u52dd):\n \u2022\tMeaning: 'Qi (\u5947)' refers to unpredictable, irregular, unconventional tactics. This includes striking the enemy's weak points, attacking from unexpected directions, carrying out deception operations, or bypassing the main force. 'Qi (\u5947)' plays the role of inducing enemy carelessness, penetrating weaknesses, and achieving decisive victory. 'Qi (\u5947)' confuses the enemy, breaks their balance, and delivers the decisive blow for victory.\n\n",null,B.a,null,B.c)
