B.afy=new A.a("\uc190\uc790\ubcd1\ubc95 \uc791\uc804(\u4f5c\u6230)\ud3b8\uc5d0\uc11c\ub294 \uc804\uc7c1(\uacbd\uc7c1)\uc758 \ubcf8\uc9c8\uc744 \uae4a\uc774 \uc774\ud574\ud558\uace0, \ucca0\uc800\ud55c \uc0ac\uc804 \ubd84\uc11d\uacfc \uae30\ub9cc \uc804\ub7b5\uc744 \ud1b5\ud574 \ub2e8\uae30\uac04\uc5d0 \ud655\uc2e4\ud55c \uc2b9\ub9ac\ub97c \uc7c1\ucde8\ud558\uba70, \uc774\ub97c \ud1b5\ud574 \uad6d\ub825(\uae30\uc5c5 \uacbd\uc7c1\ub825/\ud300 \uc804\ub825)\uc744 \uac15\ud654\ud574\uc57c \ud55c\ub2e4\uace0 \uc5ed\uc124\ud569\ub2c8\ub2e4. \ub610\ud55c, \uc804\uc7c1\uc758 \ud574\ub85c\uc6c0(\uc190\uc2e4)\uc744 \uc644\uc804\ud788 \uc778\uc9c0\ud558\ub294 \uac83\uc774 \uc9c4\uc815\ud55c \uc774\ub85c\uc6c0(\uc774\uc775)\uc744 \uc544\ub294 \uc804\uc81c \uc870\uac74\uc774\uba70, \uc774\ub97c \uc704\ud574 \ud6a8\uc728\uc801\uc778 \uc790\uc6d0 \uc870\ub2ec(\ud2b9\ud788 \uc801\uc5d0\uac8c\uc11c)\uacfc \ub9ac\ub354\uc758 \ub9c9\uc911\ud55c \ucc45\uc784\uac10\uc744 \uac15\uc870\ud569\ub2c8\ub2e4.\n",null,B.a,null,B.t)
B.fj=new A.a("\ud575\uc2ec \uc6d0\uce59\uc740 \ub2e4\uc74c\uacfc \uac19\uc2b5\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
B.aqP=new A.a("1.\t\uc804\uc7c1\uc758 \ubcf8\uc9c8\uacfc \uc2e0\uc911\ub860: \uc804\uc7c1\uc740 \uad6d\uac00\uc758 \uc874\ub9dd\uacfc \ubc31\uc131\uc758 \uc0dd\uba85\uc774 \uac78\ub9b0 \uc911\ub300\ud55c \uc0ac\uc548\uc774\ubbc0\ub85c, \uc808\ub300 \uac00\ubccd\uac8c \uc5ec\uaca8\uc11c\ub294 \uc548 \ub418\uba70, '\uc624\uc0ac(\u4e94\u4e8b)'\uc640 '\uce60\uacc4(\u4e03\u8a08)'\ub97c \ud1b5\ud574 \ubaa8\ub4e0 \uc694\uc18c\ub97c \ucca0\uc800\ud558\uac8c \ubd84\uc11d\ud558\uace0 \uc219\uace0\ud574\uc57c \ud569\ub2c8\ub2e4. (\u5175\u8005 \u570b\u4e4b\u5927\u4e8b \u6b7b\u751f\u4e4b\u5730 \u5b58\u4ea1\u4e4b\u9053 \u4e0d\u53ef\u4e0d\u5bdf\u4e5f; \u7d93\u4e4b\u4ee5\u4e94\u4e8b \u6821\u4e4b\u4ee5\u4e03\u8a08 \u800c\u7d22\u5176\u60c5; \u4e00\u66f0\u9053\u4e8c\u66f0\u5929\u4e09\u66f0\u5730\u56db\u66f0\u5c07\u4e94\u66f0\u6cd5)\n\n2.\t\uae30\ub9cc\uacfc \ud615\uc138 \uc870\uc131: \uc804\uc7c1\uc740 **'\uc18d\uc784\uc218(\u8a6d\u9053)'**\uc5d0 \uae30\ubc18\ud558\ubbc0\ub85c, \uc2e4\uc81c \ub2a5\ub825\uc774 \uc788\uc5b4\ub3c4 \uc5c6\ub294 \uac83\ucc98\ub7fc, \ud65c\uc6a9\ud560 \uc218 \uc788\uc5b4\ub3c4 \ud65c\uc6a9\ud558\uc9c0 \uc54a\ub294 \uac83\ucc98\ub7fc \ubcf4\uc5ec \uc801\uc744 \uae30\ub9cc\ud574\uc57c \ud569\ub2c8\ub2e4. \uc774 \uc774\ud574\ub4dd\uc2e4\uc744 \ubc14\ud0d5\uc73c\ub85c \uc720\ub9ac\ud55c \ud615\uc138(\u52e2)\ub97c \uc870\uc131\ud558\uace0, \uc774 \ud615\uc138\ub85c \uc678\ubd80 \uc0c1\ud669\uae4c\uc9c0 \uc544\uad70\uc5d0\uac8c \uc720\ub9ac\ud558\uac8c \ud1b5\uc81c\ud574\uc57c \ud569\ub2c8\ub2e4. '\uc138(\u52e2)'\ub294 \uace7 \uc720\ub9ac\ud55c \uc0c1\ud669\uc5d0 \ub530\ub77c \uc720\uc5f0\ud558\uac8c \ub300\uc751\ud558\uba70 \uc8fc\ub3c4\uad8c\uc744 \uc7a1\ub294 \uc784\uae30\uc751\ubcc0\uc758 \uc9c0\ud61c\ub97c \uc758\ubbf8\ud569\ub2c8\ub2e4. (\u5175\u8005 \u8a6d\u9053\u4e5f; \u80fd\u800c\u793a\u4e4b\u4e0d\u80fd\uff0c\u7528\u800c\u793a\u4e4b\u4e0d\u7528; \u8a08\u5229\u4ee5\u807d\uff0c\u4e43\u70ba\u4e4b\u52e2\uff0c\u4ee5\u4f50\u5176\u5916\u3002\u52e2\u8005\uff0c\u56e0\u5229\u800c\u5236\u6b0a\u4e5f)\n\n3.\t\uc18d\uc804\uc18d\uacb0\uacfc \ud6a8\uc728\uc131: \uc804\uc7c1\uc740 '\uc2b9\ub9ac'\ub97c \uac00\uc7a5 \uadc0\ud558\uac8c \uc5ec\uae30\uba70, \uc624\ub798 \ub044\ub294 \uac83\uc744 \uadc0\ud558\uac8c \uc5ec\uae30\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4. \ub2e4\uc18c \uc11c\ud22c\ub974\ub354\ub77c\ub3c4 \uc2e0\uc18d\ud558\uac8c \uacb0\ud310\uc744 \ub0b4\ub294 \uac83\uc774 \uc911\uc694\ud558\uba70, \uc804\uc7c1\uc774 \uc624\ub798 \uc9c0\uc18d\ub418\uc5b4 \uad6d\uac00\uc5d0 \uc774\ub85c\uc6b4 \uacbd\uc6b0\ub294 \ub2e8 \ud55c \ubc88\ub3c4 \uc5c6\uc5c8\uc2b5\ub2c8\ub2e4. \uc7a5\uae30\uc804\uc740 \ubcd1\uc0ac\ub4e4\uc758 \uc0ac\uae30\ub97c \uaebe\uace0, \uad6d\ub825\uc744 \uc57d\ud654\uc2dc\ud0a4\uba70, \uc790\uc6d0\uc744 \uace0\uac08\uc2dc\ucf1c \uc8fc\ubcc0 \uacbd\uc7c1 \uc138\ub825\uc758 \ub3c4\ubc1c\uc744 \uc790\ucd08\ud569\ub2c8\ub2e4. (\u5176\u7528\u6230\u4e5f\u8cb4\u52dd\uff0c\u4e45\u5247\u920d\u5175\u632b\u92b3; \u592b\u920d\u5175\u632b\u92b3 \u5c48\u529b\u6bab\u8ca8 \u5247\u8af8\u4faf\u4e58\u5176\u5f0a\u800c\u8d77; \u5175\u805e\u62d9\u901f\uff0c\u672a\u7779\u5de7\u4e4b\u4e45\u4e5f\uff1b\u592b\u5175\u4e45\u800c\u570b\u5229\u8005\uff0c\u672a\u4e4b\u6709\u4e5f\u3002)\n\n4.\t\uc704\ud5d8 \uc778\uc9c0\uc640 \uc790\uc6d0 \uc870\ub2ec: \uc804\uc7c1\uc758 \ud574\ub85c\uc6c0\uc744 \uc644\uc804\ud788 \uc54c\uc9c0 \ubabb\ud558\uba74 \uc774\ub85c\uc6c0\ub3c4 \uc628\uc804\ud788 \uc54c \uc218 \uc5c6\uc73c\ubbc0\ub85c, \uc9c0\ud61c\ub85c\uc6b4 \uc7a5\uc218\ub294 \uad6d\ub825 \uc18c\ubaa8\ub97c \uc904\uc774\uace0 \uc774\uc775\uc744 \uadf9\ub300\ud654\ud558\uae30 \uc704\ud574 \uc801\uc5d0\uac8c\uc11c \uc2dd\ub7c9 \ub4f1 \ud544\uc694\ud55c \ubb3c\uc790\ub97c \uc870\ub2ec\ud574\uc57c \ud569\ub2c8\ub2e4. \uc801\uc744 \uc81c\uc555\ud558\ub294 \uac83\uc740 \ubcd1\uc0ac\ub4e4\uc758 **\ud22c\uc9c0(\ubd84\ub178)**\uc5d0 \ub2ec\ub824 \uc788\uc9c0\ub9cc, \uc801\uc758 \uc774\ub85c\uc6c0(\uc790\uc6d0)\uc744 \ucde8\ud558\ub294 \uac83\uc740 **\uc2e4\uc9c8\uc801\uc778 \uc7ac\ud654(\ubb3c\uc790, \ubcf4\uae09\ud488)**\uc5d0 \ub2ec\ub824 \uc788\uc2b5\ub2c8\ub2e4. (\u4e0d\u76e1\u77e5\u7528\u5175\u4e4b\u5bb3\u8005\uff0c\u5247\u4e0d\u80fd\u76e1\u77e5\u7528\u5175\u4e4b\u5229\u4e5f\u3002\u6545\u667a\u5c07\u52d9\u98df\u65bc\u6575; \u6bba\u6575\u8005 \u6012\u4e5f\uff0c\u53d6\u6575\u4e4b\u5229\u8005 \u8ca8\u4e5f)\n\n5.\t\ub9ac\ub354\uc758 \ucc45\uc784: \uc801\uc744 \uc774\uae40\uc73c\ub85c\uc368 \ub354\uc6b1 \uac15\ud574\uc9c8 \uc218 \uc788\uc73c\uba70, \ubcd1\ubc95\uc744 \ud1b5\ub2ec\ud55c \uc7a5\uc218\uc57c\ub9d0\ub85c \ubc31\uc131\uc758 \uc0dd\uba85\uc744 \uc88c\uc6b0\ud558\uace0 \uad6d\uac00\uc758 \uc548\uc704\ub97c \ucc45\uc784\uc9c0\ub294 \uac00\uc7a5 \uc911\uc694\ud55c \uc874\uc7ac\uc785\ub2c8\ub2e4. (\u52dd\u6575\u800c\u76ca\u5f3a\uff0c\u5175\u8cb4\u52dd\uff0c\u4e0d\u8cb4\u4e45\uff0c\u77e5\u5175\u4e4b\u5c07\uff0c\u6c11\u4e4b\u53f8\u547d\uff0c\u570b\u5bb6\u5b89\u5371\u4e4b\u4e3b\u4e5f)\n\n",null,B.a,null,B.c)
