B.a7L=new A.a("\uc885\ud569\uc801\uc73c\ub85c \uc190\uc790\ubcd1\ubc95\uc740 \uc804\uc7c1(\uacbd\uc7c1)\uc744 \uc2dc\uc791\ud558\uae30 \uc804\uc758 \ucca0\uc800\ud55c \ubd84\uc11d\uacfc \uc900\ube44, \uc804\uc7c1 \uc911\uc758 \uce58\ubc00\ud55c \uae30\ub9cc \uc804\uc220\uacfc \uc720\uc5f0\ud55c \ub300\uc751, \ub2e8\uae30\uac04 \ub0b4\uc758 \ud6a8\uc728\uc801\uc778 \uc2b9\ub9ac \ucd94\uad6c, \uadf8\ub9ac\uace0 \uc774 \ubaa8\ub4e0 \uac83\uc744 \ucd1d\uad04\ud558\ub294 \ub9ac\ub354\uc758 \ub0c9\ucca0\ud55c \ud310\ub2e8\ub825\uacfc \ub9c9\uc911\ud55c \ucc45\uc784\uac10\uc744 \uac00\uc7a5 \uc911\uc694\ud558\uac8c \uac15\uc870\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
B.aoK=new A.a("\uc804\uc7c1\uc740 \uad6d\uc6b4\uc744 \uac74 \uc0dd\uc0ac \uac08\ub9bc\uae38, \ubaa8\ub4e0 \uc804\uc220\uc740 \uc18d\uc784\uc218\uc758 \uc5f0\uc18d\uc774\ub2e4. \ub300\uc758\uba85\ubd84, \ud658\uacbd, \uc9c0\ud615, \uc9c0\ud718\uad00, \uc2dc\uc2a4\ud15c\uc744 \uae30\ubcf8\uc73c\ub85c, 7\ub300 \uc804\ub825\uc744 \ucca0\uc800\ud788 \ube44\uad50 \ubd84\uc11d\ud558\ub77c. \uc555\ub3c4\uc801 \uc804\ub825\uc774 \uc788\uc5b4\ub3c4 \uc5c6\ub294 \ucc99, \uacf5\uaca9 \uae30\ud68c\uc5d0\ub3c4 \ub9dd\uc124\uc774\ub294 \ucc99\ud558\uba70, \uc720\ub9ac\ud55c \ud615\uc138\ub97c \ub9cc\ub4e4\uc5b4 \uc804\uc7a5\uc744 \uc9c0\ubc30\ud558\ub77c! \ud604\ub300\uc804\uc740 \uc11c\ud234\ub7ec\ub3c4 \uc2e0\uc18d\ud788 \ub05d\ub0b4\ub77c! \uc7a5\uae30\uc804\uc740 \uad6d\ub825 \uc18c\ubaa8\uc640 \uc8fc\ubcc0\uad6d\uc758 \ub3c4\ubc1c\uc744 \uc790\ucd08\ud558\uba70 \uacb0\ucf54 \uad6d\uac00\uc5d0 \uc774\ub86d\uc9c0 \uc54a\ub2e4! \uc804\uc7c1\uc758 \ud3d0\ud574\ub97c \uc54c\uc544\uc57c \uc2b9\ub9ac\ud55c\ub2e4! \ud604\uba85\ud55c \uc7a5\uc218\ub294 \uc801\uc758 \ubcf4\uae09\uc744 \ub04a\uace0 \ud604\uc9c0\uc5d0\uc11c \uc870\ub2ec\ud55c\ub2e4! \uad70\uc0ac\uc758 \uc0ac\uae30\uac00 \uc801\uc744 \uc81c\uc555\ud558\uace0, \uc801\uc758 \ubb3c\uc790\uac00 \uc804\uc7a5\uc758 \ubcf4\uae09\uc744 \ucc45\uc784\uc9c4\ub2e4! \uc2b9\ub9ac\ub85c \ub354\uc6b1 \uac15\ud574\uc9c0\uace0, \uc18d\uc804\uc18d\uacb0\uc774 \uc2b9\ub9ac\uc758 \uae38\uc774\ub2e4! \ubcd1\ubc95\uc744 \uc544\ub294 \uc9c0\ud718\uad00\uc774 \uad6d\ubbfc\uc758 \uc0dd\uba85\uacfc \uad6d\uac00 \uc548\uc704\ub97c \ucc45\uc784\uc9c4\ub2e4!\n\n",null,B.a,null,B.c)
B.ayY=new A.a("\uc0ac\uc5c5\uc740 \uae30\uc5c5\uc758 \uc874\ub9dd\uc774 \uac78\ub9b0 \uc804\uc7c1, \ubaa8\ub4e0 \uc804\ub7b5\uc740 \uc5ed\ubc1c\uc0c1\uc758 \uc5f0\uc18d\uc774\ub2e4. \ube44\uc804, \uc2dc\uc7a5, \ud658\uacbd, \ub9ac\ub354, \uc2dc\uc2a4\ud15c\uc744 \uae30\ubcf8\uc73c\ub85c, 7\ub300 \uacbd\uc7c1\ub825\uc744 \ucca0\uc800\ud788 \ube44\uad50 \ubd84\uc11d\ud558\ub77c. \uc555\ub3c4\uc801 \uae30\uc220\uc774 \uc788\uc5b4\ub3c4 \uacb8\uc190\ud55c \ucc99, \uacf5\uaca9 \ud22c\uc790 \uae30\ud68c\uc5d0\ub3c4 \uad00\ub9dd\ud558\ub294 \ucc99\ud558\uba70, \uc720\ub9ac\ud55c \uc2dc\uc7a5 \ud658\uacbd\uc744 \ub9cc\ub4e4\uc5b4 \uacbd\uc7c1\uc744 \uc8fc\ub3c4\ud558\ub77c! \ube44\uc988\ub2c8\uc2a4 \uacbd\uc7c1\uc740 \uc11c\ud234\ub7ec\ub3c4 \ube60\ub974\uac8c \ucd9c\uc2dc\ud558\ub77c! \ud504\ub85c\uc81d\ud2b8 \uc9c0\uc5f0\uc740 \uacb0\ucf54 \uae30\uc5c5\uc5d0 \uc774\ub86d\uc9c0 \uc54a\ub2e4! \uc2dc\uc7a5 \uc704\ud5d8\uc744 \uc54c\uc544\uc57c \uc131\uacf5\ud55c\ub2e4! \ud604\uba85\ud55c CEO\ub294 \uacbd\uc7c1\uc0ac\uc758 \uc57d\uc810\uc744 \ud65c\uc6a9\ud558\uace0 \ube44\uc6a9\uc744 \ucd5c\uc18c\ud654\ud55c\ub2e4! \uc9c1\uc6d0 \uc5f4\uc815\uc774 \uacbd\uc7c1\uc790\ub97c \uc555\ub3c4\ud558\uace0, \uacbd\uc7c1\uc0ac\uc758 \uc57d\uc810 \uc774\uc6a9\uc774 \uae30\uc5c5\uc758 \uc774\uc775\uc744 \ucc3d\ucd9c\ud55c\ub2e4! \uc2dc\uc7a5 \uc2b9\ub9ac\uac00 \uace7 \uae30\uc5c5\uc758 \uc131\uc7a5\uc774\ub2e4! \uc0ac\uc5c5\uc740 \uc18d\uc804\uc18d\uacb0\ub85c \uc131\uacf5\ud574\uc57c \ud55c\ub2e4! \uc804\ub7b5\uc744 \uc544\ub294 CEO\uac00 \uc9c1\uc6d0\uacfc \uae30\uc5c5\uc758 \ud765\ub9dd\uc744 \ucc45\uc784\uc9c4\ub2e4!\n\n",null,B.a,null,B.c)
B.awi=new A.a("\uacbd\uae30\ub294 \ud300\uc758 \uc6b4\uba85\uc774 \uac78\ub9b0 \uc2b9\ubd80\ucc98, \ubaa8\ub4e0 \ud50c\ub808\uc774\ub294 \uc18d\uc784\uc218\uc758 \uc5f0\uc18d\uc774\ub2e4. \ud300 \ucca0\ud559, \ub0a0\uc528, \ud648 \uc774\uc810, \uac10\ub3c5, \uaddc\uc728\uc744 \uae30\ubcf8\uc73c\ub85c, 7\ub300 \uc804\ub825\uc744 \ucca0\uc800\ud788 \ube44\uad50 \ubd84\uc11d\ud558\ub77c. \uc5d0\uc774\uc2a4\uc758 \uae30\ub7c9\uc744 \uc228\uae30\uace0, \uc8fc\ub825 \uc804\uc220\uc744 \uc704\uc7a5\ud558\uba70, \uc720\ub9ac\ud55c \ud750\ub984\uc744 \ub9cc\ub4e4\uc5b4 \uacbd\uae30\ub97c \uc9c0\ubc30\ud558\ub77c! \uacbd\uae30\ub294 \uc11c\ud234\ub7ec\ub3c4 \uc18d\ub3c4\uc804\uc744 \ud3bc\uccd0\ub77c! \uc2b9\ubd80\uac00 \uae38\uc5b4\uc9c0\uba74 \uacb0\ucf54 \ud300\uc5d0 \uc774\ub86d\uc9c0 \uc54a\ub2e4! \uacbd\uae30 \uc704\ud5d8\uc744 \uc54c\uc544\uc57c \uc2b9\ub9ac\ud55c\ub2e4! \ud604\uba85\ud55c \uac10\ub3c5\uc740 \uc0c1\ub300\uc758 \uc2e4\uc218\ub97c \uc720\ub3c4\ud558\uace0 \uc5d0\ub108\uc9c0 \uc18c\ubaa8\ub97c \uc904\uc778\ub2e4! \uc120\uc218 \ud22c\uc9c0\uac00 \uc0c1\ub300\ub97c \uc81c\uc555\ud558\uace0, \uc0c1\ub300\uc758 \uc2e4\uc218 \uc720\ub3c4\uac00 \ud300\uc758 \uae30\ud68c\ub97c \ub9cc\ub4e0\ub2e4! \uacbd\uae30 \uc2b9\ub9ac\uac00 \uace7 \ud300\uc758 \uc804\ub825 \uac15\ud654\ub2e4! \uacbd\uae30\ub294 \uc18d\uc804\uc18d\uacb0\ub85c \ub05d\ub0b4\ub77c! \uc804\uc220\uc744 \uc544\ub294 \uac10\ub3c5\uc774 \uc120\uc218\uc640 \ud300\uc758 \uc6b4\uba85\uc744 \ucc45\uc784\uc9c4\ub2e4!\n\n",null,B.a,null,B.c)
