B.adx=new A.a(" 1. \uc131\uacfc \ubc30\ubd84\uc758 \uc911\uc694\uc131: \uc9c1\uc811\uc801\uc778 \uad70\uc0ac\uc801 \ubaa9\ud45c \ub2ec\uc131 \uc678\uc5d0, \ubcd1\uc0ac\ub4e4\uc758 \uc0ac\uae30\ub97c \ub192\uc774\uace0 \ub3d9\uae30\ub97c \ubd80\uc5ec\ud558\uae30 \uc704\ud55c \uc804\ub9ac\ud488 \ubc30\ubd84\uacfc \uac19\uc740 \uc2e4\uc9c8\uc801\uc778 \ubcf4\uc0c1\uc774 \uc911\uc694\ud569\ub2c8\ub2e4.\n\n  2. \uc9c0\uc18d \uac00\ub2a5\ud55c \uc774\ub4dd \ucd94\uad6c: \ub2e8\uae30\uc801\uc778 \uc57d\ud0c8\uc744 \ub118\uc5b4 \uc601\ud1a0 \ud655\uc7a5 \ubc0f \uad00\ub9ac\uc640 \uac19\uc740 \uc7a5\uae30\uc801\uc778 \uc774\ub4dd \ucc3d\ucd9c \ubc29\uc548\ub3c4 \ud568\uaed8 \uace0\ub824\ud574\uc57c \ud569\ub2c8\ub2e4.\n\n  3. \uad8c\ubaa8\uc220\uc218\uc758 \ud65c\uc6a9: \uace0\uc815\ub41c \uc6d0\uce59\uc5d0 \uc5bd\ub9e4\uc774\uc9c0 \uc54a\uace0, \uc0c1\ud669\uc758 \ubcc0\ud654\uc5d0 \ub530\ub77c \uac00\uc7a5 \uc720\ub9ac\ud55c \ubc29\ubc95\uc73c\ub85c \uc784\uae30\uc751\ubcc0(\uad8c\ub3c4)\uc744 \ubc1c\ud718\ud558\ub294 \uc9c0\ud61c\uac00 \ud544\uc694\ud569\ub2c8\ub2e4.\n\n  4. \uc138\uc2ec\ud55c \ud310\ub2e8\uacfc \uc2e4\ud589: \ubaa8\ub4e0 \ud589\ub3d9\uc5d0 \uc55e\uc11c \ub4dd\uacfc \uc2e4, \uae30\ud68c\uc640 \uc704\ud5d8\uc744 \uba74\ubc00\ud788 \uc800\uc6b8\uc9c8\ud558\uace0 \ud5e4\uc544\ub824 \uc2e0\uc911\ud558\uac8c \uc6c0\uc9c1\uc5ec\uc57c \ud569\ub2c8\ub2e4.\n\n  5. \uc774\ud574\uad00\uacc4 \uc870\uc808: \uad70\uc0ac\uc801 \ud589\ub3d9\uc774 \ub2e8\uc21c\ud55c \uc2b9\ub9ac\ub97c \ub118\uc5b4, \ucc38\uc5ec\uc790\ub4e4\uc758 \uc2e4\uc9c8\uc801\uc778 \uc774\ub4dd\uacfc \uc5f0\uacb0\ub418\uc5b4\uc57c \ud568\uc744 \uc2dc\uc0ac\ud569\ub2c8\ub2e4.\n\n ",null,B.a,null,B.c)
