B.a89=new A.a("\u318d\u5c07\u8005(ji\xe0ng zh\u011b): A general (one who commands an army, a commander). \n\u318d\u570b\u4e4b\u8f14\u4e5f(gu\xf3 zh\u012b f\u01d4 y\u011b): The nation is assisted by the general (a general is the nation's assistant). \n\u318d\u8f14\u5468(f\u01d4 zh\u014du): If the assistance is thorough (if the assistance is meticulous). \n\u318d\u5247\u570b\u5fc5\u5f3a(z\xe9 gu\xf3 b\xec qi\xe1ng): Then the nation will surely be strong. \n\u318d\u8f14\u9699(f\u01d4 x\xec): If the assistance is lax (if there is a flaw in the assistance). \n\u318d\u5247\u570b\u5fc5\u5f31(z\xe9 gu\xf3 b\xec ru\xf2): Then the nation will surely be weak. \n\n",null,B.a,null,B.c)
B.awp=new A.a("\u201cA general is the assistant of the nation. If their assistance is thorough and solid, the nation will surely be strong, but if the general's assistance is lax or unfaithful, the nation will inevitably be weak.\u201d",null,B.a,null,B.c)
