B.acH=new A.a("This classifies the targets of fire attack into five specific categories, implying that the purpose and effect of fire attack differ depending on the target.  \n\n",null,B.a,null,B.c)
B.ach=new A.a(" 1.\t\u706b\u4eba (Burning Personnel): Setting fire to people (soldiers). The purpose is to directly inflict casualties on the enemy and demoralize them by instilling fear. \n\n 2.\t\u706b\u7a4d (Burning Stores): Setting fire to accumulated supplies (provisions, stored goods). The purpose is to paralyze the enemy's long-term war-fighting capability and cut off their supply. \n\n 3.\t\u706b\u8f1c (Burning Transport): Setting fire to moving supplies (carts, transport vehicles). The purpose is to cause chaos by disrupting the supply necessary for the enemy's short-term operations. \n\n 4.\t\u706b\u5eab (Burning Arsenals): Setting fire to storehouses (arsenals). The purpose is to weaken the enemy's power by destroying war materials such as weapons, ammunition, and equipment. \n\n 5.\t\u706b\u968a (Burning Formations): Setting fire to formations (troops' ranks, encampments). The purpose is to break the enemy's organized defense, cause confusion, and inflict direct damage on massed troops. \n\n",null,B.a,null,B.c)
