B.avJ=new A.a(" 1.\tObjective-Oriented Attack: Maximizing strategic effect comes not from indiscriminate burning but from defining what is to be destroyed. Attack objectives must be clearly set. \n\n 2.\tDestruction of Supplies and Resources: The outcome of war ultimately depends on supply and resource acquisition capabilities. Destroying enemy supply lines and materials can be more devastating than direct combat. \n\n 3.\tPsychological Warfare and Inducing Chaos: Fire attack is a powerful tool for psychological warfare, causing fear and confusion among enemy troops, thereby lowering their morale, in addition to physical damage. \n\n 4.\tWeakening Combat Power: Fire attack is used to weaken various components of combat power, such as enemy personnel, materials, and organization. \n\n",null,B.a,null,B.c)
