B.ahI=new A.a(" 1. \uc8fc\ub3c4\uad8c \uc7a5\uc545: \uc804\ud22c\uc5d0\uc11c \uc2b9\ub9ac\ud558\ub824\uba74 \ud56d\uc0c1 \uc544\uad70\uc774 \uc8fc\ub3c4\uad8c\uc744 \uc950\uace0 \uc801\uc744 \ud1b5\uc81c\ud574\uc57c \ud569\ub2c8\ub2e4. \uc801\uc5d0\uac8c \ub04c\ub824\ub2e4\ub2c8\ub294 \uc218\uc138\uc801\uc778 \uc790\uc138\ub85c\ub294 \uc2b9\ub9ac\ud558\uae30 \uc5b4\ub835\uc2b5\ub2c8\ub2e4.\n\n 2. \uc804\uc7a5 \uc124\uc815: \uc544\uad70\uc774 \uc2f8\uc6b8 \uc7a5\uc18c\uc640 \uc2dc\uae30\ub97c \ub2a5\ub3d9\uc801\uc73c\ub85c \uc120\ud0dd\ud558\uace0 \uc124\uc815\ud560 \uc218 \uc788\uc5b4\uc57c \ud569\ub2c8\ub2e4. \uc774\ub294 \uc801\uc744 \ubd88\ub9ac\ud55c \uc9c0\ud615\uc774\ub098 \uc608\uce21 \ubd88\uac00\ub2a5\ud55c \uc0c1\ud669\uc73c\ub85c \uc720\uc778\ud558\ub294 \uac83\uc744 \ud3ec\ud568\ud569\ub2c8\ub2e4.\n\n 3. \uae30\ub9cc\uacfc \uc720\uc778: \uc801\uc758 \uc2ec\ub9ac\uc640 \uc695\ub9dd\uc744 \uc774\uc6a9\ud558\uc5ec \uc801\uc774 \uc790\ubc1c\uc801\uc73c\ub85c \uc544\uad70\uc758 \uacc4\ud68d\uc5d0 \ub530\ub974\ub3c4\ub85d \uc720\ub3c4\ud558\ub294 \uac83\uc774 \uc911\uc694\ud569\ub2c8\ub2e4.\n\n 4. \uc815\ubcf4 \uc6b0\uc704: \uc801\uc758 \uc758\ub3c4\uc640 \ud568\uc815\uc744 \uac04\ud30c\ud558\uace0, \uadf8\ub4e4\uc758 \uc6c0\uc9c1\uc784\uc744 \uc608\uce21\ud560 \uc218 \uc788\ub294 \uc815\ud655\ud55c \uc815\ubcf4\uc640 \ubd84\uc11d \ub2a5\ub825\uc774 \ud544\uc218\uc801\uc785\ub2c8\ub2e4.\n\n 5. \ud754\ub4e4\ub9ac\uc9c0 \uc54a\ub294 \uc6d0\uce59: \uc544\ubb34\ub9ac \uc801\uc774 \uc720\ud639\ud558\uac70\ub098 \ub3c4\ubc1c\ud574\ub3c4, \uc544\uad70\uc740 \uc790\uc2e0\ub9cc\uc758 \uc804\ub7b5\uc801 \uc6d0\uce59\uacfc \ubaa9\ud45c\uc5d0 \ucda9\uc2e4\ud558\uba70 \ud754\ub4e4\ub9ac\uc9c0 \uc54a\ub294 \uc778\ub0b4\uc2ec\uc744 \uac00\uc838\uc57c \ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
