B.aea=new A.a("\ud83d\udcda 4: Tacktical dispositions(\u8ecd\u5f62) \u2013 4\n",null,B.a,null,B.m)
B.ayT=new A.a("\u318d\u4e00\u66f0 \u5ea6(y\u012b yu\u0113 d\xf9): First, Du (\u5ea6), measuring the terrain or distance of the battlefield\n\u318d\u4e8c\u66f0 \u91cf(\xe8r yu\u0113 li\xe0ng): Second, Liang (\u91cf), weighing the quantity of troops or resources \n\u318d\u4e09\u66f0 \u6578(s\u0101n yu\u0113 sh\xf9): Third, Shu (\u6578), calculating numerical values such as the number of soldiers or combat power \n\u318d\u56db\u66f0 \u7a31(s\xec yu\u0113 ch\u0113ng): Fourth, Cheng (\u7a31), gauging the situation by comparing with the enemy \n\u318d\u4e94\u66f0 \u52dd(w\u01d4 yu\u0113 sh\xe8ng): Fifth, Sheng (\u52dd), judging whether victory is possible  \n\n ",null,B.a,null,B.c)
B.anJ=new A.a("\u201cBefore engaging in war, one must first assess: first, the extent of the terrain (\u5ea6); second, the volume of supplies (\u91cf); third, the number of troops (\u6578); fourth, the balance of power (\u7a31); and fifth, the possibility of victory (\u52dd)\u201d",null,B.a,null,B.c)
