B.agy=new A.a("This passage explains that the five core elements constituting victory are in a continuous and causal relationship. This is not a mere enumeration, but rather presents logical steps for war preparation and execution.\n\n",null,B.a,null,B.c)
B.a6j=new A.a("1.\t\u5ea6 (Du - Extent of Terrain/Spatial Scale): Refers to the spatial background of the battlefield. The breadth and characteristics of the battlefield (mountains, plains, rivers, etc.) directly influence the deployment of troops and the difficulty of logistics.  \n\n2.\t\u91cf (Liang - Volume of Supplies/Logistics): Once the extent of the battlefield is determined, the amount of supplies (food, weapons, equipment, etc.) needed to operate troops within that area is measured. Sufficient supply is directly linked to the ability to sustain a prolonged war. \n\n3.\t\u6578 (Shu - Number of Troops): If the necessary volume of supplies can be secured, the number of deployable troops is determined based on this. The number of troops represents the basic capability for waging war. \n\n4.\t\u7a31 (Cheng - Balance of Power/Comparative Advantage): All elements\u2014terrain, supplies, and number of troops\u2014are integrated to compare the forces of one's own side and the enemy, and to weigh which side holds a relative advantage. This assessment of the 'situation' becomes a decisive factor in determining victory. \n\n5.\t\u52dd (Sheng - Victory): Based on these four elements (\u5ea6, \u91cf, \u6578, \u7a31), when a favorable 'disposition (\u5f62)' is created, ultimate 'victory' can be achieved. This means that victory is not by chance but the result of thorough analysis and preparation.\n\n",null,B.a,null,B.c)
B.KB=s([B.agy,B.a6j],t.R)
