B.ac_=new A.a("\ud83d\udcda 3: Attack by Stratagem(\u8b00\u653b) \u2013 Summary\n",null,B.a,null,B.m)
B.adO=new A.a("The 'Attack by Stratagem(\u8b00\u653b)' chapter emphasizes that war (competition) aims to minimize losses and achieve victory through supreme wisdom, and to this end, strategic depth, the commander's capability, and the importance of information must be maximized. Beyond simply winning battles, winning without fighting is considered the most ideal victory, and the role of the leader is decisive in achieving this. \n\n",null,B.a,null,B.t)
B.aiP=new A.a("It views war as a grave matter determining the rise and fall of nations, emphasizing advanced strategy and wisdom beyond mere armed conflict. In summary:\n\n",null,B.a,null,B.c)
B.awZ=new A.a("1.\tUltimate Victory Goal: Preserving the enemy nation intact rather than destroying it is paramount, and to achieve this, 'winning without fighting' by subduing the enemy is considered the highest value. Winning a hundred battles in a hundred engagements may seem excellent on the surface, but it is not the best option considering the wear and tear and damage incurred in the process. \n\n2.\tPriority of Strategy: For winning without fighting, 'schemes and cunning (\u4f10\u8b00)' are the best approach, followed by 'diplomatic means (\u4f10\u4ea4)', and then direct use of troops (\u4f10\u5175). The worst option to avoid is 'siege warfare (\u653b\u57ce)', as it entails immense losses. \n\n3.\tFlexible Response Based on Troop Size: Accurately comparing the size of one's own forces with the enemy's requires flexible strategies appropriate to the situation. It emphasizes wise judgment to minimize losses, such as encircling or attacking when overwhelmingly superior, and avoiding or fleeing when equal or inferior. \n\n4.\tImportance of Leadership: A general (leader) is the assistant of the nation or organization; if their ability and judgment are perfect, the organization strengthens, but if there are flaws, it weakens. Furthermore, a leader must accurately assess the field situation, respect professionalism, and delegate authority commensurate with responsibility. Orders given without knowing the field, unprofessional interference, and responsibility without authority cause confusion and distrust within the organization. \n\n5.\tFive Conditions for Victory: Key conditions for success include the wisdom to know when to fight and when to avoid, the art of troop deployment based on strength, the united will of all organizational members, thorough prior preparation, and the supreme decision-maker's trust and non-interference with a capable field leader. \n\n6.\tFundamental Principle of Victory: Underlying all of this is 'knowing the enemy and knowing oneself (\u77e5\u5f7c\u77e5\u5df1)', meaning accurately understanding the opponent and objectively understanding oneself. This allows one to be 'never imperiled in a hundred battles (\u767e\u6230\u4e0d\u6b86)', always maintaining the initiative in a favorable position and minimizing risks. \n\n",null,B.a,null,B.c)
B.IT=s([B.ac_,B.adO,B.aiP,B.awZ],t.R)
