B.aaI=new A.a("\u318d \u80fd\u800c (n\xe9ng \xe9r): \ub2a5\ud558\ub418 \uc5ec\ub825\uc774 \uc788\ub294, \uc544\uc9c1\uae4c\uc9c0\ub294\n\u318d \u793a\u4e4b\u4e0d\u80fd (sh\xec zh\u012b b\xf9 n\xe9ng): \uadf8\uac83\uc744 \uc801\uc5d0\uac8c \u201c\ub2a5\ud558\uc9c0 \uc54a\uc740 \uac83\ucc98\ub7fc\u201d \ubcf4\uc774\uac8c \ud558\ub77c\n\u318d \u7528\u800c (y\xf2ng \xe9r): \uc2e4\uc81c\ub85c \uc0ac\uc6a9\ud558\uba74\uc11c\ub3c4\n\u318d \u793a\u4e4b\u4e0d\u7528 (sh\xec zh\u012b b\xf9 y\xf2ng): \uc0ac\uc6a9\ud558\uc9c0 \uc54a\ub294 \uac83\ucc98\ub7fc \ubcf4\uc774\uac8c \ud558\ub77c.\n\n",null,B.a,null,B.c)
