B.amL=new A.a("1.\t\ub2a5\ub825\uc758 \uac10\ucda4: \uc2e4\uc81c\ub85c \ub2a5\ub825\uc774 \ub6f0\uc5b4\ub098\uac70\ub098 \uac15\uc810\uc774 \uc788\uc74c\uc5d0\ub3c4 \ubd88\uad6c\ud558\uace0, \uc774\ub97c \uc228\uae30\uace0 \uc57d\ud558\uac70\ub098 \ub2a5\ub825\uc774 \uc5c6\ub294 \uac83\ucc98\ub7fc \uac00\uc7a5\ud558\uc5ec \uc801\uc744 \ubc29\uc2ec\ud558\uac8c \ub9cc\ub4e4\uac70\ub098, \uc544\uad70\uc758 \uc9c4\uc9dc \uac15\uc810\uc744 \uc608\uc0c1\ud558\uc9c0 \ubabb\ud558\uac8c \ud569\ub2c8\ub2e4.\n\n2.\t\uc758\ub3c4\uc758 \uc704\uc7a5: \ubcd1\ub825\uc774\ub098 \uc804\uc220\uc744 \ud65c\uc6a9\ud560 \uc218 \uc788\ub294 \uc0c1\ud669\uc784\uc5d0\ub3c4 \ubd88\uad6c\ud558\uace0, \uc774\ub97c \ud65c\uc6a9\ud558\uc9c0 \uc54a\ub294 \uac83\ucc98\ub7fc \uc704\uc7a5\ud558\uc5ec \uc801\uc5d0\uac8c \uc544\uad70\uc758 \uc758\ub3c4\ub97c \uc624\ud310\ud558\uac8c \ub9cc\ub4ed\ub2c8\ub2e4. \uacf5\uaca9\ud560 \uc218 \uc788\ub294\ub370\ub3c4 \uacf5\uaca9\ud558\uc9c0 \uc54a\ub294 \uac83\ucc98\ub7fc \ubcf4\uc5ec \uc801\uc758 \uacbd\uacc4\ub97c \ub2a6\ucd94\uac8c \ud558\uac70\ub098, \ub2e4\ub978 \uc758\ub3c4\uac00 \uc788\ub294 \uac83\ucc98\ub7fc \ucc29\uac01\ud558\uac8c \ub9cc\ub4ed\ub2c8\ub2e4.\n\n3.\t\ud5c8\uc640 \uc2e4\uc758 \uc6b4\uc6a9: \uc790\uc2e0\uc758 \uc9c4\uc815\ud55c \uc2e4\ub825\uacfc \uc758\ub3c4\ub97c \uac10\ucdb0 '\ud5c8(\u865b)'\ub97c \ubcf4\uc5ec\uc90c\uc73c\ub85c\uc368 \uc801\uc5d0\uac8c '\uc2e4(\u5be6)'\uc744 \ub178\ucd9c\ud558\uac8c \uc720\ub3c4\ud558\uace0, \uadf8 \ud5c8\uc810\uc744 \ucc0c\ub974\ub294 \uae30\ub9cc \uc804\ub7b5\uc758 \uae30\ubcf8\uc744 \uc774\ub8f9\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
