B.agq=new A.a("\ud83d\udcda 13: The Use of Spies(\u7528\u9593) \u2013 Summary \n",null,B.a,null,B.m)
B.anO=new A.a("Sun Tzu's Art of War, Chapter on Using Spies (\u7528\u9593), emphasizes that information and intelligence activities are the most crucial factors determining the outcome of war. \n\n ",null,B.a,null,B.t)
B.auX=new A.a("Sun Tzu explains the fundamental methods and importance of information acquisition, and the role of the leader in executing them, as follows: \n\n",null,B.a,null,B.c)
B.aA6=new A.a(" 1.\tKey to Success is 'Foreknowledge (\u5148\u77e5)': Outstanding success stems from knowing in advance. This 'foreknowledge' cannot be obtained through superstition, overt phenomena, or statistical figures; it must be obtained through 'people' to ascertain 'the enemy's true situation.' \n\n 2.\tFive Types of Spy Utilization: There are five types of intelligence activities: native spies (\u56e0\u9593) who utilize locals, internal spies (\u5167\u9593) who recruit individuals from within the enemy, converted spies (\u53cd\u9593) who counter-use enemy spies, doomed spies (\u6b7b\u9593) who mislead the enemy by leaking false information, and surviving spies (\u751f\u9593) who collect information and return directly. Various types of spies must be employed according to their purpose. \n\n 3.\tAbsolute Importance of Intelligence Activities: Among all military activities, none are as important and intimate as intelligence activities, and spies who bring information should be rewarded most generously. Furthermore, intelligence activities must be conducted with the utmost secrecy. \n\n 4.\tImportance of Detailed Human Intelligence: When attacking any target (army, city, specific person), beyond merely troop strength, one must ascertain the 'names' of the defending general and key aides in advance, making them specific targets for intelligence activities. \n\n 5.\tLeader's Role and Information Warfare: Only an enlightened and wise ruler and general can utilize the most intelligent individuals in intelligence activities, and through this, they will surely achieve great success. Intelligence activity is the essence of military art and the foundation upon which the entire army relies to move. \n\n In conclusion, Sun Tzu's Art of War regards information as the most fundamental element of war, emphasizing investment in systematic and diverse intelligence activities for accurate information acquisition, and making it the top priority of leadership. \n\n",null,B.a,null,B.c)
