B.az8=new A.a("  \u2022 \u6545(g\xf9): \uadf8\ub7ec\ubbc0\ub85c, \uadf8\ub798\uc11c \n  \u2022 \u7528\u9593(y\xf2ng ji\xe0n): \uac04\ucca9(\ucca9\uc790)\uc744 \uc0ac\uc6a9\ud568 \n  \u2022 \u6709\u4e94(y\u01d2u w\u01d4): \ub2e4\uc12f \uac00\uc9c0\uac00 \uc788\uc74c \n  \u2022 \u56e0\u9593(y\u012bn ji\xe0n): \uc801\uc758 \uac04\ucca9\uc744 \ud3ec\uc12d\ud574 \uc0ac\uc6a9\ud568 \n  \u2022 \u5167\u9593(n\xe8i ji\xe0n): \uc801\uad6d \ub0b4\ubd80 \uc778\ubb3c\uc744 \ub9e4\uc218\ud574 \uc2a4\ud30c\uc774\ub85c \uc0bc\uc74c \n  \u2022 \u53cd\u9593(f\u01cen ji\xe0n): \uc801\uc774 \ubcf4\ub0b8 \uac04\ucca9\uc744 \uc5ed\uc774\uc6a9\ud568 (\uc774\uc911\uac04\ucca9) \n  \u2022 \u6b7b\u9593(s\u01d0 ji\xe0n): \ud5c8\uc704 \uc815\ubcf4\ub97c \uc8fc\uace0 \ud76c\uc0dd\uc2dc\ucf1c \uc801\uc744 \uc18d\uc774\ub294 \uac04\ucca9 \n  \u2022 \u751f\u9593(sh\u0113ng ji\xe0n): \uc815\ubcf4\ub97c \uc218\uc9d1\ud558\uace0 \uc0b4\uc544 \ub3cc\uc544\uc624\ub294 \uac04\ucca9 \n\n ",null,B.a,null,B.c)
