B.asK=new A.a(" 1. \u56e0\u9593: \uc801\uc758 \ud5a5\ud1a0\ubbfc(\ud604\uc9c0\uc778)\uc744 \uc774\uc6a9\ud558\ub294 \uac04\ucca9. \uc801\uc758 \uc9c0\ub9ac, \ud48d\uc2b5, \uc778\uc2ec, \ubcd1\ub825 \ub3d9\ud5a5 \ub4f1 \ud604\uc9c0 \uc0ac\uc815\uc5d0 \ub300\ud55c \uc815\ubcf4\ub97c \uc5bb\ub294 \ub370 \uc8fc\ub85c \ud65c\uc6a9\ub429\ub2c8\ub2e4. \uc801\uc758 \uc77c\ubc18 \uc8fc\ubbfc\uc744 \uc774\uc6a9\ud558\uc5ec \uc815\ubcf4\ub97c \ud68d\ub4dd\ud558\ub294 \uc720\ud615\uc785\ub2c8\ub2e4. \n\n 2. \u5167\u9593: \uc801\uc758 \uad00\ub9ac\ub97c \uc774\uc6a9\ud558\ub294 \uac04\ucca9. \uc801\uc758 \ub0b4\ubd80 \uace0\uc704 \uc778\uc0ac\ub098 \uad00\ub9ac, \ubcd1\uc0ac\ub4e4\uc744 \ub9e4\uc218\ud558\uac70\ub098 \ud68c\uc720\ud558\uc5ec \uc801\uc758 \ud575\uc2ec \uc804\ub7b5, \uba85\ub839 \uccb4\uacc4, \ub0b4\ubd80 \uc0c1\ud669 \ub4f1 \uace0\uae09 \uc815\ubcf4\ub97c \ud68d\ub4dd\ud558\ub294 \ub370 \ud65c\uc6a9\ub429\ub2c8\ub2e4. \n\n 3. \u53cd\u9593: \uc801\uc758 \uac04\ucca9\uc744 \uc5ed\uc774\uc6a9\ud558\ub294 \uac04\ucca9. \uc801\uc774 \uc6b0\ub9ac\uc5d0\uac8c \uc2ec\uc740 \uac04\ucca9\uc744 \uc5ed\uc73c\ub85c \ud3ec\uc12d\ud558\uac70\ub098, \uac70\uc9d3 \uc815\ubcf4\ub97c \ud758\ub824 \uc801\uc5d0\uac8c \ud63c\ub780\uc744 \uc8fc\uac70\ub098, \uc801\uc758 \ub0b4\ubd80 \uc0ac\uc815\uc744 \uc54c\uc544\ub0b4\ub294 \ub370 \ud65c\uc6a9\ub429\ub2c8\ub2e4. \uac00\uc7a5 \uace0\ucc28\uc6d0\uc801\uc778 \uac04\ucca9 \ud65c\uc6a9\ubc95 \uc911 \ud558\ub098\uc785\ub2c8\ub2e4. \n\n 4. \u6b7b\u9593: \uc77c\ubd80\ub7ec \uac70\uc9d3 \uc815\ubcf4\ub97c \uac00\uc9c0\uace0 \uc801\uc5d0\uac8c \ubcf4\ub0b4\uc5b4 \uc8fd\uac8c \ub9cc\ub4dc\ub294 \uac04\ucca9. \uc544\uad70\uc758 \uac70\uc9d3 \uc815\ubcf4\ub97c \uc801\uc5d0\uac8c \ubbff\uac8c \ud558\uac70\ub098, \uc801\uc744 \uc624\ub3c4\ud558\uae30 \uc704\ud574 \ud65c\uc6a9\ub429\ub2c8\ub2e4. \uac04\ucca9 \uc790\uc2e0\uc740 \uc801\uc5d0\uac8c \ubc1c\uac01\ub418\uc5b4 \uc8fd\uc744 \uac83\uc744 \uac01\uc624\ud574\uc57c \ud558\ubbc0\ub85c '\uc8fd\uc740 \uac04\ucca9'\uc774\ub77c \ubd88\ub9bd\ub2c8\ub2e4. \n\n 5. \u751f\u9593: \uc0b4\uc544\uc11c \ub3cc\uc544\uc640 \uc815\ubcf4\ub97c \ubcf4\uace0\ud558\ub294 \uac04\ucca9. \uc801\uc9c4\uc5d0 \uce68\ud22c\ud558\uc5ec \uc815\ubcf4\ub97c \uc218\uc9d1\ud55c \ud6c4 \ubb34\uc0ac\ud788 \uc544\uad70\uc5d0\uac8c \ubcf5\uadc0\ud558\uc5ec \ubcf4\uace0\ud558\ub294 \uac04\ucca9\uc785\ub2c8\ub2e4. \uac00\uc7a5 \uc77c\ubc18\uc801\uc774\uace0 \uae30\ubcf8\uc801\uc778 \uac04\ucca9 \uc720\ud615\uc774\uba70, \uc0dd\ud658 \uac00\ub2a5\uc131\uc744 \uc5fc\ub450\uc5d0 \ub461\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
