B.aug=new A.a(" 1. \uc815\ubcf4\uc758 \uc0dd\uba85\ub825: \uc804\uc7c1\uc758 \uc2b9\ud328\ub294 \uc815\ud655\ud55c \uc815\ubcf4 \ud68d\ub4dd\uacfc \ud65c\uc6a9\uc5d0 \ub2ec\ub824 \uc788\uc73c\uba70, \uac04\ucca9\uc740 \uadf8 \ud575\uc2ec\uc801\uc778 \uc218\ub2e8\uc785\ub2c8\ub2e4. \n\n 2. \uc815\ubcf4\uc6d0 \ub2e4\uac01\ud654: \ub2e8\uc21c\ud788 \ud55c\ub450 \uc885\ub958\uc758 \uc815\ubcf4\uc6d0\uc5d0 \uc758\uc874\ud558\ub294 \uac83\uc774 \uc544\ub2c8\ub77c, \ub2e4\uc591\ud55c \uc720\ud615\uc758 \uc815\ubcf4\uc6d0\uc744 \ud65c\uc6a9\ud558\uc5ec \uc5ec\ub7ec \uac01\ub3c4\uc5d0\uc11c \uc815\ubcf4\ub97c \uc218\uc9d1\ud574\uc57c \ud569\ub2c8\ub2e4. \n\n 3. \ub0b4\ubd80 \uc815\ubcf4\uc758 \uc911\uc694\uc131: \uc801\uc758 \ub0b4\ubd80 \uae4a\uc219\ud55c \uacf3(\u5167\u9593)\uc5d0\uc11c \uc5bb\ub294 \uc815\ubcf4\uac00 \uac00\uc7a5 \uc815\ud655\ud558\uace0 \uac00\uce58 \uc788\ub294 \uacbd\uc6b0\uac00 \ub9ce\uc2b5\ub2c8\ub2e4. \n\n 4. \uc5ed\uc815\ubcf4 \ubc0f \uae30\ub9cc \uc791\uc804: \uc801\uc758 \uc815\ubcf4\ub9dd\uc744 \uc5ed\uc774\uc6a9(\u53cd\u9593)\ud558\uac70\ub098 \uac70\uc9d3 \uc815\ubcf4(\u6b7b\u9593)\ub97c \ud758\ub824 \uc801\uc744 \uae30\ub9cc\ud558\ub294 \uac83\uc774 \ud6a8\uacfc\uc801\uc778 \uc804\ub7b5\uc774 \ub420 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \n\n 5. \uc815\ubcf4\uc758 \uc2e0\ub8b0\uc131 \ubc0f \uc0dd\uc874: \uc815\ubcf4\ub97c \ud68d\ub4dd\ud558\ub294 \uac83\uc744 \ub118\uc5b4, **\uc815\ubcf4\uc6d0\uc758 \uc0dd\uc874(\u751f\u9593)**\uacfc \uc815\ubcf4\uc758 \uc2e0\ub8b0\uc131 \ud655\ubcf4 \ub610\ud55c \uc911\uc694\ud569\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
