B.ag1=new A.a(" 1. \ucd08\uac1c\uc778\uc801 \ubaa9\ud45c: \ub9ac\ub354\ub294 \uac1c\uc778\uc758 \uba85\uc608, \uc774\uc775, \uc548\uc704\ub97c \ub118\uc5b4\uc120 \ucd08\uac1c\uc778\uc801\uc778 \ubaa9\ud45c(\uc870\uc9c1\uc758 \uc548\ub155\uacfc \uc774\uc775)\ub97c \ucd5c\uc6b0\uc120\uc73c\ub85c \uc0bc\uc544\uc57c \ud569\ub2c8\ub2e4. \n\n 2. \uac15\ub825\ud55c \ucc45\uc784\uac10: \uc131\uacf5 \uc2dc\uc758 \uc601\uad11\ubfd0 \uc544\ub2c8\ub77c \uc2e4\ud328 \uc2dc\uc758 \ucc45\uc784\uae4c\uc9c0\ub3c4 \uae30\uaebc\uc774 \uac10\uc218\ud558\ub294 \uc790\uc138\uac00 \ud544\uc694\ud569\ub2c8\ub2e4. \n\n 3. \uc870\uc9c1\uc6d0 \ubcf4\ud638\uc758 \ucd5c\uc6b0\uc120: \ub9ac\ub354\uc758 \uac00\uc7a5 \uc911\uc694\ud55c \uc784\ubb34 \uc911 \ud558\ub098\ub294 \uc790\uc2e0\uc774 \uc774\ub044\ub294 \uc870\uc9c1 \uad6c\uc131\uc6d0\ub4e4\uc744 \ubcf4\ud638\ud558\uace0 \uadf8\ub4e4\uc758 \uc548\ub155\uc744 \ucc45\uc784\uc9c0\ub294 \uac83\uc785\ub2c8\ub2e4. \n\n 4. \uc804\uccb4\uc801 \uc774\uc775 \ucd94\uad6c: \ubaa8\ub4e0 \uc758\uc0ac\uacb0\uc815\uacfc \ud589\ub3d9\uc740 \ub2e8\uae30\uc801\uc778 \uc131\uacfc\ub098 \ubd80\ubd84\uc801\uc778 \uc774\uc775\uc774 \uc544\ub2c8\ub77c, \uc870\uc9c1 \uc804\uccb4\uc758 \uad81\uadf9\uc801\uc778 \uc774\uc775\uacfc \ubaa9\ud45c\uc5d0 \ubd80\ud569\ud558\ub3c4\ub85d \uc774\ub8e8\uc5b4\uc838\uc57c \ud569\ub2c8\ub2e4. \n\n 5. \uc9c4\uc815\ud55c \ub9ac\ub354\uc2ed: \uc774\ub7ec\ud55c \ud5cc\uc2e0\uc801\uc774\uace0 \uc0ac\uc2ec \uc5c6\ub294 \ud0dc\ub3c4\uc57c\ub9d0\ub85c \uc870\uc9c1 \uad6c\uc131\uc6d0\ub4e4\uc758 \uc9c4\uc815\ud55c \uc2e0\ub8b0\uc640 \ucda9\uc131\uc744 \uc5bb\uace0, \uad81\uadf9\uc801\uc73c\ub85c \uc870\uc9c1\uc744 \uc131\uacf5\uc73c\ub85c \uc774\ub044\ub294 \uc9c4\uc815\ud55c \ub9ac\ub354\uc2ed\uc758 \ubcf8\uc9c8\uc785\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
