B.apX=new A.a("\u318d \u4e00\u66f0\u9053 (y\u012b yu\u0113 d\xe0o): First, \u9053'Dao' (Moral Influence/Purpose) \n\u318d \u4e8c\u66f0\u5929 (\xe8r yu\u0113 ti\u0101n): Second, \u5929'Tian' (Heaven/Weather) \n\u318d \u4e09\u66f0\u5730 (s\u0101n yu\u0113 d\xec): Third, \u5730'Di' (Earth/Terrain)\n\u318d \u56db\u66f0\u5c07 (s\xec yu\u0113 ji\u0101ng): Fourth, \u5c07'Jiang' (Commander)\n\u318d \u4e94\u66f0\u6cd5 (w\u01d4 yu\u0113 f\u01ce): Fifth, \u6cd5'Fa' (Method/Discipline) \n\n",null,B.a,null,B.c)
B.aw3=new A.a('"First is Dao (Moral Influence/Purpose), second is Tian (Heaven/Weather), third is Di (Earth/Terrain), fourth is Jiang (Commander), and fifth is Fa (Method/Discipline)." ',null,B.a,null,B.c)
