B.arf=new A.a("This passage sequentially presents the five core elements that must be considered and analyzed before waging war.   \n\n",null,B.a,null,B.c)
B.aex=new A.a("1.\t\u9053 (Dao - Moral Influence/Purpose): Refers to the righteous cause, ideology, and political consensus that make the people united with their ruler. It is the spiritual foundation that makes people willingly face death and obey orders, and it signifies a shared understanding of the justness and objectives of war. \n\n2. \u5929 (Tian - Heaven/Weather): Refers to heavenly conditions such as timing, climate (seasons, weather), and day and night. It involves understanding and utilizing the impact of natural and environmental factors like weather, seasons, and day/night on warfare. \n\n3.\t\u5730 (Di - Earth/Terrain): Refers to earthly conditions such as geography, topography, elevation, ruggedness, breadth, narrowness, and fatal/living ground. It involves understanding the geographical characteristics of the combat area and utilizing them strategically. \n\n4.\t\u5c07 (Jiang - Commander): Refers to the commander's ability and qualities. It emphasizes the influence of virtues like wisdom, trustworthiness, benevolence, courage, and strictness, as well as leadership, on the outcome of war. \n\n5.\t\u6cd5 (Fa - Method/Discipline): Refers to military laws, systems, discipline, organizational structure, and logistics systems. It represents the systemic elements that enable the army to move in a coordinated manner and efficiently allocate and operate resources. \n\n",null,B.a,null,B.c)
