B.a8b=new A.a("After becoming a vassal of King Hel\xfc of Wu, he proved his strategic knowledge in real battles and contributed to making the state of Wu a powerful nation. \nIn particular, the famous episode in which Sun Wu trained female soldiers and demonstrated his leadership before King Hel\xfc is widely known as a symbolic example of his military philosophy.\n\n",null,B.a,null,B.c)
