B.arA=new A.a("The Art of War has had a profound influence not only in China but also in Japan, Korea, and the West.\nStrategists such as Clausewitz, Machiavelli, Napoleon, MacArthur, and institutions like the CIA have studied Sun Tzu's principles.\nEven today, his ideas are applied to military strategy, business management, sports tactics, psychological warfare, and diplomacy.",null,B.a,null,B.c)
