B.ax9=new A.a("\ud83d\udcda Life of Sun Wu (\u5b6b\u6b66, ca. 545 BCE ~ ?) \n",null,B.a,null,B.m)
B.alG=new A.a("1. Birth and Background\nSun Wu is believed to have been a native of the state of Qi during the Spring and Autumn period, likely from a noble family. He was said to be gifted in military strategy from a young age and wrote the treatise The Art of War, organizing his military philosophy systematically.\n\n2. Migration to the State of Wu\nSun Wu left Qi and traveled to the state of Wu, where he presented The Art of War to King Hel\xfc.The king, initially skeptical, asked, \u201cCan the principles in your book be applied in reality?\u201d \n\n3. The Famous Episode of Training Female Soldiers\nTo demonstrate the practicality of his theories, Sun Wu trained 180 palace maidens as soldiers. He divided them into two groups and appointed two of the king\u2019s favorite concubines as their commanders. When they disobeyed orders, he executed them. This incident is considered a prime example of Sun Wu\u2019s strict military discipline and philosophy of responsible leadership.  \n\n4. Military Reform and Campaigns in Wu\nSun Wu was appointed a general in Wu and actively participated in military campaigns. He employed tactics, deception, and intelligence warfare to achieve successive victories against the powerful state of Chu.In particular, in 506 BCE, he played a key role in conquering the Chu capital of Ying alongside King Hel\xfc. Through these campaigns, Sun Wu defeated Chu forces repeatedly and gained fame as a legendary commander. \n\n5. Later Years and Disappearance\nIt is unclear why Sun Wu left political life or when and where he died. According to Records of the Grand Historian (Shiji), he disappeared after the conquest of Chu, and it is speculated that he may have retired or died of natural causes. A later military strategist, Sun Bin (\u5b6b\u81cf), is believed to have been either a descendant or a disciple of Sun Wu.\n\n",null,B.a,null,B.c)
