B.axx=new A.a("\u2022\t\uc804\uc7c1(\uacbd\uc7c1)\uc758 \uc911\ub300\uc131 \uc778\uc2dd: \uc804\uc7c1\uc740 \uad6d\uac00\uc758 \uc874\ub9dd\uc744 \uacb0\uc815\ud558\ub294 \uc911\ub300\ud55c \uc77c\uc774\ubbc0\ub85c, \uacb0\ucf54 \uac00\ubccd\uac8c \uc5ec\uaca8\uc11c\ub294 \uc548 \ub418\uba70 \ubaa8\ub4e0 \uc694\uc18c\ub97c \uc2e0\uc911\ud558\uac8c \uc0b4\ud53c\uace0 \ubd84\uc11d\ud574\uc57c \ud569\ub2c8\ub2e4.\n\n\u2022\t\ub2e4\uac01\uc801\uc778 \ubd84\uc11d\uacfc \ud310\ub2e8: \uc0c1\ud669\uc744 \ud310\ub2e8\ud560 \ub54c\ub294 \ub2e8\uc21c\ud788 \ubcf4\uc774\ub294 \uac83\ubfd0\ub9cc \uc544\ub2c8\ub77c '\uc624\uc0ac(\u4e94\u4e8b)'\uc640 '\uce60\uacc4(\u4e03\u8a08)'\uc640 \uac19\uc740 \uccb4\uacc4\uc801\uc778 \ubd84\uc11d \ud2c0\uc744 \ud65c\uc6a9\ud558\uc5ec \ubcf8\uc9c8\uc801\uc778 \uc2e4\uc815\uc744 \ud30c\uc545\ud574\uc57c \ud569\ub2c8\ub2e4.\n\n\u2022\t\uc774\uc775\uc744 \uae30\ubc18\uc73c\ub85c \ud55c \uc720\uc5f0\ud55c \uc804\ub7b5: \uc804\ub7b5\uc740 \uace0\uc815\ub41c \uac83\uc774 \uc544\ub2c8\ub77c, '\uc774\uc775'\uc774\ub77c\ub294 \ubaa9\ud45c\uc5d0 \ub530\ub77c \uc0c1\ud669\uc744 \ud310\ub2e8\ud558\uace0 \uadf8\ub54c\uadf8\ub54c \ubcc0\ud654\uc5d0 \ub9de\ucdb0 \uad8c\ubaa8\uc220\uc218\ub97c \ubd80\ub9ac\ub294 \uc720\uc5f0\uc131\uc774 \ud575\uc2ec\uc785\ub2c8\ub2e4.\n\n\u2022\t\uae30\ub9cc\uacfc \uc18d\uc784\uc218\uc758 \ud65c\uc6a9: \uc804\uc7c1\uc758 \ubcf8\uc9c8\uc740 '\uc18d\uc774\ub294 \uac83'\uc774\ubbc0\ub85c, \uc801\uc744 \uc18d\uc5ec \ud63c\ub780\uc5d0 \ube60\ub728\ub9ac\uace0 \uc544\uad70\uc758 \uc758\ub3c4\ub97c \uac10\ucd94\ub294 \uae30\ub9cc \uc804\uc220\uc740 \uc2b9\ub9ac\ub97c \uc704\ud55c \ud544\uc218\uc801\uc778 \uc218\ub2e8\uc785\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
