B.ahm=new A.a("\uc0ac\uc5c5\uc740 \uae30\uc5c5\uc758 \uc874\ub9dd\uc774 \uac78\ub9b0 \uc804\uc7c1, \ubaa8\ub4e0 \uc804\ub7b5\uc740 \uc5ed\ubc1c\uc0c1\uc758 \uc5f0\uc18d\uc774\ub2e4. \ube44\uc804, \uc2dc\uc7a5, \ud658\uacbd, \ub9ac\ub354, \uc2dc\uc2a4\ud15c\uc744 \uae30\ubcf8\uc73c\ub85c, 7\ub300 \uacbd\uc7c1\ub825\uc744 \ucca0\uc800\ud788 \ube44\uad50 \ubd84\uc11d\ud558\ub77c. \uc555\ub3c4\uc801 \uae30\uc220\uc774 \uc788\uc5b4\ub3c4 \uacb8\uc190\ud55c \ucc99, \uacf5\uaca9 \ud22c\uc790 \uae30\ud68c\uc5d0\ub3c4 \uad00\ub9dd\ud558\ub294 \ucc99\ud558\uba70, \uc720\ub9ac\ud55c \uc2dc\uc7a5 \ud658\uacbd\uc744 \ub9cc\ub4e4\uc5b4 \uacbd\uc7c1\uc744 \uc8fc\ub3c4\ud558\ub77c!\n\n",null,B.a,null,B.c)
B.awL=new A.a("\uacbd\uae30\ub294 \ud300\uc758 \uc6b4\uba85\uc774 \uac78\ub9b0 \uc2b9\ubd80\ucc98, \ubaa8\ub4e0 \ud50c\ub808\uc774\ub294 \uc18d\uc784\uc218\uc758 \uc5f0\uc18d\uc774\ub2e4. \ud300 \ucca0\ud559, \ub0a0\uc528, \ud648 \uc774\uc810, \uac10\ub3c5, \uaddc\uc728\uc744 \uae30\ubcf8\uc73c\ub85c, 7\ub300 \uc804\ub825\uc744 \ucca0\uc800\ud788 \ube44\uad50 \ubd84\uc11d\ud558\ub77c. \uc5d0\uc774\uc2a4\uc758 \uae30\ub7c9\uc744 \uc228\uae30\uace0, \uc8fc\ub825 \uc804\uc220\uc744 \uc704\uc7a5\ud558\uba70, \uc720\ub9ac\ud55c \ud750\ub984\uc744 \ub9cc\ub4e4\uc5b4 \uacbd\uae30\ub97c \uc9c0\ubc30\ud558\ub77c!\n\n",null,B.a,null,B.c)
