B.aAF=new A.a(" \u2022 \u907f\u5176\u92b3\u6c23(b\xec q\xed ru\xec q\xec): \uadf8 \ub0a0\uce74\ub85c\uc6b4 \uae30\uc138(\ucd08\ubc18\uc758 \uc804\ud22c \uc5f4\uae30)\ub97c \ud53c\ud558\uace0\n   \u2022 \u64ca\u5176\u60f0\u6b78(j\u012b q\xed du\xf2 gu\u012b): \uc9c0\uccd0\uc11c \ub3cc\uc544\uac00\ub294 \ubcd1\ub825\uc744 \uacf5\uaca9\ud558\ub77c\n   \u2022\u6b64\u6cbb\u6c23\u8005\u4e5f(c\u01d0 zh\xec q\xec zh\u011b y\u011b): \uc774\uac83\uc774 '\uae30\uc138(\u58eb\u6c23)'\ub97c \ub2e4\uc2a4\ub9ac\ub294 \ubc29\ubc95\uc774\ub2e4\n   \u2022\u4ee5\u6cbb\u5f85\u4e82(y\u01d0 zh\xec d\xe0i lu\xe0n): \uc9c8\uc11c \uc788\ub294 \uc0c1\ud0dc\ub85c \ud63c\ub780\uc744 \uae30\ub2e4\ub824\ub77c\n   \u2022\u4ee5\u975c\u5f85\u8b41(y\u01d0 j\xecng d\xe0i hu\xe1): \uce68\ucc29\ud558\uac8c \uc18c\ub780\uc744 \uae30\ub2e4\ub824\ub77c\n\u2022\t\u6b64\u6cbb\u5fc3\u8005\u4e5f(c\u01d0 zh\xec x\u012bn zh\u011b y\u011b): \uc774\uac83\uc774 '\uc2ec\ub9ac'\ub97c \ub2e4\uc2a4\ub9ac\ub294 \uac83\uc774\ub2e4\n   \u2022 \u6b64\u6cbb\u529b\u8005\u4e5f(c\u01d0 zh\xec l\xec zh\u011b y\u011b): \uc774\uac83\uc774 '\uc804\ub825(\u6230\u529b)'\uc744 \ub2e4\uc2a4\ub9ac\ub294 \uac83\uc774\ub2e4\n   \u2022 \u7121\u9080\u6b63\u6b63\u4e4b\u65d7(w\xfa y\u0101o zh\xe8ng zh\xe8ng zh\u012b q\xed): \uc815\ub82c\ub41c \uae43\ubc1c\uc744 \uc815\uba74\uc73c\ub85c \ub9de\uc774\ud558\uc9c0 \ub9d0\uace0\n   \u2022 \u7269\u64ca\u5802\u5802\u4e4b\u9663(w\xf9 j\u012b t\xe1ng t\xe1ng zh\u012b zh\xe8n): \ub2f9\ub2f9\ud788 \uc815\ub82c\ub41c \uc9c4\ud615\uc744 \uc815\uba74 \uacf5\uaca9\ud558\uc9c0 \ub9c8\ub77c\n   \u2022 \u6b64\u6cbb\u8b8a\u8005\u4e5f(c\u01d0 zh\xec bi\xe0n zh\u011b y\u011b): \uc774\uac83\uc774 '\ubcc0\ud654(\u5c40\u9762)'\ub97c \ub2e4\uc2a4\ub9ac\ub294 \uac83\uc774\ub2e4 \n\n",null,B.a,null,B.c)
B.ayz=new A.a("\u201c\uadf8 (\uc801\uc758) \uc608\ub9ac\ud55c \uae30\uc138\ub294 \ud53c\ud558\uace0, \uadf8 (\uc801\uc758) \ub098\ud0dc\ud574\uc838 \ub3cc\uc544\uac08 \ub54c\ub97c \uacf5\uaca9\ud558\ub77c. \uc774\uac83\uc774 \uae30\uc138\ub97c \ub2e4\uc2a4\ub9ac\ub294 \ubc29\ubc95\uc774\ub2e4.\n \uc815\ub3c8\ub428\uc73c\ub85c\uc368 \ud63c\ub780\ud568\uc744 \uae30\ub2e4\ub9ac\uace0, \uace0\uc694\ud568\uc73c\ub85c\uc368 \uc18c\ub780\uc2a4\ub7ec\uc6c0\uc744 \uae30\ub2e4\ub824\ub77c. \uc774\uac83\uc774 \ub9c8\uc74c\uc744 \ub2e4\uc2a4\ub9ac\ub294 \ubc29\ubc95\uc774\uace0, \uc774\uac83\uc774 \ud798\uc744 \ub2e4\uc2a4\ub9ac\ub294 \ubc29\ubc95\uc774\ub2e4.\n \uc815\uc5f0\ud558\uac8c \uc815\ube44\ub41c \uae43\ubc1c\uc744 \uac00\uc9c4 \uc801\uc744 \ub9de\uc774\ud558\uc9c0 \ub9d0\uace0, \uc6c5\uc7a5\ud558\uace0 \uc9c8\uc11c \uc815\uc5f0\ud55c \uc9c4\ud615\uc744 \uac00\uc9c4 \uc801\uc744 \uacf5\uaca9\ud558\uc9c0 \ub9c8\ub77c. \uc774\uac83\uc774 \ubcc0\ud654\ub97c \ub2e4\uc2a4\ub9ac\ub294 \ubc29\ubc95\uc774\ub2e4\u201d\n ",null,B.a,null,B.c)
