B.aiA=new A.a(" 1.\t\u907f\u5176\u92b3\u6c23 \u64ca\u5176\u60f0\u6b78 \u6b64\u6cbb\u6c23\u8005\u4e5f (\uc801\uc758 \ub0a0\uce74\ub85c\uc6b4 \uae30\uc138\ub97c \ud53c\ud558\uace0, \uc801\uc774 \ub098\ud0dc\ud574\uc838 \ub3cc\uc544\uac08 \ub54c \uacf5\uaca9\ud558\ub77c. \uc774\uac83\uc774 '\uae30(\u6c23)'\ub97c \ub2e4\uc2a4\ub9ac\ub294 \ubc29\ubc95\uc774\ub2e4):\n   \u2022 \uc758\ubbf8: \uc801\uc758 \uc0ac\uae30\uac00 \ucd5c\uace0\uc870\uc5d0 \ub2ec\ud588\uc744 \ub54c(\u92b3\u6c23)\ub294 \uc815\uba74 \ub300\uacb0\uc744 \ud53c\ud558\uace0, \uc801\uc758 \uae30\uc138\uac00 \uaebe\uc774\uace0 \ub098\ud0dc\ud574\uc838 \ucca0\uc218\ud558\ub824 \ud560 \ub54c(\u60f0\u6b78)\ub97c \ub178\ub824 \uacf5\uaca9\ud574\uc57c \ud568\uc744 \uac15\uc870\ud569\ub2c8\ub2e4. \uc774\ub294 \uc801\uc758 **\uc0ac\uae30(\u6c23)**\ub97c \uad00\ucc30\ud558\uace0 \uadf8 \uc57d\uc810\uc744 \ub178\ub824 \uc2f8\uc6b0\ub294 \uc9c0\ud61c\ub97c \ub9d0\ud569\ub2c8\ub2e4.\n\n  2.\t\u4ee5\u6cbb\u5f85\u4e82 \u4ee5\u975c\u5f85\u8b41 \u6b64\u6cbb\u5fc3\u8005\u4e5f (\uc798 \uc815\ube44\ub41c \uc0c1\ud0dc\ub85c \ud63c\ub780\uc744 \uae30\ub2e4\ub9ac\uace0, \uace0\uc694\ud55c \uc0c1\ud0dc\ub85c \uc18c\ub780\uc744 \uae30\ub2e4\ub824\ub77c. \uc774\uac83\uc774 '\ub9c8\uc74c(\u5fc3)'\uc744 \ub2e4\uc2a4\ub9ac\ub294 \ubc29\ubc95\uc774\ub2e4):\n \u2022 \uc758\ubbf8: \uc544\uad70\uc740 \uc798 \uc815\ube44\ub41c(\u6cbb) \uc0c1\ud0dc\ub85c \uc801\uc758 \ud63c\ub780(\u4e82)\uc744 \uae30\ub2e4\ub9ac\uace0, \uace0\uc694\ud55c(\u975c) \uc0c1\ud0dc\ub85c \uc801\uc758 \uc18c\ub780(\u8b41)\uc744 \uae30\ub2e4\ub824\uc57c \ud568\uc744 \uac15\uc870\ud569\ub2c8\ub2e4. \uc774\ub294 \uc544\uad70 \uc9c0\ud718\uad00\uacfc \ubcd1\uc0ac\ub4e4\uc758 \ud3c9\uc628\ud558\uace0 \ud754\ub4e4\ub9bc \uc5c6\ub294 \ub9c8\uc74c(\u5fc3) \uc0c1\ud0dc\ub97c \uc720\uc9c0\ud558\uc5ec, \uc801\uc758 \uad50\ub780\uc774\ub098 \ud63c\ub780\uc5d0 \ub3d9\uc694\ud558\uc9c0 \uc54a\uace0 \uae30\ud68c\ub97c \ud3ec\ucc29\ud558\ub294 \uac83\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4.\n\n  3.\t\u6b64\u6cbb\u529b\u8005\u4e5f (\uc774\uac83\uc774 '\ud798(\u529b)'\uc744 \ub2e4\uc2a4\ub9ac\ub294 \ubc29\ubc95\uc774\ub2e4):\n\u2022 \uc758\ubbf8: \uc55e\uc758 \ub450 \ubb38\uad6c(\uae30\uc138\uc640 \ub9c8\uc74c\uc744 \ub2e4\uc2a4\ub9ac\ub294 \ubc29\ubc95)\uc5d0\uc11c \uc5b8\uae09\ub41c \uac83\ucc98\ub7fc, **\uc544\uad70\uc758 \ud798(\u529b)**\uc744 \ud6a8\uacfc\uc801\uc73c\ub85c \ubcf4\uc874\ud558\uace0, \uc801\uc758 \ud798\uc744 \uc18c\ubaa8\uc2dc\ud0a4\uba70, \uacb0\uc815\uc801\uc778 \uc21c\uac04\uc5d0 \uc9d1\uc911\ud558\uc5ec \ubc1c\ud718\ud558\ub294 \uac83\uc774 \uc9c4\uc815\uc73c\ub85c \ud798\uc744 \ub2e4\uc2a4\ub9ac\ub294 \ubc29\ubc95\uc784\uc744 \uac15\uc870\ud569\ub2c8\ub2e4. \uc989, \uc2f8\uc6b8 \ub54c\ub294 \uc2f8\uc6b0\uace0, \ud53c\ud560 \ub54c\ub294 \ud53c\ud558\uba70, \uae30\ub2e4\ub9b4 \ub54c\ub294 \uae30\ub2e4\ub9ac\ub294 \uac83\uc774 \uace7 \ud798\uc758 \ud6a8\uc728\uc801\uc778 \uc6b4\uc6a9\uc785\ub2c8\ub2e4.\n\n  4.\t\u7121\u9080\u6b63\u6b63\u4e4b\u65d7 \u7269\u64ca\u5802\u5802\u4e4b\u9663 \u6b64\u6cbb\u8b8a\u8005\u4e5f (\uc815\uc5f0\ud558\uac8c \ub298\uc5b4\uc120 \uae43\ubc1c\uc744 \ub9de\uc774\ud558\ub824 \ub4e4\uc9c0 \ub9d0\uace0, \uc6c5\uc7a5\ud558\uac8c \uac16\ucdb0\uc9c4 \uc9c4\uc601\uc744 \uacf5\uaca9\ud558\uc9c0 \ub9c8\ub77c. \uc774\uac83\uc774 '\ubcc0\ud654(\u8b8a)'\ub97c \ub2e4\uc2a4\ub9ac\ub294 \ubc29\ubc95\uc774\ub2e4): \n \u2022 \uc758\ubbf8: \uc801\uc758 \uc0ac\uae30\uac00 \ub192\uace0(\uc815\uc815\uc9c0\uae30) \ubc29\uc5b4 \ud0dc\uc138\uac00 \uc644\ubcbd\ud55c(\ub2f9\ub2f9\uc9c0\uc9c4) \uc0c1\ud669\uc5d0\uc11c\ub294 \uc815\uba74 \ub300\uacb0\uc744 \ud53c\ud574\uc57c \ud568\uc744 \ub9d0\ud569\ub2c8\ub2e4. \uc774\ub294 **\uc804\uc7a5\uc758 \ubcc0\ud654(\u8b8a)**\ub97c \uc77d\uace0, \uc801\uc758 \uac15\uc810\uc744 \ud68c\ud53c\ud558\uba70 \uc57d\uc810\uc744 \ucc3e\uc544 \uacf5\ub7b5\ud558\ub294 \uc720\uc5f0\ud55c \ub300\uc751\uc774 \uc911\uc694\ud568\uc744 \uac15\uc870\ud569\ub2c8\ub2e4.\n\n ",null,B.a,null,B.c)
