B.au3=new A.a(" 1. \uc801\uc758 \uc0ac\uae30(\u6c23) \ud65c\uc6a9: \uc801\uc758 \uc0ac\uae30\uac00 \ub192\uc744 \ub54c\ub294 \ud53c\ud558\uace0, \ub098\ud0dc\ud574\uc84c\uc744 \ub54c\ub97c \ub178\ub824 \uacf5\uaca9\ud558\ub294 \uc2dc\uc810 \uc120\ud0dd\uc758 \uc911\uc694\uc131\uc744 \uac15\uc870\ud569\ub2c8\ub2e4.\n\n  2. \ub0b4\ubd80 \uc548\uc815(\u5fc3) \uc720\uc9c0: \uc544\uad70\uc740 \ud63c\ub780 \uc18d\uc5d0\uc11c\ub3c4 \uce68\ucc29\ud568\uc744 \uc720\uc9c0\ud558\uace0 \ub0b4\ubd80\ub97c \uc548\uc815\uc2dc\ucf1c \uc801\uc758 \ub3d9\uc694\uc5d0 \ud729\uc4f8\ub9ac\uc9c0 \uc54a\uc544\uc57c \ud569\ub2c8\ub2e4.\n\n  3. \ud798(\u529b)\uc758 \ud6a8\uc728\uc801 \uc6b4\uc6a9: \ubb34\ubaa8\ud55c \ucda9\ub3cc\uc744 \ud53c\ud558\uace0, \uc544\uad70\uc758 \ud798\uc744 \ubcf4\uc874\ud558\uba74\uc11c \uc801\uc758 \uc57d\uc810\uc744 \uacf5\ub7b5\ud558\ub294 \uc9c0\ud61c\ub85c\uc6b4 \ud798\uc758 \uc0ac\uc6a9\uc744 \uac15\uc870\ud569\ub2c8\ub2e4.\n\n  4. \uc804\uc7a5\uc758 \ubcc0\ud654(\u8b8a) \uc778\uc2dd: \uc801\uc758 \uac15\uc810\uc744 \uc815\uba74\uc73c\ub85c \ubd80\ub52a\ud788\uc9c0 \uc54a\uace0 \uc6b0\ud68c\ud558\uac70\ub098 \ub2e4\ub978 \uc57d\uc810\uc744 \ucc3e\uc544 \uacf5\uaca9\ud558\ub294 \uc720\uc5f0\ud55c \uc804\ub7b5 \ubcc0\ud654\uac00 \ud544\uc218\uc801\uc785\ub2c8\ub2e4.\n\n  5. \uc804\uccb4\uc801\uc778 \ud1b5\ucc30: \ub2e8\uc21c\ud788 \uc2f8\uc6b0\ub294 \uac83\uc774 \uc544\ub2c8\ub77c, **\uc801\uc758 \ub2e4\uc591\ud55c \uc694\uc18c\ub97c \ubcf5\ud569\uc801\uc73c\ub85c \uace0\ub824\ud558\uc5ec \uc544\uad70\uc5d0\uac8c \uc720\ub9ac\ud55c \uc804\uc7a5\uc744 \ub9cc\ub4e4\uc5b4\uac00\ub294 '\ub2e4\uc2a4\ub9bc'**\uc758 \uc911\uc694\uc131\uc744 \uc5ed\uc124\ud569\ub2c8\ub2e4.\n\n ",null,B.a,null,B.c)
