B.agP=new A.a(" 1. \uc138(\u52e2)\uc758 \ud798:\n   \u2022  \u6fc0\u6c34\u4e4b\u75be\uff0c\u81f3\u65bc\u6f02\u77f3\u8005\uff0c\u52e2\u4e5f: **'\uc138(\u52e2)'\ub294 \ub9c8\uce58 \uae09\ub958\uac00 \ub3cc\uc744 \ub5a0\ub0b4\ub824 \ubcf4\ub0bc \uc815\ub3c4\uc758 \uc555\ub3c4\uc801\uc778 '\ud798\uc758 \ud750\ub984' \ub610\ub294 '\uae30\uc138'**\ub97c \uc758\ubbf8\ud569\ub2c8\ub2e4. \uc774\ub294 \ub2e8\uc21c\ud788 \ubcd1\ub825\uc758 \uc591\uc774\ub098 \uac1c\ubcc4\uc801\uc778 \ub2a5\ub825\uc744 \ub118\uc5b4, \ucd1d\uccb4\uc801\uc778 \uc804\ub825\uc774 \ub9cc\ub4e4\uc5b4\ub0b4\ub294 \uac70\ub300\ud55c \uc6b4\ub3d9 \uc5d0\ub108\uc9c0\uc640 \ucd94\uc9c4\ub825\uc744 \ub73b\ud569\ub2c8\ub2e4. \uc77c\ub2e8 '\uc138'\uac00 \ud615\uc131\ub418\uba74, \uc57d\ud55c \uc0c1\ub300\ub294 \uc800\ud56d\ud560 \uc218 \uc5c6\uac8c \ub429\ub2c8\ub2e4. \uc774\ub294 '\ud615(\u5f62)'\uc774 \uad6c\ucd95\ub41c \ud6c4\uc5d0 \ub098\ud0c0\ub098\ub294 \uc5ed\ub3d9\uc801\uc778 \ud798\uc785\ub2c8\ub2e4.\n\n 2. \uc808(\u7bc0)\uc758 \ud6a8\uacfc:\n  \u2022  \u9dd9\u9ce5\u4e4b\u64ca\uff0c\u81f3\u65bc\u6bc1\u6298\u8005\uff0c\u7bc0\u4e5f: **'\uc808(\u7bc0)'\uc740 \ub9f9\uae08\ub958\uac00 \uba39\uc774\ub97c \uacf5\uaca9\ud558\uc5ec \ud30c\uad34\ud560 \uc218 \uc788\ub294 '\uc815\ud655\ud55c \ud0c0\uc774\ubc0d' \ub610\ub294 '\uacb0\uc815\uc801\uc778 \uc21c\uac04\uc5d0 \ud798\uc744 \uc9d1\uc911\ud558\ub294 \uc808\ub3c4'**\ub97c \uc758\ubbf8\ud569\ub2c8\ub2e4. \uc544\ubb34\ub9ac \uac15\ub825\ud55c \ub9f9\uae08\ub958\ub77c\ub3c4 \ubb34\uc791\uc815 \uacf5\uaca9\ud558\ub294 \uac83\uc774 \uc544\ub2c8\ub77c, \uba39\uc774\uc758 \uc57d\uc810, \ubc29\uc2ec\ud55c \uc21c\uac04, \uc6c0\uc9c1\uc784\uc758 \ud2c8 \ub4f1\uc744 \ud3ec\ucc29\ud558\uc5ec \uac00\uc7a5 \ud6a8\uacfc\uc801\uc778 \uc2dc\uc810\uc5d0 \ud798\uc744 \uc9d1\uc911\ud568\uc73c\ub85c\uc368 \uacb0\uc815\uc801\uc778 \ud0c0\uaca9\uc744 \uc785\ud799\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
