B.afp=new A.a(" 1.\tSame Management Principle for Large and Small Armies (\u51e1\u6cbb\u8846\u5982\u6cbb\u5be1):\n \u2022\tMeaning: At first glance, managing a large army (or organization) might seem much more complex and difficult than managing a small one. However, Sun Tzu states that the fundamental management principles are the same. This insight means that even if an organization grows in size, efficiency can be maintained by applying core management principles.\n\n 2.\tImportance of Fen Shu (\u5206\u6578):\n \u2022\t\u5206 (fen): Refers to efficiently 'dividing' an organization. This means hierarchically dividing a large army into platoons, companies, battalions, etc., or functionally (attack teams, defense teams, etc.). Each unit thus divided becomes 'small' in scale, allowing it to be managed as if it were a small group.\n\n \u2022\t\u6578 (shu): Refers to the 'discipline, rules, and methods of control' governing each divided unit and the entire organization. This encompasses a clear chain of command, standardized procedures, command and reporting systems, and reward/punishment regulations. Since individual soldiers cannot be controlled one by one, consistency and efficiency are ensured through clear 'shu' (rules). \n\n",null,B.a,null,B.c)
