B.aoo=new A.a("\uc774 \ubb38\uad6c\ub294 '\uad6c\ubcc0(\u4e5d\u8b8a)'\uc758 \ud575\uc2ec \uc6d0\ub9ac \uc911 \ud558\ub098\uc778 \uc5ed\ubc1c\uc0c1\uc758 \uc9c0\ud61c\ub97c \ub2f4\uace0 \uc788\uc2b5\ub2c8\ub2e4. \uac89\uc73c\ub85c \ubcf4\uc774\ub294 \ubd88\ub9ac\ud568\uc774\ub098 \uc5b4\ub824\uc6c0\uc744 \ud68c\ud53c\ud558\ub294 \ub300\uc2e0, \uadf8\uac83\uc744 \uc801\uadf9\uc801\uc73c\ub85c \ud65c\uc6a9\ud558\uc5ec \uc720\ub9ac\ud55c \uacb0\uacfc\ub97c \ucc3d\ucd9c\ud558\ub294 \ub2a5\ub3d9\uc801\uc778 \uc0ac\uace0\ubc29\uc2dd\uc744 \uac15\uc870\ud569\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
B.a6G=new A.a(" 1.\t\u9053\u6709\u6240\u4e0d\u7531 (\ub54c\ub85c\ub294 \ub530\ub974\uc9c0 \uc54a\uc544\uc57c \ud560 \uae38\uc774 \uc788\ub2e4):\n    \u318d \uc758\ubbf8: \uc0c1\uc2dd\uc801\uc73c\ub85c \ud639\uc740 \uc77c\ubc18\uc801\uc778 \uc6d0\uce59\uc0c1 \uac00\uc57c \ud560 \uae38\ucc98\ub7fc \ubcf4\uc774\uc9c0\ub9cc, \uc2e4\uc81c \uc0c1\ud669\uc5d0\uc11c\ub294 \uc544\uad70\uc5d0\uac8c \ubd88\ub9ac\ud558\uac70\ub098 \uc704\ud5d8\uc744 \ucd08\ub798\ud560 \uc218 \uc788\ub294 \uae38(\u9053)\uc740 \ub530\ub974\uc9c0 \ub9d0\uc544\uc57c(\u4e0d\u7531) \ud568\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \uc774\ub294 \uad00\uc2b5\uc774\ub098 \uace0\uc815\uad00\ub150\uc744 \ubc97\uc5b4\ub09c \uc720\uc5f0\ud55c \uc0ac\uace0\ub97c \uc694\uad6c\ud569\ub2c8\ub2e4.\n\n 2.\t\u8ecd\u6709\u6240\u4e0d\u64ca (\ub54c\ub85c\ub294 \uacf5\uaca9\ud558\uc9c0 \uc54a\uc544\uc57c \ud560 \uad70\ub300\uac00 \uc788\ub2e4):\n   \u318d \uc758\ubbf8: \uc801\uc758 \uad70\ub300(\u8ecd) \uc911\uc5d0\uc11c\ub3c4 \uc0ac\uae30\uac00 \ub192\uac70\ub098, \uc644\ubcbd\ud55c \ubc29\uc5b4 \ud0dc\uc138\ub97c \uac16\ucd98 \uc815\uc608 \ubd80\ub300 \ub4f1\uc740 \uacf5\uaca9\ud558\uc9c0 \uc54a\uc544\uc57c(\u4e0d\u64ca) \ud568\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \ubb34\ubaa8\ud55c \uc815\uba74 \ub300\uacb0\uc744 \ud53c\ud558\uace0 \uc544\uad70\uc758 \uc190\uc2e4\uc744 \uc904\uc774\ub294 \uc9c0\ud61c\uc785\ub2c8\ub2e4.\n\n 3.\t\u57ce\u6709\u6240\u4e0d\u653b (\ub54c\ub85c\ub294 \uacf5\uaca9\ud558\uc9c0 \uc54a\uc544\uc57c \ud560 \uc131\uc774 \uc788\ub2e4):\n   \u318d \uc758\ubbf8: \uc801\uc758 \uc131(\u57ce) \uc911\uc5d0\uc11c\ub3c4 \ubc29\uc5b4\uac00 \uacac\uace0\ud558\uc5ec \ud568\ub77d\uc2dc\ud0a4\uae30 \uc5b4\ub835\uac70\ub098, \ud568\ub77d\uc2dc\ucf1c\ub3c4 \uc5bb\ub294 \uac83\ubcf4\ub2e4 \uc190\uc2e4\uc774 \ub354 \ud070 \uc131\uc740 \uacf5\uaca9\ud558\uc9c0 \uc54a\uc544\uc57c(\u4e0d\u653b) \ud568\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \uc774\ub294 \ube44\uc6a9 \ub300\ube44 \ud6a8\uacfc\ub97c \uace0\ub824\ud55c \uc804\ub7b5\uc801 \ud310\ub2e8\uc785\ub2c8\ub2e4. \n\n 4.\t\u5730\u6709\u6240\u4e0d\u722d (\ub54c\ub85c\ub294 \ub2e4\ud22c\uc9c0 \uc54a\uc544\uc57c \ud560 \ub545\uc774 \uc788\ub2e4):\n \u318d \uc758\ubbf8: \ud2b9\uc815 \ub545(\u5730)\uc774 \uc804\ub7b5\uc801 \uac00\uce58\uac00 \ub0ae\uac70\ub098, \uadf8\uacf3\uc744 \ucc28\uc9c0\ud558\uae30 \uc704\ud574 \ub108\ubb34 \ub9ce\uc740 \ud76c\uc0dd\uc744 \uce58\ub7ec\uc57c \ud55c\ub2e4\uba74, \uad73\uc774 \ub2e4\ud22c\uc9c0 \uc54a\uc544\uc57c(\u4e0d\u722d) \ud568\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \uc774\ub294 \uc790\uc6d0 \ubd84\ubc30\uc758 \ud6a8\uc728\uc131\uacfc \ucd5c\uc885 \ubaa9\ud45c \ub2ec\uc131\uc744 \uc704\ud55c \ub0c9\ucca0\ud55c \ud310\ub2e8\uc785\ub2c8\ub2e4. \n\n 5.\t\u8ecd\u547d\u6709\u6240\u4e0d\u53d7 (\ub54c\ub85c\ub294 \ubc1b\uc9c0 \uc54a\uc544\uc57c \ud560 \uad70\uc8fc\uc758 \uba85\ub839\uc774 \uc788\ub2e4):\n \u318d \uc758\ubbf8: \uad70\uc8fc(\u541b)\uc758 \uba85\ub839(\u547d)\uc774\ub77c \ud560\uc9c0\ub77c\ub3c4, \ud604\uc7a5 \uc0c1\ud669\uc5d0 \ube44\ucd94\uc5b4 \uc544\uad70\uc5d0\uac8c \uce58\uba85\uc801\uc73c\ub85c \ubd88\ub9ac\ud558\uac70\ub098 \ud328\ubc30\ub97c \ucd08\ub798\ud560 \uac83\uc774 \ubd84\uba85\ud558\ub2e4\uba74, \ub54c\ub85c\ub294 \uadf8 \uba85\ub839\uc744 \ubc1b\uc9c0 \uc54a\uace0(\u4e0d\u53d7) \ub3c5\uc790\uc801\uc778 \ud310\ub2e8\uc744 \ub0b4\ub824\uc57c \ud568\uc744 \uac15\uc870\ud569\ub2c8\ub2e4. \uc774\ub294 \uc9c0\ud718\uad00\uc758 \uc790\uc728\uc131\uacfc \ucc45\uc784\uac10\uc744 \ucd5c\ub300\ub85c \uac15\uc870\ud558\ub294 \ubd80\ubd84\uc785\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
