B.aoX=new A.a(" 1. \uc804\ub7b5\uc801 \uc120\ud0dd\uacfc \uc9d1\uc911: \ubaa8\ub4e0 \uac83\uc744 \ub2e4 \uc5bb\uc73c\ub824 \ud558\uc9c0 \ub9d0\uace0, \uc815\ub9d0\ub85c \uc911\uc694\ud558\uace0 \uac00\uce58 \uc788\ub294 \ubaa9\ud45c\uc5d0 \uc790\uc6d0\uc744 \uc9d1\uc911\ud558\uae30 \uc704\ud574 \ubd88\ud544\uc694\ud55c \uc2f8\uc6c0\uc744 \ud68c\ud53c\ud574\uc57c \ud569\ub2c8\ub2e4.\n\n 2. \uacf5\uaca9 \ub300\uc0c1\uc758 \uc120\ubcc4: \uc801\uc758 \uac15\uc810\uc744 \uc815\uba74\uc73c\ub85c \ubd80\ub52a\ud788\ub294 \ubb34\ubaa8\ud55c \uacf5\uaca9\uc744 \ud53c\ud558\uace0, \uc544\uad70\uc758 \ud53c\ud574\ub97c \ucd5c\uc18c\ud654\ud560 \uc218 \uc788\ub294 \ub300\uc0c1\uc744 \uc120\ud0dd\ud574\uc57c \ud569\ub2c8\ub2e4. \n\n 3. \uc190\uc775 \ubd84\uc11d: \ubaa8\ub4e0 \ud589\ub3d9\uc5d0 \uc55e\uc11c \uc5bb\uc744 \uc218 \uc788\ub294 \uc774\ub4dd\uacfc \uce58\ub7ec\uc57c \ud560 \ub300\uac00\ub97c \ub0c9\ucca0\ud558\uac8c \ubd84\uc11d\ud558\uc5ec \ube44\ud6a8\uc728\uc801\uc778 \uc790\uc6d0 \ub0ad\ube44\ub97c \ub9c9\uc544\uc57c \ud569\ub2c8\ub2e4.\n\n 4. \uc720\uc5f0\ud55c \uc6d0\uce59 \uc801\uc6a9: \uace0\uc815\ub41c \uc6d0\uce59\uc774\ub098 \uba85\ub839\uc5d0 \uc5bd\ub9e4\uc774\uc9c0 \uc54a\uace0, \ud604\uc2e4 \uc0c1\ud669\uc5d0 \ub9de\ucdb0 \uac00\uc7a5 \uc720\ub9ac\ud55c \ubc29\ud5a5\uc73c\ub85c \uc720\uc5f0\ud558\uac8c \ud310\ub2e8\ud558\uace0 \ub300\uc751\ud558\ub294 \uac83\uc774 \uc911\uc694\ud569\ub2c8\ub2e4.\n\n 5. \uc9c0\ud718\uad00\uc758 \uacb0\ub2e8\ub825\uacfc \ucc45\uc784: \ud604\uc7a5 \uc9c0\ud718\uad00\uc740 \ub54c\ub85c \uc0c1\ubd80\uc758 \uba85\ub839\uc774\ub77c\ub3c4 \uc804\uccb4\uc801\uc778 \uc2b9\ub9ac\ub97c \uc704\ud574 \uac70\ubd80\ud560 \uc218 \uc788\ub294 \uc6a9\uae30\uc640 \uadf8\uc5d0 \ub300\ud55c \ucc45\uc784\uc744 \uc838\uc57c \ud569\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
