B.apl=new A.a("This phrase explains the ultimate strategic goal for victory in war (or competition) and the highest level of 'Weak Points and Strong' application. \n\n",null,B.a,null,B.c)
B.as3=new A.a("1.\t\u5f62\u5175\u4e4b\u6975 (The ultimate in military forms):\n\u2022\tMeaning: This refers to the highest state in military operations or troop deployment, the most perfect level of form manipulation. This goes beyond simple troop deployment or tactical movements to include sophisticated deception and psychological warfare capabilities that make it difficult for the enemy to grasp our intentions.\n\n2.\t\u81f3\u65bc\u7121\u5f62 (To reach the formless):\n\u2022\tMeaning: This means making our troop formation or actual intentions completely indiscernible to the enemy, reaching a 'formless (\u7121\u5f62)' state. The enemy becomes unable to predict our scale, location, or next actions, leaving them completely unaware of where to defend or attack. This is the ultimate state that causes extreme anxiety and confusion for the enemy, making them expose their weaknesses themselves. \n\n",null,B.a,null,B.c)
