B.aub=new A.a(" 1.\tUltimate Deception: Our true substance and intentions must be perfectly hidden from the enemy, making it impossible for them to perceive us.\n\n 2.\tMaximizing Unpredictability: Our movements must be made extremely fluid and uncertain to thwart all enemy predictions.\n\n 3.\tInformation Control: All information about our side must be strictly controlled, and, if necessary, distorted information should be disseminated to induce enemy misjudgment.\n\n 4.\tPsychological Superiority: Create an invisible threat and unpredictable anxiety for the enemy to psychologically overwhelm them. The enemy feels the greatest fear from an unseen foe.\n\n 5.\tHighest State of Weak Points and Strong (\u865b\u5be6): The ultimate goal of 'Weak Points and Strong' tactics is to freely disguise our strengths (fullness) and weaknesses (emptiness), perfectly grasp the enemy's fullness and emptiness, and make our presence 'formless.'\n\n",null,B.a,null,B.c)
