B.a6X=new A.a("\uc190\uc790\ubcd1\ubc95 \uad70\ud615(\u8ecd\u5f62)\ud3b8\uc5d0\uc11c\ub294 \uc2b9\ub9ac\ub294 \ucca0\uc800\ud55c \uc900\ube44\ub97c \ud1b5\ud55c \ubc29\uc5b4\uc801 \uc6b0\uc704 \ud655\ubcf4\uc5d0\uc11c \uc2dc\uc791\ub418\uba70, \uae30\ud68c\uac00 \uc654\uc744 \ub54c \uc555\ub3c4\uc801\uc778 \ud798\uc73c\ub85c \uacb0\uc815\uc801\uc778 \uacf5\uaca9\uc744 \uac00\ud558\ub294 \uac83\uc774 \ud575\uc2ec\uc785\ub2c8\ub2e4. \uc989, \uc2b9\ub9ac\ub294 \ub9cc\ub4e4\uc5b4\ub0b4\ub294 \uac83\uc774 \uc544\ub2c8\ub77c \uc778\uc2dd\ud558\uace0 \ud65c\uc6a9\ud558\ub294 \uac83\uc774\uba70, \uc774\ub97c \uc704\ud574\uc11c\ub294 \uac1d\uad00\uc801\uc778 \uce21\uc815\uacfc \ud3c9\uac00\uac00 \ud544\uc218\uc801\uc784\uc744 \uac15\uc870\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.t)
B.asy=new A.a(" \ud575\uc2ec \uc6d0\uce59\uc740 \ub2e4\uc74c\uacfc \uac19\uc2b5\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
B.auK=new A.a(" \u2022\t\uc120\uc81c\uc801 \ubc29\uc5b4\uc640 \uae30\ud68c \ud3ec\ucc29: \uba3c\uc800 **\uc2b9\ub9ac\ud560 \uc218 \uc5c6\ub294 \uc0c1\ud0dc(\ubd88\uac00\uc2b9)**\ub97c \ub9cc\ub4e4\uc5b4 \uc2a4\uc2a4\ub85c\ub97c \uad73\uac74\ud788 \ud558\uace0, \uc774\ud6c4 \uc801\uc774 **\uc2b9\ub9ac\ud560 \uc218 \uc788\ub294 \uc0c1\ud0dc(\uac00\uc2b9)**\uac00 \ub420 \ub54c\uae4c\uc9c0 \uae30\ub2e4\ub824\uc57c \ud569\ub2c8\ub2e4.\n\n \u2022\t\uc2b9\ub9ac\uc758 \uc778\uc2dd\uacfc \ud65c\uc6a9: \uc2b9\ub9ac\ud560 \uc218 \uc788\ub294 \uc870\uac74\uc740 \uc54c \uc218 \uc788\uc9c0\ub9cc(\u53ef\u77e5), \uc774\ub97c \uc5b5\uc9c0\ub85c \ub9cc\ub4e4\uc5b4\ub0bc \uc218\ub294 \uc5c6\uc2b5\ub2c8\ub2e4(\u4e0d\u53ef\u70ba). \uc989, \uc2b9\ub9ac\ub294 \uc778\uc704\uc801\uc73c\ub85c \ucc3d\uc870\ub418\ub294 \uac83\uc774 \uc544\ub2c8\ub77c, \uc801\uc758 \uc57d\uc810\uacfc \uae30\ud68c\ub97c \uc815\ud655\ud788 \uc77d\uc5b4\ub0b4\uace0 \ud65c\uc6a9\ud558\ub294 \ub370\uc11c \uc635\ub2c8\ub2e4.\n\n \u2022\t\ubc29\uc5b4\uc640 \uacf5\uaca9\uc758 \uad00\uacc4: \ubc29\uc5b4\ub294 \uc544\uad70\uc774 \ucda9\ubd84\uce58 \uc54a\uc744 \ub54c(\u5b88\u5247\u4e0d\u8db3) \ud0dd\ud558\ub294 \uac83\uc774\uace0, \uacf5\uaca9\uc740 \uc544\uad70\uc774 \ucda9\ubd84\ud788 \uac15\ub825\ud560 \ub54c(\u653b\u5247\u6709\u9918) \ud589\ud558\ub294 \uac83\uc785\ub2c8\ub2e4. \uc218\ube44\ub294 \ubd80\uc871\ud568\uc5d0\uc11c \ub098\uc624\uace0, \uacf5\uaca9\uc740 \uc5ec\uc720\ub85c\uc6c0\uc5d0\uc11c \ub098\uc635\ub2c8\ub2e4.\\nn \u2022\t\uc2b9\ub9ac\uc758 \uce21\uc815 \ub2e8\uacc4: \uc804\uc7c1\uc758 \uc2b9\ub9ac\ub294 **\ub2e4\uc12f \uac00\uc9c0 \uc694\uc18c(\ub3c4, \ub7c9, \uc218, \uce6d, \uc2b9)**\ub97c \ud1b5\ud574 \uce21\uc815\ub418\uace0 \uacc4\uc0b0\ub429\ub2c8\ub2e4. \uc774\ub294 \uace7 \uc815\ud655\ud55c \ub370\uc774\ud130\uc640 \ubd84\uc11d\uc744 \ud1b5\ud55c \uac1d\uad00\uc801\uc778 \ud310\ub2e8\uc758 \uc911\uc694\uc131\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4.\n\n   \u2219 \u5ea6(\ub3c4): \ub545\uc758 \ub113\uc774 (\uacf5\uac04\uc801 \uaddc\ubaa8)\n   \u2219 \u91cf(\ub7c9): \uad70\ub7c9\uc758 \uc591 (\ubb3c\uc801 \uc790\uc6d0) \n   \u2219 \u6578(\uc218): \ubcd1\ub825\uc758 \uc218 (\uc778\uc801 \uc790\uc6d0) \n   \u2219 \u7a31(\uce6d): \uc5ed\ub7c9\uc758 \ube44\uad50 (\uc0c1\ub300\uc801 \uc6b0\uc5f4) \n   \u2219 \u52dd(\uc2b9): \ucd5c\uc885\uc801\uc778 \uc2b9\ud328 \ud310\ub2e8\n\n \uc555\ub3c4\uc801\uc778 \uc2b9\ub9ac\uc758 \ud615\uc138: \uc2b9\ub9ac\ud558\ub294 \uc2f8\uc6c0\uc740 \ub9c8\uce58 \ucc9c \uae38 \uae4a\uc774\uc758 \uacc4\uace1\uc5d0\uc11c \uc3df\uc544\uc9c0\ub294 \uc5c4\uccad\ub09c \uc591\uc758 \ubb3c\ucc98\ub7fc(\u82e5\u6c7a\u7a4d\u6c34\u65bc\u5343\u4ede\u4e4b\u6eaa), \uc555\ub3c4\uc801\uc778 \ud615\uc138\ub97c \ud1b5\ud574 \uacb0\uc815\ub418\uc5b4\uc57c \ud569\ub2c8\ub2e4. \uc774\ub294 \ub2e8\uc228\uc5d0 \uc801\uc744 \uc81c\uc555\ud558\ub294 \uacb0\uc815\uc801\uc774\uace0 \ud30c\uad34\uc801\uc778 \ud798\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
