B.ar9=new A.a("\uc6b0\ub9ac\uc758 \ubc29\uc5b4\ub294 \ub09c\uacf5\ubd88\ub77d\uc774\uc5b4\uc57c \ud55c\ub2e4! \uc801\uc758 \ud5c8\uc810\uc744 \uc608\uce21\ud558\uace0, \ubaa8\ub4e0 \uc790\uc6d0\uacfc \ubcd1\ub825\uc744 \ucd5c\uc801\ud654\ud558\uc5ec \uc555\ub3c4\uc801\uc778 \uc804\ub825\uc744 \uad6c\ucd95\ud558\ub77c. \uc2b9\ub9ac\ub294 \uc608\uce21 \uac00\ub2a5\ud558\uc9c0\ub9cc, \uac15\uc694\ud560 \uc218 \uc5c6\ub2e4. \uc720\ub9ac\ud55c \ud615\uc138\uac00 \uad6c\ucd95\ub418\uba74, \ub9c8\uce58 \ub310\uc774 \ud130\uc9c4 \ubb3c\ucc98\ub7fc \uc801\uc744 \uc4f8\uc5b4\ubc84\ub9b4 \uac83\uc774\ub2e4!\n\u2022  \uc694\uc57d: \uad70\uc0ac \uc804\ub7b5\uc740 \ub2e8\uc21c\ud788 \uacf5\uaca9\uc744 \uc704\ud55c \uac83\uc774 \uc544\ub2c8\ub77c, \uac15\ub825\ud55c \uc5b5\uc81c\ub825\uacfc \ubc29\uc5b4 \uccb4\uacc4\ub85c \uc801\uc774 \uac10\ud788 \ub3c4\uc804\ud560 \uc218 \uc5c6\ub294 '\ubd88\uac00\uc2b9'\uc758 \uc0c1\ud0dc\ub97c \ub9cc\ub4dc\ub294 \ub370 \uc9d1\uc911\ud574\uc57c \ud569\ub2c8\ub2e4. \uc815\ubcf4, \uc790\uc6d0, \ubcd1\ub825\uc758 \uce58\ubc00\ud55c \ubd84\uc11d\uc744 \ud1b5\ud574 \uad70\uc0ac\uc801 '\ud615\uc138'\ub97c \uad6c\ucd95\ud558\uace0, \uc801\uc758 \uc2e4\uc218\ub97c \uae30\ub2e4\ub824 \uacb0\uc815\uc801\uc778 \uc21c\uac04\uc5d0 \uc555\ub3c4\uc801\uc778 \ud798\uc744 \ubc1c\ud718\ud558\ub294 \uac83\uc774 \ud604\ub300\uc804\uc758 \uc2b9\ub9ac \uacf5\uc2dd\uc785\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
B.aut=new A.a(" \uacbd\uc7c1\uc0ac\uac00 \ub118\ubcfc \uc218 \uc5c6\ub294 \ub3c5\uc810\uc801 \uc6b0\uc704\ub97c \uad6c\ucd95\ud558\ub77c! \uc2dc\uc7a5\uacfc \uacbd\uc7c1\uc0ac\ub97c \ubd84\uc11d\ud558\uace0, \uc790\uc6d0\uacfc \uc778\ub825\uc744 \ucd5c\uc801 \ubc30\ubd84\ud558\uc5ec \uc555\ub3c4\uc801\uc778 \uacbd\uc7c1\ub825\uc744 \ud655\ubcf4\ud558\ub77c. \uc2dc\uc7a5\uc758 \uc2b9\ub9ac\ub294 \uc608\uce21 \uac00\ub2a5\ud558\uc9c0\ub9cc, \ub3c5\ub2e8\uc73c\ub85c \ub9cc\ub4e4 \uc218 \uc5c6\ub2e4. \uace0\uac1d\uc758 \ub2c8\uc988\ub97c \ud3ed\ubc1c\uc2dc\ud0a4\ub294 \ud615\uc138\uac00 \ub418\uba74, \uc2dc\uc7a5\uc744 \uc7a5\uc545\ud560 \uac83\uc774\ub2e4!\n\u2022  \uc694\uc57d: \uae30\uc5c5\uc740 \uae30\uc220\ub825, \ube0c\ub79c\ub4dc, \uc11c\ube44\uc2a4, \uc790\ubcf8\ub825 \ub4f1 \ud575\uc2ec \uc5ed\ub7c9\uc744 \uac15\ud654\ud558\uc5ec \uacbd\uc7c1\uc790\uac00 \uc27d\uac8c \uce68\ubc94\ud560 \uc218 \uc5c6\ub294 '\ubd88\uac00\uc2b9'\uc758 \uc2dc\uc7a5 \uc9c0\uc704\ub97c \ub9cc\ub4e4\uc5b4\uc57c \ud569\ub2c8\ub2e4. \uc2dc\uc7a5 \ud658\uacbd, \uacbd\uc7c1\uc0ac, \uc790\uc0ac\uc758 \uc5ed\ub7c9\uc744 \ucca0\uc800\ud788 \ubd84\uc11d\ud558\uc5ec \ucd5c\uc801\uc758 \uc790\uc6d0 \ubc30\ubd84\uacfc \uc778\ub825 \uc6b4\uc6a9\uc744 \ud1b5\ud574 \uacbd\uc7c1 \uc6b0\uc704\ub97c \ud655\ubcf4\ud558\uace0, \uace0\uac1d\uc758 \ub2c8\uc988\ub97c \ucda9\uc871\uc2dc\ud0a4\ub294 \uac15\ub825\ud55c \ube44\uc988\ub2c8\uc2a4 '\ud615\uc138'\ub97c \uad6c\ucd95\ud558\uc5ec \uc2dc\uc7a5\uc744 \uc120\ub3c4\ud574\uc57c \ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
B.axF=new A.a(" \uc6b0\ub9ac \ud300\uc740 \uc808\ub300 \ub6ab\ub9ac\uc9c0 \uc54a\ub294 \ubc29\ud328\uac00 \ub418\uc5b4\uc57c \ud55c\ub2e4! \uc0c1\ub300 \ud300\uc758 \uc57d\uc810\uc744 \uc608\uce21\ud558\uace0, \uc120\uc218\ub4e4\uc758 \ucee8\ub514\uc158\uacfc \uc804\uc220\uc744 \ucd5c\uc801\ud654\ud558\uc5ec \uc555\ub3c4\uc801\uc778 \uc804\ub825\uc744 \uad6c\ucd95\ud558\ub77c. \uacbd\uae30\uc758 \uc2b9\ub9ac\ub294 \uc608\uce21 \uac00\ub2a5\ud558\uc9c0\ub9cc, \uac15\uc81c\ub85c \ub9cc\ub4e4 \uc218 \uc5c6\ub2e4. \uc644\ubcbd\ud55c \ud300\uc6cc\ud06c\uac00 \ud3ed\ubc1c\ud558\ub294 \ud615\uc138\uac00 \ub418\uba74, \uc2b9\ub9ac\ub294 \uc790\uc5f0\uc2a4\ub7fd\uac8c \ub530\ub77c\uc62c \uac83\uc774\ub2e4!\n\u2022  \uc694\uc57d: \uc2a4\ud3ec\uce20 \ud300\uc740 \uba3c\uc800 \ud0c4\ud0c4\ud55c \uc218\ube44 \uc870\uc9c1\ub825\uacfc \uc120\uc218 \uac1c\uac1c\uc778\uc758 \uae30\ub7c9 \ud5a5\uc0c1\uc744 \ud1b5\ud574 \uc0c1\ub300 \ud300\uc774 \uc27d\uac8c \ub4dd\uc810\ud560 \uc218 \uc5c6\ub294 '\ubd88\uac00\uc2b9'\uc758 \uc0c1\ud0dc\ub97c \ub9cc\ub4e4\uc5b4\uc57c \ud569\ub2c8\ub2e4. \uc0c1\ub300 \ud300\uc758 \uc804\uc220, \uc120\uc218 \ucee8\ub514\uc158, \uadf8\ub9ac\uace0 \uc6b0\ub9ac \ud300\uc758 \uac15\uc57d\uc810\uc744 \uba74\ubc00\ud788 \ubd84\uc11d\ud558\uc5ec \ucd5c\uc801\uc758 \ud3ec\uc9c0\uc158 \ubc30\uce58\uc640 \uc804\uc220\uc744 \ud1b5\ud574 '\ud300\uc758 \ud615\uc138'\ub97c \uad6c\ucd95\ud558\uace0, \uacbd\uae30 \uc911 \uc0c1\ub300\uc758 \ud5c8\uc810\uc744 \ub178\ub824 \uc2b9\ub9ac\ub97c \ud544\uc5f0\uc801\uc73c\ub85c \ub9cc\ub4dc\ub294 \uac83\uc774 \uc911\uc694\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
