B.alo=new A.a("  \u2022\t\u6230\u52dd(zh\xe0n sh\xe8ng): \uc2f8\uc6cc\uc11c \uc774\uae30\ub2e4 \n  \u2022 \u653b\u53d6(g\u014dng q\u01d4): \uacf5\uaca9\ud558\uc5ec \uc810\ub839\ud558\ub2e4 \n  \u2022 \u800c(\xe9r): \uadf8\ub7f0\ub370\ub3c4, \uadf8\ub7fc\uc5d0\ub3c4 \ubd88\uad6c\ud558\uace0 \n  \u2022 \u4e0d(b\xf9): ~\ud558\uc9c0 \uc54a\ub2e4 \n  \u2022 \u4fee(xi\u016b): \uc218\uc2b5\ud558\ub2e4, \uc815\ube44\ud558\ub2e4, \ub2e4\ub4ec\ub2e4 \n  \u2022 \u5176\u653b(q\xed g\u014dng): \uadf8 \uacf5\uaca9(\uc758 \uc131\uacfc) \n  \u2022 \u8005(zh\u011b): ~\ud55c \uc0ac\ub78c \ud639\uc740 ~\ud558\ub294 \uc790 \n  \u2022 \u51f6(xi\u014dng): \ud749\ud558\ub2e4, \ud574\ub86d\ub2e4, \ub098\uc058\ub2e4 \n  \u2022 \u547d(m\xecng): \uc774\ub984, \ubd80\ub984, \uc815\uc758\ud568 \n  \u2022 \u66f0(yu\u0113): \ub9d0\ud558\ub2e4, \uc774\ub974\ub2e4 \n  \u2022 \u8cbb\u7559(f\xe8i li\xfa): \uc790\uc6d0\uc744 \ub0ad\ube44\ud558\uace0 \uc624\ub798 \uba38\ubb34\ub984 (\ube44\uc6a9\uacfc \uc2dc\uac04\uc758 \ub0ad\ube44) \n\n",null,B.a,null,B.c)
B.aiG=new A.a("\u201c\uc2f8\uc6cc\uc11c \uc774\uae30\uace0 \uacf5\uaca9\ud558\uc5ec \uc601\ud1a0\ub97c \ud68d\ub4dd\ud588\uc74c\uc5d0\ub3c4 \ubd88\uad6c\ud558\uace0, \uadf8 \uc131\uacfc\ub97c \uc798 \ub2e4\uc2a4\ub9ac\uc9c0 \ubabb\ud558\ub294 \uc790\ub294 \ud749\ud558\ub2c8, \uc774\ub97c '\uc18c\ubaa8\ub9cc \ud558\uace0 \uba38\ubb34\ub974\ub294 \uac83'\uc774\ub77c \uc77c\uceeb\ub294\ub2e4.\u201d",null,B.a,null,B.c)
