B.alf=new A.a("\uc2b9\ub9ac \uc774\ud6c4\uc758 \uad00\ub9ac\uc640 \uc720\uc9c0\ubcf4\uc218\uc758 \uc911\uc694\uc131\uc744 \uac15\uc870\ud558\uba70, \uc774\ub97c \uc18c\ud640\ud788 \ud560 \uacbd\uc6b0\uc758 \uc704\ud5d8\uc131\uc744 \uacbd\uace0\ud569\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
B.aar=new A.a(" 1. \uc2b9\ub9ac\uc640 \ud68d\ub4dd\uc758 \uacfc\uc815: \uc804\ud22c\uc5d0\uc11c \uc2b9\ub9ac\ud558\uace0 \uc801\uc758 \uc601\ud1a0\ub098 \uc790\uc6d0\uc744 \ud68d\ub4dd\ud558\ub294 \uac83\uc740 \uc131\uacf5\uc801\uc778 \uad70\uc0ac \uc791\uc804\uc758 \uacb0\uacfc\uc785\ub2c8\ub2e4. \n\n 2. \uc131\uacfc \uad00\ub9ac\uc758 \uc911\uc694\uc131 (\u4e0d\u4fee\u5176\u529f\u8005\u51f6): \uadf8\ub7ec\ub098 \uc774\ub7ec\ud55c \uc131\uacfc\ub97c \uc81c\ub300\ub85c \uad00\ub9ac\ud558\uace0 \uc720\uc9c0\ubcf4\uc218\ud558\uc9c0 \uc54a\uc73c\uba74 \uc704\ud5d8(\u51f6)\uc5d0 \ucc98\ud558\uac8c \ub429\ub2c8\ub2e4. \ub2e8\uc21c\ud788 \uc774\uacbc\ub2e4\uace0 \ub05d\ub098\ub294 \uac83\uc774 \uc544\ub2c8\ub77c, \uc810\ub839\uc9c0\uc758 \uc548\uc815\ud654, \uc790\uc6d0\uc758 \ud6a8\uc728\uc801 \ud65c\uc6a9, \ubcd1\ub825\uc758 \uc7ac\uc815\ube44 \ub4f1 \uc0ac\ud6c4 \uad00\ub9ac\uac00 \ud544\uc218\uc801\uc774\ub77c\ub294 \uc758\ubbf8\uc785\ub2c8\ub2e4. \n\n 3. \u8cbb\u7559\uc758 \uc758\ubbf8: \uc774\ub7ec\ud55c \uc0c1\ud0dc\ub97c \u8cbb\u7559\ub77c\uace0 \uc815\uc758\ud569\ub2c8\ub2e4. \uc774\ub294 \ub9ce\uc740 \uc2dc\uac04\uacfc \uc790\uc6d0, \ub178\ub825\uc744 \uc18c\ubaa8(\u8cbb)\ud588\uc9c0\ub9cc, \uacb0\uad6d \uc544\ubb34\ub7f0 \uc9c4\uc804 \uc5c6\uc774 \uc81c\uc790\ub9ac\uc5d0 \uba38\ubb3c\uac8c(\u7559) \ub41c\ub2e4\ub294 \ub73b\uc785\ub2c8\ub2e4. \uc989, \uc2b9\ub9ac\uac00 \ub3c5\uc774 \ub418\uc5b4 \ub354 \ud070 \uc190\uc2e4\uc744 \ucd08\ub798\ud560 \uc218 \uc788\uc74c\uc744 \uacbd\uace0\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
