B.an8=new A.a(" 1.\t\uc9c0\uc18d \uac00\ub2a5\ud55c \uc2b9\ub9ac: \uc9c4\uc815\ud55c \uc2b9\ub9ac\ub294 \ub2e8\uc21c\ud788 \uc804\ud22c\uc5d0\uc11c \uc774\uae30\ub294 \uac83\uc744 \ub118\uc5b4, \uadf8 \uc2b9\ub9ac\uc758 \uc131\uacfc\ub97c \uc7a5\uae30\uc801\uc73c\ub85c \uc720\uc9c0\ud558\uace0 \ubc1c\uc804\uc2dc\ud0a4\ub294 \ub370 \uc788\uc2b5\ub2c8\ub2e4. \n\n 2.\t\uc0ac\ud6c4 \uad00\ub9ac\uc758 \uc911\uc694\uc131: \uc131\uacf5\uc801\uc778 \uacb0\uacfc\ubb3c\uc744 \uc5bb\uc5c8\uc744 \ub54c, \uc774\ub97c \uad00\ub9ac\ud558\uace0 \uc815\ube44\ud558\ub294 \uc0ac\ud6c4 \uc808\ucc28\uac00 \uc5c6\uc73c\uba74 \uc624\ud788\ub824 \uc790\uc6d0 \ub0ad\ube44\uc640 \uc815\uccb4\ub85c \uc774\uc5b4\uc9c8 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \n\n 3.\t\uc790\uc6d0 \ub0ad\ube44 \uacbd\uacc4: \uc2b9\ub9ac\ub97c \uc704\ud55c \ud22c\uc790\uc640 \ub178\ub825\uc5d0\ub3c4 \ubd88\uad6c\ud558\uace0, \uadf8 \uc131\uacfc\ub97c \uc81c\ub300\ub85c \ud65c\uc6a9\ud558\uc9c0 \ubabb\ud558\uba74 \ub9c9\ub300\ud55c \uc790\uc6d0\uc774 \ub0ad\ube44\ub418\ub294 \uacb0\uacfc\ub97c \ucd08\ub798\ud569\ub2c8\ub2e4. \n\n 4.\t\ud655\uc7a5\uacfc \uc720\uc9c0\uc758 \uade0\ud615: \ubb34\uc870\uac74\uc801\uc778 \ud655\uc7a5\ubcf4\ub2e4\ub294 \ud655\uc7a5\ub41c \uc601\uc5ed\uc774\ub098 \ud68d\ub4dd\ud55c \uc790\uc0b0\uc744 \uc548\uc815\uc801\uc73c\ub85c \uc720\uc9c0\ud558\uace0 \ud1b5\ud569\ud558\ub294 \ub2a5\ub825\uc774 \uc911\uc694\ud569\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
