B.a98=new A.a("\ud83d\udcda \uc190\uc790\ubcd1\ubc95 13\ud3b8 \uc6a9\uac04(\u7528\u9593)\u2013 \uc694\uc57d \n",null,B.a,null,B.m)
B.aAv=new A.a(" \uc190\uc790\ubcd1\ubc95 \uc6a9\uac04(\u7528\u9593)\ud3b8\uc5d0\uc11c\ub294 \uc815\ubcf4\uc640 \ucca9\ubcf4 \ud65c\ub3d9\uc774 \uc804\uc7c1\uc758 \uc2b9\ud328\ub97c \uc88c\uc6b0\ud558\ub294 \uac00\uc7a5 \uc911\uc694\ud55c \uc694\uc18c\uc784\uc744 \uac15\uc870\ud569\ub2c8\ub2e4. \n\n ",null,B.a,null,B.t)
B.akf=new A.a(" \uc190\uc790\ub294 \uc815\ubcf4 \ud68d\ub4dd\uc758 \uadfc\ubcf8\uc801\uc778 \ubc29\ubc95\uacfc \uc911\uc694\uc131, \uadf8\ub9ac\uace0 \uc774\ub97c \uc2e4\ud589\ud558\ub294 \ub9ac\ub354\uc758 \uc5ed\ud560\uc744 \ub2e4\uc74c\uacfc \uac19\uc774 \uc124\uba85\ud569\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
B.aji=new A.a(" 1. \uc131\uacf5\uc758 \ud575\uc2ec\uc740 '\uc120\uc9c0(\u5148\u77e5)': \ub6f0\uc5b4\ub09c \uc131\uacf5\uc740 \ubbf8\ub9ac \uc544\ub294 \uac83\uc5d0\uc11c \ube44\ub86f\ub429\ub2c8\ub2e4. \uc774 '\uc120\uc9c0'\ub294 \ubbf8\uc2e0\uc774\ub098 \uac89\uc73c\ub85c \ub4dc\ub7ec\ub09c \ud604\uc0c1, \ud1b5\uacc4\uc801 \uc218\uce58\ub85c\ub294 \uc5bb\uc744 \uc218 \uc5c6\uace0, \ubc18\ub4dc\uc2dc '\uc0ac\ub78c'\uc744 \ud1b5\ud574 '\uc801\uc758 \uc2e4\uc81c \uc0c1\ud669'\uc744 \ud30c\uc545\ud574\uc57c \ud569\ub2c8\ub2e4. \n\n 2. \ub2e4\uc12f \uac00\uc9c0 \uac04\ucca9 \ud65c\uc6a9\ubc95: \ucca9\ubcf4 \ud65c\ub3d9\uc5d0\ub294 \ud604\uc9c0\uc778\uc744 \ud65c\uc6a9\ud558\ub294 \uc778\uac04(\u56e0\u9593), \uc801 \ub0b4\ubd80\uc758 \uc778\ubb3c\uc744 \ud3ec\uc12d\ud558\ub294 \ub0b4\uac04(\u5167\u9593), \uc801\uc758 \uac04\ucca9\uc744 \uc5ed\uc774\uc6a9\ud558\ub294 \ubc18\uac04(\u53cd\u9593), \uac70\uc9d3 \uc815\ubcf4\ub97c \ud758\ub824 \uc801\uc744 \uc624\ub3c4\ud558\ub294 \uc0ac\uac04(\u6b7b\u9593), \uadf8\ub9ac\uace0 **\uc9c1\uc811 \uc815\ubcf4\ub97c \uc218\uc9d1\ud558\uc5ec \ubcf5\uadc0\ud558\ub294 \uc0dd\uac04(\u751f\u9593)**\uc758 \ub2e4\uc12f \uac00\uc9c0 \uc720\ud615\uc774 \uc788\uc2b5\ub2c8\ub2e4. \uc774\ucc98\ub7fc \ub2e4\uc591\ud55c \uc885\ub958\uc758 \uac04\ucca9\uc744 \ubaa9\uc801\uc5d0 \ub9de\uac8c \uc6b4\uc6a9\ud574\uc57c \ud569\ub2c8\ub2e4. \n\n 3. \ucca9\ubcf4 \ud65c\ub3d9\uc758 \uc808\ub300\uc801 \uc911\uc694\uc131: \ubaa8\ub4e0 \uad70\uc0ac \ud65c\ub3d9 \uc911\uc5d0\uc11c \ucca9\ubcf4 \ud65c\ub3d9\ub9cc\ud07c \uc911\uc694\ud558\uace0 \uae34\ubc00\ud55c \uac83\uc740 \uc5c6\uc73c\uba70, \uc815\ubcf4\ub97c \uac00\uc838\uc624\ub294 \uac04\ucca9\uc5d0\uac8c\ub294 \uac00\uc7a5 \ud6c4\ud55c \ubcf4\uc0c1\uc744 \uc8fc\uc5b4\uc57c \ud569\ub2c8\ub2e4. \ub610\ud55c, \ucca9\ubcf4 \ud65c\ub3d9\uc740 \uac00\uc7a5 \ube44\ubc00\uc2a4\ub7fd\uac8c \uc774\ub8e8\uc5b4\uc838\uc57c \ud569\ub2c8\ub2e4. \n\n 4. \uc138\ubc00\ud55c \uc778\uc801 \uc815\ubcf4\uc758 \uc911\uc694\uc131: \uc5b4\ub5a4 \ubaa9\ud45c(\uad70\ub300, \uc131, \ud2b9\uc815 \uc778\ubb3c)\ub97c \uacf5\uaca9\ud560 \ub54c\ub294 \ub2e8\uc21c\ud788 \ubcd1\ub825 \uaddc\ubaa8\ub97c \ub118\uc5b4, \uadf8 \ubaa9\ud45c\ub97c \uc9c0\ud0a4\ub294 \uc7a5\uc218\uc640 \ud575\uc2ec \uce21\uadfc\ub4e4\uc758 '\uc774\ub984'\uae4c\uc9c0 \ubbf8\ub9ac \uc54c\uc544\ub0b4\uc5b4 \ucca9\ubcf4 \ud65c\ub3d9\uc758 \uad6c\uccb4\uc801\uc778 \ubaa9\ud45c\ub85c \uc0bc\uc544\uc57c \ud569\ub2c8\ub2e4. \n\n 5. \ub9ac\ub354\uc758 \uc5ed\ud560\uacfc \uc815\ubcf4\uc804: \uc624\uc9c1 \ucd1d\uba85\ud558\uace0 \ud604\uba85\ud55c \uad70\uc8fc\uc640 \uc7a5\uc218\ub9cc\uc774 \uac00\uc7a5 \uc9c0\ud61c\ub85c\uc6b4 \uc778\ubb3c\uc744 \ucca9\ubcf4 \ud65c\ub3d9\uc5d0 \ud65c\uc6a9\ud560 \uc218 \uc788\uc73c\uba70, \uc774\ub97c \ud1b5\ud574 \ubc18\ub4dc\uc2dc \ud070 \uc131\uacf5\uc744 \uac70\ub458 \uac83\uc785\ub2c8\ub2e4. \ucca9\ubcf4 \ud65c\ub3d9\uc774\uc57c\ub9d0\ub85c \ubcd1\ubc95\uc758 \ud575\uc2ec\uc774\uc790, \ubaa8\ub4e0 \uad70\ub300\uac00 \uc758\uc9c0\ud558\uc5ec \uc6c0\uc9c1\uc774\ub294 \uadfc\uac04\uc774 \ub429\ub2c8\ub2e4. \n\n \uacb0\ub860\uc801\uc73c\ub85c \uc190\uc790\ubcd1\ubc95\uc740 \uc815\ubcf4\ub97c \uc804\uc7c1\uc758 \uac00\uc7a5 \ubcf8\uc9c8\uc801\uc778 \uc694\uc18c\ub85c \uac04\uc8fc\ud558\uba70, \uc815\ud655\ud55c \uc815\ubcf4 \ud68d\ub4dd\uc744 \uc704\ud574 \uccb4\uacc4\uc801\uc774\uace0 \ub2e4\uc591\ud55c \ucca9\ubcf4 \ud65c\ub3d9\uc5d0 \ud22c\uc790\ud558\uace0, \uc774\ub97c \ub9ac\ub354\uc2ed\uc758 \ucd5c\uc6b0\uc120 \uacfc\uc81c\ub85c \uc0bc\uc544\uc57c \ud55c\ub2e4\uace0 \uac15\uc870\ud569\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
