B.auk=new A.a("\u318d\u767e\u6230\u767e\u52dd(b\u01cei zh\xe0n b\u01cei sh\xe8ng): To win every battle out of a hundred. \n\u318d\u975e\u5584\u4e4b\u5584\u8005\u4e5f(f\u0113i sh\xe0n zh\u012b sh\xe0n zh\u011b y\u011b): Not the supreme excellence (there is something even better). \n\u318d\u4e0d\u6230\u800c\u5c48\u4eba\u4e4b\u5175(b\xf9 zh\xe0n \xe9r q\u016b r\xe9n zh\u012b b\u012bng): To subdue the enemy's army without fighting. \n\u318d\u5584\u4e4b\u5584\u8005\u4e5f(sh\xe0n zh\u012b sh\xe0n zh\u011b y\u011b): Truly the most excellent method (the best of the best).  \n\n",null,B.a,null,B.c)
B.apO=new A.a("\u201cTo win a hundred victories in a hundred battles is not the highest excellence; to subdue the enemy's army without fighting is the highest excellence. True victory lies in winning without armed conflict.\u201d",null,B.a,null,B.c)
