B.auU=new A.a("This passage emphasizes that the purpose of war is not merely to overpower the enemy by force, but to achieve the maximum gain with the minimum loss, and the best way to do so is to win without fighting. \n\n",null,B.a,null,B.c)
B.ads=new A.a("1.\tLimitations of Hundred Victories in Hundred Battles: Winning a hundred battles in a hundred engagements may appear to be a perfect victory. However, it inevitably involves casualties among one's own forces, expenditure of resources, and depletion of national strength, which are inherent in numerous battles. Frequent wars, even if victorious, can exhaust the entire nation, meaning they cannot truly be called 'excellent (\u5584)' victories. \n\n2.\tValue of Subduing Without Fighting (\u4e0d\u6230\u5c48\u4eba): The most ideal victory is to 'subdue the enemy's army without fighting (\u4e0d\u6230\u800c\u5c48\u4eba\u4e4b\u5175)'. This means using diplomacy, strategic pressure, psychological warfare, and deception to make the enemy lose the will to fight and surrender. This method allows for the complete acquisition of enemy resources (territory, personnel, materiel, etc.) without any losses to one's own side, thus it is highly praised as 'the best of the best (\u5584\u4e4b\u5584\u8005)'. \n\n3.\tImportance of Strategy and Cunning: This passage does not simply emphasize military force but highlights the importance of strategy, diplomacy, and psychological warfare that can achieve victory without resorting to force.\n\n",null,B.a,null,B.c)
