B.awf=new A.a("This phrase explains active psychological warfare and luring tactics that can disrupt the enemy and make them move as intended by our side, by identifying their current state (at ease, full, stable) and turning that state against them. This is an important operational principle of the 'Weak Points and Strong (\u865b\u5be6)' strategy.\n\n",null,B.a,null,B.c)
B.avw=new A.a(" 1.\t\u6575\u4f5a\u80fd\u6012\u4e4b (D\xed y\xec n\xe9ng n\xf9 zh\u012b, When the enemy is at ease, be able to make him angry):\n \u2022\tMeaning: When the enemy is off guard and in a 'comfortable and lazy (\u4f5a)' state, trivial provocations or unexpected attacks can 'irritate (\u6012)' them or induce them to react hastily. The intention here is to make the enemy lose their calm judgment and react emotionally, causing them to make mistakes.\n\n 2.\t\u98fd\u80fd\u98e2\u4e4b (b\u01ceo n\xe9ng j\u012b zh\u012b, When full, be able to make him hungry):\n\u2022\tMeaning: When the enemy believes their supply situation is 'full (\u98fd)' and sufficient, this means our side can 'make them hungry (\u98e2)' by cutting off supply routes or forcing them to expend resources. This is a strategy to weaken the enemy's combat capability by undermining resources or foundations essential for their survival.\n\n 3.\t\u5b89\u80fd\u52d5\u4e4b (\u0101n n\xe9ng d\xf2ng zh\u012b, When stable, be able to make him move):\n\u2022\tMeaning: When the enemy is 'stable (\u5b89)' in their current position or state and has no intention of moving, this means our side can 'make them move (\u52d5)' by dangling a specific benefit as bait or by imposing a threat. The intention here is to lure the enemy to a location desired by our side or to draw them into unfavorable terrain for attack.\n",null,B.a,null,B.c)
