B.akv=new A.a("\ud83d\udcda 11: The Nine Situations(\u4e5d\u5730) \u2013 6\n",null,B.a,null,B.m)
B.aev=new A.a("  \u2022 \u4e0d\u722d(b\xf9 zh\u0113ng): Does not contend. \n  \u2022 \u5929\u4e0b\u4e4b\u4ea4(ti\u0101n xi\xe0 zh\u012b ji\u0101o): Worldly diplomatic relations, public relations. \n  \u2022 \u4e0d\u990a(b\xf9 y\u01ceng): \uae30Does not cultivate, does not rely on. \n  \u2022 \u5929\u4e0b\u4e4b\u6b0a(ti\u0101n xi\xe0 zh\u012b qu\xe1n): Worldly power or external forces. \n  \u2022 \u795e\u6a5f(sh\xe9n j\u012b): Divine strategy, astute planning. \n  \u2022 \u4e4b\u58eb(zh\u012b sh\xec): Such a person, strategist. \n  \u2022 \u7232\u5bb6(w\xe9i ji\u0101): To make one's dwelling, to make one's home. \n  \u2022 \u65bc\u8cca(y\xfa z\xe9i): Within enemy lines, with the enemy.   \n\n",null,B.a,null,B.c)
B.axD=new A.a('"One who does not contend for worldly diplomatic relations, nor cultivate worldly power, but possesses divine strategic insight, makes his base within the enemy\'s ranks."',null,B.a,null,B.c)
