B.aoy=new A.a("This passage means One who is not swayed by apparent diplomacy or power, but rather gains information and conducts operations from within the enemy's ranks, is a true strategist. It describes the unique approach of a 'person with divine strategic insight (\u795e\u6a5f\u4e4b\u58eb)' who goes beyond ordinary strategists.\n\n",null,B.a,null,B.c)
B.aa_=new A.a(" 1.\t\u4e0d\u722d\u5929\u4e0b\u4e4b\u4ea4 \u4e0d\u990a\u5929\u4e0b\u4e4b\u6b0a: Ordinary rulers or strategists focus on building diplomatic relations with neighboring countries, forming alliances, or expanding their power and influence. However, a 'person with divine strategic insight' does not get entangled in these direct diplomatic/political competitions. It means not being obsessed with apparent justifications or power expansion. \n\n 2.\t\u7232\u5bb6\u65bc\u8cca: They penetrate deep into enemy lines to establish their base or influence. This can mean physical occupation, but more broadly, it refers to advancing one's interests from within the enemy's heart by exploiting internal weaknesses to foster division, extract critical information, or influence enemy decision-making, through intangible means. \n\n 3.\t\u795e\u6a5f\u4e4b\u58eb: Such a strategy is difficult to understand with conventional thinking and can only be executed by someone with immense insight, courage, and a 'divine' ability to accurately discern future opportunities (\u6a5f). Although it may seem like a dangerous gamble on the surface, it can be the most effective way to undermine the enemy's core with a long-term perspective. \n\n",null,B.a,null,B.c)
