B.aza=new A.a(" 1.\tFundamental Cause Resolution: Strategic thinking is needed to delve into the root causes of problems or the enemy's core vulnerabilities, rather than being entangled in superficial phenomena or mundane competition. \n\n 2.\tUnconventional Approach: An unconventional and disruptive approach, unexpected by the opponent, is necessary instead of predictable and formalized methods. \n\n 3.\tImportance of Internal Disruption: Strategies that weaken and disintegrate the enemy from within can be far more effective than direct external conflict. \n\n 4.\tInsight and Courage: Unconventional strategies involve immense risk, so only leaders with insight to see through the future and the courage to boldly execute that insight can employ them. \n\n",null,B.a,null,B.c)
