B.wj=new A.a(" \u5fc5\u6b7b\u53ef\u6bba\u4e5f \u5fc5\u751f\u53ef\u865c\u4e5f \u5fff\u901f\u53ef\u4fae\u4e5f \u5ec9\u6f54\u53ef\u8fb1\u4e5f \u611b\u6c11\u53ef\u7169\u4e5f \n\n",null,B.a,null,B.t)
B.axp=new A.a(" \u2022 \u5fc5\u6b7b\u53ef\u6bba\u4e5f(b\xec s\u01d0 k\u011b sh\u0101 y\u011b): Those determined to die can be killed. \n \u2022 \u5fc5\u751f\u53ef\u865c\u4e5f(b\xec sh\u0113ng k\u011b l\u01d4 y\u011b): Those determined to live can be captured. \n \u2022 \u5fff\u901f\u53ef\u4fae\u4e5f(f\xe8n s\xf9 k\u011b w\u01d4 y\u011b): Those who are quick to anger can be insulted. \n \u2022 \u5ec9\u6f54\u53ef\u8fb1\u4e5f(li\xe1n ji\xe9 k\u011b r\u01d4 y\u011b): \uc9c0Those who are excessively incorruptible can be disgraced. \n \u2022 \u611b\u6c11\u53ef\u7169\u4e5f(\xe0i m\xedn k\u011b f\xe1n y\u011b): Those who love their people can be troubled.  \n\n",null,B.a,null,B.c)
B.at7=new A.a("\u201cThose determined to die can be killed, those who wish to live can be captured, those who are quick to anger can be insulted, those who are excessively incorruptible can be disgraced, and those who cherish their people can be exhausted.\u201d\n",null,B.a,null,B.c)
