B.adm=new A.a(" This passage classifies five types of individuals (or psychological states) and presents methods to exploit their inherent weaknesses. This is a sophisticated psychological warfare tactic that penetrates the enemy's inner thoughts and uses their characteristics against them to achieve victory.\n",null,B.a,null,B.c)
B.af8=new A.a(" 1.\t\u5fc5\u6b7b\u53ef\u6bba\u4e5f (Those determined to die can be killed):\n\u2022\tMeaning: Those who fight desperately, not fearing death (\u5fc5\u6b7b), are often reckless and easily put themselves in danger. Therefore, if one seizes the opportunity to attack, they can be killed. (This may sound paradoxical, but it points out that a blind courage that disregards death can sometimes be a fatal weakness).\n\n 2.\t\u5fc5\u751f\u53ef\u865c\u4e5f (Those who wish to live can be captured):\n\u2022\tMeaning: Those who have a strong desire to live (\u5fc5\u751f) are likely to surrender or be persuaded to avoid death. Therefore, they can be captured.\n\n 3.\t\u5fff\u901f\u53ef\u4fae\u4e5f (Those who are quick to anger can be insulted):\n\u2022\tMeaning: Those who are impatient and easily angered (\u5fff\u901f) are easily provoked or insulted, losing their composure and acting rashly. Therefore, they can be defeated through such means. \n\n 4.\t\u5ec9\u6f54\u53ef\u8fb1\u4e5f (Those who are incorruptible can be disgraced):\n\u2022\tMeaning: Those who are incorruptible and value honor (\u5ec9\u6f54) are extremely sensitive to slander, conspiracy, or humiliating situations. Therefore, their mental composure can be broken through such means. \n\n 5.\t\u611b\u6c11\u53ef\u7169\u4e5f (Those who love their people can be troubled):\n\u2022\tMeaning: Those who have strong love and responsibility for their people or subordinates (\u611b\u6c11) are sensitive to their safety or suffering. Therefore, this can be used to trouble them or psychologically pressure them, clouding their judgment. (e.g., inducing civilian casualties to create humanitarian pressure, or increasing supply/relief burdens through rear disturbances to trouble the commander).\n ",null,B.a,null,B.c)
