B.at6=new A.a(" 1.\tAnalysis of Individual Psychology: Thoroughly analyze the tendencies and psychological states of enemy commanders, key figures, or the entire army to identify their inherent weaknesses. \n\n 2.\tTailored Exploitation of Weaknesses: Employ tailored strategies according to each identified weakness (disregard for death, desire for survival, impatience, sense of honor, love and responsibility) to effectively defeat the opponent. \n\n 3.\tPsychological Disruption: Emphasizes the importance of psychological warfare that shakes the opponent's mental composure, judgment, and morale even before direct physical conflict. \n\n 4.\tWisdom of Counter-Exploitation: It is necessary to understand that what appears to be the opponent's strength (courage, incorruptibility, love for people) can paradoxically become a weakness in certain situations and to have the wisdom to exploit this. \n\n 5.\tIndirect Influence: Sometimes, indirect influence that provokes the opponent's weaknesses, making them act rashly or collapse on their own, is more effective than direct attacks. \n\n",null,B.a,null,B.c)
