B.awP=new A.a("\uc6b0\ub9ac\ub294 \uc801\uc73c\ub85c \ud558\uc5ec\uae08 \uc6b0\ub9ac\uac00 \uc6d0\ud558\ub294 \uacf3\uc73c\ub85c \uc624\uac8c \ud560\uc9c0\uc5b8\uc815, \uacb0\ucf54 \uc801\uc758 \uacc4\ub7b5\uc5d0 \uc774\ub04c\ub9ac\uc9c0 \uc54a\ub294\ub2e4. \uc774\uc775\uc744 \ub358\uc838 \uc801\uc744 \uc720\uc778\ud558\uace0, \uc190\ud574\ub97c \uc785\ud600 \uc801\uc774 \uc624\uc9c0 \ubabb\ud558\uac8c \ub9c9\ub294\ub2e4. \uc801\uc774 \ud3b8\uc548\ud788 \uc274 \ub54c \ub3c4\ubc1c\ud558\uc5ec \ubd84\ub178\ucf00 \ud558\uace0, \ubcf4\uae09\uc774 \ucda9\ubd84\ud560 \ub54c \ucc28\ub2e8\ud558\uc5ec \uad76\uc8fc\ub9ac\uac8c \ud558\uba70, \ubc29\uc5b4 \ud0dc\uc138\uac00 \uc548\uc815\uc801\uc77c \ub54c \uc720\uc778\ud558\uc5ec \uc6c0\uc9c1\uc774\uac8c \ud558\ub77c. \uc801\uc774 \ubc29\uc5b4\ud558\uc9c0 \uc54a\ub294 \ud5c8\uc810\uc744 \ud30c\uace0\ub4e4\uace0, \uc801\uc774 \uc804\ud600 \uc608\uc0c1\uce58 \ubabb\ud558\ub294 \ubc29\ud5a5\uc5d0\uc11c \uc2e0\uc18d\ud788 \uae30\uc2b5\ud558\uc5ec \uc2b9\ub9ac\ud558\ub77c. \uc120\uc81c\uacf5\uaca9\uc73c\ub85c \uc801\uc758 \ubc29\uc5b4\uc120\uc744 \ub4a4\ud754\ub4e4\uace0, \ucca0\ud1b5 \ubc29\uc5b4\ub85c \uc801\uc758 \uacf5\uaca9 \ubaa9\ud45c\ub97c \ubaa8\ud638\ud558\uac8c \ub9cc\ub4e4\ub77c. \ubaa8\ub4e0 \uc804\uc120\uc744 \ubc29\uc5b4\ud558\ub824\ub2e4 \ubaa8\ub4e0 \uacf3\uc5d0\uc11c \uc57d\ud574\uc9c4\ub2e4. \uc57d\ud55c \uad70\ub300\ub294 \uc801\uc5d0\uac8c \ub04c\ub824\ub2e4\ub2c8\uc9c0\ub9cc, \uac15\ud55c \uad70\ub300\ub294 \uc801\uc774 \uc790\uc2e0\uc744 \ubc29\uc5b4\ud558\uac8c \ub9cc\ub4e0\ub2e4. \uad81\uadf9\uc758 \uc804\ub7b5\uc740 \uc801\uc774 \uc6b0\ub9ac\ub97c \ubcf4\uc9c0 \ubabb\ud558\uace0, \uc6b0\ub9ac\uc758 \uc758\ub3c4\ub97c \uc54c\uc9c0 \ubabb\ud558\ub294 '\ubb34\ud615\uc758 \uc0c1\ud0dc'\uc5d0 \uc774\ub974\ub294 \uac83\uc774\ub2e4!\n\u2022  \uc694\uc57d: \ud604\ub300\uc804\uc740 \ub2e8\uc21c\ud788 \ubb3c\ub9ac\uc801 \ucda9\ub3cc\uc774 \uc544\ub2cc, \uc2ec\ub9ac\uc804, \uc815\ubcf4\uc804, \ube44\ub300\uce6d \uc804\uc220\uc774 \uacb0\ud569\ub41c \uace0\ub3c4\uc758 \uc9c0\ub2a5\uc804\uc785\ub2c8\ub2e4. \uc801\uc758 \ud589\ub3d9\uc744 \ud1b5\uc81c\ud558\uace0, \uc608\uce21 \ubd88\uac00\ub2a5\ud55c \uc6c0\uc9c1\uc784\uc73c\ub85c \ud63c\ub780\uc744 \uc720\ub3c4\ud558\uba70, \uc790\uc6d0\uc744 \ud6a8\uc728\uc801\uc73c\ub85c \uc0ac\uc6a9\ud558\uc5ec \uc8fc\ub3c4\uad8c\uc744 \ud655\ubcf4\ud558\ub294 \uac83\uc774 \ud575\uc2ec\uc785\ub2c8\ub2e4. \uc2a4\ud154\uc2a4, \uc0ac\uc774\ubc84 \uacf5\uaca9, \uc804\uc790\uc804 \ub4f1\uc740 '\ubb34\ud615\uc758 \uc804\ub7b5'\uc744 \uad6c\ud604\ud558\ub294 \ud604\ub300\uc801 \uc218\ub2e8\uc785\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
B.adN=new A.a("\uace0\uac1d\uacfc \uc2dc\uc7a5\uc744 \uc6b0\ub9ac \uc0c1\ud488\uacfc \uc11c\ube44\uc2a4\ub85c \uc720\uc778\ud560\uc9c0\uc5b8\uc815, \uc6b0\ub9ac\ub294 \uacb0\ucf54 \uacbd\uc7c1\uc0ac\uc758 \uc804\ub7b5\uc5d0 \ud718\ub458\ub9ac\uc9c0 \uc54a\ub294\ub2e4. \uace0\uac1d\uc744 \uc6b0\ub9ac \uc11c\ube44\uc2a4\ub85c \ub04c\uc5b4\ub4e4\uc77c \ub54c\ub294 '\ud61c\ud0dd'\uc73c\ub85c \uc720\uc778\ud558\uace0, \uacbd\uc7c1\uc0ac\uac00 \ud2b9\uc815 \uc2dc\uc7a5\uc5d0 \uc9c4\uc785\ud558\uc9c0 \ubabb\ud558\uac8c \ud560 \ub54c\ub294 '\uc9c4\uc785 \uc7a5\ubcbd'\uc73c\ub85c \ubc29\ud574\ud558\ub77c. \uacbd\uc7c1\uc0ac\uac00 \ud604\uc7ac \uc704\uce58\uc5d0 \uc548\uc8fc\ud560 \ub54c \ud601\uc2e0\uc73c\ub85c \ub3c4\ubc1c\ud558\uace0, \uc790\ubcf8\uc774 \ucda9\ubd84\ud560 \ub54c \ud22c\uc790 \ubd80\ub2f4\uc744 \uac00\uc911\uc2dc\ud0a4\uba70, \uc2dc\uc7a5 \uc810\uc720\uc728\uc774 \uc548\uc815\uc801\uc77c \ub54c \uc0c8\ub85c\uc6b4 \uc2dc\uc7a5\uc73c\ub85c \uc720\uc778\ud558\uc5ec \uc6c0\uc9c1\uc774\uac8c \ud558\ub77c. \uacbd\uc7c1\uc0ac\uac00 \uac04\uacfc\ud558\ub294 \ud2c8\uc0c8\uc2dc\uc7a5\uc744 \uac1c\ucc99\ud558\uace0, \uc608\uc0c1\uce58 \ubabb\ud558\ub294 \ubc29\uc2dd\uc73c\ub85c \uc2e0\uc18d\ud788 \uc2dc\uc7a5\uc744 \uc120\uc810\ud558\uc5ec \uc2b9\ub9ac\ud558\ub77c. \uc120\uc81c\uc801\uc73c\ub85c \uc2dc\uc7a5\uc744 \uacf5\ub7b5\ud558\uc5ec \uacbd\uc7c1\uc0ac\uc758 \ubc29\uc5b4 \uc804\ub7b5\uc744 \ubb34\ub825\ud654\ud558\uace0, \uc6b0\ub9ac \uae30\uc5c5\uc758 \uac15\uc810\uc744 \uc644\ubcbd\ud788 \ubc29\uc5b4\ud558\uc5ec \uacbd\uc7c1\uc0ac\uac00 \uacf5\ub7b5\ud560 \uc57d\uc810\uc744 \ucc3e\uc9c0 \ubabb\ud558\uac8c \ud558\ub77c. \ubaa8\ub4e0 \uc2dc\uc7a5\uc5d0 \uc9c4\ucd9c\ud558\ub824\ub2e4 \ubaa8\ub4e0 \uacf3\uc5d0\uc11c \uacbd\uc7c1\ub825\uc774 \uc57d\ud574\uc9c4\ub2e4. \uc57d\ud55c \uae30\uc5c5\uc740 \uac15\ud55c \uacbd\uc7c1\uc0ac\uc5d0 \ub04c\ub824\ub2e4\ub2c8\uc9c0\ub9cc, \uac15\ud55c \uae30\uc5c5\uc740 \uacbd\uc7c1\uc0ac\uac00 \uc790\uc2e0\uc744 \ubc29\uc5b4\ud558\uac8c \ub9cc\ub4e0\ub2e4. \ube44\uc988\ub2c8\uc2a4 \ud615\ud0dc\uc758 \uadf9\uce58\ub294 \uacbd\uc7c1\uc0ac\uac00 \ubaa8\ubc29\ud560 \uc218\ub3c4, \uc608\uce21\ud560 \uc218\ub3c4 \uc5c6\ub294 '\ubb34\ud615\uc758 \ube44\uc988\ub2c8\uc2a4 \ubaa8\ub378'\uc744 \uad6c\ucd95\ud558\ub294 \uac83\uc774\ub2e4!\n\u2022  \uc694\uc57d: \ube44\uc988\ub2c8\uc2a4 \uacbd\uc7c1\uc5d0\uc11c \uae30\uc5c5\uc740 \uace0\uac1d\uacfc \uc2dc\uc7a5\uc744 \uc8fc\ub3c4\uc801\uc73c\ub85c \uc720\uc778\ud558\uace0, \uacbd\uc7c1\uc0ac\uc758 \uc6c0\uc9c1\uc784\uc744 \ud1b5\uc81c\ud558\uba70, \uc790\uc6d0\uc744 \ud575\uc2ec \ubd84\uc57c\uc5d0 \uc9d1\uc911\ud574\uc57c \ud569\ub2c8\ub2e4. \uc608\uce21 \ubd88\uac00\ub2a5\ud55c \ud601\uc2e0\uacfc \ucc28\ubcc4\ud654\ub41c \ube44\uc988\ub2c8\uc2a4 \ubaa8\ub378\uc744 \ud1b5\ud574 \uacbd\uc7c1\uc0ac\uac00 \ubaa8\ubc29\ud558\uac70\ub098 \ub300\uc751\ud558\uae30 \uc5b4\ub824\uc6b4 '\ubb34\ud615\uc758 \uacbd\uc7c1 \uc6b0\uc704'\ub97c \uad6c\ucd95\ud558\ub294 \uac83\uc774 \uc911\uc694\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
B.afb=new A.a("\uc0c1\ub300 \ud300\uc744 \uc6b0\ub9ac\uac00 \uc6d0\ud558\ub294 \ud50c\ub808\uc774\ub85c \uc720\ub3c4\ud560\uc9c0\uc5b8\uc815, \uc6b0\ub9ac\ub294 \uacb0\ucf54 \uc0c1\ub300\uc758 \uc804\uc220\uc5d0 \ub9d0\ub824\ub4e4\uc9c0 \uc54a\ub294\ub2e4. \uc0c1\ub300 \ud300\uc744 \uc6b0\ub9ac \ud50c\ub808\uc774\ub85c \ub04c\uc5b4\ub4e4\uc77c \ub54c\ub294 '\uacf5\uac04'\uc744 \uc5f4\uc5b4\uc8fc\uc5b4 \uc720\uc778\ud558\uace0, \uc0c1\ub300 \ud300\uc774 \ud2b9\uc815 \uc9c0\uc5ed\uc73c\ub85c \uc624\uc9c0 \ubabb\ud558\uac8c \ud560 \ub54c\ub294 '\uc555\ubc15'\uc73c\ub85c \ubc29\ud574\ud558\ub77c. \uc0c1\ub300 \ud300\uc774 \ub290\uc2a8\ud558\uac8c \ud50c\ub808\uc774\ud560 \ub54c \uc801\uadf9\uc801\uc778 \uc555\ubc15\uc73c\ub85c \ud765\ubd84\uc2dc\ud0a4\uace0, \uccb4\ub825\uc774 \ucda9\ubd84\ud560 \ub54c \ub04a\uc784\uc5c6\ub294 \uc6c0\uc9c1\uc784\uc73c\ub85c \uc18c\ubaa8\uc2dc\ud0a4\uba70, \uc218\ube44\uac00 \uc548\uc815\uc801\uc77c \ub54c \uc720\uc778\ud558\uc5ec \uacf5\uac04\uc744 \uc5f4\uac8c \ud558\ub77c. \uc0c1\ub300 \ud300\uc774 \uc2e0\uacbd \uc4f0\uc9c0 \uc54a\ub294 \uacf5\uac04\uc744 \ud30c\uace0\ub4e4\uace0, \uc0c1\ub300\uac00 \uc804\ud600 \uc608\uc0c1\uce58 \ubabb\ud558\ub294 \ubc29\uc2dd\uc73c\ub85c \uc2e0\uc18d\ud788 \uacf5\uaca9\ud558\uc5ec \ub4dd\uc810\ud558\ub77c. \uba3c\uc800 \uacf5\uaca9\ud558\uc5ec \uc0c1\ub300 \uc218\ube44\uc758 \ud63c\ub780\uc744 \uc57c\uae30\ud558\uace0, \uc644\ubcbd\ud55c \uc218\ube44\ub85c \uc0c1\ub300 \uacf5\uaca9\uc758 \ubc29\ud5a5\uc744 \uc783\uac8c \ud558\ub77c. \ubaa8\ub4e0 \ud3ec\uc9c0\uc158\uc744 \uc644\ubcbd\ud788 \uc218\ube44\ud558\ub824\ub2e4 \ubaa8\ub4e0 \uacf3\uc5d0\uc11c \uc57d\ud574\uc9c4\ub2e4. \uc57d\ud55c \ud300\uc740 \uac15\ud55c \uc0c1\ub300\uc5d0\uac8c \ub04c\ub824\ub2e4\ub2c8\uc9c0\ub9cc, \uac15\ud55c \ud300\uc740 \uc0c1\ub300\uac00 \uc790\uc2e0\uc744 \ubc29\uc5b4\ud558\uac8c \ub9cc\ub4e0\ub2e4. \uc804\uc220 \ud615\ud0dc\uc758 \uadf9\uce58\ub294 \uc0c1\ub300 \ud300\uc774 \uc6b0\ub9ac\uc758 \ud3ec\uba54\uc774\uc158\uacfc \ub2e4\uc74c \ud50c\ub808\uc774\ub97c \uc804\ud600 \uc608\uce21\ud560 \uc218 \uc5c6\ub294 '\ubb34\ud615\uc758 \uc804\uc220'\uc744 \uad6c\uc0ac\ud558\ub294 \uac83\uc774\ub2e4!\n\u2022  \uc694\uc57d: \uc2a4\ud3ec\uce20 \uacbd\uae30\uc5d0\uc11c \ud300\uc740 \ub2a5\ub3d9\uc801\uc73c\ub85c \uacbd\uae30\ub97c \uc6b4\uc601\ud558\uace0, \uc0c1\ub300 \ud300\uc758 \uc2ec\ub9ac\uc801, \uccb4\ub825\uc801, \uc804\uc220\uc801 \uc0c1\ud0dc\ub97c \uad50\ub780\ud574\uc57c \ud569\ub2c8\ub2e4. \uc608\uce21 \ubd88\uac00\ub2a5\ud55c \uacf5\uaca9\uacfc \uacac\uace0\ud55c \uc218\ube44\ub97c \ud1b5\ud574 \uc8fc\ub3c4\uad8c\uc744 \uc7a1\uace0, \uc0c1\ub300\uac00 \uc6b0\ub9ac \ud300\uc758 \uc804\uc220\uc744 \ud30c\uc545\ud558\uae30 \uc5b4\ub835\uac8c \ub9cc\ub4dc\ub294 '\ubb34\ud615\uc758 \uc804\uc220'\uc744 \uad6c\uc0ac\ud558\uc5ec \uc2b9\ub9ac\ub97c \uc7c1\ucde8\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
