B.aiu=new A.a("\ud83d\udcda \uc190\uc790\ubcd1\ubc95 11\ud3b8 \uad6c\uc9c0(\u4e5d\u5730) \u2013 7\n",null,B.a,null,B.m)
B.w5=new A.a("\u5728\u65bc\u9806\u8a73\u6575\u4e4b\u610f \u5e77\u6575\u4e00\u5411 \u5343\u91cc\u6bba\u5c07 \u6b64\u8b02\u5de7\u80fd\u6210\u4e8b\u8005\u4e5f \n\n",null,B.a,null,B.t)
B.aol=new A.a("  \u2022 \u5728\u65bc(z\xe0i y\xfa): ~\uc5d0 \uc788\ub2e4 \n  \u2022 \t\u9806(sh\xf9n): \ub530\ub974\ub2e4, \uc21c\uc751\ud558\ub2e4 \n  \u2022 \u8a73(xi\xe1ng): \uc790\uc138\ud788 \uc0b4\ud53c\ub2e4, \uc815\ubc00\ud558\uac8c \uc54c\ub2e4 \n  \u2022 \u6575\u4e4b\u610f(d\xed zh\u012b y\xec): \uc801\uc758 \uc758\ub3c4 \n  \u2022 \u5e77\u6575(b\xecng d\xed): \uc801\uc744 \ud1b5\ud569\ud558\uc5ec / \ud558\ub098\ub85c \ubb36\ub2e4 \n  \u2022 \u4e00\u5411(y\u012b xi\xe0ng): \ud55c \ubc29\ud5a5\uc73c\ub85c \n  \u2022 \u5343\u91cc(qi\u0101n l\u01d0): \ucc9c \ub9ac \uac70\ub9ac (\uc544\uc8fc \uba3c \uac70\ub9ac) \n  \u2022 \u6bba\u5c07(sh\u0101 ji\xe0ng): \uc801\uc7a5\uc758 \ubaa9\uc744 \ubca4\ub2e4 \n  \u2022 \u5de7\u80fd(qi\u01ceo n\xe9ng): \ub2a5\ub780\ud55c \uae30\uc220 / \uc19c\uc528 \n  \u2022 \u6210\u4e8b\u8005(ch\xe9ng sh\xec zh\u011b): \uc77c\uc744 \uc131\ucde8\ud558\ub294 \uc0ac\ub78c \n\n",null,B.a,null,B.c)
B.ags=new A.a("\u201c\uc801\uc758 \uc758\ub3c4\ub97c \uc21c\uc751\ud558\uace0 \uc790\uc138\ud788 \ud30c\uc545\ud558\uba70, \uc801\uc744 \ud558\ub098\ub85c \ubb36\uc5b4 \ud55c \ubc29\ud5a5\uc5d0\uc11c \uacf5\uaca9\ud558\uace0, \ucc9c \ub9ac \ubc16\uc5d0\uc11c\ub3c4 \uc801\uc7a5\uc744 \uc81c\uac70\ud55c\ub2e4. \uc774\uac83\uc774 \ubc14\ub85c \ub2a5\ub780\ud558\uac8c \uc77c\uc744 \uc131\ucde8\ud558\ub294 \uc790\uc774\ub2e4.\u201d",null,B.a,null,B.c)
