B.af6=new A.a("\u318d \u80fd\u800c (n\xe9ng \xe9r): Being capable, yet \n\u318d \u793a\u4e4b\u4e0d\u80fd (sh\xec zh\u012b b\xf9 n\xe9ng): Show them (the enemy) as if incapable \n\u318d \u7528\u800c (y\xf2ng \xe9r): While actually employing, yet \n\u318d \u793a\u4e4b\u4e0d\u7528 (sh\xec zh\u012b b\xf9 y\xf2ng): Show them as if not employing \n\n",null,B.a,null,B.c)
