B.ana=new A.a("This passage provides key behavioral guidelines for deceiving the enemy in war.   \n\n",null,B.a,null,B.c)
B.a9F=new A.a("1.\tConcealing Capability: Even when one is actually skilled or has strengths, one should hide them and pretend to be weak or incapable, thereby making the enemy complacent or preventing them from anticipating one's true strengths. \n\n2.\tFeigning Inactivity: Even when one is in a situation to utilize troops or tactics, one should feign inactivity to make the enemy misjudge one's intentions. By appearing as if not attacking when capable of attacking, one can make the enemy lower their guard or mistakenly believe there are other intentions. \n\n3.\tManaging Emptiness and Reality: This forms the basis of a deception strategy where one conceals one's true strength and intentions, showing emptiness (\u865b) to induce the enemy to expose their reality (\u5be6), and then striking at those weak points. \n\n",null,B.a,null,B.c)
