B.atx=new A.a("1.\t\u4e0a\u5175\u4f10\u8b00(sh\xe0ng b\u012bng f\xe1 m\xf3u): The supreme method of warfare (\u4e0a\u5175) is to 'attack (\u4f10)' the enemy's 'schemes (\u8b00)'. Here, 'schemes' refers to ingenious methods that break the enemy's will to fight, create internal division, and secure victory before actual combat. Anticipating and disrupting the enemy's plans, and causing them to collapse on their own, leads to the most cost-effective victory. \n\n2.\t\u5176\u6b21\u4f10\u4ea4(q\xed c\xec f\xe1 jiao): The next best method is to 'attack (\u4f10)' the enemy through 'diplomacy (\u4ea4)'. This means pressuring and weakening the enemy through diplomatic means, such as leveraging alliances to isolate them or sowing discord to dismantle their alliances. It is a way to weaken the enemy's power without direct armed conflict. \n\n3.\t\u5176\u6b21\u4f10\u5175(q\xed c\xec f\xe1 b\u012bng): \uadf8The next best method is to 'attack (\u4f10)' the enemy's 'troops (\u5175)'. This refers to direct military engagement to defeat the enemy's forces. This method is only considered when 'attacking schemes' or 'attacking alliances' is not possible. Even in this case, it is crucial to achieve maximum effect with minimum troop losses. \n\n4.\t\u57fa\u4e0b\u653b\u57ce(q\xed xi\xe0 g\u014dng ch\xe9ng): The lowest method (\u5176\u4e0b) is to 'attack (\u653b)' 'cities (\u57ce)'. Siege warfare is considered the last resort because it causes immense losses in terms of both personnel and materiel for both the attacking and defending sides, making it the most inefficient and costly form of combat. \n\n",null,B.a,null,B.c)
