B.ara=new A.a(" 1. \uc774\uc775(\u5229)\uc73c\ub85c \uc801\uc744 \uc720\uc778 (\u80fd\u4f7f\u6575\u4eba\u81ea\u81f3\u8005 \u5229\u4e4b\u4e5f):\n \u318d \uc758\ubbf8: \uc801\uc774 \ud0d0\ub0bc \ub9cc\ud55c '\uc774\uc775(\u5229)'\uc744 \uc81c\uacf5\ud558\uac70\ub098, \uc27d\uac8c \uc5bb\uc744 \uc218 \uc788\uc744 \uac83\ucc98\ub7fc \uc704\uc7a5\ud558\uc5ec \uc801\uc744 \uc544\uad70\uc774 \uc6d0\ud558\ub294 \uc7a5\uc18c\ub098 \uc0c1\ud669\uc73c\ub85c '\uc2a4\uc2a4\ub85c \uc624\uac8c(\u81ea\u81f3)' \ub9cc\ub4dc\ub294 \uac83\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \uc774\ub294 \uc801\uc758 \ud0d0\uc695\uc774\ub098 \uc624\ud310\uc744 \uc720\ub3c4\ud558\uc5ec \uc544\uad70\uc758 \uacc4\ud68d\ub300\ub85c \uc801\uc744 \ub04c\uc5b4\ub4e4\uc774\ub294 \ub2a5\ub3d9\uc801\uc778 \uc720\uc778 \uc804\ub7b5\uc785\ub2c8\ub2e4.\n\n 2. \uc190\ud574(\u5bb3)\ub85c \uc801\uc744 \ubc29\ud574 (\u80fd\u4f7f\u6575\u4eba\u4e0d\u5f97\u81f3\u8005 \u5bb3\u4e4b\u4e5f):\n \u318d \uc758\ubbf8: \uc801\uc774 \uc6d0\ud558\ub294 \uc7a5\uc18c\ub098 \ubaa9\ud45c\uc5d0 '\ub3c4\ub2ec\ud558\uc9c0 \ubabb\ud558\uac8c(\u4e0d\u5f97\u81f3)' \ub9c9\ub294 \uac83\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \uc774\ub294 \uc801\uc5d0\uac8c '\uc190\ud574(\u5bb3)'\ub97c \ucd08\ub798\ud560 \uc218 \uc788\uc74c\uc744 \ubcf4\uc5ec\uc8fc\uac70\ub098, \uc2e4\uc81c\uc801\uc778 \ud53c\ud574\ub97c \uc785\ud600 \uc801\uc758 \uc6c0\uc9c1\uc784\uc744 \ubc29\ud574\ud558\ub294 \uc804\ub7b5\uc785\ub2c8\ub2e4. \uc608\ub97c \ub4e4\uc5b4, \ubcf4\uae09\uc120\uc744 \ucc28\ub2e8\ud558\uac70\ub098, \ubcd1\ucc38\uae30\uc9c0\ub97c \uacf5\uaca9\ud558\uc5ec \uc801\uc774 \ub354 \uc774\uc0c1 \uc804\uc9c4\ud560 \uc218 \uc5c6\uac8c \ub9cc\ub4e4\uac70\ub098, \ubd88\ub9ac\ud55c \uc9c0\ud615\uc5d0 \ub9e4\ubcf5\ud558\uc5ec \uc9c4\uaca9\uc744 \ub9c9\ub294 \uac83\uc785\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
