B.ap5=new A.a("\uc774\ub294 \ub2e8\uc21c\ud788 \ud798\uc758 \ub300\uacb0\uc744 \ub118\uc5b4\uc120 \uc9c0\ud61c\ub85c\uc6b4 \uc120\ud0dd, \uc0c1\ud669\uc5d0 \ub300\ud55c \uc801\uc808\ud55c \ubc18\uc751, \uc2ec\ub9ac\uc801 \uc6b0\uc704 \ud655\ubcf4, \uadf8\ub9ac\uace0 \uc790\uc728\uc801\uc774\uace0 \ucc45\uc784\uac10 \uc788\ub294 \ub9ac\ub354\uc2ed\uc758 \uc911\uc694\uc131\uc744 \uac15\uc870\ud569\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
B.amD=new A.a(" 1. \uc804\ub7b5\uc801 '\ubd88\uc704(\u4e0d\u7232)'\uc758 \uc9c0\ud61c: \ubaa8\ub4e0 \uae38\uc744 \uac08 \ud544\uc694\ub294 \uc5c6\uace0, \ubaa8\ub4e0 \uc801\uad70\uc744 \uacf5\uaca9\ud560 \ud544\uc694\ub3c4 \uc5c6\uc73c\uba70, \ubaa8\ub4e0 \uc131\uc744 \uc810\ub839\ud560 \ud544\uc694\ub3c4 \uc5c6\uace0, \ubaa8\ub4e0 \ub545\uc744 \ub2e4\ud234 \ud544\uc694\ub3c4 \uc5c6\uc2b5\ub2c8\ub2e4. \uc2ec\uc9c0\uc5b4 \ub54c\ub85c\ub294 \uad70\uc8fc\uc758 \uba85\ub839\uc774\ub77c \ud560\uc9c0\ub77c\ub3c4 \ud604\uc7a5 \uc0c1\ud669\uc5d0 \ube44\ucd94\uc5b4 \ubd88\ub9ac\ud558\ub2e4\uba74 \ub530\ub974\uc9c0 \uc54a\uc744 \uc218 \uc788\ub294 \uc9c0\ud718\uad00\uc758 \uc804\ub7b5\uc801 \ud310\ub2e8\ub825\uacfc \uc720\uc5f0\uc131\uc744 \uac15\uc870\ud569\ub2c8\ub2e4. \uc774\ub294 \ubd88\ud544\uc694\ud55c \uc18c\ubaa8\ub97c \ud53c\ud558\uace0 \ud575\uc2ec \ubaa9\ud45c\uc5d0 \uc9d1\uc911\ud558\ub294 \uc120\ud0dd\uacfc \uc9d1\uc911\uc758 \uc911\uc694\uc131\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \n\n 2. \ud658\uacbd\uc5d0 \ub530\ub978 \ud589\ub3d9 \ucd5c\uc801\ud654: \uace0\ub9bd\ub41c \ub545(\u572e\u5730)\uc5d0\uc11c\ub294 \uba38\ubb34\ub974\uc9c0 \uc54a\uace0, \uc0ac\ud1b5\ud314\ub2ec\ud55c \ub545(\u8862\u5730)\uc5d0\uc11c\ub294 \ubcd1\ub825\uc744 \ud569\uce58\uba70, \ud5d8\ub09c\ud55c \ub545(\u7d76\u5730)\uc5d0\uc11c\ub294 \uc9c0\uccb4\ud558\uc9c0 \uc54a\uace0 \ud1b5\uacfc\ud558\uace0, \ud3ec\uc704\ub41c \ub545(\u570d\u5730)\uc5d0\uc11c\ub294 \uc9c0\ud61c\ub85c\uc6b4 \uacc4\ucc45\uc744 \uc138\uc6cc \ub3cc\ud30c\uad6c\ub97c \ucc3e\uc73c\uba70, \ud1f4\ub85c\uac00 \uc5c6\ub294 \uc8fd\uc744 \ub545(\u6b7b\u5730)\uc5d0\uc11c\ub294 \uacb0\uc0ac\uc801\uc73c\ub85c \uc2f8\uc6cc\uc57c \ud568\uc744 \uac15\uc870\ud569\ub2c8\ub2e4. \uc774\ub294 \ub2e4\uc591\ud55c \uc9c0\ud615\uc801 \ud2b9\uc131\uacfc \uc804\uc7a5 \uc0c1\ud669\uc5d0 \ub9de\ucdb0 \ucd5c\uc801\uc758 \ud589\ub3d9 \uc6d0\uce59\uc744 \uc801\uc6a9\ud558\ub294 \uc720\uc5f0\uc131\uacfc \uacb0\ub2e8\ub825\uc744 \uc694\uad6c\ud569\ub2c8\ub2e4. \n\n 3. \uc9c0\ud61c\ub85c\uc6b4 \uc790\uc758 \uc591\uba74\uc131 \uc778\uc2dd: \uc9c0\ud61c\ub85c\uc6b4 \uc0ac\ub78c\uc758 \uc0dd\uac01\uc5d0\ub294 \ubc18\ub4dc\uc2dc '\uc774\ub85c\uc6c0(\u5229)'\uacfc '\ud574\ub85c\uc6c0(\u5bb3)'\uc774 \ud568\uaed8 \uc11e\uc5ec \uc788\uc74c\uc744 \uc778\uc9c0\ud574\uc57c \ud569\ub2c8\ub2e4. \uc5b4\ub5a4 \uacb0\uc815\uc774\ub4e0 \uc5bb\ub294 \uac83\uc774 \uc788\uc73c\uba74 \uc783\ub294 \uac83\ub3c4 \uc788\uace0, \uae30\ud68c\uac00 \uc788\uc73c\uba74 \uc704\ud5d8\ub3c4 \ub530\ub985\ub2c8\ub2e4. \ub530\ub77c\uc11c \ub2e8\uc21c\ud55c \uc774\ub4dd\ub9cc\uc744 \ucd94\uad6c\ud558\ub294 \uac83\uc774 \uc544\ub2c8\ub77c, \uc7a0\uc7ac\uc801\uc778 \uc190\uc2e4\uacfc \uc704\ud5d8\uae4c\uc9c0\ub3c4 \uc885\ud569\uc801\uc73c\ub85c \uace0\ub824\ud558\uc5ec \ub0c9\ucca0\ud558\uac8c \ud310\ub2e8\ud574\uc57c \ud569\ub2c8\ub2e4.\n\n 4. \ub2a5\ub3d9\uc801 \ubc29\uc5b4\uc640 \uc790\uac15\ubd88\uc2dd(\u81ea\u5f3a\u4e0d\u606f): \uc801\uc774 \uacf5\uaca9\ud558\uc9c0 \uc54a\uc744 \uac83\uc774\ub77c\ub294 \ub9c9\uc5f0\ud55c \uae30\ub300\uc5d0 \uc758\uc9c0\ud558\uc9c0 \ub9d0\uace0, \uc544\uad70 \uc2a4\uc2a4\ub85c\uac00 \uc801\uc774 \uac10\ud788 \uacf5\uaca9\ud560 \uc218 \uc5c6\ub294 \uacac\uace0\ud55c \uc0c1\ud0dc\uac00 \ub418\ub294 \uac83\uc744 \ubbff\uc5b4\uc57c \ud569\ub2c8\ub2e4. \uc774\ub294 \uc218\ub3d9\uc801\uc73c\ub85c \uc801\uc758 \ud589\ub3d9\uc744 \ubc14\ub77c\uc9c0 \uc54a\uace0, \ub2a5\ub3d9\uc801\uc73c\ub85c \uc544\uad70\uc758 \uc5ed\ub7c9\uacfc \ubc29\uc5b4 \uccb4\uacc4\ub97c \uac15\ud654\ud558\ub294 \uac83\uc774 \uc9c4\uc815\ud55c \ubc29\uc5b4 \uc804\ub7b5\uc784\uc744 \uac15\uc870\ud569\ub2c8\ub2e4. \n\n 5. \uc0c1\ub300\ubc29 \uc2ec\ub9ac \ubc0f \uc131\ud5a5 \ud65c\uc6a9(\u5fc5\u6b7b\u53ef\u6bba\u4e5f \u5fc5\u751f\u53ef\u865c\u4e5f \u5fff\u901f\u53ef\u4fae\u4e5f \u5ec9\u6f54\u53ef\u8fb1\u4e5f \u611b\u6c11\u53ef\u7169\u4e5f): \uc801\uc758 \uc9c0\ud718\uad00\uc774\ub098 \ubcd1\uc0ac\uac00 \uac00\uc9c4 \ud2b9\uc815 \uc2ec\ub9ac\uc801 \uc57d\uc810\uc774\ub098 \uc131\ud5a5\uc744 \ud30c\uc545\ud558\uc5ec \uc774\ub97c \uc5ed\uc774\uc6a9\ud558\ub294 \uace0\ub3c4\uc758 \uc2ec\ub9ac\uc804 \uc804\ub7b5\uc758 \uc911\uc694\uc131\uc744 \ubcf4\uc5ec\uc90d\ub2c8\ub2e4.\n    \u2022  \uc8fd\uae30\ub97c \uac01\uc624\ud55c \uc790(\u5fc5\u6b7b)\ub294 \ubb34\ubaa8\ud558\uac8c \ud589\ub3d9\ud558\ubbc0\ub85c \uae30\ud68c\ub97c \ub178\ub824 \uc8fd\uc77c \uc218 \uc788\uace0(\u53ef\u6bba\u4e5f), \n   \u2022  \uc0b4\uae30\ub97c \ubc14\ub77c\ub294 \uc790(\u5fc5\u751f)\ub294 \uc8fd\uc74c\uc744 \ud53c\ud558\uae30 \uc704\ud574 \uc0ac\ub85c\uc7a1\uc744 \uc218 \uc788\uc73c\uba70(\u53ef\u865c\u4e5f), \n   \u2022  \uc131\uae09\ud558\uace0 \ubd84\ub178\ud558\ub294 \uc790(\u5fff\u901f)\ub294 \ub3c4\ubc1c\uc5d0 \uc774\uc131\uc744 \uc783\uc73c\ubbc0\ub85c \ubaa8\uc695\ud558\uc5ec(\u53ef\u4fae\u4e5f) \ubb34\ub108\ub728\ub9b4 \uc218 \uc788\uace0, \n   \u2022  \uccad\ub834\uacb0\ubc31\ud558\uc5ec \uba85\uc608\ub97c \uc911\uc2dc\ud558\ub294 \uc790(\u5ec9\u6f54)\ub294 \uc695\ub418\uac8c \ud558\uc5ec(\u53ef\u8fb1\u4e5f) \ud754\ub4e4 \uc218 \uc788\uc73c\uba70, \n   \u2022  \ubc31\uc131\uc744 \uc0ac\ub791\ud558\ub294 \uc790(\u611b\u6c11)\ub294 \ubc31\uc131\uc758 \uace0\ud1b5\uc5d0 \ubbfc\uac10\ud558\ubbc0\ub85c \uc774\ub97c \uc774\uc6a9\ud558\uc5ec \ubc88\uac70\ub86d\uac8c \ud560 \uc218(\u53ef\u7169\u4e5f) \uc788\uc2b5\ub2c8\ub2e4.\n",null,B.a,null,B.c)
