B.aad=new A.a("\ubaa8\ub4e0 \uc804\ud22c\uc5d0 \ucc38\uc5ec\ud558\uc9c0 \uc54a\uc73c\uba70, \ubaa8\ub4e0 \uac70\uc810\uc744 \uc810\ub839\ud558\ub824 \ub4e4\uc9c0 \uc54a\ub294\ub2e4. \uace0\ub9bd\ub420 \ub545\uc5d0\uc120 \uba38\ubb34\ub974\uc9c0 \ub9d0\uace0, \uc804\ub7b5 \uc694\ucda9\uc9c0\uc5d0\uc120 \ubcd1\ub825\uc744 \ud569\uccd0\ub77c. \ud5d8\ud55c \uc9c0\ud615\uc740 \uc2e0\uc18d\ud788 \ud1b5\uacfc\ud558\uace0, \ud3ec\uc704\ub41c \uc0c1\ud669\uc5d0\uc120 \uacc4\ucc45\uc744 \uc138\uc6b0\uba70, \ud1f4\ub85c \uc5c6\ub294 \uc8fd\uc744 \ub545\uc5d0\uc120 \ud544\uc0ac\uc801\uc73c\ub85c \uc2f8\uc6cc\ub77c. \uc9c0\ud61c\ub85c\uc6b4 \uc9c0\ud718\uad00\uc740 \uc2b9\ub9ac \uac00\ub2a5\uc131\ubfd0\ub9cc \uc544\ub2c8\ub77c \uc544\uad70\uc758 \ud53c\ud574\uc640 \uc7a0\uc7ac\uc801 \uc704\ud5d8\uae4c\uc9c0 \ud568\uaed8 \uace0\ub824\ud55c\ub2e4. \uc801\uc774 \uacf5\uaca9\ud558\uc9c0 \uc54a\uc744 \uac83\uc774\ub77c \uc548\uc77c\ud558\uac8c \ubbff\uc9c0 \ub9d0\uace0, \uc6b0\ub9ac\uac00 \uc808\ub300 \uacf5\uaca9\ubc1b\uc744 \uc218 \uc5c6\ub294 \uc694\uc0c8\uac00 \ub418\ub294 \uac83\uc744 \ubbff\uc5b4\ub77c. \uacb0\uc0ac\uc801\uc778 \uc801\uc740 \uc704\ud5d8\uc73c\ub85c \ubab0\uc544\ub123\uace0, \uc0b4\uace0\uc790 \ud558\ub294 \uc801\uc740 \ud56d\ubcf5\uc73c\ub85c \uc720\ub3c4\ud558\uba70, \uc131\uae09\ud55c \uc801\uc740 \ub3c4\ubc1c\ub85c \uc774\uc131\uc744 \uc783\uac8c \ud558\uace0, \uccad\ub834\ud55c \uc801\uc740 \uba85\uc608\ub97c \ud6fc\uc190\uc2dc\ucf1c \ud754\ub4e4\uba70, \ubbfc\uac04\uc778\uc744 \uc911\uc2dc\ud558\ub294 \uc801\uc740 \ubbfc\uac04 \ud53c\ud574\ub85c \uc555\ubc15\ud558\ub77c!\n\u2022  \uc694\uc57d: \ud604\ub300 \uad70\uc0ac \uc804\ub7b5\uc740 \ubaa8\ub4e0 \uc804\uc120\uc5d0\uc11c \uc2f8\uc6b0\ub294 \uac83\uc774 \uc544\ub2cc, \uc804\ub7b5\uc801 \uac00\uce58\ub97c \ud310\ub2e8\ud558\uc5ec \ubd88\ud544\uc694\ud55c \uc18c\ubaa8\uc804\uc744 \ud68c\ud53c\ud558\ub294 \uc120\ud0dd\uacfc \uc9d1\uc911\uc774 \uc911\uc694\ud569\ub2c8\ub2e4. \ub610\ud55c, \uc2dc\uc2dc\uac01\uac01 \ubcc0\ud558\ub294 \uc804\uc7a5 \ud658\uacbd\uc5d0 \ub9de\ucdb0 \uc720\uc5f0\ud558\uac8c \ub300\uc751\ud558\uace0, \uc801\uc758 \uc57d\uc810\uacfc \uc2ec\ub9ac\ub97c \uaff0\ub6ab\uc5b4 \ube44\ubb3c\ub9ac\uc801 \uc218\ub2e8\uc744 \ud65c\uc6a9\ud558\ub294 \uac83\uc774 \ud575\uc2ec\uc785\ub2c8\ub2e4. \uad81\uadf9\uc801\uc73c\ub85c\ub294 \uc801\uc774 \uac10\ud788 \uacf5\uaca9\ud560 \uc218 \uc5c6\ub294 \uc218\uc900\uc758 \uc790\uc728\uc801\uc774\uace0 \uacac\uace0\ud55c \ubc29\uc5b4 \uccb4\uacc4\ub97c \uad6c\ucd95\ud558\ub294 \uac83\uc774 \uc2b9\ub9ac\uc758 \uadfc\uac04\uc785\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
B.avZ=new A.a("\ubaa8\ub4e0 \uc2dc\uc7a5\uc5d0 \uc9c4\ucd9c\ud558\uc9c0 \uc54a\uc73c\uba70, \ubaa8\ub4e0 \uacbd\uc7c1\uc0ac\ub97c \uc0c1\ub300\ub85c \uc2f8\uc6b0\uc9c0 \uc54a\ub294\ub2e4. \uc218\uc775 \uc5c6\ub294 \uace0\ub9bd\ub41c \uc2dc\uc7a5\uc5d0\uc120 \uba38\ubb34\ub974\uc9c0 \ub9d0\uace0, \uc7a0\uc7ac\ub825 \ub192\uc740 \uc2dc\uc7a5\uc5d0\uc120 \uacfc\uac10\ud788 \ud611\ub825\ud558\ub77c. \uc9c4\uc785 \uc5b4\ub824\uc6b4 \ub09c\uad00\uc740 \uc2e0\uc18d\ud788 \ub3cc\ud30c\ud558\uace0, \uc704\uae30\uc5d0\uc120 \uacc4\ucc45\uc744 \uc138\uc6b0\uba70, \ud1f4\ub85c \uc5c6\ub294 \uadf9\ud55c \uacbd\uc7c1\uc5d0\uc120 \ud601\uc2e0\uc73c\ub85c \uc2b9\ubd80\ud558\ub77c. \ud604\uba85\ud55c \uacbd\uc601\uc790\ub294 \uc608\uc0c1 \uc218\uc775\ubfd0\ub9cc \uc544\ub2c8\ub77c \uc7a0\uc7ac\uc801 \uc190\uc2e4\uacfc \uc704\ud5d8\uae4c\uc9c0 \ud568\uaed8 \uace0\ub824\ud55c\ub2e4. \uacbd\uc7c1\uc0ac\uac00 \uacf5\uaca9\ud558\uc9c0 \uc54a\uc744 \uac83\uc774\ub77c \ubc29\uc2ec\ud558\uc9c0 \ub9d0\uace0, \uc6b0\ub9ac \uae30\uc5c5\uc774 \uc808\ub300 \uacf5\ub7b5\ub2f9\ud560 \uc218 \uc5c6\ub294 \ud575\uc2ec \uc5ed\ub7c9\uc744 \uac16\ucd94\ub294 \uac83\uc744 \ubbff\uc5b4\ub77c. \uacfc\ub3c4\ud558\uac8c \uacf5\uaca9\uc801\uc778 \uacbd\uc7c1\uc790\ub294 \uc790\uba78\uc744 \uc720\ub3c4\ud558\uace0, \uc218\uc775\uc5d0 \uc9d1\ucc29\ud558\ub294 \uacbd\uc7c1\uc790\ub294 \ud3ec\uc12d\ud558\uba70, \uac10\uc815\uc801\uc778 \uacbd\uc7c1\uc790\ub294 \ub3c4\ubc1c\ub85c \uc2e4\uc218\ub97c \uc720\ubc1c\ud558\uace0, \uccad\ub834\ud55c \uacbd\uc7c1\uc790\ub294 \uc724\ub9ac\uc801 \uc57d\uc810\uc73c\ub85c \uacf5\uaca9\ud558\uba70, \uace0\uac1d\ub9cc \uc0dd\uac01\ud558\ub294 \uacbd\uc7c1\uc790\ub294 \uace0\uac1d\uc758 \ubd88\ub9cc\uc744 \uc790\uadf9\ud558\uc5ec \uad34\ub86d\ud600\ub77c!\n\u2022  \uc694\uc57d: \ube44\uc988\ub2c8\uc2a4 \uacbd\uc7c1\uc740 \ubaa8\ub4e0 \uae30\ud68c\uc5d0 \ub6f0\uc5b4\ub4dc\ub294 \uac83\uc774 \uc544\ub2cc, \uc120\ud0dd\uc801 \uc2dc\uc7a5 \uc9c4\uc785\uacfc \ud575\uc2ec \uc5ed\ub7c9 \uac15\ud654\uac00 \uc911\uc694\ud569\ub2c8\ub2e4. \uae09\ubcc0\ud558\ub294 \uc2dc\uc7a5 \ud658\uacbd\uacfc \uacbd\uc7c1 \uad6c\ub3c4\uc5d0 \uc720\uc5f0\ud558\uac8c \uc801\uc751\ud558\uba70, \uacbd\uc7c1\uc0ac\uc758 \uc57d\uc810\uacfc \uae30\uc5c5 \ubb38\ud654\ub97c \ubd84\uc11d\ud558\uc5ec \uc804\ub7b5\uc801\uc778 \ub9c8\ucf00\ud305 \ubc0f \uc2ec\ub9ac\uc804\uc744 \ud3bc\uccd0\uc57c \ud569\ub2c8\ub2e4. \uad81\uadf9\uc801\uc73c\ub85c\ub294 \uacbd\uc7c1\uc0ac\uac00 \uac10\ud788 \uce68\ud22c\ud560 \uc218 \uc5c6\ub294 \ub3c5\ubcf4\uc801\uc778 \ud575\uc2ec \uacbd\uc7c1\ub825\uc744 \uad6c\ucd95\ud558\ub294 \uac83\uc774 \uc9c0\uc18d \uac00\ub2a5\ud55c \uc131\uc7a5\uc758 \uae30\ubc18\uc785\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
B.ac5=new A.a("\ubaa8\ub4e0 \ud3ec\uc9c0\uc158\uc744 \uc9c0\ud0a4\uc9c0 \uc54a\uc73c\uba70, \ubaa8\ub4e0 \uacf5\uc744 \ub2e4\ud22c\uc9c0 \uc54a\ub294\ub2e4. \ubd88\ub9ac\ud55c \uc704\uce58\uc5d0\uc120 \uba38\ubb34\ub974\uc9c0 \ub9d0\uace0, \uc720\ub9ac\ud55c \uc704\uce58\uc5d0\uc120 \ud300\uc6cc\ud06c\ub97c \ud569\uccd0\ub77c. \uc218\ube44\uac00 \uacac\uace0\ud55c \uacf3\uc740 \ube60\ub974\uac8c \ud1b5\uacfc\ud558\uace0, \ud3ec\uc704\ub420 \uc0c1\ud669\uc5d0\uc120 \uc804\uc220 \ubcc0\ud654\ub97c \uaf80\ud558\uba70, \ud544\uc2b9\uc744 \ub2e4\uc9d0\ud558\ub294 \uacbd\uae30\uc5d0\uc11c\ub294 \uacb0\uc0ac\uc801\uc73c\ub85c \uc2f8\uc6cc\ub77c. \uc601\ub9ac\ud55c \uac10\ub3c5\uc740 \uc2b9\ub9ac \uac00\ub2a5\uc131\ubfd0\ub9cc \uc544\ub2c8\ub77c \uc120\uc218\ub4e4\uc758 \ubd80\uc0c1 \uc704\ud5d8\uacfc \ud300 \uc0ac\uae30 \uc800\ud558 \uac00\ub2a5\uc131\uae4c\uc9c0 \ud568\uaed8 \uace0\ub824\ud55c\ub2e4. \uc0c1\ub300 \ud300\uc774 \uc57d\ud574\uc11c \uacf5\uaca9\ud558\uc9c0 \uc54a\uc744 \uac83\uc774\ub77c \ubbff\uc9c0 \ub9d0\uace0, \uc6b0\ub9ac\uac00 \uc808\ub300 \ub6ab\ub9b4 \uc218 \uc5c6\ub294 \uc218\ube44\ub97c \uac16\ucd94\ub294 \uac83\uc744 \ubbff\uc5b4\ub77c. \ubb34\ubaa8\ud55c \uc5d0\uc774\uc2a4\ub294 \uc704\ud5d8\uc73c\ub85c \ubab0\uc544\ub123\uace0, \uc774\uae30\ub824\ub294 \uc695\uad6c\uac00 \uac15\ud55c \uc120\uc218\ub294 \uc2ec\ub9ac\uc804\uc73c\ub85c \ud754\ub4e4\uba70, \ub2e4\ud608\uc9c8 \uc120\uc218\ub294 \ub3c4\ubc1c\ub85c \ud1f4\uc7a5\uc744 \uc720\ub3c4\ud558\uace0, \uae54\ub054\ud55c \ud50c\ub808\uc774\ub97c \ucd94\uad6c\ud558\ub294 \uc120\uc218\ub294 \ud30c\uc6b8 \uc720\ub3c4\ub85c \ud754\ub4e4\uba70, \ud32c\uc2ec\uc744 \uc911\uc2dc\ud558\ub294 \uc120\uc218\ub294 \ud32c\ub364\uc758 \uc57d\uc810\uc744 \ud30c\uace0\ub4e4\uc5b4\ub77c!\n\u2022  \uc694\uc57d: \uc2a4\ud3ec\uce20 \uacbd\uae30\uc5d0\uc11c \uc2b9\ub9ac\ub294 \ubaa8\ub4e0 \uc0c1\ud669\uc5d0\uc11c \uacf5\uaca9\ud558\ub294 \uac83\uc774 \uc544\ub2cc, \uc804\ub7b5\uc801 \ud3ec\uae30\uc640 \uc0c1\ud669\uc5d0 \ub9de\ub294 \ucd5c\uc801\uc758 \ud50c\ub808\uc774 \uc120\ud0dd\uc5d0\uc11c \uc2dc\uc791\ub429\ub2c8\ub2e4. \uc0c1\ub300 \ud300\uc758 \uac15\uc810\uacfc \uc57d\uc810\uc744 \ud30c\uc545\ud558\uace0 \uc2ec\ub9ac\uc801\uc778 \uad50\ub780 \uc804\uc220\uc744 \ud65c\uc6a9\ud558\uba70, \uad81\uadf9\uc801\uc73c\ub85c \uc0c1\ub300\uac00 \uac10\ud788 \ub6ab\uc744 \uc218 \uc5c6\ub294 \uc6b0\ub9ac \ud300\ub9cc\uc758 \uacac\uace0\ud55c \uc218\ube44 \ubc0f \uc870\uc9c1\ub825\uc744 \uad6c\ucd95\ud558\ub294 \uac83\uc774 \uc2b9\ub9ac\uc758 \ud575\uc2ec\uc785\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
