B.als=new A.a(" 1. \uc815(\u6b63)\uc73c\ub85c\uc368 \ub300\uce58 (\u4ee5\u6b63\u5408):\n  \u318d\uc758\ubbf8: '\uc815(\u6b63)'\uc740 \uc815\uaddc\uc801\uc778 \ubcd1\ub825 \ubc30\uce58, \uc608\uce21 \uac00\ub2a5\ud55c \uc804\uc220, \uc815\uba74\uc5d0\uc11c\uc758 \ub300\uce58 \ub4f1\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \uc774\ub294 \uc801\uc758 \uc8fc\ub825\uc744 \ubb36\uc5b4\ub450\uace0, \uc544\uad70\uc758 \uae30\ubcf8\uc801\uc778 \ubc29\uc5b4\uc120\uc774\ub098 \uacf5\uaca9\uc758 \ud615\ud0dc\ub97c \uad6c\ucd95\ud558\uba70, \uc801\uc5d0\uac8c \uc544\uad70\uc758 '\ud45c\uc900\uc801\uc778' \uc6c0\uc9c1\uc784\uc744 \ubcf4\uc5ec\uc8fc\ub294 \uc5ed\ud560\uc744 \ud569\ub2c8\ub2e4. \uc801\uacfc\uc758 \uae30\ubcf8\uc801\uc778 \uad50\uc804\uc744 \ud1b5\ud574 \uc804\uc7a5\uc744 \ud615\uc131\ud558\uace0, \uc801\uc758 \uc8fc\uc758\ub97c \ub044\ub294 \uc5ed\ud560\uc744 \ub2f4\ub2f9\ud569\ub2c8\ub2e4. \uc774\ub294 \uc2f8\uc6c0\uc758 '\ud310'\uc744 \uae54\uace0, \uc801\uc758 \uc2dc\uc120\uc744 \ubd99\uc7a1\ub294 \ud589\uc704\uc785\ub2c8\ub2e4.\n\n 2.\t\uae30(\u5947)\ub85c\uc368 \uc2b9\ub9ac (\u4ee5\u5947\u52dd):\n \u318d\uc758\ubbf8: '\uae30(\u5947)'\ub294 \uc608\uce21 \ubd88\uac00\ub2a5\ud55c, \ube44\uc815\uaddc\uc801\uc778, \ubcc0\uce59\uc801\uc778 \uc804\uc220\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \uc801\uc758 \ud5c8\ub97c \ucc0c\ub974\uac70\ub098, \uc608\uc0c1\uce58 \ubabb\ud55c \ubc29\ud5a5\uc5d0\uc11c \uacf5\uaca9\ud558\uac70\ub098, \uae30\ub9cc \uc791\uc804\uc744 \ud3bc\uce58\uac70\ub098, \uc8fc\ub825\uc744 \uc6b0\ud68c\ud558\ub294 \uac83 \ub4f1\uc785\ub2c8\ub2e4. '\uae30'\ub294 \uc801\uc758 \ubc29\uc2ec\uc744 \uc720\ub3c4\ud558\uace0, \uc57d\uc810\uc744 \ud30c\uace0\ub4e4\uc5b4 \uacb0\uc815\uc801\uc778 \uc2b9\ub9ac\ub97c \uc7c1\ucde8\ud558\ub294 \uc5ed\ud560\uc744 \ud569\ub2c8\ub2e4. '\uae30'\ub294 \uc801\uc5d0\uac8c \ud63c\ub780\uc744 \uc8fc\uace0 \uade0\ud615\uc744 \ubb34\ub108\ub728\ub9ac\uba70, \uc2b9\ub9ac\uc758 \uacb0\uc815\ud0c0\ub97c \ub0a0\ub9bd\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
