B.aaU=new A.a(" 1. \uc815(\u6b63)\uacfc \uae30(\u5947)\uc758 \uc870\ud654: \uc815\uacf5\ubc95\uacfc \ubcc0\uce59\uc801\uc778 \uc804\uc220\uc740 \ubd84\ub9ac\ub41c \uac83\uc774 \uc544\ub2c8\ub77c \uc0c1\ud638 \ubcf4\uc644\uc801\uc73c\ub85c \ud65c\uc6a9\ub418\uc5b4\uc57c \ud569\ub2c8\ub2e4. \uc815(\u6b63)\uc774 \uc5c6\ub2e4\uba74 \uae30(\u5947)\ub294 \ub2e8\uc21c\ud55c \ub3c4\ubc15\uc774 \ub418\uace0, \uae30(\u5947)\uac00 \uc5c6\ub2e4\uba74 \uc815(\u6b63)\uc740 \ub2e8\uc21c\ud55c \uc18c\ubaa8\uc804\uc774 \ub429\ub2c8\ub2e4. \n\n 2. \uc801\uc758 \uc608\uce21 \ubd88\ud5c8: \uc815(\u6b63)\uc73c\ub85c \uc801\uc758 \uc8fc\uc758\ub97c \ubb36\uc5b4\ub450\uba74\uc11c, \uae30(\u5947)\ub85c \uc608\uc0c1\uce58 \ubabb\ud55c \uacf5\uaca9\uc744 \uac00\ud558\uc5ec \uc801\uc758 \ud310\ub2e8\uc744 \ud750\ub9ac\uac8c \ud558\uace0 \ud63c\ub780\uc744 \uc720\ub3c4\ud558\ub294 \uac83\uc774 \uc911\uc694\ud569\ub2c8\ub2e4.\n\n 3. \uc8fc\ub3c4\uad8c \uc7a5\uc545: '\uae30\uc815'\uc758 \uc801\uc808\ud55c \ud65c\uc6a9\uc740 \uc804\uc7a5\uc758 \uc8fc\ub3c4\uad8c\uc744 \uc544\uad70\uc774 \uc950\uace0, \uc801\uc744 \uc544\uad70\uc758 \uc758\ub3c4\ub300\ub85c \uc6c0\uc9c1\uc774\uac8c \ub9cc\ub4ed\ub2c8\ub2e4.\n\n4. \uc720\uc5f0\ud55c \uc0ac\uace0: \uc0c1\ud669 \ubcc0\ud654\uc5d0 \ub530\ub77c '\uc815'\uacfc '\uae30'\uc758 \ube44\uc911\uc744 \uc870\uc808\ud558\uace0, \ud544\uc694\uc5d0 \ub530\ub77c \uc5ed\ud560(\uc5b4\ub5a4 \uac83\uc774 \uc815\uc774 \ub418\uace0 \uc5b4\ub5a4 \uac83\uc774 \uae30\uac00 \ub420\uc9c0)\uc744 \ubc14\uafc0 \uc218 \uc788\ub294 \uc720\uc5f0\ud55c \uc0ac\uace0\uac00 \ud544\uc218\uc801\uc785\ub2c8\ub2e4. \n\n 5. \uc228\uaca8\uc9c4 \uc758\ub3c4: \uc815(\u6b63)\uc740 \uac89\uc73c\ub85c \ub4dc\ub7ec\ub098\ub294 \uc544\uad70\uc758 \uc6c0\uc9c1\uc784\uc774\uc9c0\ub9cc, \uc9c4\uc815\ud55c \uc2b9\ub9ac\uc758 \uc758\ub3c4\ub294 \uae30(\u5947)\uc5d0 \uc228\uaca8\uc838 \uc788\uc744 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
