B.aw6=new A.a("  \u2022 \u6545(g\xf9): Therefore, so. \n  \u2022 \u7528\u9593(y\xf2ng ji\xe0n): Employing spies (agents). \n  \u2022 \u6709\u4e94(y\u01d2u w\u01d4): There are five kinds. \n  \u2022 \u56e0\u9593(y\u012bn ji\xe0n): Employing enemy's native spies by co-opting them. \n  \u2022 \u5167\u9593(n\xe8i ji\xe0n): Bribing internal figures of the enemy nation to make them spies. \n  \u2022 \u53cd\u9593(f\u01cen ji\xe0n): Counter-using spies sent by the enemy (double agents). \n  \u2022 \u6b7b\u9593(s\u01d0 ji\xe0n): Doomed spies who are sacrificed by being given false information to deceive the enemy. \n  \u2022 \u751f\u9593(sh\u0113ng ji\xe0n): Spies who collect information and return alive.   \n\n ",null,B.a,null,B.c)
B.afR=new A.a("\u201cThere are five types of intelligence activities: native spies, internal spies, converted spies, doomed spies, and surviving spies.\u201d",null,B.a,null,B.c)
