B.ace=new A.a(" 1.\t\u56e0\u9593 (Native Spies): Spies who use the enemy's local populace (locals). Primarily used to obtain information about local conditions such as enemy geography, customs, public sentiment, and troop movements. This type involves acquiring information by using ordinary residents of the enemy. \n\n 2.\t\u5167\u9593 (Internal Spies): Spies who use enemy officials. Used to acquire high-level information such as the enemy's core strategies, command structure, and internal situations by bribing or persuading high-ranking insiders, officials, or soldiers. \n\n 3.\t\u53cd\u9593 (Converted Spies): Spies who are enemy spies turned against their masters. Used to subvert enemy spies planted among us, sow confusion in the enemy by leaking false information, or uncover the enemy's internal affairs. This is one of the most advanced methods of spy utilization. \n\n 4.\t\u6b7b\u9593 (Doomed Spies): Spies intentionally sent to the enemy with false information to be killed. Used to make the enemy believe false information from our side or to mislead the enemy. The spy themselves must be prepared to be discovered and die at the enemy's hands, hence called 'doomed spies'. \n\n 5.\t\u751f\u9593 (Surviving Spies): Spies who return alive to report information. Spies who infiltrate enemy lines, collect information, and then safely return to their own forces to report. This is the most common and basic type of spy, and their survival is taken into account. \n\n",null,B.a,null,B.c)
