B.ahw=new A.a(" \u318d \u7121\u6240\u4e0d\u5099 (w\xfa su\u01d2 b\xf9 b\xe8i): No place not prepared \u2192 Prepared in all places\n \u318d\u5247 (z\xe9): Then, if (conjunction indicating condition) \n \u318d\u7121\u6240\u4e0d\u5be1 (w\xfa su\u01d2 b\xf9 gu\u01ce): No place not few \u2192 Forces are evenly thin, dispersed\n \u318d\u5be1\u8005 (gu\u01ce zh\u011b): One with few troops\n  \u318d\u5099\u4eba\u8005\u4e5f (b\xe8i r\xe9n zh\u011b y\u011b): One who prepares against others (one who prepares against people) \n \u318d\u8846\u8005 (zh\xf2ng zh\u011b): One with many troops \n\n",null,B.a,null,B.c)
B.asw=new A.a("\u201cIf I prepare everywhere, I will be weak everywhere. He who is weak prepares against others; he who is strong makes others prepare against him.\u201d",null,B.a,null,B.c)
