B.aaN=new A.a("This phrase explains the importance of strategic resource allocation and how the subject of offensive and defensive transitions changes depending on who holds the initiative on the battlefield.\n\n",null,B.a,null,B.c)
B.azJ=new A.a(" 1.\t\u7121\u6240\u4e0d\u5099 \u5247\u7121\u6240\u4e0d\u5be1 (If you prepare everywhere, you will be weak everywhere):\n \u2022\tMeaning: No matter how many troops or resources one has, if one tries to defend all points or all possibilities simultaneously, the effort allocated to each defensive point will be dispersed, ultimately making every place vulnerable. This emphasizes the importance of 'concentration and selection.' It warns of the paradoxical situation where attempting to perfectly block every place results in not being able to properly defend any single place.\n\n 2.\t\u5be1\u8005\u5099\u4eba\u8005\u4e5f (The one with few troops is prepared against by others):\n \u2022\tMeaning: The side that is 'weak (\u5be1)' in terms of troops or strength will inevitably be 'prepared against (\u5099)' by the 'strong other (enemy).' This means being passively led by the opponent's movements and being busy defending. It describes a situation where one loses the initiative and is forced to move according to the opponent's intentions.\n\n 3.\t\u8846\u8005\u4f7f\u4eba\u5099\u5df1\u8005\u4e5f (The one with many troops makes others prepare against himself):\n \u2022\tMeaning: The side that is 'strong (\u8846)' in terms of troops or strength 'makes the weak other (enemy) prepare against itself (\u4f7f\u4eba\u5099\u5df1).' This means our side holds the initiative and makes the enemy struggle to predict our movements and focus on defense. This is a core principle of the 'Weak Points and Strong (\u865b\u5be6)' strategy, involving dispersing the enemy's resources to desired locations and expending their energy. \n\n ",null,B.a,null,B.c)
