B.abV=new A.a("1.\t\u4ee5\u8fc2\u7232\u76f4 (Make the roundabout way the direct way):\n\u2022\tMeaning: Instead of taking the 'direct (\u76f4)' path that the enemy expects, one chooses a 'roundabout (\u8fc2)' path that seems long and inefficient. However, this circuitous path actually bypasses enemy defenses, strikes at enemy vulnerabilities, and thus becomes the truly 'direct' way to reach the ultimate goal most quickly and effectively. This combines deceptive tactics with a speed-based approach that confounds the enemy's predictions. \n\n2.\t\u4ee5\u60a3\u7232\u5229 (Convert misfortune into advantage):\n\u2022\tMeaning: This means converting 'difficulties (\u60a3)' or unfavorable situations encountered in battle, even disasters, not merely into crises but into 'advantages (\u5229)' to be utilized. For example, luring the enemy into difficult terrain with poor supply lines to isolate them, or feigning exposure of our own weaknesses to draw the enemy in. This is the ability to find opportunities within a crisis and turn negative factors into positive outcomes. \n\n",null,B.a,null,B.c)
