B.ay_=new A.a("This passage defines the attitude towards war and the nature of war as follows:  \n\n",null,B.a,null,B.c)
B.as_=new A.a("1.\t\u570b\u4e4b\u5927\u4e8b (Gu\xf3 zh\u012b d\xe0 sh\xec - A Matter of Great Importance for the State): War is the biggest event that determines the fate of a nation. Therefore, it cannot be taken lightly, and all capabilities and resources must be mobilized to approach it cautiously. \n\n2.\t\u6b7b\u751f\u4e4b\u5730 (S\u01d0 sh\u0113ng zh\u012b d\xec - Ground of Life and Death): War is an affair that directly deals with the lives of soldiers, a cruel scene where individual life and death are decided. Leaders must be aware of the severity of such human casualties.\n\n3.\t\u5b58\u4ea1\u4e4b\u9053 (C\xfan w\xe1ng zh\u012b d\xe0o - Path of Survival or Ruin): The outcome of war determines the existence or destruction of a nation. If victorious, the nation can prosper, but if defeated, it can face ruin. This means war is not merely about territorial expansion but an act that gambles the fate of the nation. \n\n4.\t\u4e0d\u53ef\u4e0d\u5bdf\u4e5f (B\xf9 k\u011b b\xf9 ch\xe1 y\u011b - Must Be Thoroughly Examined): Because war is so crucial, it must be thoroughly analyzed, all factors deeply discerned, and decisions made cautiously. This is a warning against making decisions based solely on emotion or impulsive situations, and it is the core spirit running through the entire Art of War.\n\n",null,B.a,null,B.c)
