B.anZ=new A.a(" 1.\t\u51e1\u570d\u5ba2\u4e4b\u5ea6: Generally, the method of besieging an enemy from the perspective of an invader \u2014 here, it metaphorically describes the situation of an army penetrating deep into enemy territory. \n\n 2.\t\u6df1\u5165\u5247\u6230 (Deeply penetrated, then fight): Meaning if one penetrates deeply, one will dedicate oneself to fighting. This implies that if the retreat path is blocked, one has no choice but to fight for survival.\n\n 3.\t\u4e3b\u4eba\u4e0d\u514b (The host cannot prevail): Meaning the host cannot win. This implies that an invading army, having deeply penetrated enemy territory, fights with a do-or-die attitude, making it difficult for the host (defender) to win. \n\n",null,B.a,null,B.c)
