B.ak6=new A.a(" 1.\tPsychology of the Invading Army: An invading army that has advanced deep into enemy territory finds itself in a psychological state akin to being in 'deadly ground' (\u6b7b\u5730), as their retreat path is distant and supplies are difficult. That is, they believe they can only survive by fighting desperately with a 'do-or-die' resolve, thus their will to fight becomes extremely strong (connected to Sun Tzu's 'fight when on deadly ground'). \n\n 2.\tDifficulties for the Defending Army: Paradoxically, it means that the defending army (host) fighting against such a desperate invading force finds it difficult to win. Although the host army has the advantage of their home ground, they may be taken aback by the desperate resistance and unexpected power of the invading army, or find it hard to respond when the opponent is in a 'kill or be killed' mindset. \n\n",null,B.a,null,B.c)
