B.akz=new A.a(" This passage presents the most fundamental approach to achieving victory in war. It emphasizes that securing oneself is a prerequisite for victory, rather than merely focusing on attack.\n\n",null,B.a,null,B.c)
B.akN=new A.a("1.\t\u5148\u7232\u4e0d\u53ef\u52dd (xi\u0101n w\xe9i b\xf9 k\u011b sh\xe8ng - First make oneself invincible): \n \u318d Meaning: This means making one's own forces so solid that they can never be defeated, i.e., making it impossible for the enemy to win against you. This involves establishing a thorough defensive posture, perfect preparation, weaknesses\u88dc\u5f37 (\u88dc\u5f37 - reinforcement/shoring up), and building strong deterrence, thereby making it impossible for the enemy to dare challenge your forces.\n\n2.\t\u4ee5\u5f85\u6575\u4e4b\u53ef\u52dd (y\u01d0 d\xe0i d\xed zh\u012b k\u011b sh\xe8ng - Wait for the moment when the enemy can be defeated):\n \u318d Meaning: After one's own forces have become invincible, this means patiently waiting until the enemy makes a mistake or exposes a weakness, providing an opportunity for one's own forces to become winnable. This implies strategic patience, refraining from premature attacks and waiting for the enemy to crumble or reveal their flaws.\n\n",null,B.a,null,B.c)
