B.av6=new A.a("\uc774 \ubb38\uad6c\ub294 \ud55c \uad6d\uac00\uc758 \uba85\uc6b4\uc5d0 \uc788\uc5b4\uc11c \uc7a5\uc218\uc758 \uc5ed\ud560\uc774 \uc5bc\ub9c8\ub098 \uc808\ub300\uc801\uc774\uace0 \uc911\uc694\ud55c\uc9c0\ub97c \uc5ed\uc124\ud569\ub2c8\ub2e4. \uc5ec\uae30\uc11c '\uc7a5\uc218'\ub294 \ub2e8\uc21c\ud788 \uad70\uc0ac\uc801 \uc9c0\ud718\uad00\uc744 \ub118\uc5b4, \uad6d\uac00\uc758 \uc911\uc694\ud55c \uc815\ucc45 \uacb0\uc815\uacfc \uc2e4\ud589\uc5d0 \uad00\uc5ec\ud558\ub294 \ubaa8\ub4e0 \ub9ac\ub354\uc640 \ucc38\ubaa8\ub97c \ud3ec\uad04\ud558\ub294 \uc758\ubbf8\ub85c \ud574\uc11d\ub420 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
B.azD=new A.a("1.\t\uc7a5\uc218\uc758 \uad6d\uac00\uc801 \uc911\uc694\uc131: \uc7a5\uc218\ub294 \uad6d\uac00\uc758 '\ubcf4\ud544\uc790'\ub85c\uc11c, \uad6d\uac00\ub97c \ub3d5\uace0 \uc9c0\ud0f1\ud558\ub294 \ud575\uc2ec\uc801\uc778 \uc5ed\ud560\uc744 \ud569\ub2c8\ub2e4. \uc774\ub294 \uc7a5\uc218\uac00 \ub2e8\uc21c\ud788 \uc804\ud22c\ub97c \uc9c0\ud718\ud558\ub294 \uac83\uc744 \ub118\uc5b4, \uad6d\uac00\uc758 \uc804\ub7b5\uc801 \ubc29\ud5a5 \uc124\uc815\uacfc \uad6d\ub825 \uc720\uc9c0\uc5d0 \uae4a\uc774 \uad00\uc5ec\ud568\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4.\n\n2.\t\uc644\ubcbd\ud55c \ubcf4\ud544\uc758 \ud6a8\uacfc: \ub9cc\uc57d \uc7a5\uc218(\ub9ac\ub354)\uc758 \ubcf4\ud544 \ub2a5\ub825, \uc989 \uadf8\uc758 \uc9c0\ud61c, \ud1b5\ucc30\ub825, \uc2e4\ud589\ub825, \uadf8\ub9ac\uace0 \uad70 \uc804\uccb4\ub97c \uc544\uc6b0\ub974\ub294 \uc5ed\ub7c9\uc774 '\uc644\ubcbd\ud558\ub2e4\uba74', \uadf8 \ub098\ub77c\ub294 \uc5b4\ub5a4 \ub09c\uad00\uc5d0\ub3c4 \ud754\ub4e4\ub9ac\uc9c0 \uc54a\uace0 '\ubc18\ub4dc\uc2dc \uac15\ud574\uc9c8' \uac83\uc785\ub2c8\ub2e4. \uc774\ub294 \uc720\ub2a5\ud55c \ub9ac\ub354\uc758 \uc874\uc7ac\uac00 \uad6d\uac00\uc758 \uc548\uc815\uacfc \ubc88\uc601\uc5d0 \ud544\uc218\uc801\uc784\uc744 \ub9d0\ud569\ub2c8\ub2e4.\n\n3.\t\ud5c8\uc220\ud55c \ubcf4\ud544\uc758 \uc704\ud5d8\uc131: \ubc18\ub300\ub85c \uc7a5\uc218\uc758 \ubcf4\ud544 \ub2a5\ub825\uc5d0 '\ud2c8\uc774\ub098 \uacb0\uc810'\uc774 \uc788\ub2e4\uba74, \uc544\ubb34\ub9ac \uad6d\ub825\uc774 \uac15\ud558\ub354\ub77c\ub3c4 \uadf8 \ub098\ub77c\ub294 '\ubc18\ub4dc\uc2dc \uc57d\ud574\uc9c8' \uac83\uc785\ub2c8\ub2e4. \uc774\ub294 \ub9ac\ub354\uc758 \uc798\ubabb\ub41c \ud310\ub2e8, \ubb34\ub2a5\ud568, \ub610\ub294 \ub0b4\ubd80\uc758 \ubd88\ud654\uac00 \uacb0\uad6d \uad6d\uac00 \uc804\uccb4\ub97c \uc704\uae30\uc5d0 \ube60\ub728\ub9b4 \uc218 \uc788\uc74c\uc744 \uacbd\uace0\ud569\ub2c8\ub2e4.\n\n4.\t\ub9ac\ub354\uc2ed\uc758 \uacb0\uc815\uc801 \uc601\ud5a5: \uad81\uadf9\uc801\uc73c\ub85c \uc774 \ubb38\uad6c\ub294 \ub9ac\ub354\uc2ed\uc758 \uc9c8\uc774 \uad6d\uac00\uc758 \uc6b4\uba85\uc744 \uacb0\uc815\ud558\ub294 \ud575\uc2ec \uc694\uc778\uc784\uc744 \uac15\uc870\ud569\ub2c8\ub2e4. \ub9ac\ub354\uc758 \uc5ed\ub7c9\uc774 \uace7 \uad6d\uac00\uc758 \uc5ed\ub7c9\uc774 \ub41c\ub2e4\ub294 \uc190\uc790\ubcd1\ubc95\uc758 \ub9ac\ub354\uc2ed \ucca0\ud559\uc744 \ubcf4\uc5ec\uc90d\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
