B.a5D=new A.a("1.\t\ub9ac\ub354\uc2ed\uc758 \ud575\uc2ec: \uc870\uc9c1(\uad6d\uac00)\uc758 \uc6b4\uba85\uc740 \ub9ac\ub354(\uc7a5\uc218)\uc758 \uc5ed\ub7c9\uacfc \uadf8\uac00 \uc218\ud589\ud558\ub294 '\ubcf4\ud544(\u8f14)'\uc758 \uc9c8\uc5d0 \uc9c1\uc811\uc801\uc73c\ub85c \ub2ec\ub824 \uc788\uc2b5\ub2c8\ub2e4.\n\n2.\t\uc778\uc7ac\uc758 \uc911\uc694\uc131: \uc720\ub2a5\ud558\uace0 \uc644\ubcbd\ud558\uac8c \uc870\uc9c1\uc744 \ubcf4\ud544\ud560 \uc218 \uc788\ub294 \ucd5c\uace0\uc758 \uc778\uc7ac\ub97c \ub9ac\ub354 \uc790\ub9ac\uc5d0 \uc549\ud788\ub294 \uac83\uc774 \uc870\uc9c1\uc758 \uc131\uacf5\uc744 \uc704\ud55c \uac00\uc7a5 \uc911\uc694\ud55c \uc804\ub7b5\uc785\ub2c8\ub2e4.\n\n3.\t\uc9c0\uc18d\uc801\uc778 \ub9ac\ub354\uc2ed \uad00\ub9ac: \ub9ac\ub354\uc758 \uc5ed\ub7c9\uc774 '\ud2c8(\u9699)'\uc774 \uc0dd\uae30\uc9c0 \uc54a\ub3c4\ub85d \uc9c0\uc18d\uc801\uc73c\ub85c \uc810\uac80\ud558\uace0 \uad00\ub9ac\ud574\uc57c \ud569\ub2c8\ub2e4. \uc774\ub294 \ub9ac\ub354\uc758 \uc5ed\ub7c9 \uac15\ud654\ubfd0\ub9cc \uc544\ub2c8\ub77c, \ub9ac\ub354\ub97c \ubcf4\uc88c\ud558\ub294 \ucc38\ubaa8\uc9c4\uc758 \uc5ed\ub7c9\ub3c4 \uc911\uc694\ud568\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4.\n\n4.\t\uce58\uba85\uc801\uc778 \ub9ac\uc2a4\ud06c: \ub9ac\ub354\uc2ed\uc758 \uacb0\ud568\uc740 \ub2e8\uc21c\ud788 \ud6a8\uc728\uc131\uc744 \ub5a8\uc5b4\ub728\ub9ac\ub294 \uac83\uc744 \ub118\uc5b4, \uc870\uc9c1 \uc804\uccb4\ub97c \uce58\uba85\uc801\uc778 \uc57d\ud654\uc640 \ubd95\uad34\ub85c \uc774\ub04c \uc218 \uc788\ub294 \uac00\uc7a5 \ud070 \ub9ac\uc2a4\ud06c\uc785\ub2c8\ub2e4.\n\n5.\t\uc608\ubc29\uc758 \uc911\uc694\uc131: \ub9ac\ub354\uc2ed\uc5d0 \ubb38\uc81c\uac00 \ubc1c\uc0dd\ud55c \ud6c4 \uc218\uc2b5\ud558\ub294 \uac83\ubcf4\ub2e4, \ubb38\uc81c\uac00 \ubc1c\uc0dd\ud558\uae30 \uc804\uc5d0 \uc720\ub2a5\ud55c \ub9ac\ub354\ub97c \uc138\uc6b0\uace0 \uadf8 \uc5ed\ub7c9\uc744 \uc720\uc9c0\ud558\ub294 \uac83\uc774 \ud6e8\uc52c \uc911\uc694\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
