B.agj=new A.a("\u318d \u8a08\u5229 (j\xec l\xec): \uc774\uc775\uc744 \uacc4\uc0b0\ud558\ub2e4 (\uc720\ub9ac\ud568\uc744 \ubd84\uc11d\ud558\ub2e4)\n\u318d \u4ee5\u807d (y\u01d0 t\u012bng): \ub4e3\uace0 \ub530\ub978\ub2e4 (\uc0c1\ud669\uc5d0 \ub9de\uac8c \ud310\ub2e8\uc744 \ub530\ub974\ub2e4)\n\u318d \u4e43\u70ba\u4e4b\u52e2 (n\u01cei w\xe9i zh\u012b sh\xec): \uc774\uc5d0 \ub530\ub77c \ud615\uc138(\u52e2)\ub97c \ub9cc\ub4e0\ub2e4\n\u318d \u4ee5\u4f50\u5176\u5916 (y\u01d0 zu\u01d2 q\xed w\xe0i): \uc774\ub97c \ud1b5\ud574 \uc678\ubd80\ub97c \ub3d5\ub294\ub2e4(\uc9c1\uc811\uc801\uc778 \ud798 \uc678\uc5d0 \uac04\uc811\uc801\uc73c\ub85c \ubcf4\uc870\ud568)\n\u318d \u52e2\u8005 (sh\xec zh\u011b): \ud615\uc138\n\u318d \u56e0\u5229\u800c\u5236\u6b0a\u4e5f (y\u012bn l\xec \xe9r zh\xec qu\xe1n y\u011b): \uc720\ub9ac\ud568\uc744 \ubc14\ud0d5\uc73c\ub85c \uad8c(\u6b0a)\uc744 \uc870\uc808\ud558\ub294 \uac83\uc774\ub2e4.\n\n",null,B.a,null,B.c)
B.ag0=new A.a('"\uc774\ud574\ub4dd\uc2e4\uc744 \uc798 \ud5e4\uc544\ub824 \ud310\ub2e8\ud558\uace0, \ube44\ub85c\uc18c \uadf8\uc5d0 \ub530\ub77c \ud615\uc138\ub97c \ub9cc\ub4e4\uba70, \uadf8 \ud615\uc138 \ub85c \uc678\ubd80 \uc0c1\ud669\uc744 \ubcf4\uc870\ud574\uc57c \ud55c\ub2e4. \ud615\uc138\ub77c\ub294 \uac83\uc740 \uc720\ub9ac\ud568\uc5d0 \ub530\ub77c \uc784\uae30\uc751\ubcc0\uc744 \ubd80\ub824 \uc0c1\ud669\uc744 \ud1b5\uc81c\ud558\ub294 \uac83\uc774\ub2e4." ',null,B.a,null,B.c)
