B.a7c=new A.a("\uc774 \ubb38\uad6c\ub294 \uc804\ub7b5 \uc218\ub9bd\uacfc \uc2e4\ud589 \uacfc\uc815\uc5d0\uc11c\uc758 \uc0c1\ud669 \ud310\ub2e8, \ud615\uc138 \uc870\uc131, \uadf8\ub9ac\uace0 \uc720\uc5f0\ud55c \ub300\ucc98 \ub2a5\ub825\uc758 \uc911\uc694\uc131\uc744 \uac15\uc870\ud569\ub2c8\ub2e4.   \n\n",null,B.a,null,B.c)
B.aqA=new A.a("1.\t\u8a08\u5229\u4ee5\u807d (J\xec l\xec y\u01d0 t\u012bng - Thorough Assessment of Advantages and Disadvantages): \uc5b4\ub5a4 \uc804\ub7b5\uc744 \uc138\uc6b0\uace0 \uc2e4\ud589\ud558\uae30 \uc804\uc5d0, \uba3c\uc800 \uc0c1\ud669\uc758 \uc774\ub85c\uc6b4 \uc810\uacfc \ud574\ub85c\uc6b4 \uc810, \uc989 \uc774\ud574\ub4dd\uc2e4\uc744 \uba74\ubc00\ud558\uac8c \ubd84\uc11d\ud558\uace0 \ucda9\ubd84\ud788 \uace0\ub824\ud558\uace0 \ud310\ub2e8\ud574\uc57c \ud569\ub2c8\ub2e4. \uc774\ub294 \uac10\uc815\uc801\uc778 \ud310\ub2e8\uc774\ub098 \ub9f9\ubaa9\uc801\uc778 \ud589\ub3d9\uc744 \uacbd\uacc4\ud558\ub294 \uc190\uc790\ubcd1\ubc95\uc758 \uae30\ubcf8 \uc6d0\uce59\uc785\ub2c8\ub2e4.\n\n2.\t\u4e43\u70ba\u4e4b\u52e2 (N\u01cei w\xe9i zh\u012b sh\xec - Creating a Favorable Momentum): \uc774\ud574\ub4dd\uc2e4\uc744 \ubc14\ud0d5\uc73c\ub85c \uc720\ub9ac\ud558\ub2e4\uace0 \ud310\ub2e8\ub418\uba74, \uadf8\uc5d0 \ub9de\ucdb0 '\uc138(\u52e2)'\ub97c \uc870\uc131\ud574\uc57c \ud569\ub2c8\ub2e4. \uc5ec\uae30\uc11c '\uc138(\u52e2)'\ub294 \ub2e8\uc21c\ud55c \ubcd1\ub825\uc758 \uc6b0\uc704\uac00 \uc544\ub2c8\ub77c, \uc0c1\ub300\ubc29\uc744 \uc555\ub3c4\ud560 \uc218 \uc788\ub294 \uc720\ub9ac\ud55c \ud615\uc138, \ud750\ub984, \uae30\uc138\ub97c \uc758\ubbf8\ud569\ub2c8\ub2e4. \uc774\ub294 \uc8fc\ub3c4\uba74\ubc00\ud55c \uacc4\ud68d\uacfc \uc2e4\ud589\uc744 \ud1b5\ud574 \ub9cc\ub4e4\uc5b4\uc9d1\ub2c8\ub2e4.\n\n3.\t\u4ee5\u4f50\u5176\u5916 (Y\u01d0 zu\u01d2 q\xed w\xe0i - Aiding External Conditions): \uc870\uc131\ub41c '\uc138(\u52e2)'\ub294 \ub2e8\uc21c\ud788 \ub0b4\ubd80\uc801\uc778 \uc6b0\uc704\uc5d0 \uadf8\uce58\ub294 \uac83\uc774 \uc544\ub2c8\ub77c, \uc678\ubd80\uc801\uc778 \uc0c1\ud669, \uc989 \uc804\uc7a5\uc758 \uc9c0\ub9ac\uc801 \uc870\uac74, \uc801\uad70\uc758 \uc2ec\ub9ac, \uc544\uad70\uc758 \ubcf4\uae09 \uc0c1\ud669 \ub4f1\uc744 \ubcf4\uc870\ud558\uace0 \uc720\ub9ac\ud558\uac8c \uc774\ub04c\uc5b4\uac00\ub294 \uc5ed\ud560\uc744 \ud574\uc57c \ud569\ub2c8\ub2e4. '\uc138(\u52e2)'\ub97c \ud1b5\ud574 \uc678\ubd80 \ud658\uacbd\uae4c\uc9c0 \uc544\uad70\uc5d0\uac8c \uc720\ub9ac\ud558\uac8c \ub9cc\ub4e4\ub77c\ub294 \ub73b\uc785\ub2c8\ub2e4.\n\n4.\t\u52e2\u8005\uff0c\u56e0\u5229\u800c\u5236\u6b0a\u4e5f (Sh\xec zh\u011b, y\u012bn l\xec \xe9r zh\xec qu\xe1n y\u011b - The Essence of Momentum): '\uc138(\u52e2)'\ub780 \uace0\uc815\ubd88\ubcc0\uc758 \uac83\uc774 \uc544\ub2c8\ub77c, \uc774\ub85c\uc6c0(\u5229), \uc989 \uc720\ub9ac\ud55c \uc0c1\ud669\uc774\ub098 \uc774\uc810\uc744 \uae30\ubc18\uc73c\ub85c \ud558\uc5ec, \uc784\uae30\uc751\ubcc0\uc801\uc73c\ub85c \uc0c1\ud669\uc744 \ud1b5\uc81c\ud558\uace0 \uc81c\uc5b4\ud558\ub294 '\uad8c\ub3c4(\u6b0a)'\ub97c \ubd80\ub9ac\ub294 \ub2a5\ub825\uc785\ub2c8\ub2e4. \uc774\ub294 \uc815\ud574\uc9c4 \uc6d0\uce59\uc5d0 \uc5bd\ub9e4\uc774\uc9c0 \uc54a\uace0, \uc720\ub9ac\ud55c \uc870\uac74\uc5d0 \ub530\ub77c \uc720\uc5f0\ud558\uac8c \ub300\uc751\ud568\uc73c\ub85c\uc368 \uc8fc\ub3c4\uad8c\uc744 \uc7a1\ub294 \uac83\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
