B.as7=new A.a("1.\t\ucca0\uc800\ud55c \uc0ac\uc804 \ubd84\uc11d: \uc5b4\ub5a4 \ud589\ub3d9\uc5d0 \uc55e\uc11c \uc774\ud574\ub4dd\uc2e4\uc744 \uba74\ubc00\ud788 \ubd84\uc11d\ud558\ub294 \uac83\uc774 \ubaa8\ub4e0 \uc804\ub7b5\uc758 \ucd9c\ubc1c\uc810\uc785\ub2c8\ub2e4.\n\n2.\t\ud615\uc138\uc758 \uc8fc\ub3c4\uc801 \ucc3d\ucd9c: \ub2e8\uc21c\ud788 \uc8fc\uc5b4\uc9c4 \uc0c1\ud669\uc5d0 \uc218\ub3d9\uc801\uc73c\ub85c \ub300\uc751\ud558\ub294 \uac83\uc774 \uc544\ub2c8\ub77c, \uc2a4\uc2a4\ub85c\uc5d0\uac8c \uc720\ub9ac\ud55c \ud615\uc138\ub97c \ub2a5\ub3d9\uc801\uc73c\ub85c \ub9cc\ub4e4\uc5b4\uac00\ub294 \ub2a5\ub825\uc774 \uc911\uc694\ud569\ub2c8\ub2e4.\n\n3.\t\uc0c1\ud669\uc5d0 \ub530\ub978 \uc720\uc5f0\ud55c \ub300\uc751: \uace0\uc815\ub41c \uc804\uc220\uc774\ub098 \uc6d0\uce59\uc5d0 \uc5bd\ub9e4\uc774\uc9c0 \uc54a\uace0, \uc0c1\ud669\uc758 \ubcc0\ud654\uc640 \uc774\ub85c\uc6c0\uc5d0 \ub530\ub77c '\uad8c\ub3c4'\ub97c \ubd80\ub9ac\ub294 \uc784\uae30\uc751\ubcc0\uc758 \uc9c0\ud61c\ub97c \ubc1c\ud718\ud574\uc57c \ud569\ub2c8\ub2e4.\n\n4.\t\uc678\ubd80 \ud658\uacbd \ud65c\uc6a9: \ub0b4\ubd80\uc801\uc778 \uac15\uc810\uc744 \ud1b5\ud574 \uc678\ubd80 \ud658\uacbd\uae4c\uc9c0 \uc544\uad70\uc5d0\uac8c \uc720\ub9ac\ud558\uac8c \ub9cc\ub4dc\ub294 \uc804\ub7b5\uc801 \uc0ac\uace0\uac00 \ud544\uc694\ud569\ub2c8\ub2e4.\n\n5.\t\uc8fc\ub3c4\uad8c \ud655\ubcf4: '\uc138'\ub97c \ud1b5\ud574 \uc0c1\ud669\uc744 \ud1b5\uc81c\ud558\uace0 \uc81c\uc5b4\ud568\uc73c\ub85c\uc368 \uc8fc\ub3c4\uad8c\uc744 \ud655\ubcf4\ud558\ub294 \uac83\uc774 \uc2b9\ub9ac\uc758 \ud575\uc2ec\uc785\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
