B.ai5=new A.a(" \uc190\uc790\ubcd1\ubc95 \uc9c0\ud615(\u5730\u5f62)\ud3b8\uc5d0\uc11c\ub294 \uc9c0\ud61c\ub85c\uc6b4 \ub9ac\ub354\uc2ed\uacfc \uc2ec\uc624\ud55c \ud1b5\ucc30\ub825\uc744 \ud1b5\ud574 \uad81\uadf9\uc801\uc778 \uc2b9\ub9ac\ub97c \uc7c1\ucde8\ud558\ub294 \ubc29\ubc95\uc744 \uc81c\uc2dc\ud569\ub2c8\ub2e4. \n\n",null,B.a,null,B.t)
B.akM=new A.a(" \uc704\uc5d0\uc11c \uc5b8\uae09\ub41c \uad6c\uc808\ub4e4\uc744 \uc885\ud569\ud558\uba74, \uc190\uc790\ubcd1\ubc95\uc774 \uac15\uc870\ud558\ub294 \ud575\uc2ec \uc6d0\uce59\uc740 \ub2e4\uc74c\uacfc \uac19\uc2b5\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
B.apg=new A.a(" 1. \ud658\uacbd \ubd84\uc11d\uacfc \uc720\uc5f0\ud55c \ub300\ucc98: \ubaa8\ub4e0 \uc9c0\ud615(\u5730\u5f62\u6d41\u901a\u8005 \u6109\u5feb\u8005 \u6538\u6301\u8005 \u6538\u611b\u8005 \u6538\u96aa\u8005 \u6538\u9060\u8005)\uc740 \uace0\uc720\ud55c \ud2b9\uc131\uc744 \uac00\uc9c0\uba70, \uc774\uc5d0 \ub530\ub77c \uc804\ub7b5\uc744 \uc720\uc5f0\ud558\uac8c \uc870\uc815\ud574\uc57c \ud569\ub2c8\ub2e4. '\ucc9c\uc2dc(\u5929\u6642)'\uc640 '\uc9c0\ub9ac(\u5730\u7406)'\ub97c \uc815\ud655\ud788 \ud30c\uc545\ud558\ub294 \uc9c0\ucc9c\uc9c0\uc9c0(\u77e5\u5929\u77e5\u5730)\ub294 \ub2e8\uc21c\ud55c \uc0dd\uc874\uc744 \ub118\uc5b4 \uc644\uc804\ud55c \uc2b9\ub9ac(\u52dd\u4e43\u53ef\u5168)\ub97c \uac00\ub2a5\ud558\uac8c \ud569\ub2c8\ub2e4.\n\n 2. \ud328\ubc30\uc758 \uadfc\uc6d0\uacfc \uc608\ubc29: \uad70\ub300\uc758 \uc640\ud574\uc640 \ud328\ubc30\ub294 \uc678\ubd80\uc758 \uac15\ud568\ubcf4\ub2e4 \ub0b4\ubd80\uc801\uc778 \ubb38\uc81c(\u6545\u5175\u6709\u8d70\u8005, \u6709\u5f1b\u8005, \u6709\u9677\u8005, \u6709\u5d29\u8005, \u6709\u4e82\u8005, \u6709\u5317\u8005)\uc5d0\uc11c \ube44\ub86f\ub418\ub294 \uacbd\uc6b0\uac00 \ub9ce\uc2b5\ub2c8\ub2e4. \uc9c0\ud718\uad00\uc758 \ubb34\ub2a5, \uaddc\uc728 \ud574\uc774, \uc815\ubcf4 \ubd80\uc871, \ud1b5\uc194\ub825 \ubd80\uc7ac \ub4f1\uc774 \uce58\uba85\uc801\uc778 \uacb0\uacfc\ub97c \ucd08\ub798\ud560 \uc218 \uc788\uc74c\uc744 \uacbd\uace0\ud558\uba70, \uc774\ub97c \ucca0\uc800\ud788 \uad00\ub9ac\ud558\uace0 \uc608\ubc29\ud574\uc57c \ud569\ub2c8\ub2e4. \n\n 3. \ub9ac\ub354\uc758 \ud5cc\uc2e0\uacfc \ucc45\uc784: \uc9c4\uc815\ud55c \ub9ac\ub354\ub294 \uac1c\uc778\uc758 \uba85\uc608\ub098 \uc548\uc704\ub97c \ucd94\uad6c\ud558\uc9c0 \uc54a\uace0(\u9032\u4e0d\u6c42\u540d \u9000\u4e0d\u907f\u7f6a), \uc624\uc9c1 \uacf5\ub3d9\uccb4\uc758 \uc548\ub155\uacfc \uc774\uc775(\u552f\u6c11\u662f\u4fdd \u800c\u5229\u5408\u65bc\u4e3b)\uc744 \ucd5c\uc6b0\uc120\uc73c\ub85c \uc0dd\uac01\ud574\uc57c \ud569\ub2c8\ub2e4. \ucc45\uc784\uac10 \uc788\ub294 \ud5cc\uc2e0\uc774\uc57c\ub9d0\ub85c \uacf5\ub3d9\uccb4\uc758 \uc2e0\ub8b0\ub97c \uc5bb\uace0 \ub2e8\uacb0\ub825\uc744 \uac15\ud654\ud558\ub294 \uadfc\uac04\uc785\ub2c8\ub2e4. \n\n 4. \uade0\ud615 \uc7a1\ud78c \ub9ac\ub354\uc2ed: \ub9ac\ub354\ub294 \uad6c\uc131\uc6d0\uc5d0\uac8c \uad00\ub300\ud568\uacfc \uc0ac\ub791\uc744 \ubca0\ud480\uba74\uc11c\ub3c4(\u539a\u800c\u4e0d\u80fd\u4f7f \u611b\u800c\u4e0d\u80fd\u4ee4), \ub3d9\uc2dc\uc5d0 \ub2e8\ud638\ud55c \uba85\ub839\uacfc \ud1b5\uc81c\ub825\uc744 \uac16\ucd94\uc5b4\uc57c \ud569\ub2c8\ub2e4. \ud2b9\ud788 \uc5b4\ub824\uc6b4 \uc0c1\ud669(\u96e3\u800c\u4e0d\u80fd\u6cbb)\uc5d0\uc11c \ud754\ub4e4\ub9bc \uc5c6\uc774 \uc870\uc9c1\uc744 \ub2e4\uc2a4\ub9ac\uace0 \ubb38\uc81c\ub97c \ud574\uacb0\ud560 \uc218 \uc788\ub294 \uc2e4\uc9c8\uc801\uc778 \uc5ed\ub7c9\uc774 \ud544\uc218\uc801\uc785\ub2c8\ub2e4. \n\n 5. \uc815\ubcf4 \uc6b0\uc704\uc640 \uc790\uae30 \uc774\ud574: \uc801\uc744 \uc54c\uace0 \ub098\ub97c \uc544\ub294(\u77e5\u5f7c\u77e5\u5df1) \uac83\uc740 \ucd5c\uc18c\ud55c \uc704\ud5d8\uc5d0 \ube60\uc9c0\uc9c0 \uc54a\ub294(\u52dd\u4e43\u4e0d\u6b86) \ud575\uc2ec \uc804\ub7b5\uc785\ub2c8\ub2e4. \uc774\ub294 \ub2e8\uc21c\ud788 \ud798\uc758 \uc6b0\uc704\uac00 \uc544\ub2cc, \uc815\ud655\ud55c \uc815\ubcf4 \ubd84\uc11d\uc744 \ud1b5\ud574 \uc0c1\ud669\uc744 \uc608\uce21\ud558\uace0 \uc8fc\ub3c4\uad8c\uc744 \uc7a1\ub294 \uac83\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \n\n \uacb0\ub860\uc801\uc73c\ub85c \uc190\uc790\ubcd1\ubc95\uc740 \uc804\uc7c1(\uacbd\uc7c1)\uc758 \ubcf5\uc7a1\uc131\uc744 \uc774\ud574\ud558\uace0, \ub9ac\ub354\uc758 \ub3c4\ub355\uc801 \ubc0f \uc2e4\uc9c8\uc801 \uc5ed\ub7c9\uc744 \uacb8\ube44\ud558\uba70, \ud658\uacbd\uacfc \uc815\ubcf4\uc758 \uc911\uc694\uc131\uc744 \ubc14\ud0d5\uc73c\ub85c \uc720\uc5f0\ud558\uace0\ub3c4 \ub2e8\ud638\ud55c \uc804\ub7b5\uc744 \ud3bc\uccd0 \uacf5\ub3d9\uccb4\uc758 \uc774\uc775\uc744 \uadf9\ub300\ud654\ud558\ub294 \uc9c0\ud61c\ub97c \uac15\uc870\ud569\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
