B.a8e=new A.a("\uc801\uc758 \uc804\ub825\uacfc \uc57d\uc810, \uc544\uad70\uc758 \ub2a5\ub825\uacfc \ud55c\uacc4\ub97c \ucca0\uc800\ud788 \ubd84\uc11d\ud574\uc57c\ub9cc \uc704\uae30\uc5d0 \ucc98\ud558\uc9c0 \uc54a\ub294\ub2e4. \ub098\uc544\uac00 \uae30\uc0c1, \uc2dc\uac04, \uc9c0\ud615 \ub4f1 \ubaa8\ub4e0 \ud658\uacbd \uc815\ubcf4\ub97c \uc644\ubcbd\ud788 \ud30c\uc545\ud574\uc57c \uc628\uc804\ud55c \uc2b9\ub9ac\ub97c \uac70\ub458 \uc218 \uc788\ub2e4!\n\u2022  \uc694\uc57d: \ud604\ub300\uc804\uc740 \uc815\ubcf4\uc804\uc758 \uc591\uc0c1\uc744 \ub760\uace0 \uc788\uc2b5\ub2c8\ub2e4. \uc778\uacf5\uc704\uc131, \ub4dc\ub860, \uc0ac\uc774\ubc84 \uc815\ubcf4\uc804 \ub4f1 \ucca8\ub2e8 \uae30\uc220\uc744 \ud65c\uc6a9\ud55c \uc815\ubcf4 \uc218\uc9d1\uacfc \ubd84\uc11d\uc774 \uc804\ud22c\uc758 \uc2b9\ud328\ub97c \uc88c\uc6b0\ud569\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
B.a80=new A.a(" \uacbd\uc7c1\uc0ac\uc758 \uac15\uc810\uacfc \uc57d\uc810, \uadf8\ub9ac\uace0 \uc790\uc0ac\uc758 \uc5ed\ub7c9\uacfc \ud55c\uacc4\ub97c \ucca0\uc800\ud788 \ubd84\uc11d\ud574\uc57c\ub9cc \uc2dc\uc7a5\uc5d0\uc11c \uc704\ud0dc\ub86d\uc9c0 \uc54a\ub2e4. \ub098\uc544\uac00 \uc2dc\uc7a5 \ud2b8\ub80c\ub4dc, \uacbd\uc81c \uc0c1\ud669, \uaddc\uc81c \ub4f1 \ubaa8\ub4e0 \uc678\ubd80 \ud658\uacbd\uc744 \uc644\ubcbd\ud788 \ud30c\uc545\ud574\uc57c \uc628\uc804\ud55c \uc131\uacf5\uc744 \uc774\ub8f0 \uc218 \uc788\ub2e4! \n\u2022  \uc694\uc57d: \ube44\uc988\ub2c8\uc2a4 \uacbd\uc7c1\uc740 \uc2dc\uc7a5\uc5d0 \ub300\ud55c \uae4a\uc740 \uc774\ud574\uc640 \uc790\uc0ac \uc5ed\ub7c9\uc5d0 \ub300\ud55c \ub0c9\ucca0\ud55c \ud3c9\uac00\ub97c \uc694\uad6c\ud569\ub2c8\ub2e4. \uc678\ubd80 \ud658\uacbd \ubcc0\ud654\ub97c \uc608\uce21\ud558\uace0 \ud65c\uc6a9\ud558\ub294 \ub2a5\ub825\uc740 \uc9c0\uc18d \uac00\ub2a5\ud55c \uc131\uc7a5\uc758 \ud544\uc218 \uc870\uac74\uc785\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
B.ai3=new A.a(" \uc0c1\ub300 \ud300\uc758 \uc804\ub825\uacfc \uc57d\uc810, \uc6b0\ub9ac \ud300\uc758 \uac15\uc810\uacfc \ud55c\uacc4\ub97c \ucca0\uc800\ud788 \ubd84\uc11d\ud574\uc57c\ub9cc \uacbd\uae30\uc5d0\uc11c \uc704\ud0dc\ub86d\uc9c0 \uc54a\ub2e4. \ub098\uc544\uac00 \ub0a0\uc528, \uacbd\uae30\uc7a5 \uc0c1\ud0dc, \uc2ec\ud310 \uc131\ud5a5 \ub4f1 \ubaa8\ub4e0 \ud658\uacbd \uc694\uc18c\ub97c \uc644\ubcbd\ud788 \ud30c\uc545\ud574\uc57c \uc628\uc804\ud55c \uc2b9\ub9ac\ub97c \uac70\ub458 \uc218 \uc788\ub2e4! \n\u2022  \uc694\uc57d: \uc2a4\ud3ec\uce20 \uacbd\uae30\uc5d0\uc11c \uc2b9\ub9ac\ub294 \ub2e8\uc21c\ud55c \uae30\ub7c9 \ucc28\uc774\ub97c \ub118\uc5b4\uc120 \uc804\ub7b5\uacfc \ubd84\uc11d\uc758 \uc2f8\uc6c0\uc785\ub2c8\ub2e4. \uc0c1\ub300 \ud300\uacfc \uc6b0\ub9ac \ud300, \uadf8\ub9ac\uace0 \uacbd\uae30 \ud658\uacbd\uc5d0 \ub300\ud55c \ucd1d\uccb4\uc801\uc778 \uc774\ud574\uac00 \uc2b9\ub9ac\uc758 \uae30\ubc18\uc774 \ub429\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
