B.auJ=new A.a(" \u2022 \u5fc5\u6b7b\u53ef\u6bba\u4e5f(b\xec s\u01d0 k\u011b sh\u0101 y\u011b): \uc8fd\uae30\ub97c \uac01\uc624\ud55c \uc790\ub294 \uc8fd\uc77c \uc218 \uc788\ub2e4 \n \u2022 \u5fc5\u751f\u53ef\u865c\u4e5f(b\xec sh\u0113ng k\u011b l\u01d4 y\u011b): \uc0b4\uae30\ub97c \uc6d0\ud558\ub294 \uc790\ub294 \uc0ac\ub85c\uc7a1\uc744 \uc218 \uc788\ub2e4 \n \u2022 \u5fff\u901f\u53ef\u4fae\u4e5f(f\xe8n s\xf9 k\u011b w\u01d4 y\u011b): \ubd84\ub178\ud558\uc5ec \uc870\uae09\ud55c \uc790\ub294 \ubaa8\uc695\ud560 \uc218 \uc788\ub2e4 \n \u2022 \u5ec9\u6f54\u53ef\u8fb1\u4e5f(li\xe1n ji\xe9 k\u011b r\u01d4 y\u011b): \uc9c0\ub098\uce58\uac8c \uccad\ub834\ud55c \uc790\ub294 \ub2a5\uc695\ud560 \uc218 \uc788\ub2e4 \n \u2022 \u611b\u6c11\u53ef\u7169\u4e5f(\xe0i m\xedn k\u011b f\xe1n y\u011b): \ubc31\uc131\uc744 \uc0ac\ub791\ud558\ub294 \uc790\ub294 \ud53c\uace4\ud558\uac8c \ub9cc\ub4e4 \uc218 \uc788\ub2e4 \n\n",null,B.a,null,B.c)
B.ai9=new A.a("\u201c\uc8fd\uae30\ub97c \uac01\uc624\ud55c \uc790\ub294 \uc8fd\uc77c \uc218 \uc788\uace0, \uc0b4\uace0\uc790 \ud558\ub294 \uc790\ub294 \uc7a1\uc744 \uc218 \uc788\uc73c\uba70, \ud654\ub97c \uc798 \ub0b4\ub294 \uc790\ub294 \ubaa8\uc695\ud560 \uc218 \uc788\uace0, \uc9c0\ub098\uce58\uac8c \uccad\ub834\ud55c \uc790\ub294 \uc218\uce58\ub97c \uc904 \uc218 \uc788\uc73c\uba70, \ubc31\uc131\uc744 \ub108\ubb34 \uc544\ub07c\ub294 \uc790\ub294 \ud53c\ub85c\ud558\uac8c \ub9cc\ub4e4 \uc218 \uc788\ub2e4.\u201d\n",null,B.a,null,B.c)
