B.ahT=new A.a(" \uc774 \ubb38\uad6c\ub294 \ub2e4\uc12f \uac00\uc9c0 \uc720\ud615\uc758 \uc778\ubb3c(\ub610\ub294 \uc2ec\ub9ac \uc0c1\ud0dc)\uc744 \ubd84\ub958\ud558\uace0, \uac01 \uc720\ud615\uc758 \ubcf8\uc9c8\uc801\uc778 \uc57d\uc810\uc744 \uacf5\ub7b5\ud558\ub294 \ubc29\ubc95\uc744 \uc81c\uc2dc\ud569\ub2c8\ub2e4. \uc774\ub294 \uc801\uc758 \ub0b4\uba74\uc744 \uaff0\ub6ab\uc5b4 \ubcf4\uace0, \uadf8\ub4e4\uc758 \ud2b9\uc131\uc744 \uc5ed\uc774\uc6a9\ud558\uc5ec \uc2b9\ub9ac\ud558\ub294 \uace0\ub3c4\uc758 \uc2ec\ub9ac\uc804 \uc804\uc220\uc785\ub2c8\ub2e4.\n",null,B.a,null,B.c)
B.aqB=new A.a(" 1. \u5fc5\u6b7b\u53ef\u6bba\u4e5f (\uc8fd\uae30\ub97c \uac01\uc624\ud55c \uc790\ub294 \uc8fd\uc77c \uc218 \uc788\ub2e4): \n   \u2022 \uc758\ubbf8: \uc8fd\uc74c\uc744 \ub450\ub824\uc6cc\ud558\uc9c0 \uc54a\uace0 \uacb0\uc0ac\uc801\uc73c\ub85c \uc2f8\uc6b0\ub294 \uc790(\u5fc5\u6b7b)\ub294 \uc624\ud788\ub824 \ubb34\ubaa8\ud558\uac8c \ub3cc\uc9c4\ud558\uc5ec \uc2a4\uc2a4\ub85c \uc704\ud5d8\uc5d0 \ube60\uc9c0\uae30 \uc26c\uc6b0\ubbc0\ub85c, \uae30\ud68c\ub97c \ub178\ub824 \uacf5\uaca9\ud558\uba74 \uc8fd\uc77c \uc218 \uc788\uc74c\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. (\uc5b8\ub73b \uc5ed\uc124\uc801\uc73c\ub85c \ub4e4\ub9ac\uc9c0\ub9cc, \uc8fd\uc74c\uc744 \ubd88\uc0ac\ud558\ub294 \ub9f9\ubaa9\uc801 \uc6a9\uae30\ub294 \ub54c\ub85c \uce58\uba85\uc801\uc778 \uc57d\uc810\uc774 \ub420 \uc218 \uc788\uc74c\uc744 \uc9c0\uc801).\n\n 2. \u5fc5\u751f\u53ef\u865c\u4e5f (\uc0b4\uae30\ub97c \ubc14\ub77c\ub294 \uc790\ub294 \uc0ac\ub85c\uc7a1\uc744 \uc218 \uc788\ub2e4): \n   \u2022 \uc758\ubbf8: \uc5b4\ub5bb\uac8c\ub4e0 \uc0b4\uace0\uc790 \ud558\ub294 \uc695\uad6c\uac00 \uac15\ud55c \uc790(\u5fc5\u751f)\ub294 \uc8fd\uc74c\uc744 \ud53c\ud558\uae30 \uc704\ud574 \ud56d\ubcf5\ud558\uac70\ub098 \ud68c\uc720\ub420 \uac00\ub2a5\uc131\uc774 \ub192\uc73c\ubbc0\ub85c, \uc0ac\ub85c\uc7a1\uc744 \uc218 \uc788\uc74c\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4.\n\n 3. \u5fff\u901f\u53ef\u4fae\u4e5f (\uc131\uae09\ud558\uace0 \ubd84\ub178\ud558\ub294 \uc790\ub294 \ubaa8\uc695\ud560 \uc218 \uc788\ub2e4): \n   \u2022 \uc758\ubbf8: \uc131\ubbf8\uac00 \uae09\ud558\uace0 \uc27d\uac8c \ubd84\ub178\ud558\ub294 \uc790(\u5fff\u901f)\ub294 \ub3c4\ubc1c\uc774\ub098 \ubaa8\uc695\uc5d0 \uc27d\uac8c \ubc18\uc751\ud558\uc5ec \uc774\uc131\uc744 \uc783\uace0 \ubb34\ub9ac\ud55c \ud589\ub3d9\uc744 \ud560 \uc218 \uc788\uc73c\ubbc0\ub85c, \uc774\ub97c \ud1b5\ud574 \uadf8\ub4e4\uc744 \ubb34\ub108\ub728\ub9b4 \uc218 \uc788\uc74c\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \n\n 4. \u5ec9\u6f54\u53ef\u8fb1\u4e5f (\uccad\ub834\uacb0\ubc31\ud55c \uc790\ub294 \uc695\ub418\uac8c \ud560 \uc218 \uc788\ub2e4): \n   \u2022 \uc758\ubbf8: \uccad\ub834\ud558\uace0 \uacb0\ubc31\ud558\uc5ec \uba85\uc608\ub97c \uc911\uc2dc\ud558\ub294 \uc790(\u5ec9\u6f54)\ub294 \uc624\uba85\uc774\ub098 \ubaa8\ud568, \uce58\uc695\uc801\uc778 \uc0c1\ud669\uc5d0 \uadf9\ub3c4\ub85c \ubbfc\uac10\ud558\uac8c \ubc18\uc751\ud558\ubbc0\ub85c, \uc774\ub97c \ud1b5\ud574 \uadf8\ub4e4\uc758 \uc815\uc2e0\uc801 \ud3c9\uc815\uc2ec\uc744 \uae68\ub728\ub9b4 \uc218 \uc788\uc74c\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \n\n 5. \u611b\u6c11\u53ef\u7169\u4e5f (\ubc31\uc131\uc744 \uc0ac\ub791\ud558\ub294 \uc790\ub294 \ubc88\uac70\ub86d\uac8c \ud560 \uc218 \uc788\ub2e4): \n   \u2022 \uc758\ubbf8: \ubc31\uc131\uc774\ub098 \ubd80\ud558 \uc9c1\uc6d0\uc5d0 \ub300\ud55c \uc0ac\ub791\uacfc \ucc45\uc784\uac10\uc774 \uac15\ud55c \uc790(\u611b\u6c11)\ub294 \uadf8\ub4e4\uc758 \uc548\uc804\uc774\ub098 \uace0\ud1b5\uc5d0 \ubbfc\uac10\ud558\uac8c \ubc18\uc751\ud558\ubbc0\ub85c, \uc774\ub97c \uc774\uc6a9\ud574 \uadf8\ub4e4\uc744 \ubc88\uac70\ub86d\uac8c \ud558\uac70\ub098 \uc2ec\ub9ac\uc801\uc73c\ub85c \uc555\ubc15\ud558\uc5ec \ud310\ub2e8\ub825\uc744 \ud750\ub9ac\uac8c \ud560 \uc218 \uc788\uc74c\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. (\uc608: \ubbfc\uac04\uc778 \ud53c\ud574\ub97c \uc720\ub3c4\ud558\uc5ec \uc778\ub3c4\uc8fc\uc758\uc801 \uc555\ubc15\uc744 \uac00\ud558\uac70\ub098, \ud6c4\ubc29 \uad50\ub780\uc73c\ub85c \ubcf4\uae09/\uad6c\ud638 \ubd80\ub2f4\uc744 \uc99d\uac00\uc2dc\ucf1c \uc9c0\ud718\uad00\uc744 \ubc88\uac70\ub86d\uac8c \ud568).\n ",null,B.a,null,B.c)
