B.ag7=new A.a(" 1. \uc778\ubb3c \uc2ec\ub9ac \ubd84\uc11d: \uc801\uc758 \uc9c0\ud718\uad00, \ud575\uc2ec \uc778\ubb3c, \ub610\ub294 \uad70\ub300 \uc804\uccb4\uc758 \uc131\ud5a5\uacfc \uc2ec\ub9ac \uc0c1\ud0dc\ub97c \uba74\ubc00\ud788 \ubd84\uc11d\ud558\uc5ec \uadf8\ub4e4\uc758 \ubcf8\uc9c8\uc801\uc778 \uc57d\uc810\uc744 \ud30c\uc545\ud574\uc57c \ud569\ub2c8\ub2e4. \n\n 2. \uc57d\uc810 \ub9de\ucda4\ud615 \uacf5\ub7b5: \ud30c\uc545\ub41c \uac01 \uc57d\uc810(\uc8fd\uc74c \ubd88\uc0ac, \uc0dd\uc874 \uc695\uad6c, \uc131\uae09\ud568, \uba85\uc608\uc2ec, \uc0ac\ub791\uacfc \ucc45\uc784\uac10)\uc5d0 \ub530\ub77c \ub9de\ucda4\ud615 \uc804\ub7b5\uc744 \uad6c\uc0ac\ud558\uc5ec \ud6a8\uacfc\uc801\uc73c\ub85c \uc0c1\ub300\ub97c \ubb34\ub108\ub728\ub824\uc57c \ud569\ub2c8\ub2e4. \n\n 3. \uc2ec\ub9ac\uc801 \uad50\ub780: \uc9c1\uc811\uc801\uc778 \ubb3c\ub9ac\uc801 \ucda9\ub3cc \uc774\uc804\uc5d0 \uc0c1\ub300\ubc29\uc758 \uc815\uc2e0\uc801 \ud3c9\uc815\uc2ec, \ud310\ub2e8\ub825, \uc0ac\uae30\ub97c \ud754\ub4dc\ub294 \uc2ec\ub9ac\uc804\uc758 \uc911\uc694\uc131\uc744 \uac15\uc870\ud569\ub2c8\ub2e4. \n\n 4. \uc5ed\uc774\uc6a9\uc758 \uc9c0\ud61c: \uc0c1\ub300\ubc29\uc758 \uac15\uc810(\uc6a9\uae30, \uccad\ub834, \uc560\ubbfc \uc815\uc2e0)\uc73c\ub85c \ubcf4\uc774\ub294 \uac83\ub4e4\uc774 \ud2b9\uc815 \uc0c1\ud669\uc5d0\uc11c\ub294 \uc624\ud788\ub824 \uc57d\uc810\uc774 \ub420 \uc218 \uc788\uc74c\uc744 \uac04\ud30c\ud558\uace0 \uc774\ub97c \uc5ed\uc774\uc6a9\ud558\ub294 \uc9c0\ud61c\uac00 \ud544\uc694\ud569\ub2c8\ub2e4. \n\n 5. \uac04\uc811\uc801 \uc601\ud5a5: \ub54c\ub85c\ub294 \uc9c1\uc811\uc801\uc778 \uacf5\uaca9\ubcf4\ub2e4 \uc0c1\ub300\ubc29\uc758 \uc57d\uc810\uc744 \uc790\uadf9\ud558\uc5ec \uc2a4\uc2a4\ub85c \ubb34\ub9ac\ud55c \ud589\ub3d9\uc744 \ud558\uac70\ub098 \ubb34\ub108\uc9c0\uac8c \ub9cc\ub4dc\ub294 \uac04\uc811\uc801\uc778 \uc601\ud5a5\ub825\uc774 \ub354\uc6b1 \ud6a8\uacfc\uc801\uc785\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
