B.amo=new A.a("\ud83d\udcda 13: The Use of Spies(\u7528\u9593) \u2013 5 \n",null,B.a,null,B.m)
B.apZ=new A.a("  \u2022 \u6545(g\xf9): Therefore, thus. \n  \u2022 \u60df(w\xe9i): Only, merely. \n  \u2022 \u660e\u541b(m\xedng j\u016bn): Enlightened ruler. \n  \u2022 \u8ce2\u5c07(xi\xe1n ji\xe0ng): Wise general. \n  \u2022 \u80fd(n\xe9ng): Able, capable. \n  \u2022 \u4ee5\u4e0a\u667a(y\u01d0 sh\xe0ng zh\xec): With the highest wisdom. \n  \u2022 \u7232\u9593\u8005(w\xe9i ji\xe0n zh\u011b): One who employs spies, intelligence officer. \n  \u2022 \u5fc5(b\xec): Surely, certainly. \n  \u2022 \u6210(ch\xe9ng): To achieve. \n  \u2022 \u5927\u529f(d\xe0 g\u014dng): Great merit, great success. \n  \u2022 \u6b64(c\u01d0): This. \n  \u2022 \u5175\u4e4b\u8981(b\u012bng zh\u012b y\xe0o): Essence of military art, importance of military affairs. \n  \u2022 \u4e09\u8ecd(s\u0101n j\u016bn): Three armies, entire forces. \n  \u2022 \u4e4b(zh\u012b): 's (possessive). \n  \u2022 \u6240\u6043\u800c\u52d5(su\u01d2 sh\xec \xe9r d\xf2ng): That which is relied upon to move.  \n\n",null,B.a,null,B.c)
B.aa2=new A.a("\u201cTherefore, only the enlightened ruler and the wise general can utilize the most intelligent individuals as spies, and they will surely achieve great success. This is the essence of military art, and it is the foundation upon which the entire army relies to move. \u201d",null,B.a,null,B.c)
