B.a9a=new A.a("This passage emphasizes the ultimate importance of intelligence activities and the role of the supreme leader. \n\n ",null,B.a,null,B.c)
B.au2=new A.a(" 1.\tLeader's Qualities and Intelligence Utilization: It states that only an 'enlightened ruler (\u660e\u541b)' and a 'wise general (\u8ce2\u5c07)' can utilize 'the most intelligent individuals (\u4e0a\u667a)' as spies, going beyond simply employing spies. This means that intelligence activities require the leader's capability to select individuals with the highest level of wisdom and insight and to maximize their abilities, beyond merely planting intelligence sources. \n\n 2.\tAchievement of Great Success: It asserts that when intelligence activities are operated in this manner, 'great success (\u5927\u529f)' will surely be achieved. This reiterates that intelligence activities are the most important factor determining the outcome of war. \n\n 3.\tEssence of Military Art and Foundation of the Army: Furthermore, it defines intelligence activities as the essence of military art (\u5175\u4e4b\u8981) and the foundation upon which the entire army relies to move (\u4e09\u8ecd\u4e4b\u6240\u6043\u800c\u52d5\u4e5f). This means that no military operation can succeed without intelligence, and it becomes the starting point and basis for all movements. \n\n ",null,B.a,null,B.c)
