B.a7p=new A.a("Sun Tzu's Art of War emphasizes the top priority of information warfare, the importance of talent utilization, the role of leadership, and intelligence-based decision-making. \n\n ",null,B.a,null,B.c)
B.axX=new A.a(" 1.\tInformation Warfare is a Core Competency of Commanders: The commander's insight and wisdom determine the success of intelligence activities, and it is important to deploy the most outstanding talents in the intelligence field. \n\n 2.\tInformation as the Basis for All Actions: All military actions must be based on accurate and reliable information. Without information, the army moves blindly. \n\n 3.\tUtilization of Intellectuals: Instead of merely brave individuals, wise and insightful individuals should be placed in intelligence activities to maximize their intellectual capabilities. \n\n 4.\tInformation Superiority is Victory: Securing information superiority through effective intelligence activities is the secret to achieving great success in war. \n\n ",null,B.a,null,B.c)
