B.ah9=new A.a("\u318d \u5176\u7528\u6230\u4e5f(q\xed y\xf2ng zh\xe0n y\u011b): \uadf8\uac00 \uc804\uc7c1\uc744 \uc6b4\uc6a9\ud568\uc5d0 \uc788\uc5b4 (\uc804\uc7c1\uc744 \uc218\ud589\ud560 \ub54c\ub294)\n\u318d \u8cb4\u52dd (gu\xec sh\xe8ng ): \uc2b9\ub9ac\ub97c \uadc0\ud558\uac8c \uc5ec\uae34\ub2e4 (\ubb34\uc5c7\ubcf4\ub2e4 \uc2b9\ub9ac\ub97c \uc911\uc694\ud558\uac8c \uc5ec\uae34\ub2e4)\n\u318d \u4e45\u5247 (ji\u01d4 z\xe9): \uc624\ub798 \ub04c\uba74 (\uc804\uc7c1\uc774 \uc7a5\uae30\ud654\ub418\uba74)\n\u318d \u920d\u5175 (d\xf9n b\u012bng): \ubcd1\uc0ac\ub4e4\uc774 \ubb34\ub514\uc5b4\uc9c0\uace0 (\uc804\ud22c\ub825\uc774 \ub5a8\uc5b4\uc9c0\uace0)\n\u318d \u632b\u92b3 (cu\xf2 ru\xec): \uc608\ub9ac\ud568\uc774 \uaebe\uc778\ub2e4 (\ub0a0\uce74\ub85c\uc6c0\uc774 \ubb34\ub38c\uc9c4\ub2e4)\n\n",null,B.a,null,B.c)
