B.aAq=new A.a("1.\t\ubaa9\ud45c \uc9c0\ud5a5\uc801 \uc0ac\uace0: \ubaa8\ub4e0 \uc804\ub7b5\uacfc \ud589\ub3d9\uc740 \ucd5c\uc885\uc801\uc778 \uc2b9\ub9ac\ub97c \ubaa9\ud45c\ub85c \uc0bc\uc544\uc57c \ud569\ub2c8\ub2e4.\n\n2.\t\uc2dc\uac04\uc758 \uc804\ub7b5\uc801 \uac00\uce58: \uc804\uc7c1\uc5d0\uc11c \uc2dc\uac04\uc740 \uace7 \ube44\uc6a9\uc774\uc790 \uc790\uc6d0\uc774\uba70, \ubd88\ud544\uc694\ud558\uac8c \uc2dc\uac04\uc744 \ub044\ub294 \uac83\uc740 \uce58\uba85\uc801\uc778 \uc190\uc2e4\uc744 \ucd08\ub798\ud569\ub2c8\ub2e4.\n\n3.\t\uc2ec\ub9ac\uc801 \uc694\uc18c\uc758 \uc911\uc694\uc131: \uad70\uc0ac\ub4e4\uc758 **\uc0ac\uae30(\u92b3\u6c23)**\ub294 \uc804\ud22c\ub825\uc758 \ud575\uc2ec\uc774\uba70, \uc774\ub294 \uc2dc\uac04\uc758 \ud750\ub984\uc5d0 \ub530\ub77c \uc27d\uac8c \uc800\ud558\ub420 \uc218 \uc788\uc73c\ubbc0\ub85c \uc9c0\uc18d\uc801\uc778 \uad00\ub9ac\uac00 \ud544\uc218\uc801\uc785\ub2c8\ub2e4.\n\n4.\t\ud6a8\uc728\uc131\uacfc \uc2e0\uc18d\uc131 \ucd94\uad6c: \uc790\uc6d0\uc744 \ud6a8\uc728\uc801\uc73c\ub85c \uc0ac\uc6a9\ud558\uc5ec \ucd5c\ub2e8 \uc2dc\uac04 \ub0b4\uc5d0 \ubaa9\ud45c\ub97c \ub2ec\uc131\ud558\ub294 \uac83\uc774 \uc911\uc694\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
