B.arn=new A.a("\u318d\u82e5(ru\xf2): ~\uc640 \uac19\ub2e4 (\ube44\uc720 \ud45c\ud604) \n\u318d\u6c7a(ju\xe9): \ud130\ub728\ub9ac\ub2e4, \ubb34\ub108\ub728\ub9ac\ub2e4, \ubc29\ucd9c\ud558\ub2e4 \n\u318d\u7a4d\u6c34(j\u012b shu\u01d0): \uace0\uc5ec \uc788\ub294 \ub9ce\uc740 \ubb3c, \uc989 \ub300\ub7c9\uc758 \ubb3c \n\u318d\u65bc \u5343\u4ede\u4e4b\u6eaa(y\xfa qi\u0101n r\xe8n zh\u012b x\u012b): \ucc9c \uae38(=\ub9e4\uc6b0 \ub192\uc740) \uacc4\uace1\uc5d0\uc11c\n\u318d\u8005 \u5f62\u4e5f(zh\u011b x\xedng y\u011b): \uc774\uac83\uc774 \ubc14\ub85c \ud615\uc138(\u5f62\u52e2)\uc774\ub2e4 \n\n",null,B.a,null,B.c)
