B.aib=new A.a("1. \ucc9c \uae38 \uacc4\uace1\uc758 \uace0\uc778 \ubb3c (\u7a4d\u6c34\u65bc\u5343\u4ede\u4e4b\u6eaa): \ub2e8\uc21c\ud788 \ubb3c\uc774 \ub9ce\ub2e4\ub294 \uac83\uc744 \ub118\uc5b4, \ub9e4\uc6b0 \ub192\uc740 \uacf3\uc5d0 \uac70\ub300\ud558\uace0 \uc5c4\uccad\ub09c \uc591\uc758 \uc5d0\ub108\uc9c0\ub97c \ud488\uace0 \uc788\ub294 \uc0c1\ud0dc\ub97c \ube44\uc720\ud569\ub2c8\ub2e4. \uc989, \uc544\uad70\uc774 \uc804\uc7c1\uc744 \uc900\ube44\ud558\ub294 \uacfc\uc815\uc5d0\uc11c \ucd95\uc801\ud55c \ub9c9\uac15\ud55c \ud798, \uc555\ub3c4\uc801\uc778 \uc804\ub825, \uc644\ubcbd\ud55c \uc900\ube44 \ud0dc\uc138, \uadf8\ub9ac\uace0 \uc0c1\ub300\uc801\uc778 \uc6b0\uc704\ub97c \uc0c1\uc9d5\ud569\ub2c8\ub2e4.\n\n2. \ud130\ub728\ub9ac\ub294 \uac83 (\u6c7a): \uc774\ucc98\ub7fc \uac70\ub300\ud55c \uc5d0\ub108\uc9c0\uac00 '\ud130\uc838 \ub098\uc62c \ub54c'\uc758 \ud3ed\ubc1c\uc801\uc778 \uc704\ub825\uacfc \uac70\uce68\uc5c6\ub294 \ucd94\uc9c4\ub825\uc744 \ub098\ud0c0\ub0c5\ub2c8\ub2e4. \uc77c\ub2e8 \ud130\uc838 \ub098\uc624\uba74 \uc544\ubb34\ub3c4 \ub9c9\uc744 \uc218 \uc5c6\ub294 \ud544\uc5f0\uc801\uc778 \ud750\ub984\uc744 \ub73b\ud569\ub2c8\ub2e4.\n\n3. \uc2b9\ub9ac\ud558\ub294 \uc790\uc758 \uc2f8\uc6c0 (\u52dd\u8005\u4e4b\u6230): \uc2b9\ub9ac\ud558\ub294 \uc790\ub294 \ubc14\ub85c \uc774\ucc98\ub7fc \ubbf8\ub9ac \ucda9\ubd84\ud55c \ud798\uc744 \ucd95\uc801\ud558\uace0, \uadf8 \ud798\uc744 \uc801\uc808\ud55c \uc2dc\uc810\uc5d0 \ud3ed\ubc1c\uc2dc\ud0a4\ub294 \uc790\uc785\ub2c8\ub2e4. \uc2b9\ub9ac\ud558\ub294 \uc2f8\uc6c0\uc740 \uc6b0\uc5f0\uc774\ub098 \ud798\uaca8\ub8e8\uae30\uac00 \uc544\ub2c8\ub77c, \uc774\ubbf8 \ub9cc\ub4e4\uc5b4\uc9c4 \uc555\ub3c4\uc801\uc778 \ud615\uc138\uc5d0 \ub530\ub77c \ud544\uc5f0\uc801\uc73c\ub85c \ud758\ub7ec\uac00\ub294 \uacfc\uc815\uc784\uc744 \uac15\uc870\ud569\ub2c8\ub2e4.\n\n4. \uc774\uac83\uc774 \ubc14\ub85c \ud615\uc138 (\u5f62\u4e5f): \uc2b9\ub9ac\ub97c \uac00\ub2a5\ud558\uac8c \ud558\ub294 \uad81\uadf9\uc801\uc778 \ud798\uc774 \ubc14\ub85c **'\ud615\uc138(\u5f62)'**\uc784\uc744 \uba85\ud655\ud788 \ud569\ub2c8\ub2e4. \uc5ec\uae30\uc11c '\ud615\uc138'\ub294 \ub2e8\uc21c\ud788 \ud615\ud0dc\ub098 \uc678\ud615\uc774 \uc544\ub2c8\ub77c, \uc544\uad70\uc774 \uad6c\ucd95\ud55c \uc720\ub9ac\ud55c \uc870\uac74, \uac15\ub825\ud55c \uc5ed\ub7c9, \uadf8\ub9ac\uace0 \uadf8\uac83\uc774 \ub9cc\ub4e4\uc5b4\ub0b4\ub294 \uc555\ub3c4\uc801\uc778 \uc6b0\uc704\uc640 \uae30\uc138\ub97c \ucd1d\uccb4\uc801\uc73c\ub85c \uc758\ubbf8\ud569\ub2c8\ub2e4. \uc774 \ud615\uc138\uac00 \ud55c\ubc88 \ud615\uc131\ub418\uba74 \uc2b9\ub9ac\ub294 \uc790\uc5f0\uc2a4\ub7fd\uac8c \ub530\ub77c\uc628\ub2e4\ub294 \uac83\uc785\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
