B.a6d=new A.a(" 1. \uc555\ub3c4\uc801 \uc900\ube44\uc640 \ud798\uc758 \ucd95\uc801: \uc2b9\ub9ac\ub294 \uc2f8\uc6c0\uc5d0 \uc55e\uc11c \ubbf8\ub9ac \ucd95\uc801\ub41c \uc555\ub3c4\uc801\uc778 \ud798\uacfc \uc644\ubcbd\ud55c \uc900\ube44\uc5d0\uc11c \ube44\ub86f\ub429\ub2c8\ub2e4. \ubb3c\uc774 \uacc4\uace1\uc5d0 \uac00\ub4dd \ucc28\ub294 \uac83\ucc98\ub7fc, \uc544\uad70\uc758 \uc5ed\ub7c9\uc744 \ucd5c\ub300\ud55c\uc73c\ub85c \ub04c\uc5b4\uc62c\ub824\uc57c \ud569\ub2c8\ub2e4.\n\n 2. \ud544\uc5f0\uc801 \uc2b9\ub9ac\uc758 \uc6d0\ub9ac: \ucda9\ubd84\ud55c \ud798\uc774 \ucd95\uc801\ub418\uace0 \uc801\uc808\ud55c \uc2dc\uc810\uc5d0 \ubc1c\ud604\ub418\uba74, \uc2b9\ub9ac\ub294 \uc6b0\uc5f0\uc774 \uc544\ub2cc \ud544\uc5f0\uc801\uc778 \uacb0\uacfc\uac00 \ub429\ub2c8\ub2e4. \uc774\ub294 '\uc2f8\uc6b0\uba74 \uc774\uae30\ub294 \uc2f8\uc6c0'\uc744 \ub9cc\ub4dc\ub294 \uc6d0\ub9ac\uc785\ub2c8\ub2e4.\n\n 3. \uc8fc\ub3c4\uad8c \ud655\ubcf4: '\ud615\uc138'\ub97c \uad6c\ucd95\ud568\uc73c\ub85c\uc368 \uc804\uc7c1(\uacbd\uc7c1)\uc758 \uc8fc\ub3c4\uad8c\uc744 \uc644\uc804\ud788 \uc7a5\uc545\ud558\uace0, \uc0c1\ub300\ubc29\uc774 \uc544\uad70\uc758 \ud750\ub984\uc744 \uac70\uc2a4\ub97c \uc218 \uc5c6\uac8c \ub9cc\ub4ed\ub2c8\ub2e4.\n\n 4. \ucd1d\uccb4\uc801\uc778 \uc6b0\uc704: '\ud615\uc138'\ub294 \ub2e8\uc21c\ud788 \ubcd1\ub825 \uc218\ub098 \ubb34\uae30 \uc131\ub2a5\ub9cc\uc774 \uc544\ub2c8\ub77c, \uc9c0\ud615, \ubcf4\uae09, \uc815\ubcf4, \uc0ac\uae30, \uc804\uc220 \ub4f1 \ubaa8\ub4e0 \uc694\uc18c\uac00 \uacb0\ud569\ub418\uc5b4 \ub9cc\ub4e4\uc5b4\uc9c0\ub294 \ucd1d\uccb4\uc801\uc778 \uc6b0\uc704\ub97c \uc758\ubbf8\ud569\ub2c8\ub2e4.\n\n 5. \uae30\uc138\uc758 \uc911\uc694\uc131: \uc77c\ub2e8 \ud615\uc131\ub41c '\ud615\uc138'\ub294 \ub9c8\uce58 \ub451\uc774 \ud130\uc9c4 \ubb3c\ucc98\ub7fc \uac70\uce68\uc5c6\ub294 \uae30\uc138\ub85c \uc801\uc744 \ud729\uc4f8\uc5b4\ubc84\ub9bd\ub2c8\ub2e4. \uc774 \uae30\uc138\ub97c \ud65c\uc6a9\ud558\ub294 \uac83\uc774 \uc2b9\ub9ac\uc758 \ud575\uc2ec\uc785\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
