B.ajO=new A.a("This passage presents two key steps for seizing the initiative and controlling the enemy in war (or competition).\n\n",null,B.a,null,B.c)
B.avx=new A.a(" 1.\tLuring the Enemy with Profit (\u4ee5\u5229\u52d5\u4e4b):\n   \u2022\tMeaning: Refers to throwing bait in the form of 'profit (\u5229)' that the enemy desires, to stir their minds and lure them in the direction one wants. Here, 'profit' includes not only material wealth but also easily obtainable victory, seemingly vulnerable forces, exposure of strategic strongholds, and all other inducements that make the enemy blind with greed and act rashly. This is the process of drawing the enemy into one's 'vulnerable point'. \n\n 2.\tWaiting with Prepared Troops (\u4ee5\u5352\u5f85\u4e4b):\n   \u2022\tMeaning: Refers to waiting with already thoroughly prepared 'sufficient troops (\u5352)' in ambush at the location where the enemy is lured, and then delivering a decisive blow. Here, 'z\xfa (\u5352)' means more than just the number of soldiers; it represents perfectly prepared combat power that is well-trained, organized, and deployed in advantageous terrain. This is consistent with the principle of 'xian wei bu ke sheng (\u5148\u7232\u4e0d\u53ef\u52dd)'.\n\n",null,B.a,null,B.c)
