B.a7v=new A.a(" 1. \uc608\uce21 \ubd88\uac00\ub2a5\uc131: \uacf5\uaca9\uc774\ub4e0 \ubc29\uc5b4\ub4e0, \uc544\uad70\uc758 \uc758\ub3c4\ub97c \uc801\uc774 \uc608\uce21\ud558\uc9c0 \ubabb\ud558\uac8c \ub9cc\ub4dc\ub294 \uac83\uc774 \uc2b9\ub9ac\uc758 \ud575\uc2ec\uc785\ub2c8\ub2e4. \uc608\uce21 \uac00\ub2a5\ud55c \uc804\ub7b5\uc740 \uc27d\uac8c \ud30c\ud6fc\ub420 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n\n 2. \uc8fc\ub3c4\uad8c \uc7a5\uc545: \uacf5\uaca9\uc5d0\uc11c\ub294 \uc801\uc744 \ud63c\ub780\uc2dc\ucf1c \ubc29\uc5b4\ub97c \uc5b4\ub835\uac8c \ud558\uace0, \ubc29\uc5b4\uc5d0\uc11c\ub294 \uc801\uc758 \uacf5\uaca9 \ubc29\ud5a5\uc744 \ubaa8\ud638\ud558\uac8c \ub9cc\ub4e4\uc5b4 \uc8fc\ub3c4\uad8c\uc744 \uc720\uc9c0\ud574\uc57c \ud569\ub2c8\ub2e4.\n\n 3. \ud5c8\uc810\uc758 \uad00\ub9ac: \uacf5\uaca9 \uc2dc\uc5d0\ub294 \uc801\uc758 \ubc29\uc5b4 \ud5c8\uc810\uc744 \ub9cc\ub4e4\uace0 \uc774\uc6a9\ud558\uba70, \ubc29\uc5b4 \uc2dc\uc5d0\ub294 \uc544\uad70\uc758 \ud5c8\uc810\uc744 \ucca0\uc800\ud788 \uac10\ucd94\uc5b4 \uc801\uc774 \uacf5\uaca9\ud560 \uacf3\uc744 \ucc3e\uc9c0 \ubabb\ud558\uac8c \ud574\uc57c \ud569\ub2c8\ub2e4.\n\n 4. \uc815\ubcf4\uc758 \ube44\ub300\uce6d\uc131: \uc544\uad70\uc740 \uc801\uc758 \uc6c0\uc9c1\uc784\uc744 \ud30c\uc545\ud558\ub824 \ub178\ub825\ud558\ub294 \ub3d9\uc2dc\uc5d0, \uc544\uad70\uc758 \uc911\uc694\ud55c \uc815\ubcf4\ub97c \uc801\uc5d0\uac8c \ub178\ucd9c\ud558\uc9c0 \uc54a\uac70\ub098 \uc65c\uace1\ud558\uc5ec \uc81c\uacf5\ud568\uc73c\ub85c\uc368 \uc801\uc758 \uc624\ud310\uc744 \uc720\ub3c4\ud574\uc57c \ud569\ub2c8\ub2e4.\n\n 5. \uc720\uc5f0\ud55c \uc804\uc220 \uc6b4\uc6a9: \uc0c1\ud669\uc5d0 \ub530\ub77c \uacf5\uaca9\uacfc \ubc29\uc5b4\uc758 \uc5ed\ud560\uc744 \uc720\uc5f0\ud558\uac8c \uc804\ud658\ud558\uace0, \uac01 \uc0c1\ud669\uc5d0 \ub9de\ub294 \ucd5c\uc801\uc758 \uc608\uce21 \ubd88\uac00\ub2a5 \uc804\ub7b5\uc744 \uad6c\uc0ac\ud574\uc57c \ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
