B.avo=new A.a(" 1.\t\uc5ed\ub7c9\uc5d0 \uae30\ubc18\ud55c \uc804\ub7b5: \uc790\uc2e0\uc758 \uc5ed\ub7c9(\uc790\uc6d0, \ub2a5\ub825, \uc900\ube44 \uc0c1\ud0dc)\uc744 \ub0c9\ucca0\ud558\uac8c \ud310\ub2e8\ud558\uace0, \uadf8\uc5d0 \ub530\ub77c \uacf5\uaca9\ud560\uc9c0 \uc218\ube44\ud560\uc9c0\ub97c \uacb0\uc815\ud574\uc57c \ud569\ub2c8\ub2e4.\n\n 2.\t\uc720\uc5f0\ud55c \uacf5\uc218 \uc804\ud658: \uc0c1\ud669\uacfc \uc5ed\ub7c9\uc758 \ubcc0\ud654\uc5d0 \ub530\ub77c \uacf5\uaca9\uacfc \uc218\ube44 \uc804\ub7b5\uc744 \uc720\uc5f0\ud558\uac8c \uc804\ud658\ud560 \uc218 \uc788\uc5b4\uc57c \ud569\ub2c8\ub2e4. \uace0\uc815\ub41c \ubc29\uc2dd\ub9cc\uc744 \uace0\uc9d1\ud574\uc11c\ub294 \uc548 \ub429\ub2c8\ub2e4.\n\n 3.\t\uc704\ud5d8 \uad00\ub9ac: \uc5ed\ub7c9\uc774 \ubd80\uc871\ud560 \ub54c\ub294 \ubb34\ub9ac\ud55c \uacf5\uaca9\uc73c\ub85c \uc778\ud55c \ubd88\ud544\uc694\ud55c \uc190\uc2e4\uc744 \ud53c\ud558\uace0 \uc804\ub825\uc744 \ubcf4\uc874\ud558\ub294 \uac83\uc774 \uc911\uc694\ud569\ub2c8\ub2e4.\n\n 4.\t\uc8fc\ub3c4\uad8c \ud655\ubcf4: \uc5ed\ub7c9\uc758 \uc6b0\uc704\uac00 \uc788\uc744 \ub54c\ub294 \uacfc\uac10\ud55c \uacf5\uaca9\uc73c\ub85c \uc8fc\ub3c4\uad8c\uc744 \ud655\ubcf4\ud558\uace0 \uc2b9\ub9ac\ub97c \uc7c1\ucde8\ud574\uc57c \ud569\ub2c8\ub2e4.\n\n 5.\t\uc131\uae09\ud568 \uacbd\uacc4: \uc5ed\ub7c9\uc774 \ucda9\ubd84\uce58 \uc54a\uc744 \ub54c \uc131\uae09\ud558\uac8c \uacf5\uaca9\ud558\uba74 \uc2e4\ud328\ub85c \uc774\uc5b4\uc9c0\uba70, \uc5ed\ub7c9\uc774 \ucda9\ubd84\ud560 \ub54c \ub9dd\uc124\uc774\uba74 \uae30\ud68c\ub97c \ub193\uce69\ub2c8\ub2e4. \uc801\uc808\ud55c \ud0c0\uc774\ubc0d\uc5d0 \uc801\uc808\ud55c \uc804\ub7b5\uc774 \uc911\uc694\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
