B.asT=new A.a("\u318d \u9b2a(d\xf2u): To fight, to combat\n\u318d \u8846(zh\xf2ng): Multitude, large army\n\u318d \u5982(r\xfa): ~like, as if\n\u318d \u5be1(gu\u01ce): Small army, minority\n\u318d \u5f62(x\xedng): Form, appearance, tactical deployment and position \n\u318d \u540d(m\xedng): Order, name, command system and instructions\n\u318d \u662f\u4e5f(sh\xec y\u011b): This is the reason / This is the correct principle \n\n ",null,B.a,null,B.c)
B.asS=new A.a("\u201cTo engage a large army in battle is like engaging a small one. This is because it depends on 'xing (\u5f62)' and 'ming (\u540d)'.\u201d",null,B.a,null,B.c)
