B.asY=new A.a("This passage explains the secret to how one's own forces can effectively confront an overwhelmingly large enemy in an actual combat situation. The core lies in 'xing ming (\u5f62\u540d)'.\n\n",null,B.a,null,B.c)
B.agh=new A.a(" 1.\tSame Combat Principle for Large and Small Armies (\u9b2a\u8846\u5982\u9b2a\u5be1):\n \u2022\tMeaning: Sun Tzu's Art of War states that even when fighting against a large enemy, a well-prepared army can feel as if it is fighting a small enemy. This provides a method to effectively counter the enemy without being overwhelmed by their size.\n\n 2.\tImportance of Xing Ming (\u5f62\u540d):\n \u2022\t\u5f62 (xing): Refers to the 'form of deploying troops' in a combat situation. This means dividing large forces into small combat units for deployment, or forming formations where each unit is organically connected. No matter how numerous the enemy, if one's own forces move in a well-structured form, the enemy will feel as if they are fighting individual small combat units, not the entire army. \n\n \u2022\t\u540d (ming): Refers to the 'name' or 'identification system' of each unit. This ensures that each unit accurately recognizes its mission and moves without confusion through clear unit distinctions, command systems, and role assignments. If 'ming' is clear, precise instructions and reports are possible even during large-scale battles, preventing chaos and maintaining cohesion. \n\n",null,B.a,null,B.c)
