B.alI=new A.a(" 1.\tOrganization during Combat: The key is to divide and operate one's forces into effective combat units, no matter how large the battle. This makes it difficult for the enemy to grasp the full scale of one's forces and enables efficient combat for each unit.\n\n 2.\tClear Command and Control: By clarifying the names and roles of each unit, accurate command and communication must be maintained even in chaos. This is essential for maintaining cohesion and reaction speed in large-scale combat situations.\n\n 3.\tInducing Enemy Confusion: The well-organized 'xing ming' of one's own forces can induce confusion and misjudgment in the enemy. The enemy may overestimate or underestimate one's actual size and combat power, or find it difficult to grasp one's intentions.\n\n 4.\tPsychological Advantage: When fighting against a large enemy, if one's own forces are well-organized and move without confusion, it can maintain the morale of soldiers and put pressure on the enemy.\n\n 5.\tEfficient Combat Performance: Through 'xing ming', each unit focuses on its role and contributes to achieving the overall combat objective. This leads to the efficient use of combat resources.\n\n",null,B.a,null,B.c)
