B.apG=new A.a("\u318d\u5341\u5247\u570d\u4e4b(sh\xed z\xe9 w\xe9i zh\u012b): \uc544\uad70 \ubcd1\ub825\uc774 \uc801\ubcf4\ub2e4 10\ubc30\uc77c \uacbd\uc6b0 \ud3ec\uc704\ud558\ub77c\n\u318d\u4e94\u5247\u653b\u4e4b(w\u01d4 z\xe9 g\u014dng zh\u012b): 5\ubc30\uc77c \uacbd\uc6b0 \uacf5\uaca9\ud558\ub77c\n\u318d\u500d\u5247\u5206\u4e4b(b\xe8i z\xe9 f\u0113n zh\u012b): 2\ubc30\uc77c \uacbd\uc6b0 \ubd84\uc0b0\uc2dc\ucf1c \ub300\uc751\ud558\ub77c\n\u318d\u6575\u5247\u80fd\u6230\u4e4b(d\xed z\xe9 n\xe9ng zh\xe0n zh\u012b): \ubcd1\ub825\uc774 \ube44\uc2b7\ud560 \uacbd\uc6b0 \uc815\uba74\uc73c\ub85c \uc2f8\uc6cc\ub3c4 \ub41c\ub2e4\n\u318d\u5c11\u5247\u80fd\u9003\u4e4b(sh\u01ceo z\xe9 n\xe9ng t\xe1o zh\u012b): \uc801\ubcf4\ub2e4 \ubcd1\ub825\uc774 \uc801\uc73c\uba74 \ud53c\ud558\ub77c (\ud1f4\uac01\ud558\ub77c)\n\u318d\u4e0d\u82e5\u5247\u80fd\u907f\u4e4b(b\xf9 ru\xf2 z\xe9 n\xe9ng b\xec zh\u012b): \uc544\uad70\uc774 \ubd88\ub9ac\ud558\uba74 \ub9de\uc11c\uc9c0 \ub9d0\uace0 \ud53c\ud558\ub77c (\uc804\uba74 \ucda9\ub3cc\uc744 \ud53c\ud558\ub77c\n\n",null,B.a,null,B.c)
B.ak4=new A.a("\u201c\uc801\ubcf4\ub2e4 \ubcd1\ub825\uc774 \uc555\ub3c4\uc801\uc73c\ub85c \ub9ce\uc744 \uacbd\uc6b0\uc5d0\ub294 \ud3ec\uc704\ud558\uace0, \uc6b0\uc138\ud560 \uacbd\uc6b0\uc5d0\ub294 \uacf5\uaca9\ud558\uba70, \ub2e4\uc18c \uc6b0\uc704\uc77c \uacbd\uc6b0\uc5d4 \ubd84\uc0b0\uc2dc\ucf1c \ub300\uc751\ud558\ub77c. \ubcd1\ub825\uc774 \ube44\uc2b7\ud560 \uacbd\uc6b0\ub294 \uc2f8\uc6b8 \uc218 \uc788\uc9c0\ub9cc, \uc5f4\uc138\uc77c \uacbd\uc6b0\uc5d0\ub294 \ud1f4\uac01\ud558\uac70\ub098 \ud53c\ud558\ub294 \uac83\uc774 \ubc14\ub78c\uc9c1\ud558\ub2e4. \ubb34\ubaa8\ud55c \uc804\ud22c\ub294 \ud53c\ud558\uace0 \uc0c1\ud669\uc5d0 \ub530\ub77c \uc720\uc5f0\ud558\uac8c \ud310\ub2e8\ud558\ub77c.\u201d",null,B.a,null,B.c)
