B.awG=new A.a("1.\t\uc555\ub3c4\uc801 \uc6b0\uc704 (\uc5f4 \ubc30, \ub2e4\uc12f \ubc30):\n\u318d\u5341\u5247\u570d\u4e4b (\uc2ed\uc989\uc704\uc9c0): \uc544\uad70\uc774 \uc801\ubcf4\ub2e4 \uc5f4 \ubc30 \uc6b0\uc138\ud558\ub2e4\uba74, \uc801\uc744 \uc644\uc804\ud788 \ud3ec\uc704\ud558\uc5ec \ub3c4\ub9dd\uac08 \uae38\uc744 \ub9c9\uace0 \uc12c\uba78\ud558\uac70\ub098 \ud56d\ubcf5\uc744 \ubc1b\uc544\ub0b4\ub294 \uc804\ub7b5\uc744 \uc501\ub2c8\ub2e4. \uc774\ub294 \uc801\uc758 \uc800\ud56d \uc758\uc9c0\ub97c \uaebe\uace0 \ucd5c\ub300\ud55c\uc758 \uc131\uacfc\ub97c \uc5bb\ub294 \ubc29\ubc95\uc785\ub2c8\ub2e4.\n\n\u318d\u4e94\u5247\u653b\u4e4b (\uc624\uc989\uacf5\uc9c0): \uc544\uad70\uc774 \uc801\ubcf4\ub2e4 \ub2e4\uc12f \ubc30 \uc6b0\uc138\ud558\ub2e4\uba74, \uc801\uadf9\uc801\uc73c\ub85c \uc801\uc744 \uacf5\uaca9\ud558\uc5ec \uaca9\ud30c\ud569\ub2c8\ub2e4. \uc774 \uc815\ub3c4\uc758 \uc6b0\uc138\ub294 \uc804\uba74 \uacf5\uaca9\uc73c\ub85c \uc2b9\ub9ac\ud560 \uc218 \uc788\ub294 \ucda9\ubd84\ud55c \ubcd1\ub825\uc785\ub2c8\ub2e4.\n\n2.\t\uc804\uc220\uc801 \uc6b0\uc704 (\ub450 \ubc30)\n\u318d\u500d\u5247\u5206\u4e4b (\ubc30\uc989\ubd84\uc9c0): \uc544\uad70\uc774 \uc801\ubcf4\ub2e4 \ub450 \ubc30 \uc6b0\uc138\ud558\ub2e4\uba74, \uc801\uc744 \ubd84\uc0b0\uc2dc\ucf1c \uac01\uac1c\uaca9\ud30c\ud558\uac70\ub098, \uc801\uc758 \ubcd1\ub825\uc744 \ubd84\ud560\ud558\uc5ec \uc544\uad70\uc758 \uac01 \ubd80\ub300\uac00 \uc0c1\ub300\uc801\uc778 \uc6b0\uc704\ub97c \ud655\ubcf4\ud55c \uc0c1\ud0dc\uc5d0\uc11c \uc804\ud22c\ub97c \ubc8c\uc774\ub294 \uc804\ub7b5\uc744 \uc0ac\uc6a9\ud569\ub2c8\ub2e4.\n\n3.\t\ub300\ub4f1\ud558\uac70\ub098 \uc5f4\uc138 (\ub300\ub4f1, \uc801\uc74c, \ubbf8\uce58\uc9c0 \ubabb\ud568):\n\u318d\u6575\u5247\u80fd\u6230\u4e4b (\uc801\uc989\ub2a5\uc804\uc9c0): \uc544\uad70\uacfc \uc801\uad70\uc758 \ubcd1\ub825\uc774 \ub300\ub4f1\ud558\ub2e4\uba74, \uc815\uba74\uc73c\ub85c \uc2f8\uc6b8 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc774\ub54c\ub294 \ubcd1\ub825 \uc218 \uc678\uc758 \uc694\uc18c(\uc9c0\ud615, \uc0ac\uae30, \uc9c0\ud718\uad00 \ub2a5\ub825 \ub4f1)\uac00 \uc2b9\ud328\ub97c \uc88c\uc6b0\ud569\ub2c8\ub2e4.\n\n\u318d\u5c11\u5247\u80fd\u9003\u4e4b (\uc18c\uc989\ub2a5\ub3c4\uc9c0): \uc544\uad70 \ubcd1\ub825\uc774 \uc801\ubcf4\ub2e4 \uc801\ub2e4\uba74, \uc2f8\uc6c0\uc744 \ud53c\ud558\uace0 \ub2ec\uc544\ub098\uc11c \uc804\ub825\uc744 \ubcf4\uc874\ud558\ub294 \uac83\uc774 \ud604\uba85\ud569\ub2c8\ub2e4. \ubd88\ub9ac\ud55c \uc804\ud22c\ub294 \ud68c\ud53c\ud558\uc5ec \uc544\uad70\uc758 \uc190\uc2e4\uc744 \ub9c9\ub294 \uac83\uc774 \uc911\uc694\ud569\ub2c8\ub2e4.\n\n\u318d\u4e0d\u82e5\u5247\u80fd\u907f\u4e4b (\ubd88\uc57d\uc989\ub2a5\ud53c\uc9c0): \uc544\uad70\uc774 \uc801\uc5d0\uac8c \ub3c4\uc800\ud788 \ubbf8\uce58\uc9c0 \ubabb\ud558\ub294 \uc555\ub3c4\uc801\uc778 \uc5f4\uc138\ub77c\uba74, \uc544\uc608 \uc804\ud22c\ub97c \ud68c\ud53c\ud558\uace0 \ub2e4\ub978 \uc804\ub7b5\uc801 \ubaa9\ud45c\ub97c \ucd94\uad6c\ud558\uac70\ub098, \ud6c4\uc77c\uc744 \ub3c4\ubaa8\ud574\uc57c \ud569\ub2c8\ub2e4. \uc774\ub294 \ud328\ubc30\uac00 \ud655\uc2e4\ud55c \uc2f8\uc6c0\uc740 \uc544\uc608 \ud558\uc9c0 \uc54a\ub294\ub2e4\ub294 \uc6d0\uce59\uc785\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
