B.ars=new A.a("1.\t\uc0c1\ud669 \ud310\ub2e8\uc758 \uc911\uc694\uc131: \uc804\uc7a5\uc5d0\uc11c \uc544\uad70\uacfc \uc801\uad70\uc758 \uc0c1\ub300\uc801\uc778 \uc804\ub825\uc744 \uc815\ud655\ud558\uac8c \ud30c\uc545\ud558\ub294 \uac83\uc774 \ubaa8\ub4e0 \uc804\ub7b5 \uc218\ub9bd\uc758 \uc804\uc81c\uc785\ub2c8\ub2e4.\n\n2.\t\uc0c1\ud669\uc5d0 \ub530\ub978 \uc720\uc5f0\ud55c \ub300\uc751: \ubcd1\ub825 \uc0c1\ud669\uc5d0 \ub530\ub77c \uacf5\uaca9, \ud3ec\uc704, \ubd84\uc0b0, \ud68c\ud53c, \ub3c4\uc8fc \ub4f1 \ub2e4\uc591\ud55c \uc804\ub7b5\uc744 \uc720\uc5f0\ud558\uac8c \uad6c\uc0ac\ud574\uc57c \ud569\ub2c8\ub2e4. \ud55c \uac00\uc9c0 \ubc29\ubc95\ub9cc\uc744 \uace0\uc9d1\ud574\uc11c\ub294 \uc548 \ub429\ub2c8\ub2e4.\n\n3.\t\uc2b9\ub9ac\uac00\ub2a5\uc131 \ud310\ub2e8: \uc804\ud22c\ub97c \uc2dc\uc791\ud558\uae30 \uc804\uc5d0 \uc2b9\ub9ac\ud560 \uac00\ub2a5\uc131\uc774 \uc788\ub294\uc9c0\ub97c \ub0c9\ucca0\ud558\uac8c \ud310\ub2e8\ud558\uace0, \uc2b9\ub9ac\uac00 \ubd88\uac00\ub2a5\ud558\ub2e4\uace0 \ud310\ub2e8\ub418\uba74 \uacfc\uac10\ud788 \ud68c\ud53c\ud558\uc5ec \uc190\uc2e4\uc744 \ucd5c\uc18c\ud654\ud574\uc57c \ud569\ub2c8\ub2e4.\n\n4.\t\ud53c\ud574 \ucd5c\uc18c\ud654 \uc6d0\uce59: \uc544\uad70\uc5d0\uac8c \ubd88\ub9ac\ud55c \uc2f8\uc6c0\uc740 \ud53c\ud558\uace0, \uc720\ub9ac\ud55c \uc0c1\ud669\uc5d0\uc11c\ub9cc \uc2f8\uc6cc \ubd88\ud544\uc694\ud55c \uc778\uba85 \ubc0f \ubb3c\uc790 \uc190\uc2e4\uc744 \ucd5c\uc18c\ud654\ud574\uc57c \ud569\ub2c8\ub2e4.\n\n5.\t\uc804\ub825 \ubcf4\uc874: \uc5f4\uc138\uc77c \ub54c\ub294 \uc2f8\uc6c0\uc744 \ud53c\ud558\uc5ec \uc804\ub825\uc744 \ubcf4\uc874\ud558\uace0, \ud6c4\uc77c\uc744 \ub3c4\ubaa8\ud558\ub294 \uac83\uc774 \uc7a5\uae30\uc801\uc778 \uc2b9\ub9ac\uc5d0 \uae30\uc5ec\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
