B.afn=new A.a(" 1.\t\uac10\uc815\uc5d0 \uce58\uc6b0\uce58\uc9c0 \uc54a\ub294 \ub9ac\ub354\uc2ed: \ub9ac\ub354\ub294 \ubd84\ub178 \ub610\ub294 \ubd88\ucf8c\ud568\uacfc \uac19\uc774 \uac1c\uc778\uc801\uc778 \uac10\uc815\uc5d0 \ud729\uc4f8\ub824 \uc911\uc694\ud55c \uc804\ub7b5\uc801 \uacb0\uc815\uc744 \ub0b4\ub824\uc11c\ub294 \uc548 \ub429\ub2c8\ub2e4. \ub0c9\ucca0\ud558\uace0 \uc774\uc131\uc801\uc778 \ud310\ub2e8\uc774 \ud544\uc218\uc801\uc785\ub2c8\ub2e4. \n\n 2.\t\ucd5c\uc545\uc758 \uacb0\uacfc \uc778\uc9c0: \ubaa8\ub4e0 \uc804\ub7b5\uc801 \ud589\ub3d9, \ud2b9\ud788 \uc804\uc7c1\uc740 \uad6d\uac00\uc758 \uc874\ub9bd\uacfc \uc0dd\uba85\uc758 \uc0c1\uc2e4\uc774\ub77c\ub294 \ucd5c\uc545\uc758, \ub3cc\uc774\ud0ac \uc218 \uc5c6\ub294 \uacb0\uacfc\ub97c \ucd08\ub798\ud560 \uc218 \uc788\uc74c\uc744 \ud56d\uc0c1 \uc778\uc9c0\ud574\uc57c \ud569\ub2c8\ub2e4. \n\n 3.\t\uc608\ubc29\uc758 \uc911\uc694\uc131: \uc77c\ub2e8 \ubc1c\uc0dd\ud55c \ud30c\uad6d\uc740 \ub418\ub3cc\ub9b4 \uc218 \uc5c6\uc73c\ubbc0\ub85c, \uc0ac\uc804\uc5d0 \uc774\ub97c \uc608\ubc29\ud558\uace0 \ud68c\ud53c\ud558\ub294 \uac83\uc774 \uac00\uc7a5 \ud604\uba85\ud55c \uc804\ub7b5\uc785\ub2c8\ub2e4. \n\n 4.\t\uc7a5\uae30\uc801\uc778 \uad00\uc810: \ub2e8\uae30\uc801\uc778 \uc774\ub4dd\uc774\ub098 \uac10\uc815\uc801 \ub9cc\uc871\ubcf4\ub2e4\ub294, \uad6d\uac00\uc640 \uad6d\ubbfc\uc758 \uc7a5\uae30\uc801\uc778 \uc548\uc704\ub97c \ucd5c\uc6b0\uc120\uc73c\ub85c \uace0\ub824\ud574\uc57c \ud569\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
