B.asb=new A.a("\ud83d\udcda 4: Tacktical dispositions(\u8ecd\u5f62) \u2013 \uc694\uc57d\n",null,B.a,null,B.m)
B.ajp=new A.a("Sun Tzu's Tactical Disposition(\u8ecd\u5f62) chapter emphasizes that victory begins with securing a defensive advantage through thorough preparation, and the key is to launch a decisive attack with overwhelming force when the opportunity arises. That is, victory is not created but recognized and utilized, and for this, objective measurement and evaluation are essential. \n\n",null,B.a,null,B.t)
B.afY=new A.a(" \u2022\tPreemptive Defense and Seizing Opportunity: One must first make oneself invincible (\u4e0d\u53ef\u52dd) to strengthen oneself, and then wait until the enemy becomes winnable (\u53ef\u52dd). \n\n \u2022\tRecognizing and Utilizing Victory: The conditions for victory can be known (\u53ef\u77e5), but they cannot be forced (\u4e0d\u53ef\u70ba). That is, victory is not artificially created but comes from accurately reading and utilizing the enemy's weaknesses and opportunities. \n\n \u2022\tRelationship Between Defense and Attack: Defense is chosen when one's forces are insufficient (\u5b88\u5247\u4e0d\u8db3), and attack is undertaken when one's forces are sufficiently strong (\u653b\u5247\u6709\u9918). Defense stems from insufficiency, and attack from abundance. \n\n \u2022\tStages of Victory Measurement: Victory in war is measured and calculated through five elements (\u5ea6, \u91cf, \u6578, \u7a31, \u52dd). This implies the importance of objective judgment through accurate data and analysis. \n\n \u2219 \u5ea6(Du): Extent of terrain (spatial scale) \n   \u2219 \u91cf(Liang): Volume of military provisions (material resources)  \n   \u2219 \u6578(Shu): Number of troops (human resources)  \n   \u2219 \u7a31(Cheng): Comparison of capabilities (relative superiority/inferiority)  \n   \u2219 \u52dd(Sheng): Final judgment of victory or defeat\n\n \u2022\tOverwhelming Disposition for Victory: A winning battle should be decided through an overwhelming disposition, like a massive amount of water pouring down from a ravine a thousand ren deep (\u82e5\u6c7a\u7a4d\u6c34\u65bc\u5343\u4ede\u4e4b\u6eaa). This means a decisive and destructive force that overwhelms the enemy in one fell swoop. \n\n",null,B.a,null,B.c)
