B.asG=new A.a("This phrase explains that in two contrasting situations\u2014attack and defense\u2014imparting 'uncertainty' to the enemy to obscure their judgment and our side seizing the initiative is the key to victory.\n\n",null,B.a,null,B.c)
B.awU=new A.a(" 1.\t\u5148\u653b\u8005 \u6575\u4e0d\u77e5\u5176\u6240\u5b88 (xi\u0101n g\u014dng zh\u011b d\xed b\xf9 zh\u012b q\xed su\u01d2 sh\u01d2u, One who attacks first makes the enemy unaware of what he should guard):\n\u2022\tMeaning: When our side initiates an attack (\u5148\u653b), the enemy becomes confused (\u4e0d\u77e5) about where to focus their defense (\u5176\u6240\u5b88) because they do not know our actual attack intentions or main objective. This makes our attack direction and intensity unpredictable, causing the enemy to disperse their defensive resources or use them inefficiently. \n\n 2.\t\u5584\u5b88\u8005 \u6575\u4e0d\u77e5\u5176\u6240\u653b (sh\xe0n sh\u01d2u zh\u011b d\xed b\xf9 zh\u012b q\xed su\u01d2 gong, One who defends well makes the enemy unaware of what he should attack):\n:\u2022\tMeaning: When our side 'defends well (\u5584\u5b88),' the enemy becomes confused (\u4e0d\u77e5) because they cannot find clear weaknesses in our defensive lines or specific points to attack (\u5176\u6240\u653b). This renders the enemy's attack ineffective by our side effectively deploying defensive resources, not exposing weaknesses, and making the form of defense unpredictable. \n\n",null,B.a,null,B.c)
