B.aiW=new A.a(" 1.\t\u51fa\u5176\u6240\u4e0d\u8da8 (Ch\u016b q\xed su\u01d2 b\xf9 q\u016b, March to places where the enemy does not head):\n\u2022\tMeaning: This refers to our side boldly advancing (\u51fa) to find and exploit places that the enemy does not consider important or has not deployed troops, thus where defenses are weak (\u4e0d\u8da8). This means attacking the enemy's weaknesses, gaps, or complacent points.\n\n 2.\t\u8da8\u5176\u6240\u4e0d\u610f (q\u016b q\xed su\u01d2 b\xf9 y\xec, Rush to where the enemy does not expect):\n\u2022\tMeaning: This refers to our side swiftly advancing (\u8da8) at a time, in a direction, or by a method that the enemy completely 'does not expect (\u4e0d\u610f).' This causes psychological confusion for the enemy and simultaneously gives them no time to prepare physically, making effective counter-responses impossible.\n\n",null,B.a,null,B.c)
