B.aAf=new A.a("This phrase explains two powerful means of controlling the enemy's actions: 'luring' and 'hindering.' These are core strategies to secure initiative on the battlefield by making the enemy move or be tied down according to our intentions.\n\n",null,B.a,null,B.c)
B.atW=new A.a(" 1.\tLuring the enemy with benefit (\u80fd\u4f7f\u6575\u4eba\u81ea\u81f3\u8005 \u5229\u4e4b\u4e5f):\n \u2022\tMeaning: This refers to providing an 'advantage (\u5229)' that the enemy would covet, or feigning that it can be easily obtained, thereby making the enemy 'come of himself (\u81ea\u81f3)' to a place or situation desired by our side. This is an active luring strategy that induces the enemy's greed or misjudgment, drawing them into our plan.\n\n 2.\tHindering the enemy with harm (\u80fd\u4f7f\u6575\u4eba\u4e0d\u5f97\u81f3\u8005 \u5bb3\u4e4b\u4e5f):\n \u2022\tMeaning: This refers to preventing the enemy from 'reaching (\u4e0d\u5f97\u81f3)' a desired place or objective. This is a strategy to impede the enemy's movement by showing that it could cause 'harm (\u5bb3)' or by inflicting actual damage. For example, cutting off supply lines, attacking logistics bases to prevent further enemy advance, or ambushing them in unfavorable terrain to block their progress.\n\n",null,B.a,null,B.c)
