B.alv=new A.a("\ud83d\udcda 7: Maneuvering(\u8ecd\u722d) \u2013 Summary\n",null,B.a,null,B.m)
B.aee=new A.a("Sun Tzu's Maneuvering (\u8ecd\u722d) chapter contains advanced strategic wisdom for seizing and maintaining the initiative on the battlefield (in competition), thoroughly analyzing the enemy's psychology and situation for efficient responses, and achieving victory while minimizing one's own losses. It emphasizes the importance of wise control, paradoxical thinking, psychological warfare, and flexible situational adaptation, going beyond a mere clash of forces. \n\n",null,B.a,null,B.t)
B.a5u=new A.a("It presents a perfect victory strategy through five major pillars: proactive control, paradoxical deception, recognizing the duality of military engagement, flexible situational adaptation, and victory through minimizing losses. \n\n",null,B.a,null,B.c)
B.avS=new A.a(" 1.\tProactive Control and Inducing Enemy Actions:\n\u2022\t\u5c07\u53d7\u547d\u65bc\u541b\uff0c\u5408\u8ecd\u805a\u8846\uff0c\u4ea4\u548c\u800c\u820d\uff0c\u83ab\u96e3\u65bc\u8ecd\u722d: Emphasizes that 'military engagement'\u2014seizing the initiative on the battlefield\u2014is the most difficult and important aspect, more so than assembling military forces (or organizations) and peacefully encamping. Our side must always hold the initiative on the battlefield and make the enemy move at the time, place, and manner desired by our side.\n\n\u2022\t\u81f4\u4eba\u800c\u4e0d\u81f4\u65bc\u4eba: Cause others to come to you, but do not be caused to come by others.\n\u2022\t\u80fd\u4f7f\u6575\u4eba\u81ea\u81f3\u8005\u5229\u4e4b\u4e5f\uff0c\u80fd\u4f7f\u6575\u4eba\u4e0d\u5f97\u81f3\u8005\u5bb3\u4e4b\u4e5f: Control the enemy's actions according to our intentions by luring them with benefits and hindering them with harm.\n\n\u2022\t\u6575\u4f5a\u80fd\u6012\u4e4b\uff0c\u98fd\u80fd\u98e2\u4e4b\uff0c\u5b89\u80fd\u52d5\u4e4b: When the enemy is at ease, make them angry; when full, make them hungry; when stable, make them move, thereby disrupting them and making them move as desired by our side.\n\n 2.\tParadoxical Deception and Turning Situations to Advantage: \n\u2022\t\u4ee5\u8fc2\u7232\u76f4 \u4ee5\u60a3\u7232\u5229: Emphasizes the wisdom of paradoxical thinking: choosing a roundabout path that seems long and inefficient to achieve the fastest and most effective results, and transforming crises or hardships into opportunities or advantages.\n\n\u2022\t\u51fa\u5176\u6240\u4e0d\u8da8 \u8da8\u5176\u6240\u4e0d\u610f: Go where the enemy does not head, and swiftly rush where the enemy does not expect, thereby catching the enemy off guard.\n\n\u2022\t\u5148\u653b\u8005\u6575\u4e0d\u77e5\u5176\u6240\u5b88 \u5584\u5b88\u8005\u6575\u4e0d\u77e5\u5176\u6240\u653b: Preemptively attack to make the enemy's defensive objectives ambiguous, and defend in a solid and unpredictable manner so the enemy cannot find a place to attack.\n\n3.\tRecognizing the Duality of 'Military Engagement': \n\u2022\t\u8ecd\u722d\u7232\u5229 \u8ecd\u722d\u7232\u5371: Recognize that 'military engagement'\u2014contending for initiative on the battlefield\u2014can bring great 'advantages (\u5229)' but also be fatally 'dangerous (\u5371)' at the same time, and approach it cautiously.\n\n4.\tFlexible Situational Adaptation and Perfect Control:\n\u2022\t\u5176\u75be\u5982\u98a8 \u5176\u5f90\u5982\u6797 \u4fb5\u63a0\u5982\u706b \u4e0d\u52d5\u5982\u5c71: The army's actions must change with extreme flexibility according to the situation, moving swiftly like the wind (\u5176\u75be\u5982\u98a8), being as quiet and secretive as a forest (\u5176\u5f90\u5982\u6797), attacking fiercely like fire (\u4fb5\u63a0\u5982\u706b), and defending as solidly and unshakably as a mountain (\u4e0d\u52d5\u5982\u5c71). This implies perfect control that surpasses enemy predictions.\n\n\u2022\t\u63a0\u9115\u5206\u8846 \u5ed3\u5730\u5206\u5229 \u61f8\u6b0a\u800c\u52d5: Boost soldiers' morale with acquired resources (\u63a0\u9115\u5206\u8846), share long-term benefits by expanding occupied territories (\u5ed3\u5730\u5206\u5229), and move flexibly (\u61f8\u6b0a\u800c\u52d5) by meticulously weighing all situations.\n\n\u2022\t\u907f\u5176\u92b3\u6c23 \u64ca\u5176\u60f0\u6b78 \u6b64\u6cbb\u6c23\u8005\u4e5f \u4ee5\u6cbb\u5f85\u4e82 \u4ee5\u975c\u5f85\u8b41 \u6b64\u6cbb\u5fc3\u8005\u4e5f \u6b64\u6cbb\u529b\u8005\u4e5f \u7121\u9080\u6b63\u6b63\u4e4b\u65d7 \u7269\u64ca\u5802\u5802\u4e4b\u9663 \u6b64\u6cbb\u8b8a\u8005\u4e5f: Avoid the enemy's keen spirit (\u92b3\u6c23) and attack when they are sluggish, thereby managing 'spirit (\u6c23)'; wait for the enemy's chaos (\u4e82) in an orderly state and for their uproar in a calm state, thereby managing 'mind (\u5fc3)'; and thus efficiently employ 'strength (\u529b).' Furthermore, avoid directly confronting the enemy's strong, well-aligned formations (\u6b63\u6b63\u4e4b\u65d7 \u5802\u5802\u4e4b\u9663), thereby managing 'change (\u8b8a).'\n\n5.\tVictory Through Minimizing Losses:\n\u2022\t\u9867\u9675\u52ff\u5411 \u80cc\u4e18\u52ff\u9006 \u4f6f\u80cc\u52ff\u5f9e \u92b3\u5352\u52ff\u653b \u990c\u5175\u52ff\u98df \u6b78\u5e2b\u52ff\u904f \u570d\u5e2b\u5fc5\u95d5 \u7aae\u5bc7\u52ff\u8feb: These are warnings to avoid situations where the enemy has a geographical advantage or is prepared for desperate resistance, and not to be deceived by traps or bait. In particular, it emphasizes the principle of always leaving an escape route for a besieged enemy (\u570d\u5e2b\u5fc5\u95d5) and not pressing a cornered foe too hard (\u7aae\u5bc7\u52ff\u8feb). This asserts the wisdom of preventing the enemy's desperate resistance and achieving victory while minimizing one's own losses.\n\n",null,B.a,null,B.c)
