B.axQ=new A.a("\ud83d\udcda \uc190\uc790\ubcd1\ubc95 9\ud3b8 \ud589\uad70(\u884c\u8ecd)\u2013 \uc694\uc57d\n",null,B.a,null,B.m)
B.anp=new A.a(" \uc190\uc790\ubcd1\ubc95 \ud589\uad70(\u884c\u8ecd)\ud3b8\uc5d0\uc11c\ub294 \uc2b9\ub9ac\ub294 \ub2e8\uc21c\ud788 \ud798\uc73c\ub85c \uc801\uc744 \uc555\ub3c4\ud558\ub294 \uac83\uc774 \uc544\ub2c8\ub77c \ud658\uacbd\uc5d0 \ub300\ud55c \uae4a\uc740 \ud1b5\ucc30, \uc720\uc5f0\ud558\uace0 \ub2a5\ub3d9\uc801\uc778 \uc804\ub7b5 \uad6c\uc0ac, \uadf8\ub9ac\uace0 \uc9c0\ud718\uad00\uc758 \ucca0\uc800\ud55c \uc790\uae30 \uad00\ub9ac\uc640 \uc5b8\ud589\uc77c\uce58\uc5d0 \ub2ec\ub824 \uc788\uc74c\uc744 \uc54c \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n\n",null,B.a,null,B.t)
B.atl=new A.a(" \ud575\uc2ec \uc6d0\uce59\uc740 \ub2e4\uc74c\uacfc \uac19\uc2b5\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
B.amE=new A.a(" \u2022\t\ud658\uacbd \ubd84\uc11d \ubc0f \ud65c\uc6a9: \uc9c0\ud615\uc758 \uc720\ub9ac\ud568(\ub192\uc740 \uacf3 \uc120\uc810)\uacfc \ubd88\ub9ac\ud568(\ud5d8\uc9c0, \uace0\ub9bd \uc9c0\uc5ed)\uc744 \uc815\ud655\ud788 \ud30c\uc545\ud558\uc5ec \uc544\uad70\uc5d0\uac8c \uc774\ub85c\uc6b4 \ubc29\ud5a5\uc73c\ub85c \ud65c\uc6a9\ud558\uace0, \uc704\ud5d8\ud55c \uacf3\uc740 \ucca0\uc800\ud788 \ud53c\ud558\uac70\ub098 \uc218\uc0c9\ud574\uc57c \ud569\ub2c8\ub2e4. \uc801\uc758 \ubbf8\uc138\ud55c \uc6c0\uc9c1\uc784\uc774\ub098 \uc790\uc5f0 \ud604\uc0c1\uc758 \ubcc0\ud654\ub97c \ud1b5\ud574 \uc801\uc758 \uc758\ub3c4\ub97c \uc77d\uc5b4\ub0b4\ub294 \ud1b5\ucc30\ub825\ub3c4 \uc911\uc694\ud569\ub2c8\ub2e4. \n\n \u2022\t\uc801\uc5d0 \ub300\ud55c \uc774\ud574\uc640 \uc2ec\ub9ac\uc804: \uc801\uc758 \ubb3c\ub9ac\uc801 \uc57d\uc810(\ud53c\ub85c, \ubcf4\uae09 \ubd80\uc871)\ubfd0\ub9cc \uc544\ub2c8\ub77c, \uc9c0\ud718\uad00\uc758 \uc2ec\ub9ac\uc801 \uc57d\uc810(\ubb34\ubaa8\ud568, \ubd84\ub178, \uacfc\ub3c4\ud55c \uc0dd\uc874\uc695 \ub4f1)\uae4c\uc9c0 \ud30c\uc545\ud558\uc5ec \uc774\ub97c \uc5ed\uc774\uc6a9\ud558\ub294 \uc804\ub7b5\uc774 \ud544\uc694\ud569\ub2c8\ub2e4. \n\n \u2022\t\ub2a5\ub3d9\uc801 \ubc29\uc5b4\uc640 \ud68c\ud53c: \uc801\uc758 \uacf5\uaca9\uc744 \ub2e8\uc21c\ud788 \uae30\ub2e4\ub9ac\ub294 \uac83\uc774 \uc544\ub2c8\ub77c, \uc2a4\uc2a4\ub85c \ub09c\uacf5\ubd88\ub77d\uc758 \uc0c1\ud0dc\ub97c \ub9cc\ub4e4\uc5b4 \uc801\uc774 \uacf5\uaca9\ud560 \uc5c4\ub450\ub97c \ub0b4\uc9c0 \ubabb\ud558\uac8c \ud574\uc57c \ud569\ub2c8\ub2e4. \ubd88\ud544\uc694\ud55c \uc2f8\uc6c0\uc740 \ud53c\ud558\uace0, \ub54c\ub85c\ub294 \uc0c1\ubd80\uc758 \ubd88\ud569\ub9ac\ud55c \uba85\ub839\uc774\ub77c\ub3c4 \uac70\ubd80\ud560 \uc218 \uc788\ub294 \uc9c0\ud718\uad00\uc758 \ub3c5\ub9bd\uc801\uc778 \ud310\ub2e8\uc774 \uc911\uc694\ud569\ub2c8\ub2e4.\n\n \u2022\t\ub9ac\ub354\uc2ed\uacfc \uc2e0\ub8b0 \uad6c\ucd95: \ub9ac\ub354\ub294 \uc790\uc2e0\uc774 \ub0b4\ub9ac\ub294 \uba85\ub839\uc744 \uba3c\uc800 \uc2e4\ucc9c\ud558\uace0 \ubaa8\ubc94\uc744 \ubcf4\uc5ec\uc57c \ud569\ub2c8\ub2e4. \uadf8\ub798\uc57c\ub9cc \ub300\uc911\uc758 \uc9c4\uc815\ud55c \uc2e0\ub8b0\uc640 \ubcf5\uc885\uc744 \uc5bb\uc5b4 \uc870\uc9c1 \uc804\uccb4\uc758 \ub2e8\uacb0\ub825\uc744 \uac15\ud654\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
