B.a8T=new A.a(" 1.\t\u81f4\u4eba (zh\xec r\xe9n, Cause others to come):\n\u2022\tMeaning: This refers to our side seizing the strategic initiative and enticing or making the enemy move at a time, place, and manner desired by our side. It is an active act of luring the enemy according to our plan by inducing their greed or misjudgment through offering benefits (\u4ee5\u5229\u52d5\u4e4b), exposing vulnerabilities, or employing deceptive tactics.\n\n 2.\t\u800c\u4e0d\u81f4\u65bc\u4eba (\xe9r b\xf9 zh\xec y\xfa r\xe9n, Not being caused to come by others):\n\u2022\tMeaning: This means our side is never swayed by the enemy's intentions or tactics, does not fall into traps set by the enemy, and does not passively react to the enemy's actions. It emphasizes that our side always preserves its strengths, does not succumb to the enemy's lures, and acts solely according to our strategic objectives and plans. \n\n",null,B.a,null,B.c)
