B.aoE=new A.a(" 1. \ud654\uacf5\uc758 \ub2e4\uba74\uc801 \ubaa9\ud45c: '\ud654\uacf5'\uc740 \ub2e8\uc21c\ud788 \uc801\uc744 \ubd88\ud0dc\uc6b0\ub294 \uac83\uc774 \uc544\ub2c8\ub77c, \uc801\uc758 \uc778\uba85(\u706b\u4eba), \ubcf4\uae09 \ubb3c\uc790(\u706b\u7a4d), \uc218\uc1a1 \uc218\ub2e8(\u706b\u8f1c), \uc800\uc7a5 \uc2dc\uc124(\u706b\u5eab), \uadf8\ub9ac\uace0 \uc870\uc9c1 \ub300\ud615(\u706b\u968a) \ub4f1 \ub2e4\uc591\ud55c \ud575\uc2ec \uc694\uc18c\ub97c \ud30c\uad34\ud558\uc5ec \uc801\uc758 \uc804\uc7c1 \uc218\ud589 \ub2a5\ub825\uc744 \ub9c8\ube44\uc2dc\ud0a4\ub294 \ub2e4\uce35\uc801 \uacf5\uaca9 \uc218\ub2e8\uc785\ub2c8\ub2e4. \n\n 2. \ud654\uacf5 \uc2e4\ud589\uc758 \uc870\uac74: \ud654\uacf5\uc744 \uc131\uacf5\uc801\uc73c\ub85c \uc218\ud589\ud558\uae30 \uc704\ud574\uc11c\ub294 \uba85\ud655\ud55c \uc6d0\uc778(\u884c\u706b\u5fc5\u6709\u56e0), \ucca0\uc800\ud55c \uc0ac\uc804 \uc900\ube44(\u7159\u706b\u5fc5\u7d20\u5177), \uadf8\ub9ac\uace0 \uc801\uc808\ud55c '\ub54c'(\u767c\u706b\u6709\u6642)\uc640 '\ub0a0'(\u8d77\u706b\u6709\u65e5)\uc744 \ud3ec\ucc29\ud558\ub294 \uce58\ubc00\ud55c \uacc4\ud68d\uacfc \ud0c0\uc774\ubc0d\uc774 \ud544\uc218\uc801\uc785\ub2c8\ub2e4. \n\n 3. \uacf5\uaca9 \uc218\ub2e8\uc758 \ud2b9\uc131\uacfc \ud55c\uacc4: \ubd88(\u706b)\uc744 \uc774\uc6a9\ud55c \uacf5\uaca9\uc740 **\uba85\ud655\ud558\uace0 \uc989\uac01\uc801\uc778 \ud6a8\uacfc(\u660e)\ub97c \uac00\uc838\uc624\uc9c0\ub9cc, \ubb3c(\u6c34)\uc744 \uc774\uc6a9\ud55c \uacf5\uaca9\uc740 \uac15\ub825\ud55c \ud30c\uad34\ub825(\u5f3a)\uc744 \uac00\uc9d1\ub2c8\ub2e4. \uadf8\ub7ec\ub098 \ubb3c\uc740 \uc801\uc744 \ub2e8\uc808\uc2dc\ud0a4\uac70\ub098 \uace0\ub9bd\uc2dc\ud0ac \uc218\ub294 \uc788\uc5b4\ub3c4(\u53ef\u4ee5\u7d76), \uc801\uc758 \uc790\uc6d0\uc744 \ube7c\uc557\uc544 \uc544\uad70\uc5d0\uac8c \uc774\ub86d\uac8c \ud560 \uc218\ub294 \uc5c6\ub2e4(\u4e0d\u53ef\u4ee5\u596a)\ub294 \ud55c\uacc4\ub97c \uba85\ud655\ud788 \uc778\uc9c0\ud574\uc57c \ud569\ub2c8\ub2e4. \uc989, \uc804\ub7b5 \uc218\ub2e8 \uc120\ud0dd \uc2dc \uac01 \uc218\ub2e8\uc758 \uc7a5\ub2e8\uc810\uc744 \uba85\ud655\ud788 \ud30c\uc545\ud574\uc57c \ud569\ub2c8\ub2e4. \n\n 4. \uc2b9\ub9ac \ud6c4 \uad00\ub9ac\uc758 \uc911\uc694\uc131: \uc804\ud22c\uc5d0\uc11c \uc2b9\ub9ac\ud558\uace0 \uc801\uc758 \uac83\uc744 \ud68d\ub4dd\ud588\uc74c\uc5d0\ub3c4(\u6230\u52dd\u653b\u53d6) \ubd88\uad6c\ud558\uace0, \uadf8 \uc131\uacfc\ub97c \uc81c\ub300\ub85c \uad00\ub9ac\ud558\uace0 \uc815\ube44\ud558\uc9c0 \uc54a\uc73c\uba74(\u800c\u4e0d\u4fee\u5176\u529f) \uc624\ud788\ub824 \ud749\ud558\uace0 \uc704\ud5d8(\u51f6)\ud558\uac8c \ub429\ub2c8\ub2e4. \uc774\ub294 \uc790\uc6d0\uc744 \ub0ad\ube44\ud558\uace0 \uc544\ubb34\ub7f0 \uc9c4\uc804 \uc5c6\uc774 \uc81c\uc790\ub9ac\uc5d0 \uba38\ubb34\ub294(\u8cbb\u7559) \uacb0\uacfc\ub97c \ucd08\ub798\ud558\ubbc0\ub85c, \uc2b9\ub9ac \uc774\ud6c4\uc758 \uc548\uc815\ud654\uc640 \uad00\ub9ac\uac00 \uc9c0\uc18d \uac00\ub2a5\ud55c \uc131\uacf5\uc758 \ud575\uc2ec\uc785\ub2c8\ub2e4. \n\n 5. \uc804\uc7c1 \uacb0\uacfc\uc758 \ube44\uac00\uc5ed\uc131: \uac1c\uc778\uc758 \ub178\uc5ec\uc6c0\uc774\ub098 \ubd88\ucf8c\ud568 \uac19\uc740 \uac10\uc815\uc740 \uc2dc\uac04\uc774 \uc9c0\ub098\uba74 \ud68c\ubcf5\ub420 \uc218 \uc788\uc9c0\ub9cc(\u6012\u53ef\u4ee5\u5fa9\u559c, \u614d\u53ef\u4ee5\u5fa9\u6085), \uad6d\uac00\uac00 \uba78\ub9dd(\u4ea1\u570b)\ud558\uba74 \ub2e4\uc2dc \uc874\uc7ac\ud560 \uc218 \uc5c6\uace0, \uc0ac\ub78c\uc774 \uc8fd\uc73c\uba74(\u6b7b\u8005) \ub2e4\uc2dc \uc0b4\uc544\ub0a0 \uc218 \uc5c6\uc2b5\ub2c8\ub2e4. \uc774\ub294 \uc9c0\ub3c4\uc790\uac00 \uac10\uc815\uc5d0 \ud729\uc4f8\ub9ac\uc9c0 \uc54a\uace0, \uc804\uc7c1\uc758 \ucd5c\uc885\uc801\uc774\uace0 \ub3cc\uc774\ud0ac \uc218 \uc5c6\ub294 \ud30c\uad34\ub825\uc744 \ud56d\uc0c1 \uc778\uc2dd\ud558\uba70 \uadf9\ub3c4\ub85c \uc2e0\uc911\ud558\uac8c \uacb0\uc815\ud574\uc57c \ud568\uc744 \uac15\uc870\ud569\ub2c8\ub2e4. \n\n \uc804\uc7c1\uc5d0\uc11c \uacf5\uaca9\uc758 \ubaa9\uc801\uacfc \uc218\ub2e8\uc744 \uba74\ubc00\ud788 \ubd84\uc11d\ud558\uace0, \uce58\ubc00\ud558\uac8c \uc900\ube44\ud558\uba70, \uc801\uc808\ud55c \uc2dc\uae30\ub97c \ud3ec\ucc29\ud558\uace0, \uc2b9\ub9ac \ud6c4\uc5d0\ub294 \uadf8 \uc131\uacfc\ub97c \ucca0\uc800\ud788 \uad00\ub9ac\ud558\uba70, \ubb34\uc5c7\ubcf4\ub2e4 \uc804\uc7c1\uc758 \ucd5c\uc885\uc801\uc778 \ud30c\uae09\ub825\uc744 \uc2ec\uc0ac\uc219\uace0\ud574\uc57c \ud55c\ub2e4\ub294 \uc885\ud569\uc801\uc778 \uba54\uc2dc\uc9c0\ub97c \uc804\ub2ec\ud569\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
