B.anW=new A.a("\ub2e4\uc12f \uac00\uc9c0 \ud654\uacf5 \ubaa9\ud45c\ub97c \uba85\ud655\ud788 \uc124\uc815\ud558\uace0, \uc900\ube44\uc640 \ud0c0\uc774\ubc0d\uc744 \uc644\ubcbd\ud788 \uac16\ucdb0 \ubd88\uacfc \ubb3c\ucc98\ub7fc \ud30c\uad34\uc801\uc774\uace0 \ucc28\ub2e8\uc801\uc778 \uacf5\uaca9\uc744 \uc2e4\ud589\ud558\ub77c. \uc2b9\ub9ac \ud6c4 \uc601\ud1a0\ub97c \uc810\ub839\ud588\uc5b4\ub3c4 \uc548\uc8fc\ud558\uc9c0 \ub9d0\uace0, \uc810\ub839\uc9c0\ub97c \uad73\uac74\ud788 \ub2e4\uc9c0\ub294 \ud6c4\uc18d \uc870\uce58\uc5d0 \uc9d1\uc911\ud558\ub77c. \uc77c\uc2dc\uc801\uc778 \uac10\uc815\uc5d0 \ud754\ub4e4\ub9ac\uc9c0 \ub9c8\ub77c. \uad6d\uac00\uc758 \uba78\ub9dd\uacfc \ubcd1\uc0ac\uc758 \uc8fd\uc74c\uc740 \ub418\ub3cc\ub9b4 \uc218 \uc5c6\ub294 \uacb0\uacfc\uc784\uc744 \uba85\uc2ec\ud558\uace0, \ud68c\ubcf5 \ubd88\uac00\ub2a5\ud55c \uc190\uc2e4\uc744 \ud53c\ud558\ub294 \uc804\ub7b5\uc744 \ucd5c\uc6b0\uc120\uc73c\ub85c \uc0bc\uc73c\ub77c. \n\u2022  \uc694\uc57d: \ud604\ub300 \uad70\uc0ac \uc791\uc804\uc740 \ubaa9\ud45c\uc758 \uba85\ud655\ud654\uc640 \ucca0\uc800\ud55c \uc900\ube44, \uadf8\ub9ac\uace0 \uc815\uad50\ud55c \ud0c0\uc774\ubc0d\uc774 \ud544\uc218\uc801\uc785\ub2c8\ub2e4. \uc2b9\ub9ac \ud6c4 \uc804\ub7b5\uc801 \ubaa9\ud45c\ub97c \uacf5\uace0\ud788 \ud558\ub294 \ud6c4\uc18d \uc870\uce58\ub294 \uc131\uacf5\uc758 \uc9c0\uc18d\uc131\uc744 \ubcf4\uc7a5\ud569\ub2c8\ub2e4. \ubb34\uc5c7\ubcf4\ub2e4 \ud68c\ubcf5 \ubd88\uac00\ub2a5\ud55c \ud53c\ud574\ub97c \ucd08\ub798\ud560 \uc218 \uc788\ub294 \uacb0\uc815\uc740 \uadf9\ub3c4\ub85c \uc2e0\uc911\ud558\uac8c \ub0b4\ub824\uc57c \ud569\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
B.ag9=new A.a(" \ub2e4\uc12f \uac00\uc9c0 \ud575\uc2ec \ubaa9\ud45c(\uc778\uc7ac, \uc790\uc0b0, \ubb3c\ub958, \uae30\uc220, \uc870\uc9c1)\uc5d0 \ub300\ud55c \ud30c\uad34\uc801 \ud601\uc2e0\uc744 \uacc4\ud68d\ud558\uace0, \uc2dc\uc7a5 \uc9c4\uc785 \uc870\uac74\uacfc \uc801\uc808\ud55c \ud0c0\uc774\ubc0d\uc744 \uc644\ubcbd\ud788 \uac16\ucdb0 \uc2e4\ud589\ud558\ub77c. \uc131\uacf5\uc801\uc778 \uc2dc\uc7a5 \uc120\uc810 \ud6c4\uc5d0\ub3c4 \uc548\uc8fc\ud558\uc9c0 \ub9d0\uace0, \uace0\uac1d \ucda9\uc131\ub3c4 \ud655\ubcf4\uc640 \uc2dc\uc7a5 \uc9c0\uc704 \uac15\ud654\ub97c \uc704\ud55c \ud6c4\uc18d \uc870\uce58\uc5d0 \uc9d1\uc911\ud558\ub77c. \uc77c\uc2dc\uc801\uc778 \uacbd\uc601 \uc704\uae30\ub098 \uac10\uc815\uc801 \uc758\uc0ac\uacb0\uc815\uc5d0 \ud754\ub4e4\ub9ac\uc9c0 \ub9c8\ub77c. \uae30\uc5c5\uc758 \ub3c4\uc0b0\uacfc \ud575\uc2ec \uc778\uc7ac\uc758 \uc720\ucd9c\uc740 \ub418\ub3cc\ub9b4 \uc218 \uc5c6\ub294 \uacb0\uacfc\uc784\uc744 \uba85\uc2ec\ud558\uace0, \ud68c\ubcf5 \ubd88\uac00\ub2a5\ud55c \uc190\uc2e4\uc744 \ud53c\ud558\ub294 \uc804\ub7b5\uc744 \ucd5c\uc6b0\uc120\uc73c\ub85c \uc0bc\uc73c\ub77c. \n\u2022  \uc694\uc57d: \ube44\uc988\ub2c8\uc2a4 \ud601\uc2e0\uc740 \uba85\ud655\ud55c \ubaa9\ud45c \uc124\uc815\uacfc \ucca0\uc800\ud55c \uc2dc\uc7a5 \ubd84\uc11d, \uadf8\ub9ac\uace0 \uc2e4\ud589 \ud0c0\uc774\ubc0d\uc774 \uc911\uc694\ud569\ub2c8\ub2e4. \uc2dc\uc7a5 \uc120\uc810 \ud6c4\uc5d0\ub3c4 \uc9c0\uc18d\uc801\uc778 \ud22c\uc790\uc640 \uad00\ub9ac\ub85c \uacbd\uc7c1 \uc6b0\uc704\ub97c \uacf5\uace0\ud788 \ud574\uc57c \ud569\ub2c8\ub2e4. \ubb34\uc5c7\ubcf4\ub2e4 \uae30\uc5c5\uc758 \uc874\ud3d0\ub97c \uac00\ub97c \uc218 \uc788\ub294 \uc704\ud5d8\ud55c \uacb0\uc815\uc740 \uadf9\ub3c4\ub85c \uc2e0\uc911\ud558\uac8c \ub0b4\ub824\uc57c \ud558\uba70, \ud68c\ubcf5 \ubd88\uac00\ub2a5\ud55c \uc778\uc801, \ubb3c\uc801 \uc190\uc2e4\uc744 \ud53c\ud558\ub294 \uac83\uc774 \ucd5c\uc6b0\uc120\uc785\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
B.ahy=new A.a("\uc0c1\ub300 \ud300 \ud575\uc2ec \uc120\uc218 \ubb34\ub825\ud654, \uc8fc\uc804\ub825 \uc18c\ubaa8, \uc804\ub7b5 \ubb34\ub825\ud654, \ud6c8\ub828 \uc2dc\uc124 \ud30c\uad34, \ud300\uc6cc\ud06c \ubd95\uad34 \ub4f1 \ub2e4\uc12f \uac00\uc9c0 \uacf5\uaca9 \ubaa9\ud45c\ub97c \uc138\ubd84\ud654\ud558\uace0, \uacbd\uae30 \uc804 \uc900\ube44\uc640 \ud0c0\uc774\ubc0d\uc744 \uc644\ubcbd\ud788 \uac16\ucdb0 \uc2e4\ud589\ud558\ub77c. \uacbd\uae30\uc5d0\uc11c \uc2b9\ub9ac \ud6c4\uc5d0\ub3c4 \ubc29\uc2ec\ud558\uc9c0 \ub9d0\uace0, \ub2e4\uc74c \uacbd\uae30\ub97c \uc704\ud55c \ucca0\uc800\ud55c \ubd84\uc11d\uacfc \ucee8\ub514\uc158 \uad00\ub9ac\uc5d0 \uc9d1\uc911\ud558\ub77c. \uc77c\uc2dc\uc801\uc778 \ud328\ubc30\ub098 \uac10\uc815\uc801 \ucda9\ub3cc\uc5d0 \ud754\ub4e4\ub9ac\uc9c0 \ub9c8\ub77c. \ud575\uc2ec \uc120\uc218\uc758 \ubd80\uc0c1\uc73c\ub85c \uc778\ud55c \uc740\ud1f4\ub098 \ud300\uc758 \ud574\uccb4\ub294 \ub418\ub3cc\ub9b4 \uc218 \uc5c6\ub294 \uacb0\uacfc\uc784\uc744 \uba85\uc2ec\ud558\uace0, \ud68c\ubcf5 \ubd88\uac00\ub2a5\ud55c \uc190\uc2e4\uc744 \ud53c\ud558\ub294 \uc804\ub7b5\uc744 \ucd5c\uc6b0\uc120\uc73c\ub85c \uc0bc\uc73c\ub77c. \n\u2022  \uc694\uc57d: \uc2a4\ud3ec\uce20 \uc804\ub7b5\uc740 \uc0c1\ub300 \ud300\uc758 \uc57d\uc810 \ubd84\uc11d\uacfc \uadf8\uc5d0 \ub530\ub978 \uc815\uad50\ud55c \uc804\uc220, \uadf8\ub9ac\uace0 \uc2e4\ud589 \ud0c0\uc774\ubc0d\uc774 \uc911\uc694\ud569\ub2c8\ub2e4. \uc2b9\ub9ac \ud6c4\uc5d0\ub3c4 \uc548\uc8fc\ud558\uc9c0 \uc54a\uace0 \ub2e4\uc74c \uacbd\uae30\ub97c \uc900\ube44\ud558\ub294 \uc790\uc138\uac00 \uc9c0\uc18d\uc801\uc778 \uc131\uacf5\uc744 \uac00\uc838\uc635\ub2c8\ub2e4. \ubb34\uc5c7\ubcf4\ub2e4 \uc120\uc218\ub4e4\uc758 \ubd80\uc0c1\uacfc \uac19\uc740 \ud68c\ubcf5 \ubd88\uac00\ub2a5\ud55c \uc190\uc2e4\uc744 \ucd08\ub798\ud560 \uc218 \uc788\ub294 \uc704\ud5d8\ud55c \ud50c\ub808\uc774\ub294 \uadf9\ub3c4\ub85c \uc2e0\uc911\ud558\uac8c \ud53c\ud574\uc57c \ud569\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
