B.aiU=new A.a("\u318d \u9b2a(d\xf2u): \uc2f8\uc6b0\ub2e4, \uc804\ud22c\ud558\ub2e4\n\u318d \u8846(zh\xf2ng): \uad70\uc911, \ub9ce\uc740 \ubcd1\ub825\n\u318d \u5982(r\xfa): ~\ucc98\ub7fc\n\u318d \u5be1(gu\u01ce): \uc801\uc740 \ubcd1\ub825, \uc18c\uc218\n\u318d \u5f62(x\xedng): \ud615\uc0c1, \uc678\ud615, \uc804\uc220\uc801 \ubc30\uce58\uc640 \ud3ec\uc9c0\uc158 \n\u318d \u540d(m\xedng): \uba85\ub839, \uba85\uce6d, \uc9c0\ud718\uccb4\uacc4 \ubc0f \uc9c0\uc2dc\uc0ac\ud56d\n\u318d \u662f\u4e5f(sh\xec y\u011b): \uadf8\uac83 \ub54c\ubb38\uc774\ub2e4 / \uadf8\uac83\uc774 \uc633\uc740 \uc774\uce58\ub2e4 \n\n ",null,B.a,null,B.c)
