B.asd=new A.a("\uc774 \ubb38\uad6c\ub294 \uc2e4\uc81c \uc804\ud22c \uc0c1\ud669\uc5d0\uc11c \uc544\uad70\uc774 \uc555\ub3c4\uc801\uc778 \uaddc\ubaa8\uc758 \uc801\uc744 \ud6a8\uacfc\uc801\uc73c\ub85c \uc0c1\ub300\ud560 \uc218 \uc788\ub294 \ube44\uacb0\uc774 \ubb34\uc5c7\uc778\uc9c0\ub97c \uc124\uba85\ud569\ub2c8\ub2e4. \ud575\uc2ec\uc740 '\ud615\uba85(\u5f62\u540d)'\uc5d0 \uc788\uc2b5\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
B.avz=new A.a(" 1. \ub300\uad70\uacfc \uc18c\uc218\uc758 \ub3d9\uc77c\ud55c \uc804\ud22c \uc6d0\uce59 (\u9b2a\u8846\u5982\u9b2a\u5be1):\n \u318d \uc758\ubbf8: \uc190\uc790\ubcd1\ubc95\uc740 \ub300\uaddc\ubaa8\uc758 \uc801\uacfc \uc2f8\uc6b0\ub294 \uc0c1\ud669\uc5d0\uc11c\ub3c4, \uc798 \uc900\ube44\ub41c \uc544\uad70\uc5d0\uac8c\ub294 \uadf8 \uc2f8\uc6c0\uc774 \uc18c\uaddc\ubaa8 \uc801\uacfc \uc2f8\uc6b0\ub294 \uac83\ucc98\ub7fc \ub290\uaef4\uc9c8 \uc218 \uc788\ub2e4\uace0 \ub9d0\ud569\ub2c8\ub2e4. \uc774\ub294 \uc801\uc758 \uaddc\ubaa8\uc5d0 \uc555\ub3c4\ub2f9\ud558\uc9c0 \uc54a\uace0, \ud6a8\uacfc\uc801\uc73c\ub85c \ub300\uc751\ud560 \uc218 \uc788\ub294 \ubc29\ubc95\uc744 \uc81c\uc2dc\ud558\ub294 \uac83\uc785\ub2c8\ub2e4.\n\n 2.\t\ud615\uba85(\u5f62\u540d)\uc758 \uc911\uc694\uc131:\n \u318d \u5f62(\ud615): \uc804\ud22c \uc0c1\ud669\uc5d0\uc11c \ubcd1\ub825\uc744 '\ubc30\uce58\ud558\ub294 \ud615\ud0dc'\ub97c \uc758\ubbf8\ud569\ub2c8\ub2e4. \uc774\ub294 \ub300\uaddc\ubaa8 \ubcd1\ub825\uc744 \uc18c\uaddc\ubaa8 \uc804\ud22c \ub2e8\uc704\ub85c \ub098\ub204\uc5b4 \ubc30\uce58\ud558\uac70\ub098, \uac01 \ub2e8\uc704\uac00 \uc720\uae30\uc801\uc73c\ub85c \uc5f0\uacb0\ub41c \uc9c4\ud615\uc744 \uac16\ucd94\ub294 \uac83\uc744 \ub73b\ud569\ub2c8\ub2e4. \uc801\uc774 \uc544\ubb34\ub9ac \ub9ce\uc544\ub3c4, \uc544\uad70\uc774 \uc798 \uc9dc\uc778 \ud615\ud0dc\ub85c \ubd84\uc0b0\ub418\uc5b4 \uc6c0\uc9c1\uc774\uba74, \uc801\uc740 \uc804\uccb4 \uc544\uad70\uacfc \uc2f8\uc6b0\ub294 \uac83\uc774 \uc544\ub2c8\ub77c, \uc544\uad70\uc758 \uac01 \uc18c\uaddc\ubaa8 \uc804\ud22c \ub2e8\uc704\uc640 \uc2f8\uc6b0\ub294 \uac83\ucc98\ub7fc \ub290\ub07c\uac8c \ub429\ub2c8\ub2e4.\n\n \u318d \u540d(\uba85): \uac01 \ubd80\ub300\uc758 '\uba85\uce6d' \ub610\ub294 '\uc2dd\ubcc4 \uccb4\uacc4'\ub97c \uc758\ubbf8\ud569\ub2c8\ub2e4. \uc774\ub294 \uba85\ud655\ud55c \ubd80\ub300 \uad6c\ubd84, \uc9c0\ud718 \uccb4\uacc4, \uc5ed\ud560 \ubd84\ub2f4\uc744 \ud1b5\ud574 \uac01 \ub2e8\uc704\uac00 \uc790\uc2e0\uc758 \uc784\ubb34\ub97c \uc815\ud655\ud788 \uc778\uc9c0\ud558\uace0 \ud63c\ub780 \uc5c6\uc774 \uc6c0\uc9c1\uc774\uac8c \ub9cc\ub4ed\ub2c8\ub2e4. '\uba85'\uc774 \uba85\ud655\ud558\uba74 \ub300\uaddc\ubaa8 \uc804\ud22c \uc911\uc5d0\ub3c4 \uc815\ud655\ud55c \uc9c0\uc2dc\uc640 \ubcf4\uace0\uac00 \uac00\ub2a5\ud574\uc838 \ud63c\ub780\uc744 \ubc29\uc9c0\ud558\uace0 \uc751\uc9d1\ub825\uc744 \uc720\uc9c0\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
