B.anB=new A.a(" 1. \uc804\ud22c \uc911 \uc870\uc9c1\ud654: \uc544\ubb34\ub9ac \ub300\uaddc\ubaa8 \uc804\ud22c\ub77c\ub3c4 \uc544\uad70 \ubcd1\ub825\uc744 \ud6a8\uacfc\uc801\uc778 \uc804\ud22c \ub2e8\uc704\ub85c \ub098\ub204\uc5b4 \ubc30\uce58\ud558\uace0 \uc6b4\uc6a9\ud558\ub294 \uac83\uc774 \ud575\uc2ec\uc785\ub2c8\ub2e4. \uc774\ub294 \uc801\uc5d0\uac8c \uc544\uad70\uc758 \uc804\uccb4 \uaddc\ubaa8\ub97c \ud30c\uc545\ud558\uae30 \uc5b4\ub835\uac8c \ub9cc\ub4e4\uace0, \uc544\uad70\uc5d0\uac8c\ub294 \uac01 \ub2e8\uc704\uc758 \ud6a8\uc728\uc801\uc778 \uc804\ud22c\ub97c \uac00\ub2a5\ud558\uac8c \ud569\ub2c8\ub2e4.\n\n 2. \uba85\ud655\ud55c \uc9c0\ud718 \ud1b5\uc81c: \uac01 \ubd80\ub300\uc758 \uba85\uce6d\uacfc \uc5ed\ud560\uc744 \uba85\ud655\ud788 \ud558\uc5ec \ud63c\ub780 \uc18d\uc5d0\uc11c\ub3c4 \uc815\ud655\ud55c \uc9c0\ud718\uc640 \uc18c\ud1b5\uc774 \uc774\ub8e8\uc5b4\uc9c0\ub3c4\ub85d \ud574\uc57c \ud569\ub2c8\ub2e4. \uc774\ub294 \ub300\uaddc\ubaa8 \uc804\ud22c \uc0c1\ud669\uc5d0\uc11c \uc544\uad70\uc758 \uc751\uc9d1\ub825\uacfc \ubc18\uc751 \uc18d\ub3c4\ub97c \uc720\uc9c0\ud558\ub294 \ub370 \ud544\uc218\uc801\uc785\ub2c8\ub2e4.\n\n 3. \uc801\uc758 \ud63c\ub780 \uc720\ub3c4: \uc544\uad70\uc758 \uc798 \uc870\uc9c1\ub41c '\ud615\uba85'\uc740 \uc801\uc5d0\uac8c\ub294 \ud63c\ub780\uacfc \ud310\ub2e8 \ucc29\uc624\ub97c \uc720\ub3c4\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc801\uc740 \uc544\uad70\uc758 \uc2e4\uc81c \uaddc\ubaa8\uc640 \uc804\ud22c\ub825\uc744 \uacfc\ub300 \ub610\ub294 \uacfc\uc18c\ud3c9\uac00\ud558\uac8c \ub418\uac70\ub098, \uc544\uad70\uc758 \uc758\ub3c4\ub97c \ud30c\uc545\ud558\uae30 \uc5b4\ub835\uac8c \ub9cc\ub4ed\ub2c8\ub2e4.\n\n 4. \uc2ec\ub9ac\uc801 \uc6b0\uc704: \ub300\uaddc\ubaa8 \uc801\uad70\uc5d0 \ub9de\uc11c \uc2f8\uc6b8 \ub54c, \uc544\uad70\uc774 \uc798 \uc870\uc9c1\ub418\uc5b4 \ud63c\ub780 \uc5c6\uc774 \uc6c0\uc9c1\uc774\uba74 \ubcd1\uc0ac\ub4e4\uc758 \uc0ac\uae30\ub97c \uc720\uc9c0\ud558\uace0 \uc801\uc5d0\uac8c\ub294 \uc555\ubc15\uac10\uc744 \uc904 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n\n 5.\t\ud6a8\uc728\uc801\uc778 \uc804\ud22c \uc218\ud589: '\ud615\uba85'\uc744 \ud1b5\ud574 \uac01 \ub2e8\uc704\ub294 \uc790\uc2e0\uc758 \uc5ed\ud560\uc5d0 \uc9d1\uc911\ud558\uace0, \uc804\uccb4\uc801\uc778 \uc804\ud22c \ubaa9\ud45c \ub2ec\uc131\uc5d0 \uae30\uc5ec\ud558\uac8c \ub429\ub2c8\ub2e4. \uc774\ub294 \uc804\ud22c \uc790\uc6d0\uc758 \ud6a8\uc728\uc801\uc778 \ud65c\uc6a9\uc73c\ub85c \uc774\uc5b4\uc9d1\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
