B.aki=new A.a("\u318d \u592b (f\u016b): Generally, as a prefix emphasizin\n\u318d \u920d\u5175 (d\xf9n b\u012bng): Dulled soldiers \n\u318d \u632b\u92b3 (cu\xf2 ru\xec): Blunted sharpness \n\u318d \u5c48\u529b (q\u016b l\xec): Strength exhausted \n\u318d \u6bab\u8ca8 (d\u0101n hu\xf2): Resources depleted \n\u318d \u5247 (z\xe9): Then, in that case \n\u318d \u8af8\u4faf (zh\u016b h\xf3u): Feudal lords (rulers of various regions) \n\u318d \u4e58\u5176\u5f0a (ch\xe9ng q\xed b\xec): Take advantage of their weakness \n\u318d \u800c\u8d77 (\xe9r q\u01d0): Rise up, revolt \n\n",null,B.a,null,B.c)
B.ahv=new A.a("\u201cIf war causes soldiers to become dulled and their morale broken, and the nation's power weakens and resources are exhausted, then (taking advantage of this) the feudal lords will rise up, exploiting that debilitation.\u201d",null,B.a,null,B.c)
