B.a7z=new A.a("This passage warns of the complex dangers arising from protracted war. \n\n",null,B.a,null,B.c)
B.an3=new A.a("1. \u920d\u5175\u632b\u92b3 \u5c48\u529b\u6bab\u8ca8(d\xf9n b\u012bng cu\xf2 ru\xec, q\u016b l\xec d\u0101n hu\xf2):\n  \u2022  \u920d\u5175\u632b\u92b3(d\xf9n b\u012bng cu\xf2 ru\xec): Points out the internal problem of soldiers' combat effectiveness becoming dulled and morale breaking as the war lengthens. \n  \u2022  \u5c48\u529b\u6bab\u8ca8(q\u016b l\xec d\u0101n hu\xf2): Subsequently emphasizes the economic and national power losses where the entire nation's strength (\u529b) weakens, and wealth and resources (\u8ca8) are depleted. War imposes an immense burden not only on human lives but also on the nation's finances. \n\n 2.  \u5247\u8af8\u4faf\u4e58\u5176\u5f0a\u800c\u8d77(z\xe9 zh\u016b h\xf3u ch\xe9ng q\xed b\xec \xe9r q\u01d0): It warns that if one becomes debilitated (\u5f0a) due to war, surrounding feudal lords (\u8af8\u4faf), meaning other rival or hostile forces, will take advantage of this opportunity (\u4e58) to oppose or attack (\u800c\u8d77) them. This clearly shows the causal relationship where internal weakening directly leads to external invasion. \n\n",null,B.a,null,B.c)
