B.aus=new A.a("1.\tAbsolute Avoidance of Protracted War: Prolonging a war is a highly dangerous act that not only leads to friendly losses but also depletes the nation's overall capabilities and invites external attacks. \n\n2.\tVigilance Against National Power Depletion: War entails massive consumption of human and material resources, so war costs must be minimized, and efficient operations pursued to prevent the depletion of national power. \n\n3.\tVigilance Against Potential Threats: Even during wartime, one must always be aware that surrounding competitors or hostile forces are seeking to exploit one's weaknesses and must not neglect preparations against them. \n\n4.\tInevitability of Swift Victory: By vividly presenting the harms of protracted war, it re-emphasizes that quickly ending the war and achieving victory is essential for preserving national power and maintaining security. \n\n",null,B.a,null,B.c)
