B.acz=new A.a("  \u2022 \u884c\u706b(x\xedng hu\u01d2): \ubd88\uc744 \uc9c0\ub974\ub294 \uc804\uc220\uc744 \uc2e4\ud589\ud568 (\ud654\uacf5\uc744 \uc2e4\uc2dc\ud568) \n  \u2022 \u5fc5\u6709\u56e0(b\xec y\u01d2u y\u012bn): \ubc18\ub4dc\uc2dc \uadfc\uac70\ub098 \uc870\uac74\uc774 \uc788\uc5b4\uc57c \ud568 \n  \u2022 \u7159\u706b(y\u0101n hu\u01d2): \ubd88\uacfc \uc5f0\uae30, \ud654\uacf5\uc744 \uc704\ud55c \ub3c4\uad6c\ub098 \uc0c1\ud669 \n  \u2022 \u5fc5\u7d20\u5177(b\xec s\xf9 j\xf9): \ubc18\ub4dc\uc2dc \ubbf8\ub9ac \uc900\ube44\ub418\uc5b4\uc57c \ud568 \n  \u2022 \u767c\u706b(f\u0101 hu\u01d2): \ubd88\uc744 \ubd99\uc774\ub294 \ud589\uc704 \n  \u2022 \u6709\u6642(y\u01d2u sh\xed): \ub54c\uac00 \uc788\uc74c, \uc801\uc808\ud55c \ud0c0\uc774\ubc0d\uc774 \uc874\uc7ac\ud568 \n  \u2022 \u8d77\u706b(q\u01d0 hu\u01d2): \ubd88\uc744 \uc77c\uc73c\ud0b4, \uc2e4\uc81c\ub85c \ud654\uacf5\uc774 \uc77c\uc5b4\ub098\ub294 \uc2dc\uc810 \n  \u2022 \u6709\u65e5(y\u01d2u r\xec): \ub0a0\uc774 \uc815\ud574\uc838 \uc788\uc74c, \uc2e4\ud589\uc77c\uc774 \uc788\uc74c \n\n ",null,B.a,null,B.c)
B.aoR=new A.a("\u201c\ubd88\uc744 \uc0ac\uc6a9\ud558\ub294 \uc804\uc220\uc740 \ubc18\ub4dc\uc2dc \uc720\ub9ac\ud55c \uc870\uac74\uc774 \uc788\uc5b4\uc57c \ud558\uba70, \ubd88\uc744 \ub193\uc744 \ub3c4\uad6c\ub294 \ubc18\ub4dc\uc2dc \ubbf8\ub9ac \uac16\ucd94\uc5b4 \ub450\uc5b4\uc57c \ud55c\ub2e4.  \ubd88\uc744 \ubd99\uc774\ub294 \ub370\ub294 \uc801\uc808\ud55c \ub54c\uac00 \uc788\uace0, \ubd88\uc774 \uc77c\uc5b4\ub098\ub294 \ub370\ub294 \uc815\ud574\uc9c4 \ub0a0\uc774 \uc788\ub2e4.\u201d",null,B.a,null,B.c)
