B.ajy=new A.a(" 1. \u884c\u706b\u5fc5\u6709\u56e0: \ud654\uacf5\uc744 \uc2dc\ub3c4\ud558\uae30 \uc704\ud574\uc11c\ub294 \ubc18\ub4dc\uc2dc \uc720\ub9ac\ud55c \uc870\uac74\uc774\ub098 \uc6d0\uc778\uc774 \uc788\uc5b4\uc57c \ud569\ub2c8\ub2e4. \uc774\ub294 \uc801\uc758 \ucde8\uc57d\uc131, \uc544\uad70\uc758 \uc900\ube44 \uc0c1\ud0dc, \ub610\ub294 \ud2b9\uc815 \uc9c0\ud615\uc801 \uc774\uc810 \ub4f1 \ud654\uacf5\uc774 \ud6a8\uacfc\ub97c \ubcfc \uc218 \uc788\ub294 \ub0b4\uc7ac\uc801 \uc694\uc778\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \n\n 2. \u7159\u706b\u5fc5\u7d20\u5177: \ud654\uacf5\uc5d0 \ud544\uc694\ud55c \uc5f0\uae30(\uc704\uc7a5), \ud654\uc57d, \ubd88\uc3d8\uc2dc\uac1c \ub4f1 \ubaa8\ub4e0 \ub3c4\uad6c\uc640 \ubb3c\uc790\ub294 \uc791\uc804 \uac1c\uc2dc \uc804\uc5d0 \ubbf8\ub9ac \ucca0\uc800\ud558\uac8c \uc900\ube44\ub418\uc5b4 \uc788\uc5b4\uc57c \ud569\ub2c8\ub2e4. \uc774\ub294 \uae09\ubc15\ud55c \uc0c1\ud669\uc5d0\uc11c \ud544\uc694\ud55c \uac83\uc744 \uc81c\ub54c \ud655\ubcf4\ud558\uc9c0 \ubabb\ud558\ub294 \uc77c\uc774 \uc5c6\ub3c4\ub85d \ub300\ube44\ud558\ub294 \uac83\uc785\ub2c8\ub2e4. \n\n 3. \u767c\u706b\u6709\u6642: \ubd88\uc744 \ud53c\uc6b0\uae30 \uc704\ud574\uc11c\ub294 **\uc2dc\uc758\uc801\uc808\ud55c '\ub54c'**\ub97c \ud3ec\ucc29\ud574\uc57c \ud569\ub2c8\ub2e4. \uc774\ub294 \ubc14\ub78c\uc758 \ubc29\ud5a5, \uc801\uc758 \ubc29\uc2ec, \ub0b4\ubd80 \ud63c\ub780 \ub4f1\uacfc \uac19\uc740 \uc21c\uac04\uc801\uc778 \uae30\ud68c\ub97c \uc758\ubbf8\ud569\ub2c8\ub2e4. \n\n 4. \u8d77\u706b\u6709\u65e5: \ubd88\uc744 \uc77c\uc73c\ud0a4\uae30 \uc704\ud574\uc11c\ub294 **\ub0a0\uc528, \uae30\uc0c1 \uc870\uac74 \ub4f1 \uc7a5\uae30\uc801\uc778 '\ub0a0'**\uc744 \uace0\ub824\ud574\uc57c \ud569\ub2c8\ub2e4. \uc774\ub294 \ubc14\ub78c\uc774 \uac15\ud558\uac70\ub098 \uac74\uc870\ud55c \ub0a0\uc528 \ub4f1 \ud654\uacf5\uc758 \ud6a8\uacfc\ub97c \uadf9\ub300\ud654\ud560 \uc218 \uc788\ub294 \uc790\uc5f0\uc801 \uc870\uac74\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
