B.ayD=new A.a(" 1. \uc801\uc758 \uc0c1\ud0dc \ud30c\uc545: \uc801\uc758 \ud604\uc7ac \uc2ec\ub9ac\uc801, \ubb3c\uc9c8\uc801, \uc704\uce58\uc801 \uc0c1\ud0dc(\ud3b8\uc548\ud568, \ubc30\ubd80\ub984, \uc548\uc815)\ub97c \uc815\ud655\ud788 \ud30c\uc545\ud558\ub294 \uac83\uc774 \uc911\uc694\ud569\ub2c8\ub2e4.\n\n 2. \uc801\uc758 \uc0c1\ud0dc \uc5ed\uc774\uc6a9: \uc801\uc758 \uac15\uc810\ucc98\ub7fc \ubcf4\uc774\ub294 \uc0c1\ud0dc(\uc548\uc815)\ub97c \uc624\ud788\ub824 \uc5ed\uc774\uc6a9\ud558\uc5ec \uc57d\uc810(\ubd88\uc548, \uacb0\ud54d, \uc774\ub3d9)\uc73c\ub85c \uc804\ud658\uc2dc\ud0a4\ub294 \uc804\ub7b5\uc801 \uc0ac\uace0\uac00 \ud544\uc694\ud569\ub2c8\ub2e4.\n\n 3. \ub2a5\ub3d9\uc801 \uad50\ub780 \ubc0f \uc720\uc778: \uc544\uad70\uc774 \uc8fc\ub3c4\uc801\uc73c\ub85c \uc801\uc758 \uc2ec\ub9ac \uc0c1\ud0dc\ub97c \uad50\ub780\ud558\uace0, \uc6d0\ud558\ub294 \ubc29\ud5a5\uc73c\ub85c \uc801\uc744 \uc6c0\uc9c1\uc774\uac8c \ub9cc\ub4e4\uc5b4\uc57c \ud569\ub2c8\ub2e4. \uc218\ub3d9\uc801\uc73c\ub85c \uc801\uc758 \uc6c0\uc9c1\uc784\uc744 \uae30\ub2e4\ub9ac\ub294 \uac83\uc774 \uc544\ub2d9\ub2c8\ub2e4.\n\n 4. \uc804\uc7a5 \ud1b5\uc81c: \uc801\uc758 \uc6c0\uc9c1\uc784\uc744 \ud1b5\uc81c\ud558\uc5ec \uc544\uad70\uc5d0\uac8c \uc720\ub9ac\ud55c \uc804\uc7a5 \uc0c1\ud669\uc744 \ud615\uc131\ud558\ub294 \uac83\uc774 \ubaa9\ud45c\uc785\ub2c8\ub2e4.\n\n 5. \ub2e4\ucc28\uc6d0\uc801 \uacf5\uaca9: \ub2e8\uc21c\ud55c \ubb3c\ub9ac\uc801 \uacf5\uaca9\uc744 \ub118\uc5b4 \uc2ec\ub9ac, \ubcf4\uae09, \uc704\uce58 \ub4f1 \ub2e4\ucc28\uc6d0\uc801\uc73c\ub85c \uc801\uc744 \uc555\ubc15\ud558\uace0 \uad50\ub780\ud558\ub294 \uac83\uc774 \ud575\uc2ec\uc785\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
