B.as8=new A.a("'\uc774 \ubb38\uad6c\ub294 \uad70\ub300\uc758 \ub2e4\uc591\ud55c \ud589\ub3d9 \uc591\uc2dd\uc744 \uc790\uc5f0 \ud604\uc0c1\uc5d0 \ube44\uc720\ud558\uc5ec \uc720\uc5f0\ud55c \uc804\uc220 \ubcc0\ud654\uc640 \uc801\uc751\ub825\uc758 \uc911\uc694\uc131\uc744 \uc124\uba85\ud569\ub2c8\ub2e4. \uc774\ub294 \uc0c1\ud669\uc5d0 \ub530\ub77c \uadf9\uacfc \uadf9\uc744 \uc624\uac00\ub294 \ud0dc\uc138\ub97c \uac16\ucd94\uc5b4 \uc801\uc758 \uc608\uce21\uc744 \ubc97\uc5b4\ub098\uace0 \uc804\uc7a5\uc744 \uc644\ubcbd\ud558\uac8c \ud1b5\uc81c\ud558\ub294 \uac83\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4.\n\n'",null,B.a,null,B.c)
B.abu=new A.a(" 1. \u5176\u75be\u5982\u98a8 (\uc6c0\uc9c1\uc77c \ub54c\ub294 \ubc14\ub78c\ucc98\ub7fc \ube60\ub974\ub2e4):\n  \u2022 \uc758\ubbf8: \uad70\ub300\uc758 \uae30\ub3d9\ub825\uc774 \ubc14\ub78c\ucc98\ub7fc \ube68\ub77c\uc57c \ud568\uc744 \uac15\uc870\ud569\ub2c8\ub2e4. \uc774\ub294 \uc801\uc774 \uc608\uc0c1\uce58 \ubabb\ud55c \uc18d\ub3c4\ub85c \uae30\ub3d9\ud558\uc5ec \uc801\uc758 \ud5c8\ub97c \ucc0c\ub974\uace0, \uc801\uc5d0\uac8c \ub300\ube44\ud560 \uc2dc\uac04\uc744 \uc8fc\uc9c0 \uc54a\ub294 \uac83\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4.\n\n 2. \u5176\u5f90\u5982\u6797 (\uc870\uc6a9\ud788 \uc788\uc744 \ub54c\ub294 \uc232\ucc98\ub7fc \uace0\uc694\ud558\ub2e4): \n  \u2022 \uc758\ubbf8: \uad70\ub300\uac00 \uc228\uc8fd\uc5ec \uc6c0\uc9c1\uc774\uac70\ub098 \ub300\uae30\ud560 \ub54c\ub294 \uc232\ucc98\ub7fc \uace0\uc694\ud558\uace0 \uc740\ubc00\ud574\uc57c \ud568\uc744 \uac15\uc870\ud569\ub2c8\ub2e4. \uc774\ub294 \uc801\uc5d0\uac8c \uc544\uad70\uc758 \uc874\uc7ac\ub098 \uc758\ub3c4\ub97c \ub178\ucd9c\ud558\uc9c0 \uc54a\uace0, \uc644\ubcbd\ud558\uac8c \uc740\ubc00\uc131\uc744 \uc720\uc9c0\ud558\uba70 \uae30\ud68c\ub97c \uc5ff\ubcf4\ub294 \uac83\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4.\n\n 3. \u4fb5\u63a0\u5982\u706b (\uce68\ub7b5\ud560 \ub54c\ub294 \ubd88\uae38\ucc98\ub7fc \ub9f9\ub82c\ud558\ub2e4): \n  \u2022 \uc758\ubbf8: \uacf5\uaca9\uc744 \uac1c\uc2dc\ud558\uac70\ub098 \uc801\uc744 \uce68\ub7b5\ud560 \ub54c\ub294 \ubd88\uae38\ucc98\ub7fc \ub9f9\ub82c\ud558\uace0 \uc555\ub3c4\uc801\uc778 \uae30\uc138\ub85c \ub098\uc544\uac00\uc57c \ud568\uc744 \uac15\uc870\ud569\ub2c8\ub2e4. \uc774\ub294 \uc801\uc5d0\uac8c \uac15\ub825\ud55c \ucda9\uaca9\uc744 \uc8fc\uace0, \ub2e8\uc228\uc5d0 \uc801\uc758 \uc800\ud56d \uc758\uc9c0\ub97c \uaebe\ub294 \uac83\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4.\n\n 4. \u4e0d\u52d5\u5982\u5c71 (\uc6c0\uc9c1\uc774\uc9c0 \uc54a\uc744 \ub54c\ub294 \uc0b0\ucc98\ub7fc \ud754\ub4e4\ub9bc \uc5c6\ub2e4): \n  \u2022 \uc758\ubbf8: \uad70\ub300\uac00 \ubc29\uc5b4 \ud0dc\uc138\ub97c \uac16\ucd94\uac70\ub098 \uc6c0\uc9c1\uc774\uc9c0 \uc54a\uc744 \ub54c\ub294 \uc0b0\ucc98\ub7fc \uacac\uace0\ud558\uace0 \ud754\ub4e4\ub9bc \uc5c6\uc774 \uc548\uc815\uc801\uc774\uc5b4\uc57c \ud568\uc744 \uac15\uc870\ud569\ub2c8\ub2e4. \uc774\ub294 \uc801\uc758 \uc5b4\ub5a4 \ub3c4\ubc1c\uc774\ub098 \uacf5\uaca9\uc5d0\ub3c4 \ub3d9\uc694\ud558\uc9c0 \uc54a\uace0, \uc544\uad70\uc758 \uc704\uce58\uc640 \uacb0\uc758\ub97c \ud655\uace0\ud788 \uc720\uc9c0\ud558\ub294 \uac83\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
