B.a7P=new A.a(" 1. \uc720\uc5f0\ud55c \uc804\uc220 \ubcc0\ud654: \uc0c1\ud669\uc5d0 \ub530\ub77c \uc18d\ub3c4, \uc740\ubc00\uc131, \ub9f9\ub82c\ud568, \uacac\uace0\ud568 \ub4f1 \ub2e4\uc591\ud55c \ud589\ub3d9 \uc591\uc2dd\uc744 \uc790\uc720\uc790\uc7ac\ub85c \uc804\ud658\ud560 \uc218 \uc788\uc5b4\uc57c \ud569\ub2c8\ub2e4.\n\n 2. \uc608\uce21 \ubd88\uac00\ub2a5\uc131: \uc801\uc774 \uc544\uad70\uc758 \ub2e4\uc74c \uc6c0\uc9c1\uc784\uc744 \uc804\ud600 \uc608\uce21\ud560 \uc218 \uc5c6\uac8c \ub9cc\ub4e4\uc5b4 \ud56d\uc0c1 \uc801\uc758 \ud55c \uc218 \uc55e\uc11c\uc57c \ud569\ub2c8\ub2e4.\n\n 3. \uc0c1\ud669 \uc801\uc751: \uc8fc\uc5b4\uc9c4 \ud658\uacbd\uacfc \uc801\uc758 \uc0c1\ud0dc\uc5d0 \ub530\ub77c \ucd5c\uc801\uc758 \uc804\uc220\uc744 \uc120\ud0dd\ud558\uace0 \uc989\uc2dc \uc2e4\ud589\uc5d0 \uc62e\uae30\ub294 \ub2a5\ub825\uc774 \ud544\uc218\uc801\uc785\ub2c8\ub2e4.\n\n 4. \uc644\ubcbd\ud55c \ud1b5\uc81c: \uad70\ub300 \uc804\uccb4\uac00 \uc9c0\ud718\uad00\uc758 \uc758\ub3c4\ub300\ub85c \ube48\ud2c8\uc5c6\uc774 \uc6c0\uc9c1\uc774\uace0 \uba48\ucd94\uba70, \uacf5\uaca9\ud558\uace0 \ubc29\uc5b4\ud560 \uc218 \uc788\ub294 \ud1b5\uc81c\ub825\uc774 \uc694\uad6c\ub429\ub2c8\ub2e4.\n\n 5. \ud5c8\uc2e4(\u865b\u5be6)\uc758 \uc2ec\ud654: \uc544\uad70\uc758 \uac15\uc810(\uc2e4)\uacfc \uc57d\uc810(\ud5c8)\uc744 \uc0c1\ud669\uc5d0 \ub9de\ucdb0 \ub4dc\ub7ec\ub0b4\uac70\ub098 \uc228\uae30\uba70, \uc801\uc744 \uad50\ub780\ud558\uc5ec \uc2b9\ub9ac\ud558\ub294 \uace0\ub3c4\uc758 \uae30\ub9cc \uc804\uc220\uc744 \uad6c\uc0ac\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
