B.awd=new A.a("\uc190\uc790\ubcd1\ubc95 \ubcd1\uc138(\u5175\u52e2)\ud3b8\uc5d0\uc11c\ub294 \uc804\uc7c1(\uacbd\uc7c1)\uc740 \uaddc\ubaa8\uc5d0 \uad00\uacc4\uc5c6\uc774 \ubcf8\uc9c8\uc801\uc778 \uc6d0\ub9ac\ub294 \ub3d9\uc77c\ud558\uba70, \uc815\uacf5\ubc95\uacfc \uae30\uc2b5\uc758 \uc870\ud654, \ud5c8\uc2e4\uc758 \ud65c\uc6a9, \uadf8\ub9ac\uace0 \uc555\ub3c4\uc801\uc778 \ud615\uc138 \uad6c\ucd95\uc774 \uc2b9\ub9ac\uc758 \ud575\uc2ec\uc784\uc744 \uac15\uc870\ud569\ub2c8\ub2e4. \ub610\ud55c, \ud63c\ub780, \ub450\ub824\uc6c0, \uc57d\ud568\uc740 \uc624\ud788\ub824 \uc9c8\uc11c, \uc6a9\uae30, \uac15\ud568 \uc18d\uc5d0\uc11c \ubc1c\uc0dd\ud560 \uc218 \uc788\uc74c\uc744 \ud1b5\ucc30\ud558\uba70, \uc801\uc744 \uc720\uc778\ud558\uace0 \uae30\ud68c\ub97c \ud3ec\ucc29\ud558\ub294 \uc720\uc5f0\ud55c \uc804\ub7b5\uc758 \uc911\uc694\uc131\uc744 \uc5ed\uc124\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.t)
B.ari=new A.a(" \u2022\t\ub300\uaddc\ubaa8 \uc870\uc9c1 \uad00\ub9ac\uc758 \uc6d0\ub9ac: \ub9ce\uc740 \ubcd1\ub825\uc744 \ud1b5\uc194\ud558\ub294 \uac83\uc740 \uc18c\uc218\uc758 \ubcd1\ub825\uc744 \ub2e4\ub8e8\ub294 \uac83\uacfc \ub2e4\ub974\uc9c0 \uc54a\uc73c\uba70, \uc774\ub294 \ud3b8\uc81c\uc640 \ubd84\ud560(\u5206\u6578)\uc744 \ud1b5\ud574 \uac00\ub2a5\ud569\ub2c8\ub2e4. \ub610\ud55c, \ub300\uaddc\ubaa8 \ubcd1\ub825\uc744 \uc804\ud22c\uc5d0 \ud22c\uc785\ud558\ub294 \uac83\uc740 \uc18c\uaddc\ubaa8 \ubcd1\ub825\uc744 \uc2f8\uc6b0\uac8c \ud558\ub294 \uac83\uacfc \uac19\uc73c\uba70, \uc774\ub294 \uba85\uce6d\uacfc \ubd80\ud638(\u5f62\u540d)\ub97c \ud1b5\ud574 \ud1b5\uc81c\ub429\ub2c8\ub2e4.\n\n \u2022\t\uc815\uacf5\ubc95\uacfc \uae30\uc2b5\uc758 \uc870\ud654: \uc2b9\ub9ac\ub294 \uc815\uacf5\ubc95(\u6b63)\uc73c\ub85c \uc801\uacfc \ub9de\uc11c\uace0, \uae30\uc2b5(\u5947)\uc73c\ub85c \uacb0\uc815\uc801\uc778 \uc2b9\ub9ac\ub97c \uac70\ub450\ub294 \ub370\uc11c \uc635\ub2c8\ub2e4. \uc544\uad70\uc774 \ud328\ubc30\ud558\uc9c0 \uc54a\uace0 \ubc18\ub4dc\uc2dc \uc801\uacfc \ub9de\uc11c\uac8c \ud560 \uc218 \uc788\ub294 \uac83\uc740 \ubc14\ub85c \uc774 \uae30\uc815\uacfc \uc815\ubcd1\uc758 \uc6b4\uc6a9\uc5d0 \uc788\uc2b5\ub2c8\ub2e4.\n\n \u2022\t\ud5c8\uc2e4\uc758 \ud65c\uc6a9: \uc57d\ud55c \uc801\uc744 \uac15\ud55c \uac83\uc73c\ub85c \uc774\uae30\ub294 \uac83\uc740 \ub9c8\uce58 \u2018\uc22b\ub3cc\ub85c \uacc4\ub780\uc744 \ub358\uc9c0\ub294 \uac83(\u5982\u4ee5\u78aa\u6295\u5375\u8005)\u2019\uacfc \uac19\uc2b5\ub2c8\ub2e4. \uc774\ub294 \uc801\uc758 \ud5c8(\u865b)\ub97c \ucc14\ub7ec \uc2e4(\u5be6)\ub85c \uacf5\uaca9\ud558\ub294 \ud5c8\uc2e4(\u865b\u5be6)\uc758 \uc6d0\ub9ac\ub97c \uc758\ubbf8\ud569\ub2c8\ub2e4.\n\n \u2022\t\ud615\uc138(\u52e2)\uc640 \uc808\ub3c4(\u7bc0)\uc758 \uc911\uc694\uc131: \ube60\ub974\uace0 \ub9f9\ub82c\ud55c \ubb3c\uc0b4\uc774 \ubc14\uc704\ub97c \uc4f8\uc5b4\ubc84\ub9ac\ub294 \uac83\uc740 \ud615\uc138(\u52e2)\uc758 \ud798\uc774\uba70, \ub9f9\ub82c\ud55c \uc0c8\uac00 \ubaa9\ud45c\ub97c \ubd80\ub7ec\ub728\ub9ac\ub294 \uac83\uc740 \uc808\ub3c4(\u7bc0)\uc758 \uc815\ud655\uc131 \ub54c\ubb38\uc785\ub2c8\ub2e4. \uc555\ub3c4\uc801\uc778 \ud798\uacfc \uc815\ud655\ud55c \ud0c0\uc774\ubc0d\uc774 \uc2b9\ub9ac\ub97c \uacb0\uc815\ud569\ub2c8\ub2e4.\n\n \u2022\t\uc5ed\uc124\uc801 \ud1b5\ucc30: \ud63c\ub780\uc740 \uc9c8\uc11c\uc5d0\uc11c \uc0dd\uae30\uace0(\u4e82\u751f\u65bc\u6cbb), \ub450\ub824\uc6c0\uc740 \uc6a9\uae30\uc5d0\uc11c \uc0dd\uae30\uba70(\u602f\u751f\u65bc\u52c7), \uc57d\ud568\uc740 \uac15\ud568\uc5d0\uc11c \uc0dd\uae34\ub2e4(\u5f31\u751f\u65bc\u5f3a)\ub294 \uc5ed\uc124\uc801 \ud1b5\ucc30\uc744 \ud1b5\ud574, \uac89\uc73c\ub85c \ubcf4\uc774\ub294 \ud604\uc0c1\uc758 \uc774\uba74\uc744 \uaff0\ub6ab\uc5b4 \ubcf4\uace0 \uc57d\uc810\uc744 \ucc3e\uc544\ub0b4\uc57c \ud569\ub2c8\ub2e4.\n\n \u2022\t\uc774\uc775\uc744 \ud1b5\ud55c \uc720\uc778 \ubc0f \uae30\ud68c \ud3ec\ucc29: \uc774\uc775(\u5229)\uc73c\ub85c \uc801\uc744 \uc720\uc778\ud558\uace0, \uc900\ube44\ub41c \ubcd1\ub825(\u5352)\uc73c\ub85c \uc801\uc744 \uae30\ub2e4\ub9ac\uba70(\u5f85) \uacb0\uc815\uc801\uc778 \uae30\ud68c\ub97c \ud3ec\ucc29\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
