B.a79=new A.a("\uc6b0\ub9ac\ub294 \uc870\uc9c1\uc744 \uc138\ubd84\ud654\ud558\uace0 \uba85\ud655\ud55c \uc9c0\uce68\uc73c\ub85c \ub300\uad70\uc744 \uc18c\uc218\ucc98\ub7fc \uc6b4\uc6a9\ud55c\ub2e4. \uc801\uc758 \ub300\uaddc\ubaa8 \ubcd1\ub825\uc740 \uc6b0\ub9ac\uc758 \uc815\uad50\ud55c \ud615\ud0dc\ub85c \uc778\ud574 \uc18c\uc218\ucc98\ub7fc \ub290\uaef4\uc9c8 \uac83\uc774\ub2e4. \uc815\uba74\uc73c\ub85c \ub300\uce58\ud558\uba70 \uc801\uc744 \ubb36\uc5b4\ub450\uace0, \uc608\uce21 \ubd88\uac00\ub2a5\ud55c \uae30\uc2b5\uc73c\ub85c \uc2b9\ub9ac\ud558\ub77c! \uc801\uc744 \uc6b0\ub9ac \uc758\ub3c4\ub300\ub85c \uc6c0\uc9c1\uc774\uac8c \ud558\uba74\uc11c\ub3c4 \uc544\uad70\uc740 \uc190\uc2e4 \uc5c6\uc774! \uac15\uc810\uc744 \ub9f7\ub3cc\ucc98\ub7fc \ubaa8\uc544 \uc801\uc758 \ud5c8\uc810\uc744 \uacc4\ub780\ucc98\ub7fc \ubd80\uc234\ub77c. \uc774\uc775\uc73c\ub85c \uc801\uc744 \uc720\uc778\ud558\uace0, \uc644\ubcbd\ud558\uac8c \uc900\ube44\ub41c \uc804\ub825\uc73c\ub85c \uae30\ub2e4\ub824 \uc12c\uba78\ud558\ub77c! \uae09\ub958\ucc98\ub7fc \uc555\ub3c4\uc801\uc778 \uae30\uc138\ub85c \uc801\uc744 \uc4f8\uc5b4\ubc84\ub9ac\uace0, \ub9f9\uae08\ub958\ucc98\ub7fc \uacb0\uc815\uc801\uc778 \uc21c\uac04\uc5d0 \uce58\uba85\ud0c0\ub97c \uac00\ud558\ub77c. \uae30\uc5b5\ud558\ub77c, \uc801\uc758 \ud1b5\uc81c\ub294 \ud63c\ub780\uc73c\ub85c, \uc6a9\ub9f9\uc740 \ub450\ub824\uc6c0\uc73c\ub85c, \uac15\ud568\uc740 \uc57d\uc810\uc73c\ub85c \ubcc0\ubaa8\uc2dc\ud0ac \uc218 \uc788\ub2e4!\n\u2022\t\uc694\uc57d: \ud604\ub300 \uad70\ub300\ub294 \ub300\uaddc\ubaa8 \ubcd1\ub825\uc744 \ud6a8\uc728\uc801\uc73c\ub85c \ud1b5\uc81c\ud558\uace0, \uc801\uc758 \uc2ec\ub9ac\ub97c \uc77d\uc5b4 \uae30\ub9cc \uc804\uc220\uc744 \uad6c\uc0ac\ud558\uba70, \uac15\uc810\uc744 \uc9d1\uc911\ud558\uc5ec \uc57d\uc810\uc744 \ud0c0\uaca9\ud558\uace0, \uc555\ub3c4\uc801\uc778 \uae30\uc138\uc640 \uc815\ud655\ud55c \ud0c0\uc774\ubc0d\uc73c\ub85c \uc2b9\ub9ac\ud558\ub294 \ub370 \uc911\uc810\uc744 \ub461\ub2c8\ub2e4. \uc774\ub294 \uc801\uc758 \uc8fc\ub825\uc744 \uc815\uba74\uc73c\ub85c \uc0c1\ub300\ud558\uae30\ubcf4\ub2e4, \uadf8\ub4e4\uc758 \uc57d\uc810\uc744 \ucc3e\uc544\ub0b4\uc5b4 \ub9c8\ube44\uc2dc\ud0b4\uc73c\ub85c\uc368 \uc804\uc7c1\uc758 \uc2b9\ud328\ub97c \uacb0\uc815\uc9d3\uc2b5\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
B.a6O=new A.a("\uc218\ub9cc \uba85\uc758 \uc9c1\uc6d0\uc744 \uc18c\uc218\ucc98\ub7fc \uad00\ub9ac\ud558\uae30 \uc704\ud574 \ubd80\uc11c\ub97c \uc138\ubd84\ud654\ud558\uace0 \uba85\ud655\ud55c \ud504\ub85c\uc138\uc2a4\ub97c \uad6c\ucd95\ud558\ub77c. \uac70\ub300 \uc2dc\uc7a5\uc758 \uacbd\uc7c1\uc0ac\ub97c \uc0c1\ub300\ud560 \ub54c, \uc6b0\ub9ac\uc758 \ucc28\ubcc4\ud654\ub41c \uc0ac\uc5c5 \uad6c\uc870\uc640 \ube0c\ub79c\ub4dc\ub85c \uc18c\uc218\ucc98\ub7fc \uacbd\uc7c1\ud558\ub77c. \uae30\ubcf8 \uacbd\uc7c1\ub825\uc73c\ub85c \uc2dc\uc7a5\uc5d0 \uc9c4\uc785\ud558\uace0, \ud601\uc2e0\uc73c\ub85c \uacbd\uc7c1\uc5d0\uc11c \uc2b9\ub9ac\ud558\ub77c! \uacbd\uc7c1\uc0ac\ub97c \uc6b0\ub9ac \uc804\ub7b5\uc5d0 \ubb36\uc5b4\ub450\uba74\uc11c\ub3c4 \uc6b0\ub9ac\ub294 \uc190\uc2e4 \uc5c6\uc774 \uc2dc\uc7a5\uc744 \uc7a5\uc545\ud558\ub77c! \uc6b0\ub9ac\uc758 \ud575\uc2ec \uc5ed\ub7c9\uc744 \ub9f7\ub3cc\ucc98\ub7fc \ud65c\uc6a9\ud558\uc5ec \uacbd\uc7c1\uc0ac\uc758 \uc2dc\uc7a5 \uc57d\uc810\uc744 \uacc4\ub780\ucc98\ub7fc \uae68\ub728\ub824\ub77c. \uace0\uac1d\uc5d0\uac8c \ub9e4\ub825\uc801\uc778 \ud61c\ud0dd\uc73c\ub85c \uad6c\ub9e4\ub97c \uc720\ub3c4\ud558\uace0, \uc644\ubcbd\ud55c \uc81c\ud488\uacfc \uc11c\ube44\uc2a4\ub85c \uace0\uac1d \ub9cc\uc871\uc744 \uc774\ub04c\uc5b4\ub0b4\ub77c! \uc555\ub3c4\uc801\uc778 \uc2dc\uc7a5 \uc7a5\uc545\ub825\uc73c\ub85c \uacbd\uc7c1\uc0ac\ub97c \uad74\ubcf5\uc2dc\ud0a4\uace0, \uacb0\uc815\uc801\uc778 \uc2dc\uc810\uc5d0 \ud575\uc2ec \uc804\ub7b5\uc73c\ub85c \uacbd\uc7c1 \uc6b0\uc704\ub97c \ud30c\uad34\ud558\ub77c. \uba85\uc2ec\ud558\ub77c, \uacbd\uc7c1\uc0ac\uc758 \ucca0\uc800\ud55c \uc2dc\uc7a5 \ud1b5\uc81c\ub294 \ud63c\ub780\uc744, \uacfc\uac10\ud55c \ud22c\uc790\ub294 \ub450\ub824\uc6c0\uc744, \ub9c9\uac15\ud55c \ube0c\ub79c\ub4dc \ud30c\uc6cc\ub294 \uc228\uaca8\uc9c4 \uc57d\uc810\uc744 \uc57c\uae30\ud560 \uc218 \uc788\ub2e4!\n\u2022\t\uc694\uc57d: \uae30\uc5c5\uc740 \ud6a8\uc728\uc801\uc778 \uc870\uc9c1 \uad00\ub9ac\uc640 \uba85\ud655\ud55c \ube0c\ub79c\ub529\uc744 \ud1b5\ud574 \uaddc\ubaa8\uc758 \uc81c\uc57d\uc744 \uadf9\ubcf5\ud558\uace0, \uc2dc\uc7a5\uc758 \ud45c\uc900 \uc804\ub7b5\uacfc \ud30c\uad34\uc801\uc778 \ud601\uc2e0\uc744 \uacb0\ud569\ud558\uc5ec \uacbd\uc7c1\uc0ac\ub97c \uc555\ub3c4\ud574\uc57c \ud569\ub2c8\ub2e4. \uc18c\ube44\uc790\uc758 \uc695\ub9dd\uc744 \uc790\uadf9\ud558\uc5ec \uc2dc\uc7a5\uc744 \uc720\uc778\ud558\uace0, \uc790\uc0ac\uc758 \uac15\uc810\uc744 \uacbd\uc7c1\uc0ac\uc758 \uc57d\uc810\uc5d0 \uc9d1\uc911 \ud22c\uc0ac\ud558\uba70, \uc2dc\uc7a5\uc758 \ud750\ub984\uacfc \ud0c0\uc774\ubc0d\uc744 \ub193\uce58\uc9c0 \uc54a\uc544\uc57c \ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
B.ahE=new A.a("\uc218\uc2ed \uba85\uc758 \uc120\uc218\ub2e8\uc744 \uc18c\uc218\ucc98\ub7fc \uc774\ub04c\uae30 \uc704\ud574 \ud3ec\uc9c0\uc158\uc744 \ubd84\ub2f4\ud558\uace0 \uba85\ud655\ud55c \uc804\uc220 \ub8f0\uc744 \uc801\uc6a9\ud558\ub77c. \ub9c9\uac15\ud55c \uc0c1\ub300 \ud300\uacfc \uc2f8\uc6b8 \ub54c, \uc6b0\ub9ac\uc758 \uc720\uae30\uc801\uc778 \ud3ec\uba54\uc774\uc158\uacfc \uc5ed\ud560 \ubd84\ub2f4\uc73c\ub85c \uc57d\ud300\uacfc \uc2f8\uc6b0\ub4ef \ud6a8\uc728\uc801\uc73c\ub85c \ub300\uc751\ud558\ub77c. \uae30\ubcf8 \uc804\uc220\ub85c \uacbd\uae30\uc5d0 \uc784\ud558\uace0, \uc608\uc0c1\uce58 \ubabb\ud55c \ubcc0\uce59 \ud50c\ub808\uc774\ub85c \uc2b9\ub9ac\ud558\ub77c! \uc0c1\ub300 \ud300\uc744 \uc6b0\ub9ac \uc804\uc220\uc5d0 \ub04c\uc5b4\ub4e4\uc774\uba74\uc11c\ub3c4 \uc6b0\ub9ac\ub294 \uc2e4\uc810 \uc5c6\uc774 \uacbd\uae30\ub97c \uc9c0\ubc30\ud558\ub77c! \uc6b0\ub9ac \ud300\uc758 \uac15\uc810\uc744 \ub9f7\ub3cc\ucc98\ub7fc \ud65c\uc6a9\ud558\uc5ec \uc0c1\ub300 \ud300\uc758 \uc804\uc220\uc801 \uc57d\uc810\uc744 \uacc4\ub780\ucc98\ub7fc \ubd80\uc234\ub77c. \uc0c1\ub300\uc5d0\uac8c \uc720\ud639\uc801\uc778 \uacf5\uac04\uc744 \uc5f4\uc5b4\uc8fc\uc5b4 \uacf5\uaca9\ud558\uac8c \ud558\uace0, \uc644\ubcbd\ud558\uac8c \uc900\ube44\ub41c \uc218\ube44 \uc804\uc220\ub85c \uae30\ub2e4\ub824 \uc5ed\uc2b5\ud558\ub77c! \uc555\ub3c4\uc801\uc778 \uacbd\uae30 \uc9c0\ubc30\ub825\uc73c\ub85c \uc0c1\ub300\ub97c \uad74\ubcf5\uc2dc\ud0a4\uace0, \uacb0\uc815\uc801\uc778 \uc21c\uac04\uc5d0 \ud575\uc2ec \ud50c\ub808\uc774\ub85c \uc0c1\ub300\ub97c \ubb34\ub108\ub728\ub824\ub77c. \uc78a\uc9c0 \ub9c8\ub77c, \uc0c1\ub300 \ud300\uc758 \uacac\uace0\ud55c \uc870\uc9c1\ub825\uc740 \uade0\uc5f4\uc744, \uacfc\uac10\ud55c \uacf5\uaca9\uc740 \ud5c8\uc810\uc744, \ub9c9\uac15\ud55c \uc5d0\uc774\uc2a4\ub294 \uc57d\uc810\uc744 \ub178\ucd9c\ud560 \uc218 \uc788\ub2e4!\n\u2022\t\uc694\uc57d: \uc2a4\ud3ec\uce20 \ud300\uc740 \ud6a8\uc728\uc801\uc778 \uc120\uc218 \uad00\ub9ac\uc640 \uba85\ud655\ud55c \uc5ed\ud560 \ubd84\ub2f4\uc73c\ub85c \uc870\uc9c1\ub825\uc744 \uadf9\ub300\ud654\ud558\uace0, \uae30\ubcf8 \uc804\uc220\uacfc \ucc3d\uc758\uc801\uc778 \ubcc0\uce59 \ud50c\ub808\uc774\ub97c \uc870\ud569\ud558\uc5ec \uacbd\uae30\uc758 \uc8fc\ub3c4\uad8c\uc744 \uc7a1\uc544\uc57c \ud569\ub2c8\ub2e4. \uc0c1\ub300\uc758 \ud5c8\uc810\uc744 \uc720\ub3c4\ud558\uace0, \uc6b0\ub9ac \ud300\uc758 \uac15\uc810\uc744 \uadf8\uacf3\uc5d0 \uc9d1\uc911 \ud22c\uc0ac\ud558\uba70, \uacbd\uae30 \ud750\ub984\uacfc \ud0c0\uc774\ubc0d\uc744 \uc815\ud655\ud788 \ud30c\uc545\ud558\uc5ec \uc2b9\ub9ac\ub97c \uc7c1\ucde8\ud574\uc57c \ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
