B.aqf=new A.a("\u318d \u51e1(f\xe1n): Generally, in general \n\u318d \u7528\u5175\u4e4b\u6cd5(y\xf2ng b\u012bng zh\u012b f\u01ce): Principles of warfare, the way of waging war \n\u318d \u5168\u570b\u7232\u4e0a(qu\xe1n gu\xf3 w\xe9i sh\xe0ng): The highest strategy is to preserve the enemy nation intact and induce its surrender. \n\u318d \u7834\u570b\u6b21\u4e4b(p\xf2 gu\xf3 c\xec zh\u012b): Destroying the nation to achieve victory is secondary (a less ideal option)\n\n",null,B.a,null,B.c)
B.a6A=new A.a("\u201cThe best way in war is to subdue the enemy's country without destroying it. Defeating the enemy through combat is a secondary option. If possible, 'winning without fighting' is the supreme strategy.\u201d",null,B.a,null,B.c)
