B.aoa=new A.a("1.\tMinimum Loss, Maximum Gain: The essence of war is not destruction but maximizing one's national interests. To achieve this, it is crucial to avoid unnecessary destruction and preserve enemy resources for one's own use. \n\n2.\tSuperiority of Diplomacy and Psychological Warfare: Inducing the enemy's surrender through non-military means such as diplomacy, strategic pressure, deception, and psychological warfare is the best strategy, rather than direct armed conflict. \n\n3.\tSustainable Victory: Victory through destruction may be short-term, but victory through complete absorption brings long-term stability and benefits. This is wisdom considering the reconstruction costs and governance efficiency after occupation. \n\n4.\tEfficient Resource Utilization: By preserving enemy lives and materials, one can reduce the consumption of one's own resources and, furthermore, pursue the efficiency of converting enemy resources into one's own. \n\n",null,B.a,null,B.c)
