B.aky=new A.a("\ud83d\udcda 11: The Nine Situations(\u4e5d\u5730) \u2013 7\n",null,B.a,null,B.m)
B.ayb=new A.a("  \u2022 \u5728\u65bc(z\xe0i y\xfa): Lies in. \n  \u2022 \t\u9806(sh\xf9n): To conform to, to adapt to. \n  \u2022 \u8a73(xi\xe1ng): To examine in detail, to know precisely. \n  \u2022 \u6575\u4e4b\u610f(d\xed zh\u012b y\xec): Enemy's intention. \n  \u2022 \u5e77\u6575(b\xecng d\xed): To consolidate the enemy / to bind them into one. \n  \u2022 \u4e00\u5411(y\u012b xi\xe0ng): In one direction. \n  \u2022 \u5343\u91cc(qi\u0101n l\u01d0): A thousand li (a very long distance). \n  \u2022 \u6bba\u5c07(sh\u0101 ji\xe0ng): To kill the enemy general. \n  \u2022 \u5de7\u80fd(qi\u01ceo n\xe9ng): Skillful ability / dexterity. \n  \u2022 \u6210\u4e8b\u8005(ch\xe9ng sh\xec zh\u011b): One who accomplishes things. \n\n",null,B.a,null,B.c)
B.a9U=new A.a("\u201cIt lies in conforming to and thoroughly understanding the enemy's intentions, consolidating the enemy into one direction, and killing the general from a thousand li away. This is called one who skillfully accomplishes things.\u201d",null,B.a,null,B.c)
