B.aok=new A.a("This passage describes the most excellent strategist in three stages. \n\n",null,B.a,null,B.c)
B.avY=new A.a(" 1.\t\u5728\u65bc\u9806\u8a73\u6575\u4e4b\u610f: Thoroughly and deeply understands the enemy's thoughts, plans, weaknesses, etc. Beyond mere knowing, they make the enemy move according to their own intentions by seemingly 'conforming' to what the enemy wants, while actually deceiving them. This is the pinnacle of information warfare and psychological warfare. \n\n 2.\t\u5e77\u6575\u4e00\u5411: After understanding the enemy's intentions, they exploit them by concentrating or luring the enemy's forces or attention in a specific direction of their choosing. This neutralizes the enemy's main force or isolates them at a particular point. \n\n 3.\t\u5343\u91cc\u6bba\u5c07: After luring the enemy in the desired direction, they achieve a decisive objective (eliminating the enemy general) from a distance. Here, 'killing the general from a thousand li away' is a metaphorical expression not only for direct physical attack but also for achieving intangible strategic goals such as paralyzing the enemy's core command system or inflicting fatal damage on their leadership. \n\n 4.\t\u5de7\u80fd\u6210\u4e8b\u8005\u4e5f: Successfully completing this series of processes is not merely achieved by numerical superiority or brute force, but is only possible for someone with extraordinary wisdom, insight, and the ability to subtly manipulate situations. \n\n",null,B.a,null,B.c)
