B.a6I=new A.a("  \u2022 \u9867\u9675\u52ff\u5411(g\xf9 l\xedng w\xf9 xi\xe0ng): \u9867 (look back), \u9675 (hill), \u52ff\u5411 (do not face)\n   \u2022 \u80cc\u4e18\u52ff\u9006(b\xe8i qi\u016b w\xf9 n\xec): \u80cc\u4e18 (army with back to a hill), \u52ff\u9006 (do not oppose)\n   \u2022 \u4f6f\u80cc\u52ff\u5f9e(y\xe1ng b\xe8i w\xf9 c\xf3ng): \u4f6f\u80cc (feigned retreat), \u52ff\u5f9e (do not pursue)\n   \u2022 \u92b3\u5352\u52ff\u653b(ru\xec z\xfa w\xf9 g\u014dng): \u92b3\u5352 (eager/sharp soldiers), \u52ff\u653b (do not attack)\n  \u2022 \u990c\u5175\u52ff\u98df(\u011br b\u012bng w\xf9 sh\xed): \u990c\u5175 (bait troops), \u52ff\u98df (do not bite/take the bait)\n  \u2022 \u6b78\u5e2b\u52ff\u904f(gu\u012b sh\u012b w\xf9 \xe8): \u6b78\u5e2b (returning army), \u52ff\u904f (do not obstruct)\n  \u2022 \u570d\u5e2b\u5fc5\u95d5(w\xe9i sh\u012b b\xec qu\u0113): \u570d\u5e2b (besieged army), \u5fc5\u95d5 (must leave a gap)\n  \u2022 \u7aae\u5bc7\u52ff\u8febqi\xf3ng k\xf2u w\xf9 p\xf2): \u7aae\u5bc7 (cornered enemy), \u52ff\u8feb (do not press too hard)  \n\n",null,B.a,null,B.c)
B.akd=new A.a("\u201cDo not engage an enemy with his back to a hill, and do not pursue a retreating enemy as it may be a trap. Avoid frontal clashes with high-spirited soldiers, and be wary of bait tactics. Do not obstruct an army returning home, and when besieging an enemy, always leave an escape route. Do not press too hard on a cornered foe who fights to the last.\u201d\n ",null,B.a,null,B.c)
