B.awT=new A.a("This phrase presents wise response strategies in war (or competition) that avoid reckless actions, considering the enemy's characteristics and situation: 'avoid what should be avoided, lure what should be lured, and open a way for survival.' This is a military principle close to 'benevolent governance (\u4ec1\u653f),' aiming for victory while minimizing our own losses. \n\n",null,B.a,null,B.c)
B.a5v=new A.a("1.\t\u9867\u9675\u52ff\u5411 \u80cc\u4e18\u52ff\u9006 (Do not attack an enemy relying on a hill, and do not counter-attack an enemy with his back to a hill):\n\u2022\tMeaning: Do not attack when the enemy is using advantageous terrain (a hill) to establish a defensive posture (\u9867\u9675), and do not directly attack an enemy who has taken a last stand (\u80cc\u4e18) and intends to fight desperately, thereby provoking their desperate resistance.\n\n 2.\t\u4f6f\u80cc\u52ff\u5f9e \u92b3\u5352\u52ff\u653b (Do not pursue an enemy who feigns retreat, and do not attack sharp soldiers):\n\u2022\tMeaning: Do not fall into a trap (\u4f6f\u80cc) where the enemy feigns retreat to lure you (\u52ff\u5f9e), and avoid direct confrontation (\u52ff\u653b) with the enemy's elite soldiers (\u92b3\u5352) who are high-spirited and well-trained (\u92b3). \n\n 3.\t\u990c\u5175\u52ff\u98df \u6b78\u5e2b\u52ff\u904f (Do not bite at bait troops, and do not obstruct a returning army):\n\u2022\tMeaning: Do not take the bait (\u52ff\u98df) when the enemy uses some troops as bait (\u990c\u5175) to lure you, and do not unnecessarily provoke battle by blocking (\u52ff\u904f) an enemy army (\u6b78\u5e2b) returning to their base (\u6b78\u5e2b) after avoiding combat. This refers to the wisdom of not being swayed by the enemy's intentions and avoiding unnecessary clashes.\n\n 4.\t\u570d\u5e2b\u5fc5\u95d5 \u7aae\u5bc7\u52ff\u8feb (When besieging an enemy, you must leave a gap; do not press a cornered foe too hard):\n\u2022\tMeaning: This is the most important principle: even when completely besieging the enemy (\u570d\u5e2b), always leave one side open (\u5fc5\u95d5) to provide an escape route, and do not press too hard (\u52ff\u8feb) a cornered foe (\u7aae\u5bc7) who intends to resist desperately. This is because when escape routes are blocked, the enemy may fight desperately, like a rat biting a cat, leading to greater losses for our side. The goal is to open a path for survival, breaking their will to resist and inducing them to flee willingly. \n\n ",null,B.a,null,B.c)
