B.aAl=new A.a(" 1.\tAvoiding Reckless Frontal Clashes: When the enemy has strong advantages or a strong will to resist desperately, avoid frontal clashes to prevent unnecessary losses to our forces.\n\n  2.\tDiscerning Traps and Lures: A cool judgment is required to not be fooled by the enemy's feigned retreats or bait strategies, and to discern their true intentions.\n\n  3.\tUtilizing Enemy Psychology: When the enemy is cornered, open an escape route to prevent desperate resistance, and exercise the wisdom to win while minimizing our losses. This is the paradoxical strategy of 'opening a path to death to gain a path to life.'\n\n  4.\tMinimizing Our Losses: While victory is important, minimizing sacrifices for our side in the process is emphasized as an even greater victory.\n\n  5.\tFlexible and Realistic Responses: It is important not to be bound by fixed tactics, but to flexibly adapt to the enemy's situation and psychological state.\n\n ",null,B.a,null,B.c)
