B.ap9=new A.a("The Nine Variations chapter of Sun Tzu's Art of War encompasses core ideas such as the flexibility of strategic judgment, accurate perception of terrain and situation, exploitation of the enemy's psychological weaknesses, and proactive defense and maintaining initiative. \n\n",null,B.a,null,B.t)
B.ab_=new A.a("It emphasizes the importance of wise choices beyond mere power struggles, appropriate responses to situations, securing psychological advantage, and autonomous and responsible leadership. \n\n",null,B.a,null,B.c)
B.avG=new A.a(" 1.\tStrategic Wisdom of 'Non-Action' (\u4e0d\u7232): There is no need to follow every path, attack every enemy army, capture every city, or contest every piece of ground. It emphasizes the commander's strategic judgment and flexibility to sometimes not obey even the sovereign's command if it is disadvantageous in light of the current situation. This means the importance of selection and concentration, avoiding unnecessary attrition and focusing on core objectives. \n\n 2.\tOptimal Action Based on Environment: Do not linger in isolated ground (\u572e\u5730); unite forces in strategic ground (\u8862\u5730); pass quickly through difficult terrain (\u7d76\u5730); devise wise strategies to break through when surrounded (\u570d\u5730); and fight desperately when in death ground (\u6b7b\u5730) with no retreat. This requires flexibility and decisiveness to apply the optimal course of action according to various geographical features and battlefield situations. \n\n 3.\tWise Person's Recognition of Duality: A wise person's thoughts must always be mixed with 'benefit (\u5229)' and 'harm (\u5bb3)'. Any decision has gains and losses, and opportunities come with risks. Therefore, one should not just pursue simple gains but must also comprehensively consider potential losses and risks and make a cold judgment. \n\n 4.\tProactive Defense and Unceasing Self-Strengthening (\u81ea\u5f3a\u4e0d\u606f): Do not rely on the vague expectation that the enemy will not attack; rather, trust in our own forces being in an unassailable state. This emphasizes that true defensive strategy is not passively waiting for the enemy's actions but proactively strengthening our own capabilities and defensive system. \n\n 5.\tLeveraging Opponent's Psychology and Dispositions (\u5fc5\u6b7b\u53ef\u6bba\u4e5f \u5fc5\u751f\u53ef\u865c\u4e5f \u5fff\u901f\u53ef\u4fae\u4e5f \u5ec9\u6f54\u53ef\u8fb1\u4e5f \u611b\u6c11\u53ef\u7169\u4e5f): This demonstrates the importance of sophisticated psychological warfare strategies that identify and exploit the specific psychological weaknesses or dispositions of enemy commanders or soldiers. \n    \u2022  Those determined to die (\u5fc5\u6b7b) act recklessly, so one can seize the opportunity to kill them (\u53ef\u6bba\u4e5f) \n   \u2022  Those who wish to live (\u5fc5\u751f) can be captured to avoid death (\u53ef\u865c\u4e5f). \n   \u2022  Those who are quick to anger (\u5fff\u901f) lose their composure to provocation, so they can be insulted (\u53ef\u4fae\u4e5f) and defeated. \n   \u2022  Those who are incorruptible and value honor (\u5ec9\u6f54) can be disgraced (\u53ef\u8fb1\u4e5f) to unsettle them. \n   \u2022  Those who love their people (\u611b\u6c11) are sensitive to their people's suffering, so this can be used to trouble them (\u53ef\u7169\u4e5f). \n",null,B.a,null,B.c)
