B.ajA=new A.a(" 1.\t\u884c\u706b\u5fc5\u6709\u56e0 (There must be a basis for carrying out fire attack): To attempt a fire attack, there must be favorable conditions or reasons. This refers to intrinsic factors that allow the fire attack to be effective, such as enemy vulnerabilities, the army's state of readiness, or specific topographical advantages. \n\n 2.\t\u7159\u706b\u5fc5\u7d20\u5177 (Smoke and fire materials must be prepared beforehand): All tools and materials necessary for fire attack, such as smoke (for camouflage), gunpowder, and kindling, must be thoroughly prepared before the operation begins. This is to ensure that necessary items are not lacking during critical situations. \n\n 3.\t\u767c\u706b\u6709\u6642 (There is a proper time for igniting the fire): To start a fire, one must seize the opportune 'time'. This refers to momentary opportunities such as wind direction, enemy complacency, or internal confusion. \n\n 4.\t\u8d77\u706b\u6709\u65e5 (There is a designated day for starting the fire): To initiate a fire, one must consider long-term 'day' factors such as weather and climatic conditions. This refers to natural conditions that can maximize the effect of fire attack, such as strong winds or dry weather. \n\n",null,B.a,null,B.c)
