B.aqR=new A.a("\u318d\u4e0d\u53ef\u52dd\u8005 (b\xf9 k\u011b sh\xe8ng zh\u011b): That which cannot be defeated (situation)  \n\u318d\u5b88\u4e5f (sh\u01d2u y\u011b): Is to defend  \n\u318d\u53ef\u52dd\u8005 (k\u011b sh\xe8ng zh\u011b): That which can be defeated (situation) \n\u318d\u653b\u4e5f (g\u014dng y\u011b): Is to attack  \n\u318d\u5b88\u5247 (sh\u01d2u z\xe9): If defending  \n\u318d\u4e0d\u8db3 (b\xf9 z\xfa): Insufficient, not enough   \n\u318d \u653b\u5247 (g\u014dng z\xe9): If attacking  \n\u318d\u6709\u9918 (y\u01d2u y\xfa): Ample, more than enough \n\n",null,B.a,null,B.c)
B.ajo=new A.a("\u201cWhen there is no possibility of victory, one must focus on defense; only when the conditions for victory are met should one launch an attack. Defense is chosen when one's strength is insufficient, and attack is only possible when one's strength is abundant.\u201d",null,B.a,null,B.c)
