B.a6c=new A.a("This passage provides clear criteria for determining offensive and defensive actions in war, emphasizing the importance of accurately assessing one's own capabilities and the enemy's situation. \n\n",null,B.a,null,B.c)
B.a6e=new A.a("1.\tPrinciples of Offensive and Defensive Transition: \n   \u318d Defense when Invincible (\u4e0d\u53ef\u52dd\u8005 \u5b88\u4e5f): When one's own forces lack the conditions or capabilities to win, one should not attack recklessly but focus on defending oneself. This is a wise choice to avoid defeat and preserve one's strength.\n\n   \u318d Attack when Winnable (\u53ef\u52dd\u8005 \u653b\u4e5f): When one's own forces have sufficient conditions and capabilities for victory, and the enemy's weaknesses are exposed, one should boldly attack to seize victory.\n\n2.\tBasis for Offensive/Defensive Decisions (Capability):\n   \u318d Defense from Insufficiency (\u5b88\u5247\u4e0d\u8db3): Choosing defense occurs when one's own capabilities (troops, resources, preparation, etc.) are judged to be 'insufficient' compared to the enemy, or 'not enough' for attack. This means it is a realistic strategy adopted by the weaker side.\n\n   \u318d Attack from Abundance (\u653b\u5247\u6709\u9918): Choosing attack occurs when one's own capabilities are 'abundant' and one is judged to have 'sufficient power' to overwhelm the enemy. This means that attack stems from confidence and superiority in strength.\n\n",null,B.a,null,B.c)
