B.a7s=new A.a('\uc774 \ubb38\uad6c\ub294 \uc804\uc7c1\uc5d0\uc11c \uc544\uad70\uc774 \uc8fc\ub3c4\uad8c\uc744 \uc7a1\uace0 \uc801\uc744 \ub9c8\uc74c\ub300\ub85c \uc6c0\uc9c1\uc774\uac8c \ud558\uba74\uc11c\ub3c4, \uc544\uad70 \uc790\uc2e0\uc740 \uc548\uc804\ud558\uac8c \uc2b9\ub9ac\ub97c \uc7c1\ucde8\ud560 \uc218 \uc788\ub294 \ube44\uacb0\uc774 "\uae30\uc815(\u5947\u6b63)"\uc758 \ud65c\uc6a9\uc5d0 \uc788\uc74c\uc744 \uc124\uba85\ud569\ub2c8\ub2e4.\n\n',null,B.a,null,B.c)
B.an0=new A.a(" 1. \uc801\uc744 \ud1b5\uc81c\ud558\ub294 \ub2a5\ub825 (\u53ef\u4f7f\u5fc5\u53d7\u6575):\n  \u318d\uc758\ubbf8: \uc544\uad70\uc758 \uc758\ub3c4\ub300\ub85c \uc801\uc744 \uc6c0\uc9c1\uc774\uac8c \ud560 \uc218 \uc788\ub294 \ub2a5\ub825\uc744 \ub9d0\ud569\ub2c8\ub2e4. \uc801\uc774 \uc544\uad70\uc758 \uacf5\uaca9\uc744 '\ubc18\ub4dc\uc2dc \ubc1b\uac8c' \ub9cc\ub4e4 \uc218 \uc788\ub2e4\ub294 \uac83\uc740, \uc544\uad70\uc774 \uc804\uc7a5\uc758 \uc8fc\ub3c4\uad8c\uc744 \uc644\ubcbd\ud558\uac8c \uc7a5\uc545\ud558\uace0, \uc801\uc758 \ud589\ub3d9\uc744 \uc720\ub3c4\ud558\uac70\ub098 \uc608\uce21\ud560 \uc218 \uc788\uc74c\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \uc801\uc744 \uc720\uc778\ud558\uace0, \uace0\ub9bd\uc2dc\ud0a4\uba70, \uc57d\uc810\uc73c\ub85c \ubab0\uc544\ub123\ub294 \ub2a5\ub825\uc744 \ud3ec\ud568\ud569\ub2c8\ub2e4.\n\n 2.\t\uc544\uad70\uc758 \ubb34\ud328(\u7121\u6557) \ubcf4\uc7a5 (\u800c\u7121\u6557\u8005):\n   \u318d\uc758\ubbf8: \uc544\uad70\uc774 \uc801\uc744 \ud1b5\uc81c\ud558\ub294 \uacfc\uc815\uc5d0\uc11c\ub3c4 \uc790\uc2e0\uc740 \uacb0\ucf54 \ud328\ubc30\ud558\uc9c0 \uc54a\ub294\ub2e4\ub294 \uac83\uc744 \ubcf4\uc7a5\ud55c\ub2e4\ub294 \uc758\ubbf8\uc785\ub2c8\ub2e4. \uc774\ub294 \uc544\uad70\uc774 '\uc120\uc704\ubd88\uac00\uc2b9(\u5148\u7232\u4e0d\u53ef\u52dd - \uba3c\uc800 \uc790\uc2e0\uc744 \ud328\ubc30\ud558\uc9c0 \uc54a\ub294 \uc0c1\ud0dc\ub85c \ub9cc\ub4e6)'\uc758 \uc6d0\uce59\uc744 \ucca0\uc800\ud788 \uc9c0\ud0a4\uace0 \uc788\uc74c\uc744 \uc804\uc81c\ub85c \ud569\ub2c8\ub2e4. \uc989, \uc704\ud5d8\uc744 \ucd5c\uc18c\ud654\ud558\uba74\uc11c \ucd5c\ub300\uc758 \ud6a8\uacfc\ub97c \uc5bb\ub294 \uac83\uc744 \ub73b\ud569\ub2c8\ub2e4.\n\n 3.\t\uae30\uc815(\u5947\u6b63)\uc758 \uc6b4\uc6a9 (\u5947\u6b63\u662f\u4e5f):\n   \u318d\uae30(\u5947): \uc608\uce21 \ubd88\uac00\ub2a5\ud55c, \ube44\uc815\uaddc\uc801\uc778, \ubcc0\uce59\uc801\uc778 \uc804\uc220\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \uc801\uc758 \ud5c8\ub97c \ucc0c\ub974\uac70\ub098, \uc608\uc0c1\uce58 \ubabb\ud55c \ubc29\ud5a5\uc5d0\uc11c \uacf5\uaca9\ud558\uac70\ub098, \uae30\ub9cc \uc791\uc804\uc744 \ud3bc\uce58\ub294 \uac83 \ub4f1\uc785\ub2c8\ub2e4. \uc774\ub294 \uc801\uc5d0\uac8c \ud63c\ub780\uc744 \uc8fc\uace0 \ubc29\uc5b4\uc120\uc744 \ubb34\ub108\ub728\ub9ac\ub294 \ub370 \uc0ac\uc6a9\ub429\ub2c8\ub2e4.\n\n \u318d\uc815(\u6b63): \uc608\uce21 \uac00\ub2a5\ud55c, \uc815\uaddc\uc801\uc778, \uc815\uba74\uc758 \uc804\uc220\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \uad50\uacfc\uc11c\uc801\uc778 \uc804\uc220, \uc815\uba74 \uacf5\uaca9, \uae30\ubcf8\uc801\uc778 \ubcd1\ub825 \ubc30\uce58 \ub4f1\uc744 \ub73b\ud569\ub2c8\ub2e4. \uc774\ub294 \uc801\uc758 \uc8fc\ub825\uc744 \ubb36\uc5b4\ub450\uac70\ub098, \uae30\ubcf8\uc801\uc778 \ubc29\uc5b4\uc120\uc744 \uad6c\ucd95\ud558\ub294 \ub370 \uc0ac\uc6a9\ub429\ub2c8\ub2e4.\n\n \u318d\uc6b4\uc6a9: \uc774 \ub450 \uac00\uc9c0(\uae30\uc815)\ub97c \uc801\uc808\ud788 \uc870\ud569\ud558\uace0 \uc720\uc5f0\ud558\uac8c \uc804\ud658\ud558\uc5ec \uc801\uc744 \uad50\ub780\ud558\uace0 \uc544\uad70\uc758 \uc758\ub3c4\ub300\ub85c \uc6c0\uc9c1\uc774\uac8c \ud558\uba74\uc11c\ub3c4, \uc544\uad70\uc740 \uc548\uc804\uc744 \uc720\uc9c0\ud558\ub294 \uc804\ub7b5\uc785\ub2c8\ub2e4. \uc989, \uc815(\u6b63)\uc73c\ub85c \uc801\uc758 \uc2dc\uc120\uc744 \ub04c\uace0 \uae30(\u5947)\ub85c \uacb0\uc815\ud0c0\ub97c \ub0a0\ub9ac\uac70\ub098, \uae30(\u5947)\ub85c \uc801\uc744 \uc720\uc778\ud55c \ud6c4 \uc815(\u6b63)\uc73c\ub85c \ud3ec\uc704\ud558\ub294 \ub4f1 \ub2e4\uc591\ud55c \uc870\ud569\uc774 \uac00\ub2a5\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
