B.aff=new A.a(" 1. \uc804\uc7a5 \uc8fc\ub3c4\uad8c: \uc801\uc744 \uc544\uad70\uc758 \uc758\ub3c4\ub300\ub85c \uc6c0\uc9c1\uc774\uac8c \ud558\uc5ec \uc804\uc7a5\uc758 \uc8fc\ub3c4\uad8c\uc744 \uc644\ubcbd\ud558\uac8c \uc7a5\uc545\ud558\ub294 \uac83\uc774 \uc2b9\ub9ac\uc758 \ud575\uc2ec\uc785\ub2c8\ub2e4.\n\n 2. \uae30\ub9cc\uacfc \uc720\uc778: '\uae30'\ub97c \ud1b5\ud574 \uc801\uc758 \ud310\ub2e8\uc744 \ud750\ub9ac\uac8c \ud558\uace0, \uc801\uc744 \uc544\uad70\uc774 \uc6d0\ud558\ub294 \uacf3\uc73c\ub85c \uc720\uc778\ud558\uc5ec \uacf5\uaca9\uc5d0 \ub178\ucd9c\uc2dc\ud0a4\ub294 \uac83\uc774 \uc911\uc694\ud569\ub2c8\ub2e4.\n\n 3. \uc720\uc5f0\ud55c \uc804\uc220 \uc804\ud658: '\uc815'\uacfc '\uae30'\ub97c \uc0c1\ud669\uc5d0 \ub530\ub77c \uc790\uc720\uc790\uc7ac\ub85c \uc804\ud658\ud558\uace0 \uc870\ud569\ud568\uc73c\ub85c\uc368 \uc608\uce21 \ubd88\uac00\ub2a5\ud55c \uacf5\uaca9\uc744 \uac10\ud589\ud558\uace0 \uc801\uc744 \ud63c\ub780\uc5d0 \ube60\ub728\ub9b4 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n\n 4. \ubb34\ud328(\u7121\u6557) \uc804\ub7b5: \uc801\uc5d0\uac8c \uacf5\uaca9\uc744 \ubc1b\uac8c \ud558\uba74\uc11c\ub3c4 \uc544\uad70\uc740 \ud328\ubc30\ud558\uc9c0 \uc54a\ub294 \uacac\uace0\ud55c \uc0c1\ud0dc\ub97c \uc720\uc9c0\ud574\uc57c \ud569\ub2c8\ub2e4. \uc774\ub294 \ucca0\uc800\ud55c \uc900\ube44\uc640 \ubc29\uc5b4\uac00 \uc804\uc81c\ub429\ub2c8\ub2e4.\n\n 5. \uc608\uce21 \ubd88\uac00\ub2a5\uc131: \uc544\uad70\uc758 \uc804\uc220\uc744 \uc608\uce21\ud558\uae30 \uc5b4\ub835\uac8c \ub9cc\ub4e4\uc5b4 \uc801\uc774 \uc801\uc808\ud788 \ub300\uc751\ud558\uc9c0 \ubabb\ud558\uac8c \ud558\ub294 \uac83\uc774 \uae30\uc815 \uc6b4\uc6a9\uc758 \ud575\uc2ec\uc785\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
