B.al7=new A.a("\uc190\ubb34\ub294 \u300a\uc190\uc790\ubcd1\ubc95\u300b\uc774\ub77c\ub294 \uad70\uc0ac\uc11c\ub97c \ud1b5\ud574 \uc804\uc7c1\uc758 \ubcf8\uc9c8, \uc804\ub7b5\uacfc \uc804\uc220, \uadf8\ub9ac\uace0 \uc9c0\ud718\uad00\uc758 \uc790\uc9c8\uc744 \uccb4\uacc4\uc801\uc73c\ub85c \uc815\ub9ac\ud588\uc2b5\ub2c8\ub2e4. \uadf8\ub294 \uc624\ub098\ub77c\uc758 \uc655 \ud569\ub824\uc758 \uc2e0\ud558\uac00 \ub41c \ud6c4 \uc2e4\uc81c \uc804\ud22c\uc5d0\uc11c \uc790\uc2e0\uc758 \uc804\ub7b5\uc801 \uc9c0\uc2dd\uc744 \uc785\uc99d\ud558\uc600\uace0, \uc624\ub098\ub77c\ub97c \uac15\uad6d\uc73c\ub85c \ub9cc\ub4dc\ub294 \ub370 \uae30\uc5ec\ud588\uc2b5\ub2c8\ub2e4. \ud2b9\ud788 \uc190\ubb34\uac00 \uc5ec\uc131 \ubcd1\uc0ac\ub4e4\uc744 \ud6c8\ub828\uc2dc\ud0a4\uace0 \uc655 \ud569\ub824 \uc55e\uc5d0\uc11c \ub9ac\ub354\uc2ed\uc744 \ubcf4\uc5ec\uc900 \uc720\uba85\ud55c \uc77c\ud654\ub294 \uadf8\uc758 \uad70\uc0ac \ucca0\ud559\uc744 \uc0c1\uc9d5\uc801\uc73c\ub85c \ubcf4\uc5ec\uc8fc\ub294 \uc0ac\ub840\ub85c \ub110\ub9ac \uc54c\ub824\uc838 \uc788\uc2b5\ub2c8\ub2e4.\n",null,B.a,null,B.c)
B.a8t=new A.a("\n\uc624\uc655 \ud569\ub824(\u95d4\u95ad)\uc758 \uc2e0\ud558\uac00 \ub41c \ud6c4, \uadf8\uc758 \uc804\ub7b5\uc801 \uc9c0\uc2dd\uc744 \uc2e4\uc81c \uc804\ud22c\uc5d0\uc11c \uc99d\uba85\ud558\uba70 \uc624\ub098\ub77c\ub97c \uac15\uad6d\uc73c\ub85c \ub9cc\ub4dc\ub294\ub370 \uae30\uc5ec\ud569\ub2c8\ub2e4. \ud2b9\ud788, \uc190\ubb34\uac00 \uc5ec\uad70(\u5973\u8ecd)\uc744 \ud6c8\ub828\uc2dc\ucf1c \uc624\uc655 \uc55e\uc5d0\uc11c \ubcf4\uc5ec\uc900 \uc77c\ud654\ub294 \uadf8\uc758 \uc9c0\ud718\ub825\uacfc \ubcd1\ubc95\uc758 \ucca0\ud559\uc744 \uc0c1\uc9d5\ud558\ub294 \uc5d0\ud53c\uc18c\ub4dc\ub85c \uc720\uba85\ud569\ub2c8\ub2e4.",null,B.a,null,B.c)
