B.adG=new A.a("\uc190\uc790\ubcd1\ubc95\uc740 \uc911\uad6d\ubfd0 \uc544\ub2c8\ub77c \uc77c\ubcf8, \ud55c\uad6d, \uc11c\uc591\uc5d0\ub3c4 \uae4a\uc740 \uc601\ud5a5\uc744 \ubbf8\ucce4\uc2b5\ub2c8\ub2e4.\n\ud074\ub77c\uc6b0\uc81c\ube44\uce20, \ub9c8\ud0a4\uc544\ubca8\ub9ac, \ub098\ud3f4\ub808\uc639, \ub9e5\uc544\ub354, CIA \ub4f1\ub3c4 \uc190\uc790\uc758 \uc804\ub7b5\uc744 \uc5f0\uad6c\ud588\uc2b5\ub2c8\ub2e4.\n\uc624\ub298\ub0a0\uc5d0\ub3c4 \uad70\uc0ac \uc804\ub7b5, \uacbd\uc601\ud559, \uc2a4\ud3ec\uce20 \uc804\ub7b5, \uc2ec\uc9c0\uc5b4 \uc2ec\ub9ac\uc804\uc220\uacfc \uc678\uad50\uc5d0\ub3c4 \uc801\uc6a9\ub429\ub2c8\ub2e4.",null,B.a,null,B.c)
