B.alC=new A.a("1. \ucd9c\uc0dd\uacfc \ubc30\uacbd\n\uc190\ubb34\ub294 \ucd98\ucd94\uc2dc\ub300 \uc81c(\u9f4a)\ub098\ub77c \uc0ac\ub78c\uc73c\ub85c \uc54c\ub824\uc838 \uc788\uc73c\uba70, \uadc0\uc871 \uac00\ubb38 \ucd9c\uc2e0\uc774\uc5c8\uc744 \uac00\ub2a5\uc131\uc774 \ud07d\ub2c8\ub2e4. \uc5b4\ub824\uc11c\ubd80\ud130 \ubcd1\ubc95\uc5d0 \ub6f0\uc5b4\ub0ac\ub2e4\uace0 \uc804\ud574\uc9c0\uba70, \uccb4\uacc4\uc801\uc778 \uad70\uc0ac \uc0ac\uc0c1\uc744 \uc815\ub9ac\ud55c \uc800\uc11c \u300a\uc190\uc790\ubcd1\ubc95(\u5b6b\u5b50\u5175\u6cd5)\u300b\uc744 \uc9d1\ud544\ud588\uc2b5\ub2c8\ub2e4. \n\n2. \uc624\ub098\ub77c\ub85c\uc758 \uc774\uc8fc\n\uc190\ubb34\ub294 \uc81c\ub098\ub77c\ub97c \ub5a0\ub098 \uc624\ub098\ub77c\ub85c \uac00\uc11c, \uadf8\uacf3\uc758 \uad6d\uc655\uc778 **\uc624\uc655 \ud569\ub824(\u95d4\u95ad)**\uc5d0\uac8c \u300a\uc190\uc790\ubcd1\ubc95\u300b\uc744 \ubc14\uce69\ub2c8\ub2e4. \uc624\uc655\uc740 \ucc98\uc74c\uc5d0\ub294 \uc190\ubb34\ub97c \uc2dc\ud5d8\ud558\uace0\uc790 \u201c\ub124\uac00 \ub9d0\ud558\ub294 \ubcd1\ubc95\uc774 \uc2e4\uc81c\ub85c \uc801\uc6a9 \uac00\ub2a5\ud55c\uac00?\u201d\ub77c\uace0 \ubb3b\uc2b5\ub2c8\ub2e4. \n\n3. \uc720\uba85\ud55c \uc5ec\uad70 \ud6c8\ub828 \uc77c\ud654\n\uc190\ubb34\ub294 \uad81\ub140 180\uba85\uc744 \ubcd1\uc0ac\ub85c \ud6c8\ub828\uc2dc\ud0a4\uba70 \ubcd1\ubc95\uc758 \uc2e4\uc6a9\uc131\uc744 \uc785\uc99d\ud569\ub2c8\ub2e4. \uc5ec\uad81\ub4e4\uc744 \ub458\ub85c \ub098\ub204\uace0 \uc655\uc758 \ucd1d\uc560\ub97c \ubc1b\ub294 \ub450 \uad81\ub140\ub97c \uac01\uac01 \ub300\uc7a5\uc73c\ub85c \uc138\uc6e0\ub294\ub370, \uadf8\ub4e4\uc774 \uba85\ub839\uc744 \ub530\ub974\uc9c0 \uc54a\uc790 \uc190\ubb34\ub294 \uadf8 \ub450 \uc0ac\ub78c\uc744 \ucc38\uc218\ud569\ub2c8\ub2e4. \uc774 \uc0ac\uac74\uc740 \uc190\ubb34\uc758 \uc5c4\uc815\ud55c \uad70\uc728 \uc815\uc2e0\uacfc \ucc45\uc784\uc9c0\ud718 \ucca0\ud559\uc744 \ubcf4\uc5ec\uc8fc\ub294 \ub300\ud45c\uc801\uc778 \uc77c\ud654\ub85c \uc804\ud574\uc9d1\ub2c8\ub2e4. \n\n4. \uc624\ub098\ub77c \uad70\uc0ac \uac1c\ud601\uacfc \ud65c\uc57d\n\uc774\ud6c4 \uc190\ubb34\ub294 \uc624\ub098\ub77c\uc758 \uc7a5\uad70\uc73c\ub85c \uc784\uba85\ub418\uc5b4 \ubcf8\uaca9\uc801\uc73c\ub85c \uad70\uc0ac \ud65c\ub3d9\uc5d0 \ucc38\uc5ec\ud569\ub2c8\ub2e4. \uc190\ubb34\ub294 \uc804\uc220\uacfc \uae30\ub9cc, \uc815\ubcf4\uc804\uc744 \ud65c\uc6a9\ud574 \uac15\uad6d \ucd08\ub098\ub77c\ub97c \uc0c1\ub300\ub85c \uc5f0\uc2b9\uc744 \uac70\ub461\ub2c8\ub2e4. \ud2b9\ud788, \uae30\uc6d0\uc804 506\ub144, \uc624\uc655 \ud569\ub824\uc640 \ud568\uaed8 **\ucd08\ub098\ub77c \uc218\ub3c4 \uc601(\u90e2)**\uc744 \ud568\ub77d\uc2dc\ud0a4\ub294 \ub370 \ud06c\uac8c \uae30\uc5ec\ud569\ub2c8\ub2e4. \uc774 \uc804\ud22c\uc5d0\uc11c \uc190\ubb34\ub294 \ucd08\ub098\ub77c \uad70\ub300\ub97c \uc5f0\uc18d\uc73c\ub85c \uaca9\ud30c\ud558\uba70 \uc804\uc124\uc801\uc778 \uba85\uc7a5\uc73c\ub85c \ub5a0\uc624\ub985\ub2c8\ub2e4. \n\n5. \ub9d0\ub144\uacfc \uc2e4\uc885\n\uc190\ubb34\uac00 \uc624\ub098\ub77c\uc5d0\uc11c \uc5b4\ub5a4 \uc774\uc720\ub85c \uc815\uacc4\ub97c \ub5a0\ub0ac\ub294\uc9c0, \ub610\ub294 \uc8fd\uc740 \uc2dc\uc810\uacfc \uc7a5\uc18c\ub294 \ud655\uc2e4\uce58 \uc54a\uc2b5\ub2c8\ub2e4. \u300a\uc0ac\uae30\u300b\uc5d0\uc11c\ub294 \uc190\ubb34\uac00 \ucd08\ub098\ub77c \uc815\ubc8c \ud6c4 \uc0ac\ub77c\uc84c\ub2e4\uace0 \uac04\ub2e8\ud788 \uc5b8\uae09\ub418\uc5b4 \uc788\uc73c\uba70, \uc740\ub454\ud588\uac70\ub098 \uc790\uc5f0\uc0ac\ud588\uc744 \uac00\ub2a5\uc131\uc774 \uc81c\uae30\ub429\ub2c8\ub2e4. \uadf8 \uc774\ud6c4\uc5d0 \ud65c\ub3d9\ud55c \ub610 \ub2e4\ub978 \ubcd1\ubc95\uac00 **\uc190\ube48(\u5b6b\u81cf)**\uc740 \uc190\ubb34\uc758 \ud6c4\uc190 \ud639\uc740 \uc81c\uc790\ub85c \ucd94\uc815\ub418\uae30\ub3c4 \ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
