B.an9=new A.a("\u318d\u77e5\u53ef\u4ee5\u6230\u8207\u4e0d\u53ef\u4ee5\u6230\u8005\u52dd(zh\u012b k\u011b y\u01d0 zh\xe0n y\u01d4 b\xf9 k\u011b y\u01d0 zh\xe0n zh\u011b sh\xe8ng): \uc2f8\uc6cc\uc57c \ud560 \ub54c\uc640 \uc2f8\uc6b0\uc9c0 \ub9d0\uc544\uc57c \ud560 \ub54c\ub97c \uc544\ub294 \uc790\uac00 \uc2b9\ub9ac\ud55c\ub2e4\n\u318d\u8b58\u8846\u5be1\u4e4b\u7528\u8005\u52dd(sh\xed zh\xf2ng gu\u01ce zh\u012b y\xf2ng zh\u011b sh\xe8ng): \ubcd1\ub825\uc758 \ub9ce\uace0 \uc801\uc74c\uc744 \uace0\ub824\ud558\uc5ec \ud65c\uc6a9\ud560 \uc904 \uc544\ub294 \uc790\uac00 \uc2b9\ub9ac\ud55c\ub2e4\n\u318d\u4e0a\u4e0b\u540c\u6b32\u8005\u52dd(sh\xe0ng xi\xe0 t\xf3ng y\xf9 zh\u011b sh\xe8ng): \uc0c1\ud558(\uc9c0\ud718\uad00\uacfc \ubcd1\uc0ac)\uac00 \ub73b\uc744 \uac19\uc774\ud558\uba74 \uc2b9\ub9ac\ud55c\ub2e4\n\u318d\u4ee5\u865e\u5f85\u4e0d\u865e\u8005\u52dd(y\u01d0 y\xfa d\xe0i b\xf9 y\xfa zh\u011b sh\xe8ng): \ub300\ube44\ud558\uace0 \uc788\ub294 \uad70\uc774 \ub300\ube44\ud558\uc9c0 \ubabb\ud55c \uc801\uc744 \uc0c1\ub300\ud558\uba74 \uc2b9\ub9ac\ud55c\ub2e4\n\u318d\u5c07\u80fd\u800c\u541b\u4e0d\u5fa1\u8005\u52dd(ji\xe0ng n\xe9ng \xe9r j\u016bn b\xf9 y\xf9 zh\u011b sh\xe8ng): \uc7a5\uc218\uac00 \uc720\ub2a5\ud558\uace0 \uad70\uc8fc\uac00 \uac04\uc12d\ud558\uc9c0 \uc54a\uc73c\uba74 \uc2b9\ub9ac\ud55c\ub2e4 \n\n",null,B.a,null,B.c)
