B.ael=new A.a("1.\t\uc9c0\uc778\uac00\uc804\ubd88\uac00\uc804\uc9c0\uc790\uc2b9 (\u77e5\u53ef\u4ee5\u6230\u8207\u4e0d\u53ef\u4ee5\u6230\u8005\u52dd):\n\u2022\t\uc758\ubbf8: \uc2f8\uc6b8 \uc218 \uc788\ub294 \uc0c1\ud669(\uc989, \uc720\ub9ac\ud55c \uc870\uac74)\uacfc \uc2f8\uc6b8 \uc218 \uc5c6\ub294 \uc0c1\ud669(\uc989, \ubd88\ub9ac\ud55c \uc870\uac74)\uc744 \uba85\ud655\ud788 \ud310\ub2e8\ud558\uace0, \uc2f8\uc6b8 \ub54c \uc2f8\uc6b0\uace0 \ud53c\ud560 \ub54c \ud53c\ud558\ub294 \uc9c0\ud61c\ub97c \uac00\uc9c4 \uc790\uac00 \uc2b9\ub9ac\ud55c\ub2e4.\n\n2.\t\uc2dd\uc911\uacfc\uc9c0\uc6a9\uc790\uc2b9 (\u8b58\u8846\u5be1\u4e4b\u7528\u8005\u52dd):\n\u2022\t\uc758\ubbf8: \ubcd1\ub825\uc758 \ub9ce\uace0 \uc801\uc74c\uc5d0 \ub530\ub77c \uadf8\uc5d0 \ub9de\ub294 \uc6a9\ubcd1\uc220(\uc804\uc220)\uc744 \uc544\ub294 \uc790\uac00 \uc2b9\ub9ac\ud55c\ub2e4.\n\n3.\t\uc0c1\ud558\ub3d9\uc695\uc790\uc2b9 (\u4e0a\u4e0b\u540c\u6b32\u8005\u52dd):\n\u2022\t\uc758\ubbf8: \uc9c0\ud718\uad00\uacfc \ubcd1\uc0ac\ub4e4(\uc0c1\ud558)\uc774 \uac19\uc740 \ubaa9\ud45c\uc640 \uc5f4\ub9dd(\ub73b)\uc744 \uac00\uc9c0\uace0 \uc77c\uce58\ub2e8\uacb0\ud558\ub294 \uc790\uac00 \uc2b9\ub9ac\ud55c\ub2e4.\n\n4.\t\uc774\uc6b0\ub300\ubd88\uc6b0\uc790\uc2b9 (\u4ee5\u865e\u5f85\u4e0d\u865e\u8005\u52dd):\n\u2022\t\uc758\ubbf8: \ucca0\uc800\ud788 \uc900\ube44\ub41c(\u865e) \uc790\uc138\ub85c \uc900\ube44\ub418\uc9c0 \uc54a\uc740(\u4e0d\u865e) \uc801\uc744 \uae30\ub2e4\ub9ac\ub294 \uc790\uac00 \uc2b9\ub9ac\ud55c\ub2e4.\n\n5.\t\uc7a5\ub2a5\uc774\uad70\ubd88\uc5b4\uc790\uc2b9 (\u5c07\u80fd\u800c\u541b\u4e0d\u5fa1\u8005\u52dd):\n\u2022\t\uc758\ubbf8: \uc7a5\uc218(\ud604\uc7a5 \ub9ac\ub354)\uac00 \ub2a5\ub825\uc774 \uc788\ub294\ub370\ub3c4 \uad70\uc8fc(\ucd5c\uace0 \uacb0\uc815\uad8c\uc790)\uac00 \uac04\uc12d\ud558\uc9c0 \uc54a\uace0 \uadf8 \uc7ac\ub7c9\uc744 \ubbff\uace0 \ub9e1\uae30\ub294 \uc790\uac00 \uc2b9\ub9ac\ud55c\ub2e4.\n\n",null,B.a,null,B.c)
