B.aef=new A.a("This passage presents two key conditions for victory, emphasizing not just winning, but 'victory without peril' and 'complete victory.' \n\n",null,B.a,null,B.c)
B.arK=new A.a(" 1.\t\u77e5\u5f7c\u77e5\u5df1 \u52dd\u4e43\u4e0d\u6b86 (Know the enemy and know yourself, and in victory, there will be no peril):\n   \u2022\t\u77e5\u5f7c (Zhi Bi): Means thoroughly understanding everything about the enemy, including their strengths and weaknesses, strategies, troop strength, commander's tendencies, and supply situation. \n\n   \u2022\t\u77e5\u5df1 (Zhi Ji): Means accurately understanding everything about oneself, including strengths and weaknesses, troop strength, training level, morale, supply capability, and commander's abilities. \n\n   \u2022\t\u52dd\u4e43\u4e0d\u6b86 (Sheng Nai Bu Dai): If both the enemy and oneself are accurately known, one can not only win but also ensure that the victory is not perilous. This means minimizing unnecessary losses and maintaining a stable situation even after victory. This emphasizes risk management and efficient victory. \n\n 2.\t\u77e5\u5929\u77e5\u5730 \u52dd\u4e43\u53ef\u5168 (Know the heavens and know the earth, and your victory will be complete):\n   \u2022\t\u77e5\u5929 (Zhi Tian): Means knowing the heavenly conditions (\u5929\u6642). That is, understanding changes in the natural environment such as climate (weather), seasons, time, and astronomical phenomena, and utilizing them in strategy. \n\n   \u2022\t\u77e5\u5730 (Zhi Di): Means knowing the terrain (\u5730\u5f62). That is, understanding geographical conditions such as mountains, rivers, valleys, plains, and road networks, and utilizing them advantageously in tactics. \n\n   \u2022\t\u52dd\u4e43\u53ef\u5168 (Sheng Nai Ke Quan): If both the principles of heaven and earth are known, one can not only win but also ensure that the victory is complete. This means a complete victory gained by minimizing damage and fully preserving one's forces. In other words, it emphasizes overwhelming victory achieved by perfectly utilizing the environment.\n\n ",null,B.a,null,B.c)
