B.ayB=new A.a(" 1.\tImportance of Information: The starting point of all strategies is accurate and in-depth information about both the enemy and oneself. Without information, neither victory nor stable victory is possible. \n\n 2.\tUtilization of Environment: The natural environment (heavenly conditions and terrain) is not just a backdrop; it is a decisive factor influencing strategy formulation and tactical execution. Understanding and utilizing it determines victory or defeat. \n\n 3.\tRisk Management: Beyond simply winning, it is important to minimize unnecessary losses and maintain a stable situation after victory. \n\n 4.\tPursuit of Complete Victory: A victory obtained while minimizing losses of human and material resources (total victory) is true victory. This implies sustainable success from a long-term perspective. \n\n 5.\tHolistic Analysis: Strategy must be formulated by comprehensively analyzing and linking all these elements: internal capabilities (\u5df1), external threats (\u5f7c), and the external environment (\u5929, \u5730). \n\n",null,B.a,null,B.c)
