B.ast=new A.a("This passage presents the paradoxical relationship where contrasting concepts can cause each other or create characteristics of their opposite. This shows that Sun Tzu's Art of War emphasizes psychological warfare and deception tactics, not just a simple clash of forces. \n\n",null,B.a,null,B.c)
B.agi=new A.a("1. \u4e82\u751f\u65bc\u6cbb (lu\xe0n sh\u0113ng y\xfa zh\xec, Chaos arises from order):\n\u2022\tMeaning: An extremely well-controlled and orderly state (\u6cbb) itself can become an easy target for enemy attack due to its high predictability, or its control can be reversed to induce chaos (\u4e82) in the enemy. For example, when the enemy is bound by certain rules, unconventional actions that break those rules can cause chaos for the enemy. It also implies that intentional chaos can be planted within seemingly well-controlled order. \n\n2. \u602f\u751f\u65bc\u52c7 (qi\xe8 sh\u0113ng y\xfa y\u01d2ng, Timidity arises from courage):\n   \u2022\tMeaning: Excessive courage (\u52c7) or reckless bravery can expose vulnerabilities to the enemy, leading to situations where one's own forces become timid (\u602f). Also, one's courageous actions can induce dismay and fear (\u602f) in the enemy. That is, it means reversing the enemy's courage or inducing fear in the enemy through one's own courage.\n\n3. \u5f31\u751f\u65bc\u5f3a (ru\xf2 sh\u0113ng y\xfa qi\xe1ng, Weakness arises from strength):\n  \u2022\tMeaning: Outward strength (\u5f3a) often leads to carelessness, or an excessive concentration of force in one area can create weaknesses (\u5f31) elsewhere. Also, by disguising oneself as strong, one can make the enemy feel weak. It refers to weaknesses hidden behind strengths, or strategies that flaunt strength to induce enemy misjudgment.\n\n",null,B.a,null,B.c)
