B.a5Y=new A.a(" \uc704\uc5d0 \uc81c\uc2dc\ub41c \ubb38\uad6c\ub4e4\uc744 \uc885\ud569\ud574 \ubcf4\uba74, \uc190\uc790\ubcd1\ubc95\uc774 \uac15\uc870\ud558\ub294 \ud575\uc2ec \uc6d0\uce59\ub4e4\uc740 \ub2e4\uc74c\uacfc \uac19\uc2b5\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
B.anG=new A.a(" 1.\t\ud658\uacbd \uc774\ud574\uc640 \ub9de\ucda4 \uc804\ub7b5: \uc804\uc7c1\ud130\ub294 \ub2e8\uc21c\ud55c \uacf5\uac04\uc774 \uc544\ub2c8\ub77c, \uac01\uae30 \ub2e4\ub978 \ud2b9\uc131(\u6563\u5730, \u8f15\u5730, \u722d\u5730, \u4ea4\u5730, \u8862\u5730, \u91cd\u5730, \u572e\u5730, \u570d\u5730, \u6b7b\u5730)\uc744 \uc9c0\ub2cc \uc544\ud649 \uac00\uc9c0 \uc9c0\ud615\uc73c\ub85c \ubd84\ub958\ub418\uba70, \uac01 \uc9c0\ud615\uc5d0 \ub530\ub77c \ubcd1\ub825\uc744 \uc6b4\uc6a9\ud558\ub294 \ubc29\uc2dd\uc774 \ub2ec\ub77c\uc838\uc57c \ud569\ub2c8\ub2e4. \uc774\ub294 \uc9c0\ucc9c\uc9c0\uc9c0(\u77e5\u5929\u77e5\u5730)\uc758 \ud655\uc7a5\ub41c \uac1c\ub150\uc73c\ub85c, \ud658\uacbd\uc744 \uc815\ud655\ud788 \uc774\ud574\ud558\uace0 \uadf8\uc5d0 \ub9de\ucdb0 \uc720\uc5f0\ud558\uac8c \uc804\ub7b5\uc744 \uc218\ub9bd\ud558\ub294 \uac83\uc758 \uc911\uc694\uc131\uc744 \uac15\uc870\ud569\ub2c8\ub2e4.\n\n 2.\t\uc18d\ub3c4\uc640 \uae30\uc2b5, \uc608\uce21 \ubd88\uac00\ub2a5\uc131: \uad70\uc0ac\uc758 \ubcf8\uc131\uc740 \uc18d\ub3c4(\u5175\u4e4b\u60c5\u4e3b\u901f)\uc5d0 \uc788\uc2b5\ub2c8\ub2e4. \uc801\uc774 **\uc608\uce21\ud558\uc9c0 \ubabb\ud55c \ud2c8(\u4e58\u4eba\u4e4b\u4e0d\u53ca)\uc744 \ud0c0, \uc608\uc0c1\uce58 \ubabb\ud55c \uacbd\ub85c(\u7531\u4e0d\u865e\u4e4b\u9053)\ub85c \uacbd\uacc4\ud558\uc9c0 \uc54a\ub294 \uacf3(\u653b\u5176\u6240\u4e0d\u6212\u4e5f)\uc744 \uacf5\uaca9\ud558\ub294 \uae30\uc2b5 \uc804\ub7b5\uc740 \uc2b9\ub9ac\uc758 \ud575\uc2ec\uc785\ub2c8\ub2e4. \uc774\ub294 \uc801\uc5d0\uac8c \ud63c\ub780\uc744 \uc548\uaca8\uc8fc\uace0 \uc8fc\ub3c4\uad8c\uc744 \ube7c\uc557\ub294 \ud6a8\uacfc\uc801\uc778 \ubc29\ubc95\uc785\ub2c8\ub2e4. \n\n 3.\t\uc704\uae30\uc5d0 \ucc98\ud55c \uc0c1\ub300\uc758 \ud544\uc0ac\uc801 \uc800\ud56d: \uc801\uc758 \ubcf8\ud1a0 \uae4a\uc219\uc774 \uc9c4\uaca9\ud55c \uac1d\uad70(\u51e1\u570d\u5ba2\u4e4b\u5ea6)\uc740 \ud1f4\ub85c\uac00 \uc5c6\uc5b4 \ud544\uc0ac\uc801\uc73c\ub85c \uc2f8\uc6b8(\u6df1\u5165\u5247\u6230) \uc218\ubc16\uc5d0 \uc5c6\uc2b5\ub2c8\ub2e4. \uc774\ub7ec\ud55c \uc0c1\ud669\uc5d0\uc11c \ubc29\uc5b4\ud558\ub294 \uc8fc\uc778\uad70(\u4e3b\u4eba)\uc740 \uc624\ud788\ub824 \uc774\uae30\uae30 \uc5b4\ub824\uc6b8(\u4e0d\u514b) \uc218 \uc788\ub294\ub370, \uc774\ub294 \uc0c1\ub300\uc758 \uc808\ubc15\ud568\uc744 \uacfc\uc18c\ud3c9\uac00\ud558\uac70\ub098 \uc548\uc8fc\ud558\ub294 \ud0dc\ub3c4\uac00 \uc704\ud5d8\ud558\ub2e4\ub294 \uacbd\uace0\uc785\ub2c8\ub2e4.\n\n 4.\t\uc720\uae30\uc801\uc774\uace0 \ubbfc\ucca9\ud55c \uc870\uc9c1: \uc194\uc5f0(\u7387\u7136)\uc774\ub77c\ub294 \ubc40\ucc98\ub7fc, \uc870\uc9c1\uc740 \uc5b4\ub290 \ud55c \ubd80\ubd84\uc774 \uacf5\uaca9\ubc1b\uc544\ub3c4 \uba38\ub9ac, \uaf2c\ub9ac, \ubab8\ud1b5\uc774 \uc720\uae30\uc801\uc73c\ub85c \uc6c0\uc9c1\uc5ec \uc989\uac01\uc801\uc73c\ub85c \uc804\ubc29\uc704 \ub300\uc751\ud560 \uc218 \uc788\uc5b4\uc57c \ud569\ub2c8\ub2e4. \uc774\ub294 \uc2e0\uc18d\ud55c \uc0c1\ud669 \ud310\ub2e8\uacfc \uac01 \ubd80\uc11c \uac04\uc758 \uae34\ubc00\ud55c \ud611\ub825\uc744 \ud1b5\ud574 \uc704\ud611\uc5d0 \ud6a8\uacfc\uc801\uc73c\ub85c \ub300\ucc98\ud558\ub294 \ub2a5\ub825\uc758 \uc911\uc694\uc131\uc744 \uc5ed\uc124\ud569\ub2c8\ub2e4.\n\n 5.\t\ub9ac\ub354\uc758 \uacfc\uac10\ud55c \uacb0\ub2e8\uacfc \ucc45\uc784: \uc7a5\uad70\uc740 \ub2e8\uc21c\ud788 \ubcd1\ub825\uc744 \ubaa8\uc73c\ub294 \uac83\uc744 \ub118\uc5b4, \uc0bc\uad70\uc744 \uc774\ub04c\uace0 \uac00\uc7a5 \uc704\ud5d8\ud55c \uc804\uc7a5(\u6295\u4e4b\u65bc\u96aa)\uc5d0 \uacfc\uac10\ud788 \ud22c\uc785\ud558\uc5ec \ub09c\uad00\uc744 \ub3cc\ud30c\ud558\ub294 \uacb0\ub2e8\ub825\uacfc \ucc45\uc784\uac10(\u6b64\u8b02\u5c07\u8ecd\u4e4b\u4e8b\u4e5f)\uc744 \uc9c0\ub140\uc57c \ud569\ub2c8\ub2e4. \uac00\uc7a5 \uc911\uc694\ud558\uace0 \uc5b4\ub824\uc6b4 \uc21c\uac04\uc5d0 \ub9ac\ub354\uc758 \uacfc\uac10\ud55c \uc120\ud0dd\uc774 \uc870\uc9c1\uc758 \uc6b4\uba85\uc744 \uacb0\uc815\ud569\ub2c8\ub2e4. \n\n 6.\t\uc804\ub7b5\uac00\uc758 \uc2ec\uc624\ud55c \ud1b5\ucc30\uacfc \ube44\uc815\ud615\uc801 \uc811\uadfc: \uc9c4\uc815\ud55c \uc2e0\ubb18\ud55c \uae30\ubbf8\ub97c \uc544\ub294 \uc790(\u795e\u6a5f\u4e4b\u58eb)\ub294 \uac89\uc73c\ub85c \ub4dc\ub7ec\ub098\ub294 \uc678\uad50 \uad00\uacc4\ub098 \uc138\ub825 \ud655\uc7a5\uc5d0 \uc9d1\ucc29\ud558\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4. \ub300\uc2e0, \uc801\uc758 \uc2ec\uc7a5\ubd80\ub098 \ud575\uc2ec \ucde8\uc57d\uc810 \uae4a\uc219\uc774 \ub4e4\uc5b4\uac00(\u7232\u5bb6\u65bc\u8cca) \uc790\uc2e0\uc758 \uae30\ubc18\uc744 \uad6c\ucd95\ud558\uace0, \uc801\uc758 \uc758\ub3c4\ub97c \ud30c\uc545\ud558\uc5ec \uc5ed\uc774\uc6a9\ud558\uba70(\u9806\u8a73\u6575\u4e4b\u610f), \uc801\uc744 \ud55c \ubc29\ud5a5\uc73c\ub85c \uc720\uc778(\u5e77\u6575\u4e00\u5411)\ud55c \ud6c4 \uba40\ub9ac\uc11c \ud575\uc2ec(\u5343\u91cc\u6bba\u5c07)\uc744 \uc81c\uac70\ud558\ub294 \uad50\ubb18\ud55c \uc9c0\ub7b5(\u5de7\u80fd\u6210\u4e8b\u8005\u4e5f)\uc73c\ub85c \uc2b9\ub9ac\ub97c \uc7c1\ucde8\ud569\ub2c8\ub2e4. \uc774\ub294 \uc9c1\uc811\uc801\uc778 \ucda9\ub3cc\ubcf4\ub2e4 \uac04\uc811\uc801\uc774\uace0 \uc2ec\uc624\ud55c \uc804\ub7b5\uc774 \ub354 \ud6a8\uacfc\uc801\uc77c \uc218 \uc788\uc74c\uc744 \ubcf4\uc5ec\uc90d\ub2c8\ub2e4. \n\n \uc774 \ubaa8\ub4e0 \uc6d0\uce59\ub4e4\uc740 \uc804\uc7c1\uc758 \ubcf8\uc9c8\uc774 \ub2e8\uc21c\ud788 \ud798\uc758 \ub300\uacb0\uc774 \uc544\ub2c8\ub77c, \uc9c0\ud615, \uc18d\ub3c4, \uae30\uc2b5, \uc2ec\ub9ac, \ub9ac\ub354\uc2ed, \uadf8\ub9ac\uace0 \ud1b5\ucc30\ub825\uc774\ub77c\ub294 \ubcf5\ud569\uc801\uc778 \uc694\uc18c\ub4e4\uc758 \uc0c1\ud638\uc791\uc6a9\uc5d0 \uc788\uc74c\uc744 \uac15\uc870\ud569\ub2c8\ub2e4.\n",null,B.a,null,B.c)
