B.auV=new A.a("\ub2e4\uc591\ud55c \uc804\uc7a5 \ud658\uacbd\uc744 \uc774\ud574\ud558\uace0, \uc801\uc774 \uc608\uce21\ud558\uc9c0 \ubabb\ud558\ub294 \uc18d\ub3c4\ub85c \uae30\uc2b5\ud558\uc5ec \ud5c8\uc810\uc744 \uacf5\uaca9\ud558\ub77c. \uc801\uc9c4 \uae4a\uc219\uc774 \uce68\ud22c\ud558\uc5ec \uadf8\ub4e4\uc758 \uc804\uc758\ub97c \uc0c1\uc2e4\uc2dc\ud0a4\uace0, \uc801\uc758 \uc758\ub3c4\ub97c \uc77d\uc5b4 \ud575\uc2ec \uc9c0\ud718\ubd80\ub97c \uc815\ubc00 \ud0c0\uaca9\ud558\ub77c. \uc9c0\ud718\uad00\uc740 \ubaa8\ub4e0 \ubcd1\ub825\uc744 \uc704\ud5d8\uc5d0 \ub358\uc838 \ub123\ub294 \uacfc\uac10\ud55c \uacb0\ub2e8\uacfc \ucc45\uc784\uc744 \uc838\uc57c \ud55c\ub2e4. \uc0c1\ub300\uc758 \ub300\uc751\uc5d0 \ub530\ub77c \uc804\uc220\uc744 \uc720\uc5f0\ud558\uac8c \ubc14\uafb8\uace0, \uc801\uc758 \ud575\uc2ec\ubd80\ub97c \uc9c1\uc811 \uacf5\uaca9\ud558\uae30\ubcf4\ub2e4 \uc804\uccb4\ub97c \uad50\ub780\ud558\uc5ec \uc2b9\ub9ac\ud558\uba70, \uac15\ub300\uad6d\uc5d0 \uc758\uc874\ud558\uc9c0 \uc54a\uace0 \uc2e0\ubb18\ud55c \uc804\ub7b5\uc73c\ub85c \uc801\uc9c4 \ud55c\uac00\uc6b4\ub370\uc11c\ub3c4 \uc2b9\ub9ac\uc758 \ubc1c\ud310\uc744 \ub9c8\ub828\ud558\ub77c. \n\u2022  \uc694\uc57d: \ud604\ub300\uc804\uc740 \uc9c0\ud615 \ubd84\uc11d, \uc815\ubcf4 \uc6b0\uc704, \uadf8\ub9ac\uace0 \uc2e0\uc18d\ud55c \uae30\ub3d9\uc804\uc774 \ud544\uc218\uc801\uc785\ub2c8\ub2e4. \uc801\uc758 \uc2ec\ub9ac\ub97c \uad50\ub780\ud558\uace0, \uc804\uba74\uc804 \ub300\uc2e0 \ud575\uc2ec \ubaa9\ud45c\ub97c \uc815\ubc00 \ud0c0\uaca9\ud558\uba70, \uc608\uce21 \ubd88\uac00\ub2a5\ud55c \ubc29\ubc95\uc73c\ub85c \uc8fc\ub3c4\uad8c\uc744 \uc7a1\ub294 \uac83\uc774 \uc911\uc694\ud569\ub2c8\ub2e4. \ub610\ud55c, \ub9ac\ub354\uc758 \uacb0\ub2e8\ub825\uacfc \ubd80\ub300 \ud1b5\uc194 \ub2a5\ub825\uc774 \uc2b9\ud328\ub97c \uc88c\uc6b0\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
B.ama=new A.a(" \ub2e4\uc591\ud55c \uc2dc\uc7a5 \ud658\uacbd\uc744 \ubd84\ub958\ud558\uace0, \uacbd\uc7c1\uc0ac\uac00 \uc608\uc0c1\uce58 \ubabb\ud558\ub294 \uc18d\ub3c4\ub85c \ud2c8\uc0c8\uc2dc\uc7a5\uc744 \uacf5\ub7b5\ud558\ub77c. \uc2dc\uc7a5\uc5d0 \uc120\uc81c\uc801\uc73c\ub85c \uc9c4\ucd9c\ud558\uc5ec \uacbd\uc7c1\uc0ac\uc758 \ud63c\ub780\uc744 \uc720\ub3c4\ud558\uace0, \uace0\uac1d\uc758 \ub2c8\uc988\ub97c \uc77d\uc5b4 \uacbd\uc7c1\uc0ac\uc758 \ud575\uc2ec \uc2dc\uc7a5\uc744 \uad50\ubb18\ud558\uac8c \ube7c\uc557\uc544\ub77c. \uacbd\uc601\uc790\ub294 \ubaa8\ub4e0 \uc790\uc6d0\uc744 \ud22c\uc785\ud558\ub294 \uacfc\uac10\ud55c \uacb0\uc815\uacfc \ucc45\uc784\uc744 \uc838\uc57c \ud55c\ub2e4. \uacbd\uc7c1\uc0ac\uc758 \uc804\ub7b5 \ubcc0\ud654\uc5d0 \ub530\ub77c \uc6b0\ub9ac \uae30\uc5c5\uc758 \uc804\uc220\uc744 \uc720\uc5f0\ud558\uac8c \ubc14\uafb8\uace0, \uacbd\uc7c1\uc0ac \uc804\uccb4\ub97c \ubb34\ub108\ub728\ub9ac\uae30\ubcf4\ub2e4 \ud575\uc2ec \ube44\uc988\ub2c8\uc2a4 \ubaa8\ub378\uc744 \uad50\ub780\ud558\uc5ec \uc2b9\ub9ac\ud558\uba70, \uac70\ub300 \uae30\uc5c5\uc5d0 \uc758\uc874\ud558\uc9c0 \uc54a\uace0 \ub3c5\ucc3d\uc801\uc778 \uc544\uc774\ub514\uc5b4\ub85c \uc2dc\uc7a5\uc758 \uc57d\uc810\uc5d0\uc11c \uc0c8\ub85c\uc6b4 \uac00\uce58\ub97c \ucc3d\ucd9c\ud558\ub77c. \n\u2022  \uc694\uc57d: \ube44\uc988\ub2c8\uc2a4 \uc131\uacf5\uc740 \uc2dc\uc7a5 \ud658\uacbd\uc744 \uc815\ud655\ud788 \uc774\ud574\ud558\uace0, \ube60\ub978 \uc2e4\ud589\ub825\uc73c\ub85c \uae30\ud68c\ub97c \uc120\uc810\ud558\ub294 \ub370 \uc788\uc2b5\ub2c8\ub2e4. \uacbd\uc7c1\uc0ac\uc758 \uc57d\uc810\uc744 \ud30c\uace0\ub4e4\uc5b4 \uc2dc\uc7a5\uc744 \uad50\ub780\ud558\uace0, \uc9c1\uc811\uc801\uc778 \uacbd\uc7c1\ubcf4\ub2e4 \ud601\uc2e0\uc801\uc778 \uc544\uc774\ub514\uc5b4\ub85c \uc6b0\uc704\ub97c \uc810\ud558\ub294 \uac83\uc774 \uc911\uc694\ud569\ub2c8\ub2e4. \ub610\ud55c, \uacbd\uc601\uc790\uc758 \uacfc\uac10\ud55c \uc758\uc0ac\uacb0\uc815\uacfc \ucc45\uc784\uac10\uc774 \uae30\uc5c5\uc758 \uc131\uc7a5\uc744 \uc774\ub04c\uc5b4\ub0c5\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
B.apC=new A.a("\uacbd\uae30\uc7a5\uc758 \ub2e4\uc591\ud55c \ud2b9\uc131\uc744 \ud30c\uc545\ud558\uace0, \uc0c1\ub300\uac00 \uc608\uce21\ud558\uc9c0 \ubabb\ud558\ub294 \uc18d\ub3c4\ub85c \uacf5\uaca9\uc744 \uc804\uac1c\ud558\ub77c. \uc0c1\ub300 \uc9c4\uc601 \uae4a\uc219\uc774 \uce68\ud22c\ud558\uc5ec \uadf8\ub4e4\uc758 \uc218\ube44 \uade0\ud615\uc744 \ubb34\ub108\ub728\ub9ac\uace0, \uc0c1\ub300 \uc120\uc218\uc758 \uc758\ub3c4\ub97c \uc77d\uc5b4 \ud575\uc2ec \uacf5\uaca9\uc218\ub97c \ubb34\ub825\ud654\uc2dc\ucf1c\ub77c. \uac10\ub3c5\uc740 \ubaa8\ub4e0 \uc120\uc218\ub4e4\uc744 \ud22c\uc785\ud558\ub294 \uacfc\uac10\ud55c \uc804\uc220\uc801 \uacb0\uc815\uacfc \ucc45\uc784\uc744 \uc838\uc57c \ud55c\ub2e4. \uc0c1\ub300 \ud300\uc758 \uc804\uc220 \ubcc0\ud654\uc5d0 \ub530\ub77c \uc6b0\ub9ac \ud300\uc758 \ud50c\ub808\uc774\ub97c \uc720\uc5f0\ud558\uac8c \ubc14\uafb8\uace0, \uc0c1\ub300 \ud300 \uc804\uccb4\ub97c \uc555\ub3c4\ud558\uae30\ubcf4\ub2e4 \ud575\uc2ec \uc804\ub7b5\uc744 \ud30c\uace0\ub4e4\uc5b4 \uc2b9\ub9ac\ud558\uba70, \uae30\uc874 \uac15\ud300\uc758 \uc804\ub7b5\uc5d0 \uc5bd\ub9e4\uc774\uc9c0 \uc54a\uace0 \ub3c5\uc790\uc801\uc778 \uc804\uc220\ub85c \uc0c1\ub300\uc758 \ud5c8\uc810\uc744 \uacf5\ub7b5\ud558\uc5ec \uc2b9\ub9ac\ub97c \uc7c1\ucde8\ud558\ub77c. \n\u2022  \uc694\uc57d: \uc2a4\ud3ec\uce20 \uacbd\uae30\uc5d0\uc11c \uc2b9\ub9ac\ub294 \uacbd\uae30\uc7a5 \ud658\uacbd\uacfc \uc0c1\ub300 \ud300\uc5d0 \ub300\ud55c \ucca0\uc800\ud55c \ubd84\uc11d, \uadf8\ub9ac\uace0 \uc2e0\uc18d\ud558\uace0 \uc608\uce21 \ubd88\uac00\ub2a5\ud55c \ud50c\ub808\uc774\uc5d0 \ub2ec\ub824 \uc788\uc2b5\ub2c8\ub2e4. \uc0c1\ub300\uc758 \uc2ec\ub9ac\ub97c \ud754\ub4e4\uace0, \uc9c1\uc811\uc801\uc778 \ub300\uacb0\ubcf4\ub2e4 \uc57d\uc810\uc744 \ud30c\uace0\ub4dc\ub294 \uc804\ub7b5\uc774 \uc911\uc694\ud569\ub2c8\ub2e4. \ub610\ud55c, \uac10\ub3c5\uc758 \uacb0\ub2e8\ub825\uacfc \uc120\uc218\ub2e8\uc744 \ud558\ub098\ub85c \ubb36\ub294 \ub9ac\ub354\uc2ed\uc774 \ud300\uc758 \uc2b9\ud328\ub97c \uacb0\uc815\uc9d3\uc2b5\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
