B.adW=new A.a("\ud83d\udcda 12: The Attack by Fire(\u706b\u653b) \u2013 3\n",null,B.a,null,B.m)
B.ave=new A.a("  \u2022 \u706b\u4f50\u653b\u8005(hu\u01d2 zu\u01d2 g\u014dng zh\u011b): One who assists the attack with fire. \n  \u2022 \u660e(m\xedng): Bright, clear (wise and insightful). \n  \u2022 \u4ee5\u6c34\u4f50\u653b\u8005(y\u01d0 shu\u01d0 zu\u01d2 g\u014dng zh\u011b): One who assists the attack with water. \n  \u2022 \u5f3a(qi\xe1ng): Strong, powerful. \n  \u2022 \u6c34(shu\u01d0): Water. \n   \u2022 \u53ef\u4ee5\u7d76(k\u011b y\u01d0 ju\xe9): Can cut off (traffic/supply routes, communication, etc.). \n  \u2022 \uf967\u53ef\u4ee5\u596a(b\xf9 k\u011b y\u01d0 du\xf3): Cannot seize (cannot be possessed/occupied).  \n\n",null,B.a,null,B.c)
B.aq7=new A.a("\u201cUsing fire to assist an attack makes the strategy clearly visible, but using water to assist an attack yields powerful effects. Water can cut off the enemy's path, but it cannot seize the enemy's materials.\u201d",null,B.a,null,B.c)
