B.a85=new A.a(" 1.\t\u706b\u4f50\u653b\u8005\u660e (One who assists the attack with fire is clear): An attack using fire has quick and visually clear effects. It is effective in directly inflicting damage on the enemy and instilling confusion and fear, and its results are obvious. However, at the same time, the presence and intentions of one's own army can also be clearly exposed. \n\n 2.\t\u4ee5\u6c34\u4f50\u653b\u8005\u5f3a (One who assists the attack with water is strong): An attack using water is extremely powerful. It can cause widespread and fatal damage, such as by causing floods or submerging enemy supply routes. Its destructive power is enormous as it utilizes the immense force of nature. \n\n 3.\t\u6c34\u53ef\u4ee5\u7d76 \u4e0d\u53ef\u4ee5\u596a (Water can cut off but cannot seize): Water is powerful for cutting off enemy supply lines or retreat paths or isolating the enemy, but it cannot directly 'seize' the enemy's materials or spoils. Instead, it only submerges or renders them unusable. This clearly points out the limitation that while water attack is capable of destruction, it is difficult to directly convert it into one's own profit. \n\n",null,B.a,null,B.c)
