B.afd=new A.a("  \u2022 \u51e1(f\xe1n): Generally, all. \n  \u2022 \u8ecd\u4e4b\u6240\u6b32\u64ca(j\u016bn zh\u012b su\u01d2 y\xf9 j\u012b): The target the army wishes to attack. \n  \u2022 \u57ce\u4e4b\u6240\u6b32\u653b(ch\xe9ng zh\u012b su\u01d2 y\xf9 g\u014dng): The place among cities it wishes to attack. \n  \u2022 \u4eba\u4e4b\u6240\u6b32\u6bba(r\xe9n zh\u012b su\u01d2 y\xf9 sh\u0101): The person it wishes to kill. \n  \u2022 \u5fc5\u5148\u77e5(b\xec xi\u0101n zh\u012b): Must first know. \n  \u2022 \u5b88\u5c07(sh\u01d2u ji\xe0ng): Commander, general in charge of defense. \n  \u2022 \u5de6\u53f3(zu\u01d2 y\xf2u): Aides, close associates. \n  \u2022 \u8b01\u8005(y\xe8 zh\u011b): Gatekeeper, person in charge of granting access. \n  \u2022 \u9580\u8005(m\xe9n zh\u011b): Person guarding the gate. \n  \u2022 \u820d\u4eba(sh\xe8 r\xe9n): Attendant, servant, close associate. \n  \u2022 \u59d3\u540d(x\xecng m\xedng): Name. \n  \u2022 \u4ee4\u543e\u9593(l\xecng w\xfa ji\xe0n): Order our spies. \n  \u2022 \u5fc5\u7d22\u77e5\u4e4b(b\xec su\u01d2 zh\u012b zh\u012b): Must investigate and ascertain them.  \n\n",null,B.a,null,B.c)
B.atG=new A.a("\u201cWhenever the army wishes to attack an enemy position, a city, or a person, it must first ascertain the names of their commanding general, his close aides, gatekeepers, and attendants. Order our spies to thoroughly investigate and ascertain their names and information. \u201d",null,B.a,null,B.c)
