B.avk=new A.a(" 1.\tClarification of Attack Objectives: The more specific the attack objective (the army to attack, the city to occupy, the specific person to eliminate), the clearer the direction of intelligence gathering. \n\n 2.\tImportance of Key Personnel Information: To successfully achieve the objective, it is essential to have in-depth information about the key individuals operating and defending that target, beyond merely knowing the enemy's troop strength or weapon types. \n\n 3.\tEmphasis on Detailed Information: It specifically instructs to know not only the 'commanding general (\u5b88\u5c07)' but also his 'close aides (\u5de6\u53f3)', 'gatekeepers (\u8b01\u8005)', 'guards (\u9580\u8005)', and 'attendants (\u820d\u4eba)'\u2014all individuals directly related to the target\u2014even their 'names (\u59d3\u540d)'. This is because their personalities, vulnerabilities, and relationships can be leveraged in operations. \n\n 4.\tSpecific Directives for Spy Utilization: The commander must order his spies (\u9593) to find out such detailed information. This suggests that intelligence activities are not merely accidental but should be conducted under the direct command and management of the supreme commander. \n\n",null,B.a,null,B.c)
