B.a9p=new A.a(" 1.\tTarget-Centric Information Gathering: Instead of abstract information, specific and in-depth information about individuals directly related to the attack objective must be collected. \n\n 2.\tImportance of Human Network: It is important to identify not only the top leader of the target organization or group but also their key aides and practical staff in their human network. Through them, one can understand the leader's tendencies, weaknesses, and information flow. \n\n 3.\tData Segmentation: Beyond merely knowing positions or roles, detailed information such as individuals' names, backgrounds, and personalities must be known. This information can be used for psychological warfare, persuasion, and disruption. \n\n 4.\tCommander's Control of Intelligence Activities: Intelligence activities should be conducted under the clear direction and objective setting of the supreme commander, rather than being left to the autonomy of intelligence sources. \n\n 5.\tPreemptive Information: Emphasizes that knowing such information in advance of an attack is key to the success of the operation. \n\n",null,B.a,null,B.c)
