B.alm=new A.a(" 1.\t\u63a0\u9115\u5206\u8846 (Plunder the countryside and disperse the troops):\n\u2022\tMeaning: Entering enemy territory, plundering the countryside (\u9115) and distributing (\u5206) the spoils of war to the soldiers (\u8846), thereby boosting morale and solving supply issues. Here, 'dispersing (\u5206\u8846)' means distributing the plunder so soldiers can take their share, which can imply a temporary dispersion or relaxation from combat. \n\n  2.\t\u5ed3\u5730\u5206\u5229 (Expand territory and share benefits):\n\u2022\tMeaning: Beyond plundering, it means expanding (\u5ed3) and occupying enemy territory (\u5730), and distributing (\u5206) the continuous benefits (\u5229) that can be gained from that territory. This refers to pursuing gains through the long-term management and governance of occupied areas. \n\n   3.\t\u61f8\u6b0a\u800c\u52d5 (Weighing the circumstances like a scale and then acting):\n\u2022\tMeaning: This emphasizes that when undertaking all military actions, including those mentioned above, one must meticulously 'weigh and assess' (\u61f8\u6b0a) changes in the situation, interests, advantages and disadvantages, like balancing a scale, and then apply improvisational strategies (\u6b0a\u9053) and move (\u800c\u52d5). This requires a commander's ability to judge and execute flexibly without being constrained by fixed principles.\n\n ",null,B.a,null,B.c)
