B.aoT=new A.a(" 1.\tImportance of Performance Distribution: Beyond achieving direct military objectives, practical rewards such as distributing spoils of war are important for boosting soldiers' morale and motivating them. \n\n  2.\tPursuing Sustainable Gains: Beyond short-term plundering, long-term gain-generating methods such as territorial expansion and management should also be considered.\n\n  3.\tUtilizing Expediency: It is essential to possess the wisdom to not be bound by fixed principles, but rather to improvise (\u6b0a\u9053) in the most advantageous way according to changes in the situation.\n\n  4.\tMeticulous Judgment and Execution: Before every action, meticulously weigh and assess gains and losses, opportunities and risks, and then move cautiously. \n\n  5.\tAdjusting Interests: Implies that military actions should not simply be about victory, but should also be connected to the practical gains of the participants.\n\n ",null,B.a,null,B.c)
