B.aa9=new A.a("This passage explains that the secret to how one's own forces can seize the initiative in war, move the enemy at will, and secure victory safely for themselves lies in the application of 'qi zheng (\u5947\u6b63)'.\n\n",null,B.a,null,B.c)
B.ay8=new A.a(" 1.\tAbility to Control the Enemy (\u53ef\u4f7f\u5fc5\u53d7\u6575):\n  \u2022\tMeaning: Refers to the ability to move the enemy according to one's own intentions. Being able to make the enemy 'inevitably receive' one's attack means that one's own forces have complete control of the battlefield and can induce or predict the enemy's actions. This includes the ability to lure, isolate, and drive the enemy into a weak position.\n\n 2.\tGuarantee of One's Own Invincibility (\u800c\u7121\u6557\u8005):\n   \u2022\tMeaning: Means ensuring that one's own forces will never be defeated even while controlling the enemy. This assumes that one's own forces are strictly adhering to the principle of 'xian wei bu ke sheng (\u5148\u7232\u4e0d\u53ef\u52dd - first making oneself invincible)'. In other words, it means achieving maximum effect while minimizing risk.\n\n 3.\tApplication of Qi Zheng (\u5947\u6b63):\n   \u2022\t\u5947 (qi): Refers to unpredictable, irregular, unconventional tactics. This includes striking the enemy's weak points, attacking from unexpected directions, carrying out deception operations, etc. It is used to confuse the enemy and break their defenses.\n\n \u2022\t\u6b63 (zheng): Refers to predictable, regular, frontal tactics. This means textbook tactics, frontal attacks, basic troop deployments, etc. It is used to tie down the enemy's main force or establish basic defensive lines.\n\n \u2022\tApplication: This is a strategy of appropriately combining and flexibly switching between these two (qi and zheng) to confuse the enemy and move them according to one's own intentions, while maintaining one's own safety. That is, various combinations are possible, such as using zheng to attract the enemy's attention and qi to deliver the decisive blow, or luring the enemy with qi and then encircling them with zheng.\n\n",null,B.a,null,B.c)
