B.aby=new A.a(" 1.\tBattlefield Initiative: The key to victory is to completely seize the initiative on the battlefield by moving the enemy according to one's own intentions.\n\n 2.\tDeception and Luring: It is important to confuse the enemy's judgment through 'qi' and lure them to the desired location for an attack.\n\n 3.\tFlexible Tactical Transition: By freely switching and combining 'zheng' and 'qi' according to the situation, one can launch unpredictable attacks and confuse the enemy.\n\n 4.\tInvincible Strategy: One must maintain a solid state where one is not defeated even when receiving enemy attacks. This requires thorough preparation and defense as prerequisites.\n\n 5.\tUnpredictability: Making one's tactics difficult for the enemy to predict, and exploiting their predictable patterns to cause chaos, is the core of qi zheng operation.\n\n",null,B.a,null,B.c)
