B.amr=new A.a("\u318d\u6bba\u6575\u8005(sh\u0101 d\xed zh\u011b): The act of killing the enemy (fighting the enemy) \n\u318d\u6012\u4e5f(n\xf9 y\u011b): Is due to anger (soldiers' anger) \n\u318d\u53d6\u6575\u4e4b\u5229\u8005(q\u01d4 d\xed zh\u012b l\xec zh\u011b): The act of taking the enemy's profit (acquiring enemy materiel or resources) \n\u318d\u8ca8\u4e5f(hu\xf2 y\u011b): Is due to wealth (rewards, spoils) \n\n",null,B.a,null,B.c)
B.aur=new A.a("The reason soldiers attack the enemy is anger (emotional motivation), and the reason they want to seize the enemy's resources is the desire for wealth (material rewards).",null,B.a,null,B.c)
