B.add=new A.a("This passage presents two important driving forces and means for subduing the enemy in war. \n\n",null,B.a,null,B.c)
B.art=new A.a("1.\tDriving Force for Killing (Subduing) the Enemy: It states that the ultimate driving force for killing or subduing the enemy is the anger (\u6012) of the soldiers. Here, anger means more than just emotional rage; it encompasses the fighting spirit, morale, and strong will to win in war. It means that soldiers must have high morale and a strong will to fight to actively attack and subdue the enemy. \n\n2.\tMeans of Seizing Enemy Profit (Resources): However, it explains that beyond merely annihilating the enemy, taking (\u53d6) the enemy's profit (\u5229), meaning their resources or advantages (food, weapons, territory, etc.), depends on wealth (\u8ca8). Here, wealth does not just mean money but encompasses all materiel, supplies, and resources necessary for waging war. This emphasizes the strategic importance of seizing enemy supplies to reduce friendly consumption, enhance the sustainability of the battlefield, and further weaken the enemy's war-fighting capabilities. \n\n",null,B.a,null,B.c)
