B.arl=new A.a(" \u2022\t\u7d76\u6f97(ju\xe9 ji\xe0n): Broken ravine, rugged valley.\n \u2022 \u7a7f\u4e95(chu\u0101n j\u01d0ng): To dig a well (narrow and deep place).\n \u2022 \u7a7f\u7262(chu\u0101n l\xe1o): To dig a deep place like a cave.\n \u2022 \u7a7f\u7f85(chu\u0101n lu\xf3): To dig through complex, entangled terrain.\n \u2022 \u7a7f\u6975(chu\u0101n j\xed): To dig to an extremely deep place.\n \u2022 \u5fc5\u6975\u4e4b\u8def(b\xec j\xed zh\u012b l\xf9): A path that must lead to an extreme situation.\n \u2022 \u52ff\u8fd1\u4e5f(w\xf9 j\xecn y\u011b): Do not approach \n\n ",null,B.a,null,B.c)
B.aqI=new A.a("\u201cDo not approach paths that lead to an extreme situation, such as broken ravines (\u7d55\u6f97), well-like paths (\u7a7f\u4e95 - like a pitfall), cage-like paths (\u7a7f\u7262 - easy to get trapped), net-like paths (\u7a7f\u7f85 - difficult to escape like a net), or dead-end paths (\u7a7f\u6975).\u201d",null,B.a,null,B.c)
