B.axd=new A.a(" This passage specifically lists five types of dangerous terrain and situations that armies must absolutely avoid, emphasizing that avoiding such places is the best policy. It warns of the dangers of ambush, isolation, inescapable traps, etc.\n\n",null,B.a,null,B.c)
B.ar3=new A.a(" 1.\t\u7d76\u6f97 (Broken Ravine):\n\u2022\tMeaning: Refers to a valley or narrow passage where the road is cut off or rugged, making further progress impossible. It is vulnerable to enemy ambushes, supplies are easily cut off, and retreat routes can be blocked. \n\n 2.\t\u7a7f\u4e95 (Well-like Path):\n\u2022\tMeaning: Refers to a narrow, deep space where one is easily trapped, like inside a well, or terrain where one can easily be isolated. Escape is difficult, and one can easily be surrounded by the enemy. \n\n 3.\t\u7a7f\u7262 (Cage-like Path):\n\u2022\tMeaning: Refers to a confined space or terrain, like a prison or cage, from which it is difficult to escape once entered. One could become trapped by the enemy and unable to move. \n\n 4.\t\u7a7f\u7f85 (Net-like Path):\n\u2022\tMeaning: Refers to an area where one can easily fall into enemy traps or encirclements, like a bird caught in a net. It warns of the danger when lured into such an area by enemy deceptive tactics. \n\n 5.\t\u7a7f\u6975 (Dead-End Path):\n\u2022\tMeaning: Refers to terrain like a dead-end alley or a cliff edge where there is no further progress. This connects to 'death ground' (\u6b7b\u5730), where there is no option but a desperate fight. \n\n",null,B.a,null,B.c)
