B.ap_=new A.a(" 1.\tPrior Identification and Avoidance of Risk: Accurately identifying potential risk factors in advance and not entering such situations or terrain at all is the best strategy. \n\n 2.\tMaintaining Control: Situations where friendly forces lose initiative and are dragged along by the enemy must be avoided at all costs. \n\n 3.\tImportance of Securing Retreat Routes: Before any tactical action, always ensure a safe retreat route for friendly forces, and do not go to places where retreat routes are at risk of being blocked. \n\n 4.\tBattlefield Environment Analysis: Not only geographical features but also all environmental factors that restrict friendly actions or benefit the enemy must be identified and guarded against. \n\n 5.\tAvoiding Reckless Ventures: In situations with high uncertainty and risk, it is wiser to choose a safe and certain path rather than embarking on reckless ventures. \n\n",null,B.a,null,B.c)
