B.ahU=new A.a("This passage explains the essence and effect of the 'xu shi' strategy for achieving victory through a powerful analogy. The core is to 'attack the opponent's weak point (egg) with overwhelming strength (millstone).\n\n'",null,B.a,null,B.c)
B.awN=new A.a(" 1.\tSymbolism of the Millstone (\u78aa): \n \u2022\tMeaning: Symbolizes one's overwhelming power, solidity, and strong offensive capability. This includes not only physical strength but also thorough preparation, advantageous disposition, high morale, perfect strategy, etc., in their entirety. It is one's own 'shi (\u5be6)' built through 'xian wei bu ke sheng (\u5148\u7232\u4e0d\u53ef\u52dd)'.\n\n 2.\tSymbolism of the Egg (\u5375):\n \u2022\tMeaning: Symbolizes the enemy's vulnerabilities, weak points, weaknesses, and state of carelessness. It refers to places where the enemy is unprepared, forces are dispersed, or defensive lines are weak. This is the enemy's 'xu (\u865b)'.\n\n 3.\tAct of Throwing and Breaking (\u6295\u5375):\n \u2022\tMeaning: Represents the inevitable and overwhelming process of victory where one's strength (millstone) is concentrated on the enemy's weakness (egg) to shatter it in one blow. Just as an egg naturally breaks when a millstone is thrown at it, applying xu shi perfectly leads to inevitable victory.\n\n 4.\tApplication of Xu Shi (\u865b\u5be6):\n \u2022\t\u865b (xu): The enemy's weaknesses, poorly defended areas, dispersed forces.\n \u2022\t\u5be6 (sh\xed): One's strengths, concentrated forces, perfectly defended areas.\n \u2022\tApplication: This is a strategy where one's own forces carefully preserve and strengthen their 'shi (\u5be6)', accurately identify the enemy's 'xu (\u865b)', and then project their 'shi (\u5be6)' intensively onto that 'xu (\u865b)'. In other words, striking the enemy's weak point to efficiently utilize one's strengths is the essence of the 'xu shi' tactic.\n",null,B.a,null,B.c)
