B.af9=new A.a("\ubaa8\uacf5(\u8b00\u653b)\ud3b8\uc5d0\uc11c\ub294 \uc804\uc7c1(\uacbd\uc7c1)\uc740 \ucd5c\uace0\uc758 \uc9c0\ud61c\ub97c \ud1b5\ud574 \uc190\uc2e4\uc744 \ucd5c\uc18c\ud654\ud558\uace0 \uc2b9\ub9ac\ub97c \uac70\ub450\ub294 \uac83\uc744 \ubaa9\ud45c\ub85c \ud558\uba70, \uc774\ub97c \uc704\ud574 \uc804\ub7b5\uc801 \uae4a\uc774\uc640 \uc9c0\ud718\uad00\uc758 \uc5ed\ub7c9, \uadf8\ub9ac\uace0 \uc815\ubcf4\uc758 \uc911\uc694\uc131\uc744 \uadf9\ub300\ud654\ud574\uc57c \ud568\uc744 \uac15\uc870\ud569\ub2c8\ub2e4. \ub2e8\uc21c\ud788 \uc804\ud22c\uc5d0\uc11c \uc774\uae30\ub294 \uac83\uc744 \ub118\uc5b4, \uc2f8\uc6b0\uc9c0 \uc54a\uace0 \uc774\uae30\ub294 \uac83\uc774 \uac00\uc7a5 \uc774\uc0c1\uc801\uc778 \uc2b9\ub9ac\uc774\uba70, \uc774\ub97c \uc704\ud55c \ub9ac\ub354\uc758 \uc5ed\ud560\uc774 \uacb0\uc815\uc801\uc785\ub2c8\ub2e4.\n\n",null,B.a,null,B.t)
B.anH=new A.a("\uc804\uc7c1\uc744 \uad6d\uac00\uc758 \ud765\ub9dd\uc131\uc1e0\ub97c \uacb0\uc815\ud558\ub294 \uc911\ub300\uc0ac\ub85c \ubcf4\uace0, \ub2e8\uc21c\ud788 \ubb34\ub825 \ucda9\ub3cc\uc744 \ub118\uc5b4\uc120 \uace0\ub3c4\uc758 \uc804\ub7b5\uacfc \uc9c0\ud61c\ub97c \uac15\uc870\ud569\ub2c8\ub2e4. \uc694\uc57d\ud558\uc790\uba74 \ub2e4\uc74c\uacfc \uac19\uc2b5\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
B.a6k=new A.a("1.\t\uad81\uadf9\uc801 \uc2b9\ub9ac \ubaa9\ud45c: \uc801\uad6d\uc744 \ud30c\uad34\ud558\uae30\ubcf4\ub2e4\ub294 \uc628\uc804\ud788 \ubcf4\uc804\ud558\uba74\uc11c \uc2b9\ub9ac\ud558\ub294 \uac83\uc774 \ucd5c\uc0c1\uc774\uba70, \uc774\ub97c \uc704\ud574 \uc2f8\uc6b0\uc9c0 \uc54a\uace0 \uc801\uc744 \uad74\ubcf5\uc2dc\ud0a4\ub294 \u2018\uc2f8\uc6b0\uc9c0\uc54a\uace0 \uc2b9\ub9ac\ud558\ub294 \uac83\u2019\uc744 \uac00\uc7a5 \ub192\uc740 \uac00\uce58\ub85c \uc5ec\uae41\ub2c8\ub2e4. \ubc31 \ubc88 \uc2f8\uc6cc \ubc31 \ubc88 \uc774\uae30\ub294 \uac83\uc740 \uac89\ubcf4\uae30\uc5d0\ub294 \ud6cc\ub96d\ud558\ub098, \uadf8 \uacfc\uc815\uc5d0\uc11c \ubc1c\uc0dd\ud558\ub294 \uc18c\ubaa8\uc640 \ud53c\ud574\ub97c \uace0\ub824\ud558\uba74 \ucd5c\uc120\uc774 \uc544\ub2d9\ub2c8\ub2e4.\n\n2.\t\uc804\ub7b5\uc758 \uc6b0\uc120\uc21c\uc704: \uc2f8\uc6b0\uc9c0 \uc54a\uace0 \uc774\uae30\uae30 \uc704\ud55c \ubc29\ubc95\ub860\uc73c\ub85c, \ubaa8\ub7b5\uacfc \uc9c0\ub7b5(\u4f10\u8b00)\uc774 \ucd5c\uc0c1\ucc45\uc774\uba70, \ub2e4\uc74c\uc740 \uc678\uad50\uc801 \uc218\ub2e8(\u4f10\u4ea4), \uadf8 \ub2e4\uc74c\uc774 **\uc9c1\uc811\uc801\uc778 \ubcd1\ub825 \uc0ac\uc6a9(\u4f10\u5175)**\uc785\ub2c8\ub2e4. \uac00\uc7a5 \ud53c\ud574\uc57c \ud560 \ucd5c\ud558\ucc45\uc740 \uacf5\uc131\uc804(\u653b\u57ce)\uc73c\ub85c, \uc774\ub294 \ub9c9\ub300\ud55c \uc190\uc2e4\uc744 \uc218\ubc18\ud558\uae30 \ub54c\ubb38\uc785\ub2c8\ub2e4.\n\n3.\t\ubcd1\ub825 \uaddc\ubaa8\uc5d0 \ub530\ub978 \uc720\uc5f0\ud55c \ub300\uc751: \uc790\uc2e0\uc758 \ubcd1\ub825 \uaddc\ubaa8\uc640 \uc801\uc758 \ubcd1\ub825 \uaddc\ubaa8\ub97c \uc815\ud655\ud788 \ube44\uad50\ud558\uc5ec \uc0c1\ud669\uc5d0 \ub9de\ub294 \uc720\uc5f0\ud55c \uc804\ub7b5\uc744 \uad6c\uc0ac\ud574\uc57c \ud569\ub2c8\ub2e4. \uc555\ub3c4\uc801\uc778 \uc6b0\uc704 \uc2dc\uc5d0\ub294 \ud3ec\uc704\ud558\uac70\ub098 \uacf5\uaca9\ud558\uace0, \ub300\ub4f1\ud558\uac70\ub098 \uc5f4\uc138\uc77c \uacbd\uc6b0\uc5d0\ub294 \uc2f8\uc6c0\uc744 \ud53c\ud558\uac70\ub098 \ub2ec\uc544\ub098\ub294 \ub4f1 \uc190\uc2e4\uc744 \ucd5c\uc18c\ud654\ud558\ub294 \uc9c0\ud61c\ub85c\uc6b4 \ud310\ub2e8\uc744 \uac15\uc870\ud569\ub2c8\ub2e4.\n\n4.\t\ub9ac\ub354\uc2ed\uc758 \uc911\uc694\uc131: \uc7a5\uc218(\ub9ac\ub354)\ub294 \uad6d\uac00 \ub610\ub294 \uc870\uc9c1\uc758 \ubcf4\ud544\uc790\ub85c\uc11c, \uadf8\uc758 \ub2a5\ub825\uacfc \ud310\ub2e8\uc774 \uc644\ubcbd\ud558\uba74 \uc870\uc9c1\uc774 \uac15\ud574\uc9c0\uace0, \ud2c8\uc774 \uc0dd\uae30\uba74 \uc57d\ud574\uc9d1\ub2c8\ub2e4. \ub610\ud55c, \ub9ac\ub354\ub294 \ud604\uc7a5 \uc0c1\ud669\uc744 \uc815\ud655\ud788 \ud30c\uc545\ud558\uace0, \uc804\ubb38\uc131\uc744 \uc874\uc911\ud558\uba70, \ucc45\uc784\uc5d0 \uac78\ub9de\uc740 \uad8c\ud55c\uc744 \uc704\uc784\ud574\uc57c \ud569\ub2c8\ub2e4. \ud604\uc7a5\uc744 \ubaa8\ub978 \ucc44 \ub0b4\ub9ac\ub294 \uc9c0\uc2dc, \ube44\uc804\ubb38\uc801\uc778 \uac04\uc12d, \uad8c\ud55c \uc5c6\ub294 \ucc45\uc784\uc740 \uc870\uc9c1\uc744 \ud63c\ub780\uc5d0 \ube60\ub728\ub9ac\uace0 \ubd88\uc2e0\uc744 \uc57c\uae30\ud569\ub2c8\ub2e4.\n\n5.\t\uc2b9\ub9ac\uc758 \ub2e4\uc12f \uac00\uc9c0 \uc870\uac74: \uc131\uacf5\uc744 \uc704\ud55c \ud575\uc2ec \uc870\uac74\uc73c\ub85c \uc2f8\uc6b8 \ub54c\uc640 \ud53c\ud560 \ub54c\ub97c \uc544\ub294 \uc9c0\ud61c, \uc804\ub825\uc758 \ub9ce\uace0 \uc801\uc74c\uc5d0 \ub530\ub978 \uc6a9\ubcd1\uc220, \uc870\uc9c1 \uad6c\uc131\uc6d0 \ubaa8\ub450\uc758 \ub2e8\ud569\ub41c \uc758\uc9c0, \ucca0\uc800\ud55c \uc0ac\uc804 \uc900\ube44, \uadf8\ub9ac\uace0 \uc720\ub2a5\ud55c \ud604\uc7a5 \ub9ac\ub354\uc5d0 \ub300\ud55c \ucd5c\uace0 \uacb0\uc815\uad8c\uc790\uc758 \uc2e0\ub8b0\uc640 \ube44\uac04\uc12d\uc744 \uaf3d\uc2b5\ub2c8\ub2e4.\n\n6.\t\uc2b9\ub9ac\uc758 \uadfc\ubcf8 \uc6d0\uce59: \uc774 \ubaa8\ub4e0 \uac83\uc758 \ubc14\ud0d5\uc5d0\ub294 '\uc9c0\ud53c\uc9c0\uae30(\u77e5\u5f7c\u77e5\u5df1)', \uc989 \uc801(\uc0c1\ub300\ubc29)\uc744 \uc815\ud655\ud788 \uc54c\uace0 \ub098(\uc790\uc2e0)\ub97c \uac1d\uad00\uc801\uc73c\ub85c \uc544\ub294 \uac83\uc774 \uc804\uc81c\ub418\uc5b4\uc57c \ud569\ub2c8\ub2e4. \uc774\ub97c \ud1b5\ud574 \ubc31 \ubc88 \uc2f8\uc6cc\ub3c4 \uc704\ud0dc\ub86d\uc9c0 \uc54a\uc740(\u767e\u6230\u4e0d\u6b86) \uc0c1\ud0dc, \uc989 \ud56d\uc0c1 \uc720\ub9ac\ud55c \uc704\uce58\uc5d0\uc11c \uc8fc\ub3c4\uad8c\uc744 \uc7a1\uace0 \uc704\ud5d8\uc744 \ucd5c\uc18c\ud654\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
