B.axn=new A.a("\uc885\ud569\uc801\uc73c\ub85c \uc190\uc790\ubcd1\ubc95\uc740 \ubb3c\ub9ac\uc801\uc778 \ud798\uc758 \ub300\uacb0\uc744 \ub118\uc5b4\uc120 \uace0\ub3c4\uc758 \uc9c0\ud61c\uc640 \uc2ec\ub9ac\uc804, \uc815\ubcf4\uc804, \uc678\uad50\uc804, \uadf8\ub9ac\uace0 \ucca0\uc800\ud55c \uc900\ube44\uc640 \uc720\uc5f0\ud55c \ub9ac\ub354\uc2ed\uc774 \uc2b9\ud328\ub97c \uacb0\uc815\ud55c\ub2e4\uace0 \uac00\ub974\uce69\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
B.adL=new A.a("\ucd5c\uace0\uc758 \uc2b9\ub9ac\ub294 \ubb34\ud608\uc785\uc131\uc774\ub2e4. \uc801\uc758 \uc804\ub7b5\uc744 \ubb34\ub825\ud654\ud558\uace0, \uc544\uad70\uc758 \uc5ed\ub7c9\uc744 \uc815\ud655\ud788 \uc54c\uc544 \uc900\ube44\ub41c \uc0c1\ud669\uc5d0\uc11c\ub9cc \uc2f8\uc6cc\ub77c. \uc9c0\ud718\uad00\uc740 \ud604\uc7a5 \uc0c1\ud669\uc5d0 \ub2a5\ud1b5\ud558\uace0, \uc0c1\ubd80\ub294 \uadf8\uc5d0\uac8c \uc628\uc804\ud788 \uad8c\ud55c\uc744 \uc704\uc784\ud558\ub77c. \uc801\uc744 \uc54c\uace0 \ub098\ub97c \uc54c\uba74, \ubc31\uc804\ubc31\uc2b9\uc774 \uc544\ub2cc \ubc31\uc804\ubd88\ud328!\n\u2022\t\uc694\uc57d: \ud604\ub300 \uad70\ub300\ub294 \ubd88\ud544\uc694\ud55c \uc778\uba85 \ud53c\ud574\uc640 \uc790\uc6d0 \uc18c\ubaa8\ub97c \ud53c\ud558\uba70 \uc804\ub7b5\uc801 \ubaa9\ud45c\ub97c \ub2ec\uc131\ud558\ub294 \ub370 \uc911\uc810\uc744 \ub461\ub2c8\ub2e4. \uc815\ubcf4 \uc6b0\uc704, \uc815\ubc00 \ud0c0\uaca9, \uc678\uad50\uc801 \uc555\ubc15, \uadf8\ub9ac\uace0 \uc9c0\ud718\uad00\uc758 \uc790\uc728\uc801\uc778 \ud310\ub2e8\uacfc \ubcd1\uc0ac\ub4e4\uc758 \uc0ac\uae30 \uc9c4\uc791\uc774 \ud575\uc2ec\uc785\ub2c8\ub2e4. \uc804\uba74\uc804\uc740 \ucd5c\ud6c4\uc758 \uc218\ub2e8\uc774\uba70, \uc5b5\uc81c\ub825\uc744 \ud1b5\ud55c \ubd88\uc804\uc2b9\uc744 \uc9c0\ud5a5\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
B.ahM=new A.a("\ucd5c\uace0\uc758 \uc131\uacf5\uc740 \uacbd\uc7c1\uc0ac \ud761\uc218\uc640 \uc2dc\uc7a5 \ud601\uc2e0\uc774\ub2e4. \uc2dc\uc7a5\uacfc \uacbd\uc7c1\uc0ac\ub97c \uaff0\ub6ab\uace0, \uc790\uc0ac\uc758 \uac15\uc57d\uc810\uc744 \uc815\ud655\ud788 \uc54c\uc544 \uc900\ube44\ub41c \ud601\uc2e0\uc73c\ub85c \uacbd\uc7c1\uc790\ub97c \ubb34\ub825\ud654\ud558\ub77c. CEO\ub294 \ube44\uc804\uc744 \uc81c\uc2dc\ud558\uace0, \ud604\uc7a5 \ub9ac\ub354\uc5d0\uac8c \uc7ac\ub7c9\uad8c\uc744 \ubd80\uc5ec\ud558\ub77c. \uace0\uac1d\uacfc \uc2dc\uc7a5\uc744 \uc54c\uba74, \ubc31 \ubc88\uc758 \uacbd\uc7c1\uc5d0\ub3c4 \ud754\ub4e4\ub9bc \uc5c6\ub294 \uc131\uc7a5\uc774 \ubcf4\uc7a5\ub41c\ub2e4!\n\u2022\t\uc694\uc57d: \uae30\uc5c5 \uacbd\uc7c1\uc740 \ub2e8\uc21c\ud788 \uacbd\uc7c1\uc0ac\ub97c \ub3c4\ud0dc\uc2dc\ud0a4\ub294 \uac83\uc744 \ub118\uc5b4, \ud601\uc2e0\uc801\uc778 \ube44\uc988\ub2c8\uc2a4 \ubaa8\ub378 \uac1c\ubc1c, \uc804\ub7b5\uc801 \uc81c\ud734, M&A\ub97c \ud1b5\ud55c \uc2dc\ub108\uc9c0 \ucc3d\ucd9c\uc774 \uc911\uc694\ud569\ub2c8\ub2e4. \uc2dc\uc7a5 \ubd84\uc11d, \uace0\uac1d \uc774\ud574, \uacbd\uc7c1\uc0ac \ud30c\uc545, \uadf8\ub9ac\uace0 \uc870\uc9c1\uc6d0\uc758 \ub2e8\ud569\uacfc \ud604\uc7a5 \ud300 \ub9ac\ub354\uc758 \uc790\uc728\uc131\uc774 \uae30\uc5c5 \uc131\uc7a5\uc758 \ud575\uc2ec \ub3d9\ub825\uc785\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
B.a9L=new A.a("\ucd5c\uace0\uc758 \uc2b9\ub9ac\ub294 \uc644\ubcbd\ud55c \ubd84\uc11d\uc73c\ub85c \uc0c1\ub300\ub97c \uc555\ub3c4\ud558\ub294 \uac83\uc774\ub2e4. \uc0c1\ub300 \ud300\uc758 \uc804\uc220\uacfc \uc120\uc218 \uc57d\uc810\uc744 \uaff0\ub6ab\uace0, \uc6b0\ub9ac \ud300\uc758 \uac15\uc810\uc744 \uc815\ud655\ud788 \uc54c\uc544 \uc900\ube44\ub41c \uc804\uc220\ub85c \uacbd\uae30\ub97c \uc9c0\ubc30\ud558\ub77c. \uac10\ub3c5\uc740 \ud070 \uadf8\ub9bc\uc744 \uadf8\ub9ac\uace0, \uc8fc\uc7a5\uacfc \uc120\uc218\uc5d0\uac8c \uc784\uae30\uc751\ubcc0\uc758 \uc7ac\ub7c9\uad8c\uc744 \ubd80\uc5ec\ud558\ub77c. \uc0c1\ub300\uc640 \uc6b0\ub9ac \ud300\uc744 \uc54c\uba74, \ubc31\ubc88 \uacbd\uae30\ud574\ub3c4 \uc704\ud0dc\ub86d\uc9c0 \uc54a\uc740 \uc2b9\ub960\uc744 \uc720\uc9c0\ud55c\ub2e4!\n\u2022\t\uc694\uc57d: \uc2a4\ud3ec\uce20 \ud300\uc740 \uc0c1\ub300 \ud300 \ubd84\uc11d, \uc120\uc218 \uac1c\uac1c\uc778\uc758 \ub2a5\ub825 \ud30c\uc545, \ud300\uc6cc\ud06c \uac15\ud654, \uadf8\ub9ac\uace0 \uc0c1\ud669\uc5d0 \ub9de\ub294 \uc804\uc220 \uc6b4\uc6a9\uc774 \ud544\uc218\uc801\uc785\ub2c8\ub2e4. \uac10\ub3c5\uc758 \ub9ac\ub354\uc2ed\uacfc \uc120\uc218\ub2e8\uc758 \ub2e8\uacb0, \uadf8\ub9ac\uace0 \uc8fc\uc7a5\uc774\ub098 \ubca0\ud14c\ub791 \uc120\uc218\uc758 \ud604\uc7a5 \ud310\ub2e8 \ub2a5\ub825\uc5d0 \ub300\ud55c \uc2e0\ub8b0\uac00 \uc2b9\ud328\ub97c \uc88c\uc6b0\ud569\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
