B.aim=new A.a("\ud83d\udcda \uc190\uc790\ubcd1\ubc95 13\ud3b8 \uc6a9\uac04(\u7528\u9593) \u2013 4\n",null,B.a,null,B.m)
B.an6=new A.a("  \u2022 \u51e1(f\xe1n): \ubb34\ub987, \ubaa8\ub4e0 \n  \u2022 \u8ecd\u4e4b\u6240\u6b32\u64ca(j\u016bn zh\u012b su\u01d2 y\xf9 j\u012b): \uad70\ub300\uac00 \uacf5\uaca9\ud558\uace0\uc790 \ud558\ub294 \ub300\uc0c1 \n  \u2022 \u57ce\u4e4b\u6240\u6b32\u653b(ch\xe9ng zh\u012b su\u01d2 y\xf9 g\u014dng): \uc131 \uc911\uc5d0\uc11c \uacf5\uaca9\ud558\uace0\uc790 \ud558\ub294 \uacf3 \n  \u2022 \u4eba\u4e4b\u6240\u6b32\u6bba(r\xe9n zh\u012b su\u01d2 y\xf9 sh\u0101): \uc8fd\uc774\uace0\uc790 \ud558\ub294 \uc778\ubb3c \n  \u2022 \u5fc5\u5148\u77e5(b\xec xi\u0101n zh\u012b): \ubc18\ub4dc\uc2dc \uba3c\uc800 \uc54c\uc544\uc57c \ud55c\ub2e4 \n  \u2022 \u5b88\u5c07(sh\u01d2u ji\xe0ng): \uc9c0\ud718\uad00, \uc218\ube44\ub97c \ub2f4\ub2f9\ud558\ub294 \uc7a5\uc218 \n  \u2022 \u5de6\u53f3(zu\u01d2 y\xf2u): \ubcf4\uc88c\uad00, \uce21\uadfc \n  \u2022 \u8b01\u8005(y\xe8 zh\u011b): \ubb38\uc9c0\uae30, \ucd9c\uc785 \ud5c8\uac00 \ub2f4\ub2f9\uc790 \n  \u2022 \u9580\u8005(m\xe9n zh\u011b): \ubb38\uc744 \uc9c0\ud0a4\ub294 \uc0ac\ub78c \n  \u2022 \u820d\u4eba(sh\xe8 r\xe9n): \uc218\ud589\uc6d0, \ud558\uc778, \uce21\uadfc \n  \u2022 \u59d3\u540d(x\xecng m\xedng): \uc774\ub984 \n  \u2022 \u4ee4\u543e\u9593(l\xecng w\xfa ji\xe0n): \uc6b0\ub9ac \uac04\ucca9\uc5d0\uac8c \uba85\ub839\ud558\uc5ec \n  \u2022 \u5fc5\u7d22\u77e5\u4e4b(b\xec su\u01d2 zh\u012b zh\u012b): \ubc18\ub4dc\uc2dc \uc870\uc0ac\ud558\uc5ec \uc54c\uc544\ub0b4\uac8c \ud55c\ub2e4 \n\n",null,B.a,null,B.c)
B.agN=new A.a("\u201c\ubb34\ub987 \uad70\ub300\uac00 \uacf5\uaca9\ud558\uace0\uc790 \ud558\ub294 \uc801\uc9c4, \uc131, \uc778\ubb3c\uc774 \uc788\ub2e4\uba74, \uba3c\uc800 \uadf8 \uc9c0\ud718\uad00\uacfc \uadf8 \uce21\uadfc, \ubb38\uc9c0\uae30, \uc218\ud589\uc6d0\uc758 \uc774\ub984\uc744 \ubc18\ub4dc\uc2dc \ud30c\uc545\ud558\uac8c \ud558\ub77c. \uc6b0\ub9ac \uac04\ucca9\uc5d0\uac8c \uba85\ud558\uc5ec \uadf8\ub4e4\uc758 \uc131\uba85\uacfc \uc815\ubcf4\ub97c \ubc18\ub4dc\uc2dc \uc870\uc0ac\ud558\uc5ec \uc54c\uc544\ub0b4\uac8c \ud558\ub77c. \u201d",null,B.a,null,B.c)
