B.ai8=new A.a("1.\t\u77e5\u5f7c (Zh\u012b B\u01d0 - Knowing the Enemy):\n\u2022\tMeaning: Thoroughly understanding the opponent's (enemy's) strengths and weaknesses, strategies, intentions, resources, behavioral patterns, and their psychological state. This requires deep insight into the opponent, beyond mere information gathering. \n\n2.\t\u77e5\u5df1 (Zh\u012b J\u01d0 - Knowing Oneself):\n\u2022\tMeaning: Objectively and accurately recognizing one's own (friendly forces') strengths and weaknesses, limitations, resources, capabilities, team morale, and internal situation. \n\n3.\t\u767e\u6230\u4e0d\u6b86 (B\u01cei Zh\xe0n B\xf9 D\xe0i - Never Be Imperiled in a Hundred Battles):\n\u2022\tMeaning: If 'knowing the enemy and knowing oneself (\u77e5\u5f7c\u77e5\u5df1)' is perfectly practiced, one will never fall into a perilous situation in a hundred battles; even if one does not achieve victory, one will at least not suffer defeat and can always maintain the initiative. It is important to interpret this as creating optimal conditions for managing risk and achieving victory, rather than promising unconditional victory. This means accurately assessing the situation and knowing when to fight and when to avoid. \n\n",null,B.a,null,B.c)
