B.avP=new A.a(" 1.\t\u8d70\u8005 (\ub3c4\ub9dd\uce58\ub294 \uc790): \n   \u2022 \uc758\ubbf8: \uc804\ud22c \uc0c1\ud669\uc5d0\uc11c \uac1c\uc778\uc801\uc778 \ub450\ub824\uc6c0\uc774\ub098 \uc804\ud669\uc758 \ubd88\ub9ac\ud568\uc73c\ub85c \uc778\ud574 \uc804\uc7a5\uc5d0\uc11c \uc774\ud0c8\ud558\uc5ec \ub3c4\ub9dd\uce58\ub294 \ubcd1\uc0ac\ub4e4\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \n\n 2.\t\u5f1b\u8005 (\ud574\uc774\ud574\uc9c0\ub294 \uc790): \n   \u2022 \uc758\ubbf8: \uaddc\uc728\uc774 \ub290\uc2a8\ud574\uc9c0\uac70\ub098, \uacbd\uacc4\uc2ec\uc744 \ud480\uace0 \ub098\ud0dc\ud574\uc9c0\ub294 \ubcd1\uc0ac\ub4e4\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \uc774\ub294 \uc8fc\ub85c \uc9c0\ud718\uad00\uc758 \ub9ac\ub354\uc2ed \ubd80\uc871\uc774\ub098 \uc7a5\uae30\uc801\uc778 \uc791\uc804\uc73c\ub85c \uc778\ud55c \ud53c\ub85c\uc5d0\uc11c \ube44\ub86f\ub429\ub2c8\ub2e4. \n\n 3.\t\u9677\u8005 (\ud568\uc815\uc5d0 \ube60\uc9c0\ub294 \uc790): \n   \u2022 \uc758\ubbf8: \uc801\uc758 \uc720\uc778 \uc804\uc220\uc774\ub098 \ud568\uc815\uc5d0 \uc18d\uc544 \ub118\uc5b4\uac00 \uc704\ud5d8\uc5d0 \ube60\uc9c0\ub294 \ubcd1\uc0ac\ub4e4\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \uc774\ub294 \uc815\ubcf4 \ubd80\uc871, \uc624\ud310, \ud639\uc740 \uc9c0\ub098\uce5c \uc695\uc2ec\uc5d0\uc11c \uae30\uc778\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \n\n 4.\t\u5d29\u8005 (\ubb34\ub108\uc9c0\ub294 \uc790): \n   \u2022 \uc758\ubbf8: \uc678\ubd80\uc758 \uc555\ub825\uc774\ub098 \ub0b4\ubd80\uc758 \ucde8\uc57d\uc810\uc73c\ub85c \uc778\ud574 \uc870\uc9c1 \uc804\uccb4\uac00 \uac11\uc790\uae30 \ubd95\uad34\ub418\ub294 \ud604\uc0c1\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \uc8fc\ub85c \uc0ac\uae30 \uc800\ud558, \uc9c0\ud718 \uccb4\uacc4\uc758 \ud63c\ub780, \ud639\uc740 \uc608\uc0c1\uce58 \ubabb\ud55c \ub300\uaddc\ubaa8 \ud53c\ud574\ub85c \uc778\ud574 \ubc1c\uc0dd\ud569\ub2c8\ub2e4. \n\n 5.\t\u4e82\u8005 (\ud63c\ub780\uc5d0 \ube60\uc9c0\ub294 \uc790): \n   \u2022 \uc758\ubbf8: \uc9c0\ud718 \uccb4\uacc4\uac00 \ub9c8\ube44\ub418\uac70\ub098 \uc815\ubcf4\uac00 \ub4a4\uc11e\uc5ec \ubcd1\uc0ac\ub4e4\uc774 \uc6b0\uc655\uc88c\uc655\ud558\uba70 \ud63c\ub780\uc5d0 \ube60\uc9c0\ub294 \uc0c1\ud0dc\ub97c \uc758\ubbf8\ud569\ub2c8\ub2e4. \uc774\ub294 \ud1b5\uc81c \ubd88\ub2a5 \uc0c1\ud0dc\ub85c \uc774\uc5b4\uc838 \uc804\ud22c\ub825\uc744 \uc0c1\uc2e4\ud558\uac8c \ub9cc\ub4ed\ub2c8\ub2e4. \n\n 6.\t\u5317\u8005 (\ud328\uc8fc\ud558\ub294 \uc790): \n   \u2022 \uc758\ubbf8: \uc804\ud22c\uc5d0\uc11c \ud328\ud558\uc5ec \uc804\uc758\ub97c \uc0c1\uc2e4\ud558\uace0 \uc804\uc7a5\uc5d0\uc11c \ub3c4\ub9dd\uce58\ub294 \ubcd1\uc0ac\ub4e4\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. '\u8d70\u8005'\uac00 \uac1c\uc778\uc758 \uc774\ud0c8\uc774\ub77c\uba74 '\u5317\u8005'\ub294 \ubd80\ub300 \uc804\uccb4\uc758 \ud328\ubc30\ub85c \uc778\ud55c \ud6c4\ud1f4 \ub610\ub294 \ub3c4\uc8fc\uc5d0 \uac00\uae5d\uc2b5\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
