B.awz=new A.a(" 1. \uc778\uac04\uc801 \uc694\uc18c\uc758 \uc774\ud574: \ubcd1\uc0ac\ub4e4\uc758 \ub450\ub824\uc6c0, \ub098\ud0dc\ud568, \ud310\ub2e8 \ucc29\uc624 \ub4f1 \uc778\uac04\uc801\uc778 \uc57d\uc810\uc744 \uc774\ud574\ud558\uace0 \uc774\ub97c \uad00\ub9ac\ud558\ub294 \uac83\uc774 \uc911\uc694\ud569\ub2c8\ub2e4. \n\n 2. \ud328\ubc30 \uc6d0\uc778 \ubd84\uc11d: \ud328\ubc30\ub294 \ub2e8\uc21c\ud788 \uc801\uc758 \uac15\ud568 \ub54c\ubb38\uc774 \uc544\ub2c8\ub77c, \uc544\uad70 \ub0b4\ubd80\uc758 \ub2e4\uc591\ud55c \ucde8\uc57d\uc810(\uc0ac\uae30, \uaddc\uc728, \uc815\ubcf4, \uc9c0\ud718 \uccb4\uacc4)\uc5d0\uc11c \ube44\ub86f\ub420 \uc218 \uc788\uc74c\uc744 \uc778\uc9c0\ud574\uc57c \ud569\ub2c8\ub2e4. \n\n 3. \uc0ac\uc804 \uc608\ubc29: \uc774\ub7ec\ud55c \ubd80\uc815\uc801 \ud604\uc0c1\ub4e4\uc774 \ubc1c\uc0dd\ud558\uae30 \uc804\uc5d0 \uc6d0\uc778\uc744 \ud30c\uc545\ud558\uace0 \ubbf8\ub9ac \ub300\ube44\ud558\ub294 \uac83\uc774 \uc911\uc694\ud569\ub2c8\ub2e4. \n\n 4. \uac15\ub825\ud55c \ub9ac\ub354\uc2ed\uacfc \uaddc\uc728: \uac15\ub825\ud558\uace0 \uc77c\uad00\ub41c \ub9ac\ub354\uc2ed, \uc5c4\uaca9\ud55c \uaddc\uc728, \uadf8\ub9ac\uace0 \uba85\ud655\ud55c \uc9c0\ud718 \ud1b5\uc81c\ub294 \ud63c\ub780\uacfc \ubd95\uad34\ub97c \ub9c9\ub294 \ud575\uc2ec \uc694\uc18c\uc785\ub2c8\ub2e4. \n\n 5. \uc704\uae30 \uad00\ub9ac \ub2a5\ub825: \uc608\uc0c1\uce58 \ubabb\ud55c \uc0c1\ud669 \ubc1c\uc0dd \uc2dc \ud63c\ub780\uc744 \uc218\uc2b5\ud558\uace0, \ud568\uc815\uc5d0\uc11c \ubc97\uc5b4\ub098\uba70, \ubb34\ub108\uc9c0\ub294 \uac83\uc744 \ub9c9\uc744 \uc218 \uc788\ub294 \uc704\uae30 \uad00\ub9ac \ub2a5\ub825\uc774 \ud544\uc218\uc801\uc785\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
