B.we=new A.a("\u4e0d\u77e5\u8ecd\u4e4b\u4e0d\u53ef\u4ee5\u9032\uff0c\u800c\u8b02\u4e4b\u9032\uff1b\u4e0d\u77e5\u8ecd\u4e4b\u4e0d\u53ef\u4ee5\u9000\uff0c\u800c\u8b02\u4e4b\u9000\uff0c\u662f\u8b02\u7cdc\u8ecd\u3002\u4e0d\u77e5\u4e09\u8ecd\u4e4b\u4e8b\uff0c\u800c\u540c\u4e09\u4e4b\u653f\u8005\uff0c\u5247\u8ecd\u58eb\u60d1\u77e3\u3002\u4e0d\u77e5\u4e09\u8ecd\u4e4b\u6b0a\uff0c\u800c\u540c\u4e09\u8ecd\u4e4b\u4efb\u8005\uff0c\u5247\u8ecd\u58eb\u7591\u77e3\u3002 \n\n",null,B.a,null,B.t)
B.agL=new A.a("\u318d\u4e0d\u77e5\u8ecd\u4e4b\u4e0d\u53ef\u4ee5\u9032(b\xf9 zh\u012b j\u016bn zh\u012b b\xf9 k\u011b y\u01d0 j\xecn): Not knowing when the army should not advance. \n\u318d\u800c\u8b02\u4e4b\u9032(\xe9r w\xe8i zh\u012b j\xecn): Yet ordering it to advance. \n\u318d\u4e0d\u77e5\u8ecd\u4e4b\u4e0d\u53ef\u4ee5\u9000(b\xf9 zh\u012b j\u016bn zh\u012b b\xf9 k\u011b y\u01d0 tu\xec): Not knowing when the army should not retreat. \n\u318d\u800c\u8b02\u4e4b\u9000(\xe9r w\xe8i zh\u012b tu\xec): Yet ordering it to retreat. \n\u318d\u662f\u8b02\u7cdc\u8ecd(sh\xec w\xe8i m\xed j\u016bn): This is called causing the army to crumble (\u7cdc). \n\u318d\u4e0d\u77e5\u4e09\u8ecd\u4e4b\u4e8b(b\xf9 zh\u012b s\u0101n j\u016bn zh\u012b sh\xec): Not knowing the affairs of the entire army. \n\u318d\u800c\u540c\u4e09\u4e4b\u653f\u8005(\xe9r t\xf3ng s\u0101n zh\u012b zh\xe8ng zh\u011b): Yet interfering with military affairs as if they were civil administration. \n\u318d\u5247\u8ecd\u58eb\u60d1\u77e3(z\xe9 j\u016bn sh\xec hu\xf2 y\u01d0): Then the soldiers will be confused. \n\u318d\u4e0d\u77e5\u4e09\u8ecd\u4e4b\u6b0a(b\xf9 zh\u012b s\u0101n j\u016bn zh\u012b qu\xe1n): Not understanding the authority and flexibility of military operations. \n\u318d\u800c\u540c\u4e09\u8ecd\u4e4b\u4efb\u8005(\xe9r t\xf3ng s\u0101n j\u016bn zh\u012b r\xe8n zh\u011b): Yet attempting to control the army's responsibilities according to one's own will. \n\u318d\u5247\u8ecd\u58eb\u7591\u77e3(z\xe9 j\u016bn sh\xec y\xed y\u01d0): Then the soldiers will fall into suspicion and distrust. \n\n",null,B.a,null,B.c)
B.awy=new A.a("\u201cIf one orders an advance when the army should not advance, and orders a retreat when the army should not retreat, this is to ruin the army. If one does not understand the affairs of the army but interferes with military matters as if they were civil administration, the soldiers will be confused. If one does not understand the authority of military operations but assumes control over the army's responsibilities, the soldiers will become suspicious of their superiors.\u201d",null,B.a,null,B.c)
