B.acN=new A.a("This passage can be interpreted as follows:\n\n",null,B.a,null,B.c)
B.anE=new A.a("1. \u4e0d\u77e5\u8ecd\u4e4b\u4e0d\u53ef\u4ee5\u9032\uff0c\u800c\u8b02\u4e4b\u9032\uff1b\u4e0d\u77e5\u8ecd\u4e4b\u4e0d\u53ef\u4ee5\u9000\uff0c\u800c\u8b02\u4e4b\u9000\uff0c\u662f\u8b02\u7cdc\u8ecd\u3002\n\u2022\tTo order an army to advance when it should not, and to order it to retreat when it should not, this is called 'causing the army to crumble (\u7cdc\u8ecd)'.\n\u2022\tMeaning: This is a warning that if a superior commander or ruler, unaware of the actual situation on the ground, issues erroneous orders, the army's order will collapse, soldiers' morale will decline, and ultimately lead to defeat. It points out the danger of issuing orders based on armchair theories without accurate understanding of the field situation. \n\n2. \u4e0d\u77e5\u4e09\u8ecd\u4e4b\u4e8b\uff0c\u800c\u540c\u4e09\u4e4b\u653f\u8005\uff0c\u5247\u8ecd\u58eb\u60d1\u77e3\u3002\n\u2022\tIf one does not understand the professional affairs of the entire army (details of military operations), yet tries to interfere with the politics (policies) governing the army, the soldiers will be bewildered (confused).\n\u2022\tMeaning: This indicates that if non-military experts interfere with the detailed aspects of military operations, or if non-specialists try to formulate policies for specialized fields, the soldiers on the ground will be confused and find it difficult to determine what is right. This emphasizes the importance of respecting professionalism and the danger of infringing on authority. \n\n3. \u4e0d\u77e5\u4e09\u8ecd\u4e4b\u6b0a\uff0c\u800c\u540c\u4e09\u8ecd\u4e4b\u4efb\u8005\uff0c\u5247\u8ecd\u58eb\u7591\u77e3\u3002\n\u2022\tIf one does not understand the authority (discretionary power) for the entire army to adapt to situations (\u6b0a), yet tries to assume shared responsibility (\u4efb) for the army's duties, the soldiers will become suspicious (distrustful).\n\u2022\tMeaning: This is a warning that if a superior does not understand or infringes upon the discretionary power that should be granted to field commanders for improvisation, yet tries to assume overall responsibility, the soldiers on the ground will distrust such a leader. This emphasizes that responsibility must necessarily be accompanied by appropriate authority (discretionary power). \n\n",null,B.a,null,B.c)
