B.amO=new A.a("\ud83d\udcda 2: Waging War(\u4f5c\u6230) \u2013 1\n",null,B.a,null,B.m)
B.aoh=new A.a("\u318d \u5176\u7528\u6230\u4e5f(q\xed y\xf2ng zh\xe0n y\u011b): When he wages war (when conducting warfare)  \n\u318d \u8cb4\u52dd (gu\xec sh\xe8ng ): Values victory (considers victory paramount) \n\u318d \u4e45\u5247 (ji\u01d4 z\xe9): If prolonged (if the war becomes protracted) \n\u318d \u920d\u5175 (d\xf9n b\u012bng): Soldiers become dulled (combat effectiveness decreases) \n\u318d \u632b\u92b3 (cu\xf2 ru\xec): Sharpness is blunted (edge is dulled)\n\n",null,B.a,null,B.c)
B.arN=new A.a("\u201cIn war, it is paramount to achieve victory quickly. If the war drags on, the morale and combat effectiveness of the soldiers will decline, and the initial sharpness and focus will disappear.\u201d ",null,B.a,null,B.c)
