B.aw_=new A.a("This passage clearly presents the purpose of war and the harms of a protracted war. \n\n",null,B.a,null,B.c)
B.a5O=new A.a("1.\tThe Foremost Value of Victory: The ultimate goal of war is victory (\u52dd), and this is emphasized as the most valuable (\u8cb4) asset, to be prioritized above all else. Only victory gives meaning and value to war. \n\n2.\tThe Danger of Protracted War: However, no matter how important victory is, if a war drags on (\u4e45), severe side effects inevitably occur. \n\n  \u2022  \u920d\u5175 (d\xf9n b\u012bng): The momentum of the soldiers dulls, and fatigue accumulates, leading to a decrease in combat effectiveness. This includes not only physical fatigue but also mental laxity and weakening of discipline. \n\n  \u2022  \u632b\u92b3 (cu\xf2 ru\xec): The sharp spirit (\u92b3\u6c23) of the soldiers, meaning their morale and fighting spirit, is broken and frustrated. Loss of motivation and the spread of defeatism among soldiers are fatal to combat effectiveness. \n\n3.\tImplication of the Importance of Swift Victory: Although this passage does not directly mention swift victory, by warning of the harms of protracted war, it strongly suggests that it is important to end the war as quickly as possible and seize victory. \n\n",null,B.a,null,B.c)
