B.amA=new A.a("1.\tGoal-Oriented Thinking: All strategies and actions must aim for ultimate victory. \n\n2.\tStrategic Value of Time: In war, time is cost and resource; unnecessarily prolonging time leads to fatal losses. \n\n3.\tImportance of Psychological Factors: The morale (\u92b3\u6c23) of soldiers is the core of combat effectiveness, and it can easily decline over time, so continuous management is essential. \n\n4.\tPursuit of Efficiency and Rapidity: It is important to use resources efficiently to achieve goals in the shortest possible time. \n\n",null,B.a,null,B.c)
