B.ayW=new A.a("1. \u4e0d\u77e5\u8ecd\u4e4b\u4e0d\u53ef\u4ee5\u9032\uff0c\u800c\u8b02\u4e4b\u9032\uff1b\u4e0d\u77e5\u8ecd\u4e4b\u4e0d\u53ef\u4ee5\u9000\uff0c\u800c\u8b02\u4e4b\u9000\uff0c\u662f\u8b02\u7cdc\u8ecd\u3002\n\u2022\t\uad70\ub300\uac00 \uc804\uc9c4\ud574\uc11c\ub294 \uc548 \ub420 \ub54c \uc804\uc9c4\ud558\ub77c\uace0 \uba85\ub839\ud558\uace0, \ud6c4\ud1f4\ud574\uc11c\ub294 \uc548 \ub420 \ub54c \ud6c4\ud1f4\ud558\ub77c\uace0 \uba85\ub839\ud558\ub294 \uac83, \uc774\uac83\uc744 '\uad70\ub300\ub97c \ud63c\ub780\uc5d0 \ube60\ub728\ub9ac\ub294(\u7cdc\u8ecd)' \ud589\uc704\ub77c\uace0 \ud55c\ub2e4.\n\u2022\t\uc758\ubbf8: \ud604\uc7a5 \uc0c1\ud669\uc744 \uc54c\uc9c0 \ubabb\ud558\ub294 \uc0c1\uc704 \uc9c0\ud718\uad00\uc774\ub098 \ud1b5\uce58\uc790\uac00 \uc798\ubabb\ub41c \uba85\ub839\uc744 \ub0b4\ub9ac\uba74, \uad70\ub300\uc758 \uc9c8\uc11c\uac00 \ubb34\ub108\uc9c0\uace0 \ubcd1\uc0ac\ub4e4\uc758 \uc0ac\uae30\uac00 \uc800\ud558\ub418\uc5b4 \uacb0\uad6d \ud328\ubc30\ub85c \uc774\uc5b4\uc9c4\ub2e4\ub294 \uacbd\uace0\uc785\ub2c8\ub2e4. \uc774\ub294 \ud604\uc7a5 \uc0c1\ud669\uc5d0 \ub300\ud55c \uc815\ud655\ud55c \uc774\ud574 \uc5c6\uc774 \ud0c1\uc0c1\uacf5\ub860\uc73c\ub85c \uba85\ub839\uc744 \ub0b4\ub9ac\ub294 \uac83\uc758 \uc704\ud5d8\uc131\uc744 \uc9c0\uc801\ud569\ub2c8\ub2e4.\n\n2. \u4e0d\u77e5\u4e09\u8ecd\u4e4b\u4e8b\uff0c\u800c\u540c\u4e09\u4e4b\u653f\u8005\uff0c\u5247\u8ecd\u58eb\u60d1\u77e3\u3002\n\u2022\t\uc0bc\uad70(\uc804\uccb4 \uad70\ub300)\uc758 \uc804\ubb38\uc801\uc778 \uc77c(\uad70\uc0ac \uc6b4\uc6a9\uc758 \uc138\ubd80 \uc0ac\ud56d)\uc744 \uc54c\uc9c0 \ubabb\ud558\uba74\uc11c, \uc0bc\uad70\uc744 \uad00\ub9ac\ud558\ub294 \uc815\uce58(\uc815\ucc45)\uc5d0 \uac04\uc12d\ud558\ub824 \ub4dc\ub294 \uc790\ub294, \uad70\uc0ac\ub4e4\uc744 \ubbf8\ud639(\ud63c\ub780)\uc5d0 \ube60\ub728\ub9b4 \uac83\uc774\ub2e4.\n\u2022\t\uc758\ubbf8: \uad70\uc0ac \uc804\ubb38\uac00\uac00 \uc544\ub2cc \uc774\ub4e4\uc774 \uad70\uc0ac \uc791\uc804\uc758 \uc138\ubd80 \uc0ac\ud56d\uc5d0 \uac04\uc12d\ud558\uac70\ub098, \ube44\uc804\ubb38\uac00\uac00 \uc804\ubb38 \ubd84\uc57c\uc758 \uc815\ucc45\uc744 \uc218\ub9bd\ud558\ub824 \ub4e4\uba74, \ud604\uc7a5\uc758 \uad70\uc0ac\ub4e4\uc740 \ud63c\ub780\uc2a4\ub7ec\uc6cc\ud558\uace0 \ubb34\uc5c7\uc774 \uc633\uc740\uc9c0 \ud310\ub2e8\ud558\uae30 \uc5b4\ub824\uc6cc\uc9c4\ub2e4\ub294 \uac83\uc785\ub2c8\ub2e4. \uc774\ub294 \uc804\ubb38\uc131\uc758 \uc874\uc911\uacfc \uad8c\ud55c \uce68\ubc94\uc758 \uc704\ud5d8\uc131\uc744 \uac15\uc870\ud569\ub2c8\ub2e4.\n\n3. \u4e0d\u77e5\u4e09\u8ecd\u4e4b\u6b0a\uff0c\u800c\u540c\u4e09\u8ecd\u4e4b\u4efb\u8005\uff0c\u5247\u8ecd\u58eb\u7591\u77e3\u3002\n\u2022\t\uc0bc\uad70\uc774 \uc0c1\ud669\uc5d0 \ub530\ub77c \uc784\uae30\uc751\ubcc0(\u6b0a)\uc73c\ub85c \ub300\ucc98\ud560 \uad8c\ud55c(\uc7ac\ub7c9\uad8c)\uc744 \uc54c\uc9c0 \ubabb\ud558\uba74\uc11c, \uc0bc\uad70\uc758 \uc784\ubb34(\ucc45\uc784)\ub97c \ud568\uaed8 \uc9c0\ub824 \ub4dc\ub294 \uc790\ub294, \uad70\uc0ac\ub4e4\uc744 \uc758\uc2ec(\ubd88\uc2e0)\ud558\uac8c \ud560 \uac83\uc774\ub2e4.\n\u2022\t\uc758\ubbf8: \ud604\uc7a5 \uc9c0\ud718\uad00\uc5d0\uac8c \ubd80\uc5ec\ub418\uc5b4\uc57c \ud560 \uc784\uae30\uc751\ubcc0\uc758 \uad8c\ud55c\uc744 \uc774\ud574\ud558\uc9c0 \ubabb\ud558\uac70\ub098 \uce68\ud574\ud558\uba74\uc11c, \ucd1d\uccb4\uc801\uc778 \ucc45\uc784\ub9cc \uc9c0\ub824 \ub4dc\ub294 \uc0c1\uc704\uc790\uac00 \uc788\ub2e4\uba74, \ud604\uc7a5\uc758 \uad70\uc0ac\ub4e4\uc740 \uadf8\ub7ec\ud55c \ub9ac\ub354\ub97c \ubd88\uc2e0\ud558\uac8c \ub41c\ub2e4\ub294 \uacbd\uace0\uc785\ub2c8\ub2e4. \uc774\ub294 \ucc45\uc784\uc5d0\ub294 \ubc18\ub4dc\uc2dc \uadf8\uc5d0 \ud569\ub2f9\ud55c \uad8c\ud55c(\uc7ac\ub7c9\uad8c)\uc774 \uc218\ubc18\ub418\uc5b4\uc57c \ud568\uc744 \uc5ed\uc124\ud569\ub2c8\ub2e4. \n\n",null,B.a,null,B.c)
