B.al2=new A.a("1.\t\ud604\uc7a5 \uc9c0\uc2dd\uc758 \uc911\uc694\uc131: \ub9ac\ub354\ub294 \ud604\uc7a5 \uc0c1\ud669\uc5d0 \ub300\ud55c \uae4a\uc740 \uc774\ud574\uc640 \ud1b5\ucc30\ub825\uc744 \ubc14\ud0d5\uc73c\ub85c \uba85\ub839\uc744 \ub0b4\ub824\uc57c \ud569\ub2c8\ub2e4. \ud604\uc7a5\uc744 \ubaa8\ub978 \ucc44 \ub0b4\ub9ac\ub294 \uc9c0\uc2dc\ub294 \uc870\uc9c1 \uc804\uccb4\uc5d0 \ud63c\ub780\uc744 \ucd08\ub798\ud569\ub2c8\ub2e4.\n\n2.\t\uc804\ubb38\uc131\uc758 \uc874\uc911: \uac01\uc790\uc758 \uc804\ubb38 \uc601\uc5ed\uc744 \uc874\uc911\ud558\uace0, \ube44\uc804\ubb38\uac00\uac00 \uc804\ubb38 \ubd84\uc57c\uc758 \uc138\ubd80 \uc0ac\ud56d\uc5d0 \uc9c1\uc811\uc801\uc73c\ub85c \uac04\uc12d\ud558\ub294 \uac83\uc744 \uc9c0\uc591\ud574\uc57c \ud569\ub2c8\ub2e4. \uc774\ub294 \uc870\uc9c1 \ud6a8\uc728\uc131\uc744 \uc800\ud574\ud558\uace0 \ud63c\ub780\uc744 \uc57c\uae30\ud569\ub2c8\ub2e4.\n\n3.\t\uad8c\ud55c\uacfc \ucc45\uc784\uc758 \uc77c\uce58: \uc784\ubb34(\ucc45\uc784)\ub97c \ubd80\uc5ec\ud560 \ub54c\ub294 \ubc18\ub4dc\uc2dc \uadf8 \uc784\ubb34\ub97c \uc218\ud589\ud560 \uc218 \uc788\ub294 \ud569\ub2f9\ud55c \uad8c\ud55c(\uc7ac\ub7c9\uad8c)\uc744 \ud568\uaed8 \uc704\uc784\ud574\uc57c \ud569\ub2c8\ub2e4. \uad8c\ud55c \uc5c6\ub294 \ucc45\uc784\uc740 \ubd88\uc2e0\uc744 \ub0b3\uc2b5\ub2c8\ub2e4.\n\n4.\t\uba85\ub839 \uccb4\uacc4\uc758 \uba85\ud655\uc131: \uba85\ub839\uc740 \uba85\ud655\ud558\uace0 \uc77c\uad00\uc801\uc774\uc5b4\uc57c \ud558\uba70, \uc0c1\ud669\uc5d0 \ub530\ub77c \ud569\ub9ac\uc801\uc778 \ud310\ub2e8\uc5d0 \uadfc\uac70\ud574\uc57c \ud569\ub2c8\ub2e4. \ud63c\ub780\uc2a4\ub7ec\uc6b4 \uba85\ub839\uc740 \uc870\uc9c1\uc758 \uc640\ud574\ub85c \uc774\uc5b4\uc9d1\ub2c8\ub2e4.\n\n5.\t\ub9ac\ub354\uc2ed\uc758 \uc2e0\ub8b0 \uad6c\ucd95: \ub9ac\ub354\ub294 \ud604\uba85\ud55c \ud310\ub2e8\uacfc \uc801\uc808\ud55c \uad8c\ud55c \uc704\uc784\uc744 \ud1b5\ud574 \uc870\uc9c1 \uad6c\uc131\uc6d0\ub4e4\uc758 \uc2e0\ub8b0\ub97c \uc5bb\uc5b4\uc57c \ud569\ub2c8\ub2e4. \ubd88\uc2e0\uc740 \uc870\uc9c1\uc758 \uc0ac\uae30\ub97c \uc800\ud558\uc2dc\ud0a4\uace0 \ud300\uc6cc\ud06c\ub97c \ud574\uce69\ub2c8\ub2e4.\n\n",null,B.a,null,B.c)
