B.afh=new A.a(" This passage metaphorically explains the core concepts of 'shi (\u52e2)' and 'jie (\u7bc0)' in the Energy chapter, showing how these two elements work in victory.\n\n",null,B.a,null,B.c)
B.asQ=new A.a(" 1.\tThe Power of Shi (\u52e2):\n   \u2022\t\u6fc0\u6c34\u4e4b\u75be\uff0c\u81f3\u65bc\u6f02\u77f3\u8005\uff0c\u52e2\u4e5f: 'Shi (\u52e2)' refers to the overwhelming 'flow of power' or 'momentum' that can even sweep away stones like a swift current. It represents not merely the quantity of troops or individual abilities, but the immense kinetic energy and thrust created by the total force. Once 'shi' is formed, weaker opponents cannot resist it. This is the dynamic force that appears after 'xing (\u5f62)' is established.\n\n 2.\tThe Effect of Jie (\u7bc0):\n  \u2022\t\u9dd9\u9ce5\u4e4b\u64ca\uff0c\u81f3\u65bc\u6bc1\u6298\u8005\uff0c\u7bc0\u4e5f: 'Jie (\u7bc0)' refers to the 'precise timing' or 'precision in concentrating power at the decisive moment' that enables a bird of prey to attack and destroy its prey. No matter how powerful a bird of prey is, it does not attack blindly but focuses its power at the most effective moment by detecting the prey's weaknesses, moments of carelessness, gaps in movement, etc., thereby inflicting a decisive blow.\n\n",null,B.a,null,B.c)
