B.aiQ=new A.a(" \u2022\tImportance of Shi (\u52e2): To win in battle, it is essential to form an overall 'momentum' that can overwhelm the enemy. This momentum arises when all elements such as troops, morale, preparation, and terrain are combined.\n\n \u2022\tImportance of Jie (\u7bc0): No matter how strong the 'shi (\u52e2)' one possesses, if one cannot concentrate power at the 'precise timing (\u7bc0)' that penetrates the enemy's weak points, one cannot deliver an effective blow.\n\n \u2022\tHarmonious Operation: 'Shi (\u52e2)' and 'jie (\u7bc0)' complement each other. Based on overwhelming 'shi (\u52e2)', one must break the enemy's 'jie' and create a decisive 'jie' for one's own attack. 'Shi' shakes the enemy, and 'jie' delivers the decisive blow.\n\n \u2022\tInducing Inevitable Victory: If 'shi (\u52e2)' and 'jie (\u7bc0)' are operated perfectly, victory inevitably follows, just as a torrent sweeps away stones and a bird of prey snatches its prey.\n\n \u2022\tFlexible Thinking: Flexible thinking and quick judgment are required to focus on building 'shi (\u52e2)' or seizing 'jie (\u7bc0)' according to changes in the situation.\n\n",null,B.a,null,B.c)
